rmations can be found scattered around many an ice field, and are known as the universe\'s primary source of helium isotopes.\r\n\r\nThis ore has been compressed into a much more dense version.',1000,100,0,1,NULL,376000.0000,0,NULL,3324,NULL,0),(29117,903,'Ancient Compressed Dark Glitter','Dark glitter is one of the rarest of the interstellar ices, formed only in areas with large amounts of residual electrical current.  Little is known about the exact way in which it comes into being; the staggering amount of liquid ozone to be found inside one of these rocks makes it an intriguing mystery for stellar physicists and chemists alike.  In addition, it contains large amounts of heavy water and a decent measure of strontium clathrates.\r\n\r\nThis ore has been compressed into a much more dense version.',1000,100,0,1,NULL,1550000.0000,0,NULL,3325,NULL,0),(29119,903,'Ancient Compressed Enriched Clear Icicle','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. These crystalline formations can be found scattered around many an ice field and are known as the universe\'s primary source of helium isotopes.  Due to environmental factors, this fragment\'s isotope deposits have become even richer than its regular counterparts\'.\r\n\r\nThis ore has been compressed into a much more dense version.',1000,100,0,1,NULL,475000.0000,0,NULL,3324,NULL,0),(29121,903,'Ancient Compressed Gelidus','Fairly rare and very valuable, Gelidus-type ice formations are a large-scale source of strontium clathrates, one of the rarest ice solids found in the universe, in addition to which they contain unusually large concentrations of heavy water and liquid ozone.\r\n\r\nThis ore has been compressed into a much more dense version.',1000,100,0,1,NULL,825000.0000,0,NULL,3328,NULL,0),(29123,903,'Ancient Compressed Glacial Mass','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles.  Glacial masses are known to contain hydrogen isotopes in abundance, in addition to smatterings of heavy water and liquid ozone.\r\n\r\nThis ore has been compressed into a much more dense version.',1000,100,0,1,NULL,76000.0000,0,NULL,3326,NULL,0),(29125,903,'Ancient Compressed Glare Crust','In areas with high concentrations of electromagnetic activity, ice formations such as this one, containing large amounts of heavy water and liquid ozone, are spontaneously formed during times of great electric flux.  Glare crust also contains a small amount of strontium clathrates.\r\n\r\nThis ore has been compressed into a much more dense version.',1000,100,0,1,NULL,1525000.0000,0,NULL,3323,NULL,0),(29127,903,'Ancient Compressed Krystallos','The universe\'s richest known source of strontium clathrates, Krystallos ice formations are formed only in areas where a very particular combination of environmental factors are at play.  Krystallos compounds also include quite a bit of liquid ozone.\r\n\r\nThis ore has been compressed into a much more dense version.',1000,100,0,1,NULL,450000.0000,0,NULL,3330,NULL,0),(29129,903,'Ancient Compressed Pristine White Glaze','When star fusion processes occur near high concentrations of silicate dust, such as those found in interstellar ice fields, the substance known as White Glaze is formed.  While White Glaze generally is extremely high in nitrogen-14 and other stable nitrogen isotopes, a few rare fragments, such as this one, have stayed free of radioactive contaminants and are thus richer in isotopes than their more impure counterparts.\r\n\r\nThis ore has been compressed into a much more dense version.\r\n',1000,100,0,1,NULL,116000.0000,0,NULL,3329,NULL,0),(29131,903,'Ancient Compressed Smooth Glacial Mass','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles.  Glacial masses are known to contain hydrogen isotopes in abundance, but the high surface diffusion on this particular mass means it has considerably more than its coarser counterparts.\r\n\r\nThis ore has been compressed into a much more dense version.',1000,100,0,1,NULL,116000.0000,0,NULL,3326,NULL,0),(29133,903,'Ancient Compressed Thick Blue Ice','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. Due to its unique chemical composition and the circumstances under which it forms, blue ice will, under normal circumstances, contain more oxygen isotopes than any other ice asteroid. This particular formation is an old one and therefore contains even more than its less mature siblings.\r\n\r\nThis ore has been compressed into a much more dense version.\r\n',1000,100,0,1,NULL,116000.0000,0,NULL,3327,NULL,0),(29135,903,'Ancient Compressed White Glaze','When star fusion processes occur near high concentrations of silicate dust, such as those found in interstellar ice fields, the substance known as White Glaze is formed.  White Glaze is extremely high in nitrogen-14 and other stable nitrogen isotopes, and is thus a necessity for the sustained operation of certain kinds of control tower.\r\n\r\nThis ore has been compressed into a much more dense version.',1000,100,0,1,NULL,76000.0000,0,NULL,3329,NULL,0),(29137,314,'Caldari Traitor\'s DNA','DNA samples are any of various nucleic acids that are usually the molecular basis of heredity, are localized especially in cell nuclei, and are constructed of a double helix held together by hydrogen bonds between purine and pyrimidine bases which project inward from two chains containing alternate links of deoxyribose and phosphate.',1,0.1,0,1,NULL,NULL,1,NULL,2302,NULL,0),(29138,23,'Clone Grade Tau','',0,1,0,1,NULL,21000000.0000,0,NULL,34,NULL,0),(29139,23,'Clone Grade Upsilon','',0,1,0,1,NULL,31500000.0000,0,NULL,34,NULL,0),(29140,23,'Clone Grade Phi','',0,1,0,1,NULL,45500000.0000,0,NULL,34,NULL,0),(29141,23,'Clone Grade Chi','',0,1,0,1,NULL,63000000.0000,0,NULL,34,NULL,0),(29142,23,'Clone Grade Psi','',0,1,0,1,NULL,84000000.0000,0,NULL,34,NULL,0),(29143,23,'Clone Grade Omega','',0,1,0,1,NULL,105000