ble to do almost everything. While often dubbed a \"mini-Typhoon\" for this reason, this versatile gunboat nonetheless has nowhere near the defensive capabilities of its larger ancestor. What it does bring to the table, however, is unparalleled agility and unpredictability. A squadron of these ships can be an immense thorn in the side of even the most able and well-equipped fleet commander.',10910000,89000,440,1,2,NULL,1,1370,NULL,20078,1887),(29337,26,'Augoror Navy Issue','The Navy-issued version of the Augoror cruiser is an extremely resilient piece of hardware able to provide very good support in fleet battles, but it is also a relatively nimble cruiser ideally suited for escort duties as well as smaller skirmishes. Created to fill a void within the ranks of the traditionally slow and lumbering Amarrian fleet, this vessel has fit in perfectly.',10650000,101000,480,1,4,NULL,1,1370,NULL,20063,1730),(29338,106,'Augoror Navy Issue Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,49),(29339,106,'Scythe Fleet Issue Blueprint','',0,0.01,0,1,NULL,28775000.0000,1,NULL,NULL,NULL,304),(29340,26,'Osprey Navy Issue','Caldari ships have never been renowned for their speed. With this in mind, Caldari Navy engineers set about designing the Osprey Navy Issue. The fastest Caldari cruiser in existence and a formidable missile boat, this vessel gives Navy personnel and State loyalists alike greater opportunities to conduct true skirmish warfare than ever before.',11780000,107000,460,1,1,NULL,1,1370,NULL,20070,1784),(29341,106,'Osprey Navy Issue Blueprint','',0,0.01,0,1,NULL,28750000.0000,1,NULL,NULL,NULL,41),(29344,26,'Exequror Navy Issue','The Exequror Navy Issue was commissioned by Federation Navy High Command in response to the proliferation of close-range blaster vessels on the modern stellar battlefield. While it doesn\'t boast the speed of some of its class counterparts, this up-close-and-personal gunboat nonetheless possesses some of the more advanced hybrid plasma-coil co