n Wing','This piece of wreckage is the starboard wing of a Raven-class battleship, sheared off at the root. Where the rest of the ship ended up is anyone\'s guess.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,0),(29354,226,'Scorpion Lower Hull','This piece of wreckage is part of the lower hull of a Scorpion-class battleship. This area is mainly given over to ship systems, so loss of life resulting from the multiple hull breaches should have been comparatively minimal',0,0,0,1,1,NULL,0,NULL,NULL,NULL,0),(29355,226,'Scorpion Masthead','The masthead section of Scorpion-class battleships contains a large amount of sensitive equipment that would be of great interest to rival empires. In this case, though, it\'s clear that the damage inflicted means whatever\'s inside would only be of interest to scrap dealers',0,0,0,1,1,NULL,0,NULL,NULL,NULL,0),(29356,226,'Scorpion Upper Hull','Containing a large number of crew battle stations, the damage to this section of Scorpion superstructure must have entailed a huge loss of life',0,0,0,1,1,NULL,0,NULL,NULL,NULL,0),(29357,226,'Megathron Bow','This Megathron bow section functioned as designed, tearing cleanly away from the rest of the hull under sustained fire',0,0,0,1,8,NULL,0,NULL,NULL,NULL,0),(29358,226,'Megathron Hull','This Megathron hull has weathered significant damage, with most major protrusions ripped away. Distress beacons still function within the wreckage, but it seems unlikely that any pockets of atmosphere remain',0,0,0,1,8,NULL,0,NULL,NULL,NULL,0),(29359,226,'Tempest Lower Sail','As is common with Minmatar designs, this Tempest battleship has fragmented into multiple sections under heavy fire. This lower section appears largely inert, with only a few arcing connectors showing any signs of activity',0,0,0,1,2,NULL,0,NULL,NULL,NULL,0),(29360,226,'Tempest Upper Sail','As is common with Minmatar designs, this Tempest battleship has fragmented into multiple sections under heavy fire. A few red lights still blink forlornly within the bridge section, but the corpses drifting inside make clear that there are no other signs of life on board',0,0,0,1,2,NULL,0,NULL,NULL,NULL,0),(29361,226,'Tempest Midsection','As is common with Minmatar designs, this Tempest battleship has fragmented into multiple sections under heavy fire. This midsection seems to have taken the brunt of the damage in this case',0,0,0,1,2,NULL,0,NULL,NULL,NULL,0),(29362,226,'Tempest Stern','As is common with Minmatar designs, this Tempest battleship has fragmented into multiple sections under heavy fire. The sparking power relays at the forward end of this drive section suggest there is still some life in the main reactors, but the radiation readings indicate that this was probably not a good thing for any surviving crew.',0,0,0,1,2,NULL,0,NULL,NULL,NULL,0),(29363,226,'Naglfar Wreck','The remains of a destroyed Naglfar',0,0,0,1,2,NULL,0,NULL,NULL,NULL,3112),(29364,226,'Naglfar Upper Half','The upper half of this mighty Naglfar-class dreadnaught has sustained considerable damage to its starboard batteries. A few intermittent signals which might be signs of life deep inside can still be detected, but there\'s no easy way to cut through the mangled wreckage and find out',0,0,0,1,2,NULL,0,NULL,NULL,NULL,3112),(29365,186,'Mission Faction Industrials Wreck','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it. ',10000,27500,27500,1,NULL,NULL,0,NULL,NULL,NULL,3116),(29382,226,'Caldari Prime Station (Under Construction)','',0,0,0,1,1,NULL,0,NULL,NULL,NULL,3394),(29386,226,'CONCORD Battleship Wreck','CONCORD vessels employ advanced hull technology which allows them to maintain external integrity even after the ship has suffered complete systems failure. This is definitely one of those cases - while the hull appears intact, the rest of the ship is very clearly non-functional',0,0,0,1,8,NULL,0,NULL,NULL,NULL,1060),(29387,15,'Damaged Amarr Station Hub','',0,0,0,1,4,600000.0000,0,NULL,N