 that it cannot move.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,52),(29439,283,'Admiral Meledier ','Admiral Meledier apparently wishes to defect to Amarr. Well, so be it: It\'s all a bit suspicious, but it\'s not your decision. ',85,1,0,1,NULL,NULL,1,NULL,2536,NULL,0),(29445,306,'Cargo Container - Physical Samples','This cargo container is flimsily constructed and will not survive the rigors of space for long.',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,1176),(29446,319,'Large Container of Explosives','This large container is full of explosives.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,2007),(29447,283,'Gallente Politician','A planetside politician of the Gallente Federation.',90,2,0,1,NULL,NULL,1,NULL,2538,NULL,0),(29452,226,'Fortified Gallente Bunker','A Gallente Bunker',100000,100000000,0,1,4,NULL,0,NULL,NULL,NULL,2458),(29453,226,'Fortified Gallente Lookout','A lookout. Look out.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,2461),(29454,226,'Fortified Gallente Barricade','A barricade.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,2464),(29455,226,'Fortified Gallente Barrier','A barrier.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,2466),(29456,226,'Fortified Gallente Battery','A battery. Juicy.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,2462),(29457,226,'Fortified Gallente Fence','A fence.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,2465),(29458,226,'Fortified Gallente Junction','A junction.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,2460),(29459,226,'Fortified Gallente Wall','A wall.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,2463),(29460,226,'Gallente Starbase Control Tower','Gallente Control Towers are more pleasing to the eye than they are strong or powerful. They have above average electronic countermeasures, average CPU output, and decent power output compared to towers from the other races, but are quite lacking in sophisticated defenses.',100000,100000000,10000,1,4,NULL,0,NULL,NULL,NULL,2594),(29461,319,'Starbase Hangar Tough','A stand-alone deep-space construction designed to allow pilots to dock and refit their ships on the fly.',100000,1150,8850,1,NULL,NULL,0,NULL,NULL,NULL,2595),(29464,314,'Runaway Daughter','She\'s gone into suspended animation. It\'s probably for the best.',400,25,0,1,NULL,100.0000,1,NULL,1171,NULL,2092),(29466,927,'The Incredible Hulk','The backbone of any serious industrial operation, Hulks are amongst the most efficient mining vessels in circulation and sometimes re-engineered for survivability.',40000000,200000,8000,1,8,NULL,0,NULL,NULL,8,2938),(29467,319,'Power Generator 250k','This generator provides power to nearby structures. ',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,1684),(29468,319,'Shipyard Tough','Large construction tasks can be undertaken at this shipyard.',100000,100000000,10000,1,2,NULL,0,NULL,NULL,NULL,2625),(29469,319,'Amarr Starbase Control Tower Tough','The Amarr have always been fond of majestic and intimidating constructions. Their Control Towers do not deviate from that tradition and are truly big and powerful structures, intended more for preservation of territorial interests than commercial benefits.',100000,100000000,10000,1,4,NULL,0,NULL,NULL,NULL,2593),(29470,281,'Starcakes','The recipe for this highly ornate, traditional Jin-Mei sweet varies from planet to planet, and sometimes from city to city, but its fillings are always dense, sugary, and rich. Each cake\'s jelly center is held in place with a crusty exterior that, as befits tradition, is so highly decorated with symbols that it resembles a volcanic planet: It is possible to read the baker\'s story, lineage, and certifications in the crust\'s maze of lines and ridges, although a reader must be quite dedicated to finish the task before falling to temptation. ',400,2,0,1,NULL,98.0000,1,NULL,3435,NULL,0),(29471,314,'Ancient Painblade','This antique weapon is the traditional precursor to the modern day\'s Painblade. <br><br>\r\n\r\nIn ancient times, Jin-Mei soldiers riding to the field used to plunge their swords into filth, in the well-founded expectation that the wounds they inflicted would cause infection and rot. This nasty tactic was given new life when royal technicians (in those days referred to as <i>Nuyin</i>, something akin to \"wizards\") developed a blade whose surface, when unsheathed, swiftly attracted and encouraged bacterial growth, giving life to all kinds of deadly filth. <br><br>\r\n\r\nNowadays, these items are mostly used in theatrical plays, and anyone who gets within a hand\'s reach of their swinging blades usually spends half an act wailing about it before finally dropping dead. ',1,0.1,0,1,NULL,NULL,1,NULL,3436,NULL,0),(29472,526,'Ceremonial Brush','Before the advent of electronics, these writing tools were used throughout the Achuran continent. In times of war, it was not at all uncommon for a victor to use a brush-like pen to draw stylized icons representing the outcome of the battle and the heroics performed by his side. These icons would then be copied and molded onto an ivory or metal stamp, which was dipped into hot wax and used to stamp the victor\'s seal on the final agreement. <br><br>\r\n\r\nIt should be noted that the brushes and stamps are not the only tools in this box. Cleaning implements are of course included, and so are tiny pliers and some manner of disinfectant, for it was traditional that the victor\'s brush be inset with eyelashes drawn from the screaming conquered.',0.5,0.1,0,1,NULL,150.0000,1,NULL,3437,NULL,0),(29473,526,'Medicinal Herbs','Traditional herbal remedies have been used for perhaps tens of thousands of years among the Vheriokor tribes of Minmatar. However, they have become so popular over time, particularly among the Gallente peoples, that various herbal concoctions and infusions can be found in virtually every part of inhabited space. <br><br>\r\n\r\nBut don\'t eat the roots. <br><br>\r\n\r\nNo, seriously. No matter what any scary prophet says. <br><br>\r\n\r\nHerbs are said to cure everything from colds to warp sickness, though they are also popular for mild recreation. If a cargo container of herbs seems the slightest bit lighter after a long ship\'s journey, it is the wise captain who does not question his crew too closely, nor visit their living quarters after hours. ',5,0.2,0,1,NULL,325.0000,1,NULL,3438,NULL,0),(29474,314,'Singing Staff','A traditional musical instrument of the Vheriokor peoples, the singing staff is made from a few tightly-wound strings attached to a small staff. It is today played only ceremonially, and those proficient in its use are rare. <br><br>\r\n\r\nThe instrument is fitted over a pole, strings on one side and staff on the other, and then drawn diagonally across the pole\'s surface, eliciting soft monotones. The staffs themselves are usually made from ivory or some other type of bone. Some of these latter types are preferred, for it is said that they have an extra tone that can be heard only when one plays a song of sadness and loss. <br><br>\r\n\r\nWhile there exist plenty of poles specifically designed for this instrument, technically just about anything will do: a metal stand, a chair leg, or even, if the strings are wound tightly enough, a human appendage. ',1,0.1,0,1,NULL,NULL,1,NULL,3439,NULL,0),(29475,314,'Intaki Clackers','A traditional Intaki musical instrument, the clacker consists of two flat pieces of lightweight material, loosely bound at one edge. When that end is held and the other end swung forward, the instrument produces a sharp clashing sound. <br><br>\r\n\r\nGiven the scarcity of wood in space, the instrument today is often made from plastic or other polymer variants. More complex variants have lights or chemicals inset in the material that can make the clackers do anything from reflecting light to taking on an eerie glow, or even emitting sparks. <br><br>\r\n\r\nIt\'s not at all uncommon for older siblings to frighten their younger relatives by sneaking up at them in the dark of night, rattling their clackers like some red-eyed beast of myth snapping its jaws. ',1,0.1,0,1,NULL,NULL,1,NULL,3440,NULL,0),(29476,314,'Folkloric Painting','The Intaki have a long and glorious tradition of three-color paintings that depict scenes from both history and mythology, often melding the two into a highly symbolic rendition of their people\'s presence and purpose in the world of New Eden. <br><br>\r\n\r\nIn recent decades, the traditional Intaki painting style has been adopted by painters of the abstract \"Reticular school,\" an anti-factionalist, neo-traditional movement made famous by Suri Naatha and the Circle of Nineteen. ',0.5,0.2,0,1,NULL,NULL,1,NULL,3441,NULL,0),(29477,314,'Number Box','This construction, consisting of rows of pellets set onto colorful pins, once allowed Ni-Kunni mathematicians and natural philosophers to perform highly complex calculations. Its use faded into memory, as most things do, only to be rediscovered as a tool with which to teach students the particulars of certain highly abstract three-dimensional calculations required for space flight. <br><br>\r\n\r\nThe number box\'s pins are placed both horizontally and vertically, so the pellets can be slid along a triple axis; the box is also, to the relief of some teachers, heavy and solid enough to hit a student firmly over the head if he still can\'t grasp the math. ',5,0.2,0,1,NULL,NULL,1,NULL,3442,NULL,0),(29478,314,'Traditional Board Game','An ancient board game said to have been devised by the Ni-Kunni, this game was reputedly used for anything from entertainment on long ship hauls to deciding the fates of battles. Pieces in ancient times were made of wood or bone, but now most often consist of polymer compounds cast into intricate shapes. The game is easy to learn, hard to master, and really stupid to bet on. ',0.5,0.1,0,1,NULL,NULL,1,NULL,3443,NULL,0),(29479,526,'Firecrackers','Small explosive devices with extremely loud retorts  some even relying on cheap, built-in speakers to amplify their effects  these items are used for celebration (and often to prompt heart attacks) throughout the world of New Eden. ',100,1,0,1,NULL,750.0000,1,NULL,3444,NULL,0),(29480,314,'Antique Vheriokor Statue','This statue represents a serpentine figure from ancient Vheriokor mythology; whether it bodes good or ill depends on its origin and the mindset of its viewer. Regardless, originals are increasingly rare these days. ',5,0.2,0,1,NULL,NULL,1,NULL,3445,NULL,0),(29481,281,'Ghalen Pastries','Ghalen is an old Achuran dish of ground meat mixed with chopped vegetables, wrapped in large green leaves and cooked in fat and oils. Each Ghalen pastry is usually the size of a man\'s fist, dripping with juice when one bites into it. It is served piping hot and is one of the few dishes of old that has not only retained its appeal, but become known throughout the world of New Eden. ',100,1,0,1,NULL,98.0000,1,NULL,3449,NULL,0),(29482,281,'Ghalen Dumplings','Ghalen dumplings are variants of the more common Ghalen pastries. The dumplings have far less filling, if any, and usually consist merely of rice balls rolled in leaves and then deep-fried. On holy days, they are eaten without any condiment or side dish, but in recent times they\'ve gained vast popularity with young consumers, who tend to dip them in all manner of spicy sauces. ',120,1,0,1,NULL,98.0000,1,NULL,3446,NULL,0),(29483,526,'Zydrine Wine','This delicate wine is brewed from rice leaves. It often takes on a faint green hue akin to that of raw Zydrine ore, whence it derives its popular name.\n\nWhile Zydrine wine is in fact quite potent, it is very light on the palate and has an aftertaste of green tea. The resultant tendency for drinkers to assume the wine is non-alcoholic has led to some very amusing situations. ',500,1,0,1,NULL,1500.0000,1,NULL,3447,NULL,0),(29484,526,'Zydrine Burn','A cousin of the more refined Zydrine wine, Zydrine Burn (or just \"Burn\") is made from rice leaves and several unspecified components, one of which may or may not be liquefied fedo scent glands. The experience of drinking Burn has been compared to standing behind a spaceship\'s subspace engine, while the ship is running, with one\'s mouth open.\n\nZydrine Burn is enjoyed, or at least ingested, throughout New Eden by masses in search of a new life experience. In this, it generally rewards.',400,1,0,1,NULL,1500.0000,1,NULL,3448,NULL,0),(29485,526,'Kuashi','Two moderately ornate sticks ending in sharp points, with two-inch serrated blades along the forward edge, kuashi are used as eating utensils by the Jin-Mei people (and in fact their use has become common throughout the Caldari State). They are versatile implements, used to pick up small morsels or to stab larger items on their points (and even, among less couth folk, to cut portions away from platters of food). When the point is used to stab, the serrated edges help keep the largest mouthfuls attached to the sticks, thus avoiding clumsy faux pas. <br><br>\r\n\r\nIn some modern kuashi, tiny magnets are inset into the pointed tips to help the wielder keep them together (and thus to keep food properly pinned between), with pressure sensors in the dull ends determining their level of magnetism. ',50,0.5,0,1,NULL,150.0000,1,NULL,3450,NULL,0),(29489,283,'Fugitive Slaves','These slaves have escaped from their masters, but have yet to gain legal protection or recognition as free people.',80,1.5,0,1,NULL,NULL,1,NULL,2541,NULL,0),(29495,937,'Rank','',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(29496,937,'Medal','',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(29497,937,'Ribbon','',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(29503,226,'Indestructible Minmatar Starbase','The Matari aren\'t really that high-tech, preferring speed rather then firepower or involved technology. Unfortunately that doesn\'t apply very well to stationary objects, much to the liking of the Amarr Empire. Amarrians call it a scrapheap of epic proportions. But don\'t underestimate these structures. Minmatar commanders usually have the last laugh when it comes to combat.',100000,100000000,10000,1,2,NULL,0,NULL,NULL,NULL,2600),(29504,284,'OP Insecticide','Organophosphates, similar to nerve gases, have long been used as insecticides, and as bugs evolve, so too must the methods for dealing with them. This particular insecticide is perhaps the most lethal known to humankind, and can kill nearly anything exposed to it. ',250,0.25,0,1,NULL,320.0000,1,NULL,1187,NULL,0),(29505,226,'Fortified Amarr Bunker','A bunker. Beware.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,2422),(29506,226,'Fortified Caldari Bunker','A bunker. Beware.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,2470),(29507,226,'Caldari Starbase Control Tower','At first the Caldari Control Towers were manufactured by Kaalakiota, but since they focused their efforts mostly on other, more profitable installations, they soon lost the contract and the Ishukone corporation took over the Control Towers\' development and production.',100000,100000000,10000,1,1,NULL,0,NULL,NULL,NULL,2599),(29508,226,'Fortified Caldari Lookout','A lookout. Look out.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,2451),(29509,226,'Fortified Caldari Elevator','An elevator.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,2449),(29511,226,'China Monument','',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,1266),(29530,937,'Certificate','A certificate is an official document certifying that you have received specific education or have passed a test, to recognize most any minor achievement throughout many levels of your life.',0,0,0,1,NULL,NULL,0,NULL,1192,NULL,0),(29531,314,'Old Map','This is an old map.',1,0.1,0,1,NULL,NULL,1,NULL,2355,NULL,0),(29532,306,'Cartographer\'s Quarters','The architectural design for the CreoDron Habitation Module started out as a contract deal from the Expert Housing Corporation to standardize the modular drifter homes normally used by miners and deep space explorers. When the project was cancelled due to insufficient funding, CreoDron utilized their design for the open market as high-orbit department buildings for commercial use. The marketing was a tremendou