h as Battleships, Freighters and Industrial Command Ships can be manufactured.\r\n\r\nActivity bonuses:\r\n25% reduction in manufacturing required time\r\n2% reduction in manufacturing required materials\r\n\r\nNote: To use a ship from a Ship Assembly Array a Ship Maintenance Array with enough free storage space needs to be in range that the ship can be moved there.',200000000,25000,18500500,1,NULL,90000000.0000,1,932,NULL,NULL,2625),(29614,283,'Brutor Workers','They favor physical prowess over everything else and can be frightening to face in the flesh.',100,3,0,1,NULL,NULL,1,NULL,2536,NULL,0),(29616,476,'Guristas Nova XL Torpedo','XL Torpedoes are behemoths designed for maximum firepower against capital ships and installations. They are usable only by capital ships and starbase defense batteries.\n\nNocxium atoms captured in morphite matrices form this missile\'s devastating payload. A volley of these is able to completely obliterate most everything that floats in space, be it vehicle or structure.',1500,0.3,0,100,NULL,250000.0000,1,1194,1348,NULL,20031),(29618,476,'Guristas Inferno XL Torpedo','XL Torpedoes are behemoths designed for maximum firepower against capital ships and installations. They are usable only by capital ships and starbase defense batteries.\n\nPlasma suspended in an electromagnetic field gives this torpedo the ability to deliver a flaming inferno of destruction, wreaking almost unimaginable havoc.',1500,0.3,0,100,NULL,325000.0000,1,1194,1347,NULL,20029),(29620,476,'Guristas Scourge XL Torpedo','XL Torpedoes are behemoths designed for maximum firepower against capital ships and installations. They are usable only by capital ships and starbase defense batteries.\n\nFitted with a graviton pulse generator, this weapon causes massive damage as it overwhelms ships\' internal structures, tearing bulkheads and armor plating apart with frightening ease.',1500,0.3,0,100,NULL,300000.0000,1,1194,1346,NULL,20032),(29622,476,'Guristas Mjolnir XL Torpedo','X