00,2664,NULL,0),(29665,667,'Independent Green-Crewed Armageddon','The mighty Armageddon class is the main warship of the Amarr Empire. Its heavy armaments and strong front are specially designed to crash into any battle like a juggernaut and deliver swift justice in the name of the Emperor.\r\n\r\nThe markings on this ship reveal no obvious connection to the Empire.',20500000,1100000,235,1,4,NULL,0,NULL,NULL,NULL,297),(29667,667,'Independent Green-Crewed Apocalypse','In days past, only those in high favor with the Emperor could hope to earn the reward of commanding one of the majestic and powerful Apocalypse class battleships. In latter years, even though now in full market circulation, these golden, metallic monstrosities are still feared and respected as enduring symbols of Amarrian might.\r\n\r\nThe markings on this ship reveal no obvious connection to the Empire.',19500000,1150000,235,1,4,NULL,0,NULL,NULL,NULL,296),(29668,943,'30 Day Pilot\'s License Extension (PLEX)','<font size=\"14\"><b>Pilot\'s License Extension (PLEX)</b></font>\nPLEX can be used to add 30 days of Clone State Omega time to your account or to unlock special character and account services.\n\n<font color=\"#ff3399cc\">Tip: Purchasing PLEX to sell for ISK to other players can be a good way to kickstart your capsuleer career.</font>\n\n<font size=\"14\"><b>Buying PLEX</b></font>\nYou can buy PLEX on the regional market for ISK or securely on <url=https://secure.eveonline.com/PLEX/>https://secure.eveonline.com/PLEX/</url> using conventional payment methods.\n\n<font size=\"14\"><b>Using PLEX</b></font>\nThe primary usage for PLEX is to add 30 days of Clone State Omega time to your account. It can also be used for the following:\n\n<b>Convert to AUR:</b> A PLEX can be exchanged for 3500 AUR, the currency used in the New Eden Store where unique fashion accessories, cosmetic ship upgrades and various other services are sold.\n\n<b>Multiple character training:</b> Activate 30 days of passive skill gain on additional characters on your account with PLEX. This can also be done using a <url=showinfo:34133>Multiple Pilot Training Certificate</url> which is sold in the New Eden Store.\n\n<b>Character transfer:</b> Transferring characters between two accounts can be paid for with PLEX.\n',0,0.01,0,1,NULL,NULL,0,NULL,21481,NULL,0),(29671,667,'Independent Green-Crewed Abaddon ','The Abaddon class ship is a celestial tool of destruction. It is designed to enter combat from the outset, targeting enemies at range and firing salvo after salvo at them, and to remain intact on the battlefield until every heretic in sight has been torn to shreds.\r\n\r\nThe markings on this ship reveal no obvious connection to the Empire.\r\n',20500000,1100000,235,1,4,NULL,0,NULL,NULL,NULL,3132),(29673,667,'Independent Armageddon ','The mighty Armageddon class is the main warship of the Amarr Empire. Its heavy armaments and strong front are specially designed to crash into any battle like a juggernaut and deliver swift justice in the name of the Emperor.\r\n\r\nThe markings on this ship reveal no obvious connection to the Empire.\r\n',19500000,1150000,235,1,4,NULL,0,NULL,NULL,NULL,297),(29674,667,'Independent Apocalypse ','In days past, only those in high favor with the Emperor could hope to earn the reward of commanding one of the majestic and powerful Apocalypse class battleships. In latter years, even though now in full market circulation, these golden, metallic monstrosities are still feared and respected as enduring symbols of Amarrian might.\r\n\r\nThe markings on this ship reveal no obvious connection to the Empire.',19500000,1150000,235,1,4,NULL,0,NULL,NULL,NULL,296),(29675,667,'Independent Abaddon','The Abaddon class ship is a celestial tool of destruction. It is designed to enter combat from the outset, targeting enemies at range and firing salvo after salvo at them, and to remain intact on the battlefield until every heretic in sight has been torn to shreds.\r\n\r\nThe markings on