epublic Fleet\'s key vessels; a versatile gunship proficient at long-range bombardment and capable of dishing out specialized types of damage with great effectiveness.  A well-rounded squadron of Tempests has been proven time and time again to be an invaluable wild card in a fleet battle, one which opponents should ignore at their own peril.\r\n\r\nThe markings on this ship reveal no obvious connection to the Republic.',19000000,19000000,120,1,2,NULL,0,NULL,NULL,NULL,48),(29701,706,'Independent Green-Crewed Typhoon','Much praised by its proponents and much maligned by its detractors, the Typhoon-class battleship has always been one of the most hotly debated spacefaring vessels around. Its distinguishing aspect - and the source of most of the controversy - is its sheer versatility, variously seen as either a lack of design focus or a deliberate freedom for pilot modification.\r\n\r\nThe markings on this ship reveal no obvious connection to the Republic.',19000000,19000000,120,1,2,NULL,0,NULL,NULL,NULL,301),(29702,706,'Independent Maelstrom','With the Maelstrom, versatility is the name of the game. Its defensive capabilities make it ideally suited for small raid groups or solo work, while its 8 turret hardpoints present opportunities for untold carnage on the fleet battlefield.\r\n\r\nThe markings on this ship reveal no obvious connection to the Republic.',19000000,19000000,120,1,2,NULL,0,NULL,NULL,NULL,3134),(29703,706,'Independent Tempest','The Tempest is one of the Republic Fleet\'s key vessels; a versatile gunship proficient at long-range bombardment and capable of dishing out specialized types of damage with great effectiveness.  A well-rounded squadron of Tempests has been proven time and time again to be an invaluable wild card in a fleet battle, one which opponents should ignore at their own peril.\r\n\r\nThe markings on this ship reveal no obvious connection to the Republic.',19000000,19000000,120,1,2,NULL,0,NULL,NULL,NULL,48),(29704,706,'Independent Typhoon'