outing duties where frigates are deemed too weak. Like most Amarrian vessels, the Augoror depends first and foremost on its resilience and heavy armor to escape unscathed from unfriendly encounters.\r\n\r\nThe markings on this ship reveal no obvious connection to the Empire.',12000000,120000,450,1,4,NULL,0,NULL,NULL,NULL,58),(29747,668,'Independent Green-Crewed Arbitrator','The Arbitrator is unusual for Amarr ships in that it\'s primarily a drone carrier. While it is not the best carrier around, it has superior armor that gives it greater durability than most ships in its class.\r\n\r\nThe markings on this ship reveal no obvious connection to the Empire.',12000000,120000,450,1,4,NULL,0,NULL,NULL,NULL,298),(29748,668,'Independent Green-Crewed Maller','Quite possibly the toughest cruiser in the galaxy, the Maller is a common sight in Amarrian Imperial Navy operations. It is mainly used for military duty, although a few can be found in the private sector acting as escort ships for very important dispatches. \r\n\r\nThe markings on this ship reveal no obvious connection to the Empire.',12000000,120000,450,1,4,NULL,0,NULL,NULL,NULL,57),(29749,668,'Independent Green-Crewed Omen','The Omen is a stereotypical example of the Amarrian School of thinking when it comes to ship design: thick armor and hard hitting lasers. Advancements in heat dissipation allow the Omen to fire its lasers faster than other ships without this technology.\r\n\r\nThe markings on this ship reveal no obvious connection to the Empire.',12000000,120000,450,1,4,NULL,0,NULL,NULL,NULL,1065),(29753,668,'Independent Arbitrator','The Arbitrator is unusual for Amarr ships in that it\'s primarily a drone carrier. While it is not the best carrier around, it has superior armor that gives it greater durability than most ships in its class.\r\n\r\nThe markings on this ship reveal no obvious connection to the Empire.',11800000,118000,235,1,4,NULL,0,NULL,NULL,NULL,298),(29754,668,'Independent Augoror','The Augoror-cl