l-out combat ship, and its heavy armament allows the Moa to tackle almost anything that floats in space. In contrast to its nemesis the Thorax, the Moa is most effective at long range where its railguns and missile batteries can rain death upon foes.\r\n\r\nThe markings on this ship reveal no obvious connection to the State.',9600000,96000,450,1,1,NULL,0,NULL,NULL,NULL,49),(29764,673,'Independent Green-Crewed Osprey','The Osprey offers excellent versatility and power for its low price. Designed from the top down as a cheap but complete cruiser, the Osprey utilizes the best the Caldari have to offer in state-of-the-art armor alloys, sensor technology and weaponry - all mass manufactured to ensure low price. In the constant struggle to stay ahead of the Gallente, new technology has been implemented in the field of mining laser calibration. A notable improvement in ore yields has been made, especially in the hands of a well trained pilot.\r\n\r\nThe markings on this ship reveal no obvious connection to the State.',9600000,96000,450,1,1,NULL,0,NULL,NULL,NULL,41),(29765,673,'Independent Blackbird','The Blackbird is a small high-tech cruiser newly employed by the Caldari Navy. Commonly seen in fleet battles or acting as wingman, it is not intended for head-on slugfests, but rather delicate tactical situations. \r\n\r\nThe markings on this ship reveal no obvious connection to the State.',10100000,101000,235,1,1,NULL,0,NULL,NULL,NULL,311),(29766,673,'Independent Caracal','The Caracal is a powerful vessel that specializes in missile deployment. It has excellent shield defenses, but poor armor plating. Its missile arsenal, when fully stocked, is capable of making mincemeat of almost anyone. \n\nThe markings on this ship reveal no obvious connection to the State.',10100000,101000,235,1,1,NULL,0,NULL,NULL,NULL,42),(29767,673,'Independent Moa','The Moa was designed as an all-out combat ship, and its heavy armament allows the Moa to tackle almost anything that floats in space. In