 hit-and-run type of operations.\r\n\r\nThe markings on this ship reveal no obvious connection to the State.',1650000,16500,235,1,1,NULL,0,NULL,NULL,NULL,39),(29830,671,'Independent Veteran Condor','The Condor is fast and agile. It has limited cargo space so it\'s not very suitable for trading or mining. It is best used as an assault vessel in a hit-and-run type of operations.\r\n\r\nThe markings on this ship reveal no obvious connection to the State.',1650000,16500,235,1,1,NULL,0,NULL,NULL,NULL,39),(29831,677,'Independent Green-Crewed Atron','The Atron is a hard nugget with an advanced power conduit system, but little space for cargo. Although it is a good harvester when it comes to mining, its main ability is as a combat vessel.\r\n\r\nThe markings on this ship reveal no obvious connection to the Federation.',2250000,22500,125,1,8,NULL,0,NULL,NULL,NULL,323),(29859,677,'Independent Green-Crewed Imicus','The Imicus is a slow but hard-shelled frigate, ideal for any type of scouting activity. Used by merchant, miner and combat groups, the Imicus is usually relied upon as the operation\'s eyes and ears when traversing low security sectors.\r\n\r\nThe markings on this ship reveal no obvious connection to the Federation.',2250000,22500,125,1,8,NULL,0,NULL,NULL,NULL,322),(29863,677,'Independent Green-Crewed Incursus','The Incursus is commonly found spearheading Gallentean military operations. Its speed and surprising strength make it excellent for skirmishing duties. Incursus-class ships move together in groups and can quickly and effectively gang up on ships many times their size and overwhelm them. In recent years the Incursus has increasingly found its way into the hands of pirates, who love its aggressive appearance.\r\n\r\nThe markings on this ship reveal no obvious connection to the Federation.',2250000,22500,125,1,8,NULL,0,NULL,NULL,NULL,61),(29864,677,'Independent Green-Crewed Maulus','The Maulus is a high-tech vessel, specialized for electronic warfare. It is particularly valued in fleet warfare due to its optimization for sensor dampening technology.\r\n\r\nThe markings on this ship reveal no obvious connection to the Federation.',2250000,22500,125,1,8,NULL,0,NULL,NULL,NULL,324),(29865,677,'Independent Green-Crewed Tristan','Often nicknamed The Fat Man, this nimble little frigate is mainly used by the Federation in escort duties or on short-range patrols. The Tristan has been very popular throughout Gallente space for years because of its versatility. It is rather expensive, but buyers will definitely get their money\'s worth, as the Tristan is one of the more powerful frigates available on the market.\r\n\r\nThe markings on this ship reveal no obvious connection to the Federation.',2250000,22500,125,1,8,NULL,0,NULL,NULL,NULL,60),(29866,677,'Independent Atron','The Atron is a hard nugget with an advanced power conduit system, but little space for cargo. Although it is a good harvester when it comes to mining, its main ability is as a combat vessel.\r\n\r\nThe markings on this ship reveal no obvious connection to the Federation.',2650000,26500,235,1,8,NULL,0,NULL,NULL,NULL,323),(29867,677,'Independent Imicus','The Imicus is a slow but hard-shelled frigate, ideal for any type of scouting activity. Used by merchant, miner and combat groups, the Imicus is usually relied upon as the operation\'s eyes and ears when traversing low security sectors.\r\n\r\nThe markings on this ship reveal no obvious connection to the Federation.',2650000,26500,235,1,8,NULL,0,NULL,NULL,NULL,322),(29868,677,'Independent Incursus','The Incursus is commonly found spearheading Gallentean military operations. Its speed and surprising strength make it excellent for skirmishing duties. Incursus-class ships move together in groups and can quickly and effectively gang up on ships many times their size and overwhelm them. In recent years the Incursus has increasingly found its way into the hands of pirates, who love its aggressive appearance.\r\n\r\nThe markings on this ship reveal no obvious connection to the Federation.',2650000,26500,235,1,8,NULL,0,NULL,NULL,NULL,61),(29869,677,'Independent Maulus','The Maulus is a high-tech vessel, specialized for electronic warfare. It is particularly valued in fleet warfare due to its optimization for sensor dampening technology.\r\n\r\nThe markings on this ship reveal no obvious connection to the Federation.',2650000,26500,235,1,8,NULL,0,NULL,NULL,NULL,324),(29870,677,'Independent Tristan','Often nicknamed The Fat Man, this nimble little frigate is mainly used by the Federation in escort duties or on short-range patrols. The Tristan has been very popular throughout Gallente space for years because of its versatility. It is rather expensive, but buyers will definitely get their money\'s worth, as the Tristan is one of the more powerful frigates available on the market.\r\n\r\nThe markings on this ship reveal no obvious connection to the Federation.',2650000,26500,235,1,8,NULL,0,NULL,NULL,NULL,60),(29871,677,'Independent Veteran Atron','The Atron is a hard nugget with an advanced power conduit system, but little space for cargo. Although it is a good harvester when it comes to mining, its main ability is as a combat vessel.\r\n\r\nThe markings on this ship reveal no obvious connection to the Federation.',2650000,26500,235,1,8,NULL,0,NULL,NULL,NULL,323),(29872,677,'Independent Veteran Imicus','The Imicus is a slow but hard-shelled frigate, ideal for any type of scouting activity. Used by merchant, miner and combat groups, the Imicus is usually relied upon as the operation\'s eyes and ears when traversing low security sectors.\r\n\r\nThe markings on this ship reveal no obvious connection to the Federation.',2650000,26500,235,1,8,NULL,0,NULL,NULL,NULL,322),(29873,677,'Independent Veteran Incursus','The Incursus is commonly found spearheading Gallentean military operations. Its speed and surprising strength make it excellent for skirmishing duties. Incursus-class ships move together in groups and can quickly and effectively gang up on ships many times their size and overwhelm them. In recent years the Incursus has increasingly found its way into the hands of pirates, who love its aggressive appearance.\r\n\r\nThe markings on this ship reveal no obvious connection to the Federation.',2650000,26500,235,1,8,NULL,0,NULL,NULL,NULL,61),(29874,677,'Independent Veteran Maulus','The Maulus is a high-tech vessel, specialized for electronic warfare. It is particularly valued in fleet warfare due to its optimization for sensor dampening technology.\r\n\r\nThe markings on this ship reveal no obvious connection to the Federation.',2650000,26500,235,1,8,NULL,0,NULL,NULL,NULL,324),(29875,677,'Independent Veteran Tristan','Often nicknamed The Fat Man, this nimble little frigate is mainly used by the Federation in escort duties or on short-range patrols. The Tristan has been very popular throughout Gallente space for years because of its versatility. It is rather expensive, but buyers will definitely get their money\'s worth, as the Tristan is one of the more powerful frigates available on the market.\r\n\r\nThe markings on this ship reveal no obvious connection to the Federation.',2650000,26500,235,1,8,NULL,0,NULL,NULL,NULL,60),(29876,683,'Independent Green-Crewed Breacher','The Breacher\'s structure is little more than a fragile scrapheap, but the ship\'s missile launcher hardpoints and superior sensors have placed it among the most valued Minmatar frigates when it comes to long range combat.\r\n\r\nThe markings on this ship reveal no obvious connection to the Republic.',2250000,22500,75,1,2,NULL,0,NULL,NULL,NULL,305),(29878,683,'Independent Green-Crewed Probe','The Probe is large compared to most Minmatar frigates and is considered a good scout and cargo-runner. Uncharacteristically for a Minmatar ship, its hard outer coating makes it difficult to destroy, while the limited weapon hardpoints force it to rely on fighter assistance if engaged in combat.\n\nThe markings on this ship reveal no obvious connection to the Republic.',2250000,22500,75,1,2,NULL,0,NULL,NULL,NULL,45),(29879,683,'Independent Green-Crewed Rifter','The Rifter is a very powerful combat frigate and can easily \r\ntackle the best frigates out there. It has gone through \r\nmany radical design phases since its inauguration during \r\nthe Minmatar Rebellion. The Rifter has a wide variety of \r\noffensive capabilities, making it an unpredictable and deadly adversary. \r\n\r\nThe markings on this ship reveal no obvious connection to the Republic.',2250000,22500,75,1,2,NULL,0,NULL,NULL,NULL,46),(29881,683,'Independent Green-Crewed Vigil','The Vigil is an unusual Minmatar ship, serving both as a long range scout as well as an electronic warfare platform. It is fast and agile, allowing it to keep the distance needed to avoid enemy fire while making use of jammers or other electronic gadgets.\r\n\r\nThe markings on this ship reveal no obvious connection to the Republic.',2250000,22500,75,1,2,NULL,0,NULL,NULL,NULL,1240),(29882,683,'Independent Breacher','The Breacher\'s structure is little more than a fragile scrapheap, but the ship\'s missile launcher hardpoints and superior sensors have placed it among the most valued Minmatar frigates when it comes to long range combat.\r\n\r\nThe markings on this ship reveal no obvious connection to the Republic.',1645000,16450,120,1,2,NULL,0,NULL,NULL,NULL,305),(29883,683,'Independent Probe','The Probe is large compared to most Minmatar frigates and is considered a good scout and cargo-runner. Uncharacteristically for a Minmatar ship, its hard outer coating makes it difficult to destroy, while the limited weapon hardpoints force it to rely on fighter assistance if engaged in combat.\n\nThe markings on this ship reveal no obvious connection to the Republic.',1645000,16450,120,1,2,NULL,0,NULL,NULL,NULL,45),(29884,683,'Independent Rifter','The Rifter is a very powerful combat frigate and can easily \r\ntackle the best frigates out there. It has gone through \r\nmany radical design phases since its inauguration during \r\nthe Minmatar Rebellion. The Rifter has a wide variety of \r\noffensive capabilities, making it an unpredictable and deadly adversary. \r\n\r\nThe markings on this ship reveal no obvious connection to the Republic.',1645000,16450,120,1,2,NULL,0,NULL,NULL,NULL,46),(29885,683,'Independent Slasher','The Slasher is cheap, but versatile. It\'s been manufactured en masse, making it one of the most common vessels in Minmatar space. The Slasher is extremely fast, with decent armaments, and is popular amongst budding pirates and smugglers.\r\n\r\nThe markings on this ship reveal no obvious connection to the Republic.',1645000,16450,120,1,2,NULL,0,NULL,NULL,NULL,44),(29886,683,'Independent Vigil','The Vigil is an unusual Minmatar ship, serving both as a long range scout as well as an electronic warfare platform. It is fast and agile, allowing it to keep the distance needed to avoid enemy fire while making use of jammers or other electronic gadgets.\r\n\r\nThe markings on this ship reveal no obvious connection to the Republic.',1645000,16450,120,1,2,NULL,0,NULL,NULL,NULL,1240),(29887,683,'Independent Veteran Breacher','The Breacher\'s structure is little more than a fragile scrapheap, but the ship\'s missile launcher hardpoints and superior sensors have placed it among the most valued Minmatar frigates when it comes to long range combat.\r\n\r\nThe markings on this ship reveal no obvious connection to the Republic.',1645000,16450,120,1,2,NULL,0,NULL,NULL,NULL,305),(29888,683,'Independent Veteran Probe','The Probe is large compared to most Minmatar frigates and is considered a good scout and cargo-runner. Uncharacteristically for a Minmatar ship, its hard outer coating makes it difficult to destroy, while the limited weapon hardpoints force it to rely on fighter assistance if engaged in combat.\n\nThe markings on this ship reveal no obvious connection to the Republic.',1645000,16450,12