ise that with some salvaging equipment there is still something of value to be had from this wreck.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,3115),(29896,306,'Guristas Ship Ruins','You surmise that with some salvaging equipment there is still something of value to be had from this wreck.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,3115),(29897,306,'Sansha Ship Ruins','You surmise that with some salvaging equipment there is still something of value to be had from this wreck.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,3115),(29898,306,'Serpentis Ship Ruins','You surmise that with some salvaging equipment there is still something of value to be had from this wreck.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,3115),(29899,306,'Angel Ship Hulk','You surmise that with some salvaging equipment there is still something of value to be had from this wreck.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,0),(29900,306,'Blood Ship Hulk','You surmise that with some salvaging equipment there is still something of value to be had from this wreck.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,0),(29901,306,'Guristas Ship Hulk','You surmise that with some salvaging equipment there is still something of value to be had from this wreck.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,0),(29902,306,'Sansha Ship Hulk','You surmise that with some salvaging equipment there is still something of value to be had from this wreck.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,0),(29903,306,'Serpentis Ship Hulk','You surmise that with some salvaging equipment there is still something of value to be had from this wreck.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,0),(29904,818,'Lieutenant Orien Hakk','Raised on the Archangels station in Hemin, Orien Hakk spent most of his adult life fighting to survive amid a sea of crime and poverty. His lucky break came a few years ago, where he managed to sneak aboard an outbound industrial. Quickly realizing that he had unwittingly inserted himself into a slave transport bound for the Amarr home worlds, he commandeered the vessel and its captured crew. For months he roamed the spacelanes of Curse before an Angel raiding party pinned him down. Impressed with his merciless determination and cruel ingenuity, he was offered a place inside the Cartel; a lasting home for people of his caliber, and a place where he has gone from strength to strength.',1645000,16450,120,1,2,NULL,0,NULL,NULL,NULL,338),(29905,817,'Lieutenant Thora Faband','Though she was once an honorary member of their tribe, Thora Faband\'s name is one the Thukkers would nowadays rather forget. For almost a decade, she earned their trust under the guise of a failed trader seeking new beginnings. Over time she built up a foundation of goodwill and support, eventually earning a position as a production overseer in a covert facility said to be hidden deep inside the B-ROFP system. <p>\r\n\r\nFor almost a full year, she secretly turned the Thukkers\' production capabilities toward her own ends, manufacturing massive amounts of the illegal X-Instinct booster. When her plans were eventually uncovered, she convinced the Thukkers that she had been producing them for use in their own roaming caravan fleets. Before the matter could be resolved by the tribal elders, however, she had destroyed the facility, stolen all the stock and vanished south toward the Heaven constellation.',10900000,109000,120,1,2,NULL,0,NULL,NULL,31,337),(29906,816,'Captain Artey Vinck','Angel Captain Artey Vinck used to be one of the most successful civilian traders in the entire Nadire constellation of Sinq Laison, a place known for ruthlessly competitive trading practices. As with many booming Gallentean traders, his success eventually put him in the crosshairs of the criminal underworld. Recognizing an opportunity to shift their goods deep inside Federation space, Serpentis thugs threatened him with financial ruin if he didn\'t begin smuggling boosters for them. <p>\r\n\r\nTheir extortion attempt ended poorly, however, when Vinck decided to go over their heads and cut a far more lucrative and efficient deal with their superiors. Days later they were all dead and Vinck vanished down the path of piracy and narcotics peddling. Since that time he has never been directly linked to any criminal activity, although in recent times he is rumored to have begun leading countless operations involving X-Instinct sales, both inside Federation space and beyond.',19000000,19000000,120,1,2,NULL,0,NULL,NULL,NULL,335),(29907,816,'Captain Appakir Tarvia','Although few ever know the true histories of the Domination Angels\' members, rumors abound that Tarvia was once a humble and harmless archaeologist working on the Eve gate alongside his colleagues in the Servant Sisters of EVE. The Angel Cartel has an immense and well-funded interest in uncovering the valuable secrets locked away inside the ancient Jovian stations they now inhabit. If the rumors are indeed true, then Tarvia would undoubtedly have been tempted away from his work, often viewed as a secondary aim by the Sisters, who set the provision of humanitarian aid as their top priority. Few men of science would have been able to resist the opportunity to conduct research that could change the face of New Eden overnight.',19000000,19000000,120,1,2,NULL,0,NULL,NULL,NULL,335),(29908,817,'Lieutenant Kaura Triat','Formerly a Thukker Tribe member, Triat was enticed into work for the Salvation Angels when it became clear that a life of wandering would not get her any closer to the goals she had set for herself and her people. A firm believer in the potential of booster technology to uplift all of humanity, she has turned away from aimless and simple-minded drug peddling and begun working for the Cartel, who, like their partners in Serpentis, appreciate the deeper benefits of their trade. In Triat\'s eyes, the final manifestation of booster technology represents nothing less than the end of slavery.',10900000,109000,120,1,2,NULL,0,NULL,NULL,31,337),(29909,818,'Lieutenant Tolen Akochi','Caldari by birth, Tolen Akochi was the youngest of seven siblings in a highly successful family that built its fortunes on the back of risk-averse applied research. Even had he ever become heir to anything of substance, his daring methods would have never been tolerated by his family. Accepting these harsh realities, Akochi took what few assets were in his possession and set out for Curse. Serpentis agents soon realized that like their own leader, he had inherited the most important thing of all -- his father\'s talents. After a particularly ruthless SARO raid which almost cost him his life, Akochi saw first-hand how science on the frontier was an industry under constant threat. From that moment on, he changed paths and turned his brilliant mind toward combat training.',1645000,16450,120,1,2,NULL,0,NULL,NULL,NULL,338),(29910,816,'Captain Saira Katori','Katori has years of combat experience, having worked her way up from a lowly grunt to a respected commander. Prior to her days of piracy she served as a rookie inside the Caldari Navy but when they ruled her unfit to be a starship captain she sought other means to take to the stars. She is allegedly a close personal friend of Vepas Minimala who, as the rumor goes, was the one that recognized her raw talent and paid for everything she needed to grow into the fearsome pilot she is today.',19000000,22000000,235,1,1,NULL,0,NULL,NULL,NULL,2158),(29911,816,'Captain Isoryn Ardorele','Formerly a Federation Navy commander, Isoryn Ardorele joined the Guristas Pirates for the simplest of reasons. While deployed inside Caldari borders on a reconnaissance operation for the Federation, Ardorele was targeted back home by State black ops soldiers who kidnapped her family and threatened to kill them if she didn\'t withdraw her forces. Against the orders of her superiors, Ardorele complied with the Caldari and was consequently labeled a traitor to the nation she had served for years. Although devastated by the decision, she was able to understand how it came to be. What she could not understand, however, was the death of her family at the hands of Caldari soldiers who, without any apparent thought or compassion, reneged on their end of the bargain. <p>\r\n\r\nSince that day, her mental wellbeing has come into question time and time again, since she engages in nothing short of genocide on the spacelanes. Keen to harness both her military knowledge and raw hatred for the Caldari people, Guristas leadership offered her a position overseeing their new narcotics operations near State borders. Ardorele is said to be completely uninterested in the booster side of things, but nobody can argue with the results of her security patrols. Her tendency to indiscriminately slaughter every Caldari that she comes across has meant that the curious stay well away. ',19000000,22000000,235,1,1,NULL,0,NULL,NULL,NULL,2158),(29912,817,'Lieutenant Asitei Ohkunen','There is a great deal said about Asitei Ohkunen but separating the fact from the fiction is no easy task. Reclusive and secretive, he has made himself scarce to everyone but his Gurista cohorts since abandoning his post in the Caldari Navy. Although the Caldari State initially denied he ever worked for them, a leaked CONCORD file later revealed that Ohkunen was indeed registered with them as an electronics expert. The political backlash from the State following the leak was in fact the only time people ever heard the name Asitei Ohkunen. Whatever crimes he may have committed, if any, his name certainly hasn\'t been linked to them.',10100000,101000,235,1,1,NULL,0,NULL,NULL,31,1824),(29913,817,'Lieutenant Sukkenen Fusura','A computer expert like few others, Sukkenen Fusura was once destined for a promising career in the Caldari State. As an inquisitive young man with few moral qualms, he would often roam the greater network looking for challenging databases to hack into. It was this dubious hobby of his that saw him fall from grace inside the State, after he was caught digging around classified corporate databases. It didn\'t take long for the Guristas Pirates to notice just how easily he bypassed many of the State\'s classified systems, and soon enough he was spotted slipping out of Lonetrek towards Venal in the north. Fusura recently caused quite a stir when he boasted on a public network that the Caldari State\'s biotech corporations had all contributed heavily toward improving the design and production of the Guristas Crash boosters.',10100000,101000,235,1,1,NULL,0,NULL,NULL,31,1824),(29914,818,'Lieutenant Rodani Mihra','As a lower-class Khanid exiled from the Amarr Empire, Rodani Mihra had to quickly adapt to a challenging and foreign environment. Pledging that he would never submit himself to manual labor, Mihra fine-tuned his talents at trading and market analysis. His service to the Guristas began almost a decade ago, just as he was about to enter into legitimate work as an advertising consultant. After a chance meeting with a Gurista booster manufacturer made him realize just how much money he could make with his skills, he left for Venal and never returned. Mihra is said to be absurdly protective of the financial kingdom he has built up around Blue Pill boosters these past years.',1650000,16500,235,1,1,NULL,0,NULL,NULL,NULL,1831),(29915,818,'Lieutenant Onoki Ekala','Like so many ranking Guristas commanders, Onoki Ekala once had strong ties to the Caldari Navy. A knowledge nomad similar to the famed Tyma Raitaru, he spent many years as a freelance scientist selling his patents to the highest bidder, which in his case were most commonly Navy subsidiaries. Considered a brilliant innovator across a number of disciplines, Ekala made a small fortune optimizing anything from missile manufacturing processes to bio-weapon delivery mechanisms. <p>\r\n\r\nRealizing that it was a simple matter of ISK and greed, the Guristas offered him access to research funding and cloning technology in exchange for his lasting loyalty. Ekala has stayed with them for almost a decade since then, much to the disappointment of his former clients in the Caldari Navy.',1650000,16500,235,1,1,NULL,0,NULL,NULL,NULL,1831),(29916,816,'Captain Scane Essyn','Scane Essyn worked alongside Serpentis Officer Brynn Jerdola at the Federal Intelligence Office for many years. As one of the few close enough to her to be aware of her mission to infiltrate the Serpentis hierarchy, he was often rumored to be her lover. Not long after it became widely acknowledged that Jerdola had defected, Essyn quietly slipped outside Federation borders and was next seen in the Wyvern Constellation, flanked by a fleet of Serpentis Vindicators. Whether he followed her lead in defecting -- or, indeed, was the reason for it happening -- remains unknown. Most likely this very issue is still an ongoing investigation inside the shadowy corridors of the FIO.',17500000,1140000,480,1,8,NULL,0,NULL,NULL,NULL,2157),(29917,816,'Captain Amiette Barcier','Originally a high-ranking fleet commander for the Angel Cartel\'s Archangel Division, Barcier first came in to contact with Serpentis on a joint operation with the Guardian Angels, where her squadron was tasked with the defense of Serpentis Inquest HQ. Seeing what they thought was a weak link in Fountain\'s defensive line, CONCORD raiding parties repeatedly tried to hamper Inquest research operations. Rumor has it that Barcier eventually came to the attention of Salvador Sarpati himself when  after four long months of nothing but failed attempts  CONCORD\'s elite SARO Division called for an end to the assaults. Since that day, Barcier has continued to deliver results and impress her new employer.',17500000,1140000,480,1,8,NULL,0,NULL,NULL,NULL,2157),(29918,817,'Lieutenant Elois Ottin','Once destined to be a holovid star, Elois Ottin\'s promising career as an actress was crushed under the weight of a severe Drop addiction. Her drug dependence became a huge public scandal when a jaded lover ran to the press with the story. Unfortunately for Ottin, the revelation came on the heels of a highly successful anti-drug campaign. Federation politicians and their lackeys in the media wasted little time in alienating her completely. Seizing the opportunity to counter the Federation\'s propaganda machine, Serpentis Corporation saw to it that from then on, she would have access to training, cloning technology and anything else needed to become a flag-bearer for their ideals.',11200000,112000,480,1,8,NULL,0,NULL,NULL,31,1815),(29919,817,'Lieutenant Rayle Melania','Born and bred on the Serpentis headquarters station in Serpentis Prime, Rayle Melania lived a daily life of crime, poverty and booster addiction. He struggled for many years as a lowly pimp and failed drug dealer before his far more impressive capabilities as a capsuleer pilot were uncovered. Taking the hard lessons from the station ghettos with him straight into the spacelanes, Melania quickly earned a name for himself as one of the most rough and ruthless narco-thugs Serpentis had employed in recent years.',11200000,112000,480,1,8,NULL,0,NULL,NULL,31,1815),(29920,818,'Lieutenant Raute Viriette','A relic from the early years following the booster ban, Raute Viriette spent the last few decades locked away inside Poteque Pharmaceuticals biolabs, supposedly working on a top-secret research project for the Federal government. It was one of the worst kept secrets inside Poteque that her entry into science had come at a time when booster research was still seen in some fringe communities as the next great scientific breakthrough. Over the years however, people had forgotten about these associations. It was only recently, when she vanished from her post in the Federation, that people began to remember.',2650000,26500,235,1,8,NULL,0,NULL,NULL,NULL,1818),(29921,818,'Lieutenant Irrie Carlan','Formerly a Federation Customs officer, few understand the ways of customs and anti-narcotic squads like Irrie Carlan. Tempted away from her duty to the Federation by the promise of vast riches and access to Serpentis Inquest\'s cloning technology, she wasted little time in defecting. Although she gambled the promise of a successful career away, the decision has been one she could hardly regret, having rocketed up the Serpentis chain of command on the back of her rare and precious knowledge.',2650000,26500,235,1,8,NULL,0,NULL,NULL,NULL,1818),(29922,816,'Captain Tori Aanai','A graduate from the School of Applied Knowledge, Tori Aanai stands as one of many lessons about the dangerous freedom that capsuleer technology bestows. Shortly after her graduation, Aanai found herself deployed deep inside Stain. She was guarding what was to become a failed attempt by the Poksu Mineral Group to uncover mineral riches in a system they wrongly assumed was unexploited. When the industrial convoy fled in the face of an unexpected Sansha presence, for reasons known only to her, Aanai decided to stay. From that point on, she has been linked to countless illegal activities. <p>\r\n\r\nDED reports state that she has been killed over a thousand times on the fringes of empire space, recklessly exposing herself to near-harmless physical death as she coordinates large-scale Frentix production and distribution on the front lines. Despite their success at reining her operations in, the DED has never brought them to a complete standstill. Indeed, many say that each death has only hardened her resolve.',10010000,100100,235,1,4,NULL,0,NULL,NULL,NULL,2295),(29923,817,'Lieutenant Onuoto TS-08A','The pilot inside this Phantasm-class cruiser seems to be locked into a series of highly complex tactical maneuvers designed to hit hard and leave little room for their opponent to survive the opening assault. Although this battle strategy would spell instant death for a rookie or even an intermediate pilot, to a capsuleer these maneuvers are severely limited and, after some observation, easily predicted. Every few seconds the pilot attempts to open a comms link. When accepted, all that is transmitted is a deafening static.',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,1236),(29924,818,'Lieutenant Onuoto TS-08B','The pilot inside this Succubus-class frigate seems to be locked into a series of highly-complex tactical maneuvers designed to pin down an enemy in anticipation for a larger onslaught. Although this battle strategy would spell instant death for a rookie or even an intermediate pilot, to a capsuleer these maneuvers are severely limited and, after some observation, easily predicted. Every few seconds the pilot attempts to open a comms link. When accepted, it does nothing other than fill the audio receivers with the same looping audio fragment of some long-forgotten speech by Sansha Kuvakei.',2112000,21120,235,1,4,NULL,0,NULL,NULL,NULL,1237),(29925,816,'Captain Aneika Sareko','Known across Delve for her ruthless rise to Captain of the Crimson Hand fleet, Sareko has built a reputation for no-nonsense dealings and zero tolerance for insubordination. Of Caldari descent, she is primarily interested in business and getting the job done, but when clients\' arrangements start to look suspect, her Sani Sabik side comes out in force. One particular story bears out the truth of this, although it has never been substantiated by CONCORD. <p>\r\n\r\nApparently, during a particularly successful SARO raid deep into Delve, officers came across what appeared to be a cloning facility. Inside, however, the infrastructure had been converted into a prison of sorts. Rebellious Crimson Hand personnel had been cloned and subjected to a daily regime of capital punishment. Unofficial sources claimed they had been locked up inside their capsule prisons for as long as nine months, dying a new death each day only to be reborn to suffer it all over again. ',19500000,1150000,235,1,4,NULL,0,NULL,NULL,NULL,2121),(29926,817,'Lieutenant Kannen Sumas','A former Priest based out of Penirgman, Sumas was once a famed theologian back in his home system. He served almost two decades in the Imperial Navy before the lure of immortality brought him into the Crimson Hand\'s service. His finely honed expertise in Amarrian warfare, now augmented with the limitless potential of capsule technology has shaped him into a fearsome personal bodyguard for high-ranking military officers.',11800000,118000,235,1,4,NULL,0,NULL,NULL,31,1759),(29927,818,'Lieutenant Anton Rideux','To most customers, Rideux is the public face for the outfit and the only person in the Hand they\'re likely to ever see. As a relatively calm and amicable Intaki he is perfectly suited to handle the front end of business with clients both large and small. Very rarely will he get his hands dirty but if his own personal honor or credibility comes under attack then he is quick to have an example made out of his detractors.',2860000,28600,235,1,4,NULL,0,NULL,NULL,NULL,1764),(29932,314,'Sareko\'s Capsule','The self-destruct unit on this capsule has had the safety timer removed, a unique Crimson Hand modification that ensures military officers are rarely captured alive. The corpse also appears to have been liquefied in some way during the process, adding a dark ruby hue to the capsule fluid within.',32000,1000,0,1,NULL,NULL,1,NULL,73,NULL,73),(29933,314,'Victor Emblem','This is an expensive replica of an old Imperial Navy medal once given to soldiers on their 20th year of service. Crimson Hand lieutenant Kannen Sumas has embedded a data file underneath the resilient metal alloy exterior. The file\'s sole contents are a few selected verses of the Amarrian Scriptures, all of them celebrating the virtues of humility in the face of a superior foe. ',1,0.1,0,1,NULL,NULL,1,NULL,2096,NULL,0),(29934,314,'Splinter Bodyguard','Although the explosion of Anton Rideux\'s ship has scrambled the electronics, the intentions behind this Rogue Drone redesign remain clear. In typical Crimson Hand style, the violent and unpredictable Splinter variant has been captured and reprogrammed to protect its host ship. The fact that Rideux didn\'t launch it suggests perhaps the job hadn\'t quite been finished yet. ',34000,25,0,1,NULL,NULL,1,NULL,2989,NULL,0),(29935,314,'Cartel Holovids','Encapsulated in a surprisingly sturdy metal casing, this holovid collection appears to have survived the explosion of Serpentis drug lord Amiette Barcier\'s vessel. It seems that each of the numerous holovids involve a different depiction of the Angel Cartel from amateur documentaries theorizing about secretive research projects to underground films glorifying the Cartel\'s highly violent raids. ',1,1,0,1,NULL,250.0000,1,NULL,1177,NULL,0),(29936,314,'Accounting Records','It appears as if the only thing designed to survive the explosion of Rayle Melania\'s vessel was his accounting log, perhaps so it could later be recovered by his Serpentis colleagues. Although heavily encrypted, fragments of data are decipherable. Even from what little is readable, it is clear that Melania handles the shifting of his narcotic goods personally.  According to one transaction log, he made almost 300 individual deliveries across seven regions of New Eden, all in the space of a single day.',1,1,0,1,NULL,10000.0000,1,NULL,2886,NULL,0),(29937,314,'Inquest Drone','Hundreds of these tiny devices were released momentarily before the explosion of Irrie Carlan\'s vessel. Motionless upon launch, they began to spring to life shortly afterwards, flitting around the ruins of the ship as they assessed the damage. Most curiously, they appeared to perform some kind of in-space surgical procedure on Carlan\'s corpse once it had been located amongst the wreckage. Now removed from the rest of its swarm, this particular drone has powered down entirely and seemingly erased its own subroutines. Any chance at reverse-engineering it in this state would be slim.',1,1,0,1,NULL,NULL,1,NULL,2989,NULL,0),(29938,314,'Cipher Router','This heavily damaged fluid router appears to offer a low-profile backdoor into classified FIO networks. In a more functional state this unit could have shed some light on whether or not Serpentis Captain Scane Essyn truly defected. Without a way to bypass the various built-in encryption systems, however, it will be impossible to make sense of any recoverable data. This could be proof of Essyn using old knowledge to his advantage in a new career, or simply his link back to one he never abandoned in the first place.',10,2,0,1,NULL,NULL,1,NULL,3230,NULL,0),(29939,314,'Ottin Holoreels Case','Kept safe from the explosion of her vessel, this Holoreel collection is a meticulous document of Serpentis Lieutenant Elois Ottin\'s entire acting career. A large Impetus logo is emblazoned on the outside of the container, suggesting that perhaps the case was a gift from the corporation. Although Ottin rarely managed to snare contracts with Impetus to produce her works, they did manage and fund her two most successful acting ventures. At one point she had a third lined up, but when her drug dependency became public knowledge Impetus dropped the contract amid the scandal. ',1,1,0,1,NULL,NULL,1,NULL,16,NULL,1176),(29940,314,'Advisory Notes',' Found among the wreckage of Serpentis Lieutenant Rautte Viriette\'s vessel, these notes offer a glimpse into her recent scientific pursuits. From what little is decipherable, Viriette seems to be advising Serpentis Inquest scientists on various methods of production efficiency, all of which appear to be applied to the manufacture of Drop boosters. Although there is no evidence directly linking any of her previous Poteque research to her current work with the Serpentis, it is clear that the methods she has learned in the last few decades are being put to good use.',1,0.1,0,1,NULL,NULL,1,NULL,2886,NULL,0),(29941,314,'Dysfunctional Fluid Router','The backbones of communication across New Eden, fluid routers play a crucial role in all faster than light (FTL) transmissions. The locator and identification subsystems on this particular model appear to have been removed entirely, most likely as part of an attempt to avoid CONCORD interference. Although the unit is heavily damaged from the explosion of Saira Katori\'s ship, fragments of data have survived in its cache. Most interesting among them is an unsent mail to Vepas Minimala which reveals a certain degree of familiarity between them.',1,1,0,1,NULL,NULL,1,NULL,3230,NULL,0),(29942,314,'Research Data Fragment','Barely intact as it lies among the wreckage of his ship, this data terminal offers a rare insight into the likely research interests of the enigmatic and reclusive pirate Asitei Ohkunen. Huge amounts of data have been compiled on the neurological states of test subjects, all of them under the effects of various boosters. The reasoning behind these tests remains uncertain, although the narrow focus on electrical impulses inside the brain might suggest an attempt at some kind of digitally-produced emulation.',1,0.1,0,1,NULL,NULL,1,NULL,2885,NULL,0),(29943,314,'Demographic Analyses','Moments before the destruction of his ship Rodani Mihra attempted to destroy these files. The formatting procedure didn\'t fully complete before his ship was downed, however, and fragments of data remain, including one important-looking document. Highly convoluted and riddled with economic terminology, it appears to be a comprehensive report on various regions. Each and every system has been broken down into demographic sub-groups that clearly outline where the demand for illegal boosters is currently greatest and where it is mostly likely to grow in the coming weeks and months.',1,0.1,0,1,NULL,NULL,1,NULL,2886,NULL,0),(29944,314,'Ardorele Heirloom','Found drifting in a container amongst the wreckage of her ship, Guristas Captain Isoryn Ardorele\'s personal possessions tell a tale of devastating loss. Federation Navy medals rewarding long years of service, hand paintings made by her late daughter, a wedding ring  all mementos of a past destroyed by Caldari thugs. With such a constant and effective reminder of her painful history, it is little wonder that Ardorele manages to sustain her murderous rage towards the Caldari. ',1,0.1,0,1,NULL,NULL,1,NULL,2705,NULL,0),(29945,314,'Network Decryption Analyzer','This strange-looking piece of equipment was discovered unharmed amid the shattered hull of Guristas Lieutenant Sukkenen Fusura\'s vessel. Although baffling in its complexity, it is clearly used as a tool to breach secure networks. All the software appears to be proprietary, however. Without some way to understand even the basic functionality or system design there is little chance of using the device, let alone reverse-engineering it.',1,0.1,0,1,NULL,NULL,1,NULL,2857,NULL,0),(29946,314,'Ekala\'s Design Documents','Heavily damaged from the explosion of his vessel, Guristas Captain Onoki Ekala\'s private designs fail to offer any significant insights into what his brilliant mind is currently working toward. Careful analysis of the reconstructed diagrams reveals various bio-chemical refining array designs, but many crucial details are missing. Presumably this facility has something to do with the processing of cytoserocin, the material harvested from gas clouds as part of booster production. Without access to more information, the designs alone offer no real clue as to what Ekala is up to save for the obvious; producing Crash boosters.',1,0.1,0,1,NULL,NULL,1,NULL,2886,NULL,0),(29947,314,'Enigmatic Reports','Completely unharmed from the destruction of Angel Captain Appakir Tarvia\'s vessel, this data storage unit appears to contain a wealth of information, although every last byte is encrypted in an unknown cipher that looks leagues above current data protection technology. Every attempt made to crack the code returns nothing more than a list of strange errors, none of which are typical for decryption fault analysis. More ominously still, each attempt at decryption seems to activate an internal uplink to a remote system in the Heaven constellation, with no apparent way to stop what must be outbound transmissions. <p>\r\n\r\nDespite the impenetrability of the data, one small image juts out among the garbled text, offering an explanation as menacing as the fact that it was clearly excluded from the encryption as some kind of warning.  ',1,0.1,0,1,NULL,NULL,1,NULL,1192,NULL,0),(29948,314,'Insorum Booster Prototype','The only known cure for the infamous Vitoc method that Amarrians use to control their massive slave contingents, Insorum is the answer to every loyal Minmatar\'s desire to see their people freed from its insidious grip. How Angel Lieutenant Kaura Triat even came into possession of such a rare and highly-valued Insorum sample is anyone\'s guess. More intriguing, however, is the fact that it seems to have been heavily modified by scientists, perhaps those working for Serpentis Inquest. Encased in a resilient tamper-proof case that will destroy the contents within if opened by anyone but its owner, this sample seems to have been integrated with the Sooth Sayer booster. What purpose this process might have served remains entirely unclear. ',1,0.1,0,1,NULL,NULL,1,NULL,1193,NULL,0),(29949,314,'SARO Emblem','Bizarrely enough, it seems that Angel Cartel Lieutenant Tolan Akochi has been carrying around a CONCORD dog tag, even going to the trouble of protecting it against the rigors of exposure in space. A database query on the ID number offers a grim explanation as to why, revealing that it belongs to an ex-SARO Commander. Although nothing about him is listed on the CONCORD public network, third party news articles related to his name detail how he once lead an offensive on Serpentis Inquest Headquarters. Initially thought to be a success, later pieces tell the story of what eventually amounted to a large-scale operational failure in the face of unexpected resistance. The final article available outlines a particularly gruesome death suffered by him, his entire family and a swathe of known associates.',1,0.1,0,1,NULL,NULL,1,NULL,2552,NULL,0),(29950,314,'Customs Patrol Schedule','Found among the wreckage of Angel Captain Artey Vinck\'s vessel, this innocuous looking data core actually holds a wealth of information about previous Federation Customs patrol routes, now probably a little outdated. The level of detail is staggering: including locations of almost every single Customs vessel in operation across the entire Sinq Laison region. With information like this, a smuggler could pass undetected anywhere they pleased with complete impunity. Attached to the information is a brief note bearing the logo of Serpentis Corporation that reads Fly safe Artey, times change. As ever, I.C.',1,0.1,0,1,NULL,NULL,1,NULL,1192,NULL,0),(29951,314,'DisX Stash','Encapsulated in a resilient Mexallon alloy container, this drug stash was clearly intended to survive the explosion of Angel Lieutenant Thora Faband\'s vessel, most likely so it could be recovered by her Cartel associates. A cursory analysis of the contents reveals them to be a modified version of an X-Instinct variant known as DisX which possesses greatly increased dissociative elements that serve to heighten sensory deprivation. Strangely enough, these drugs are most popular among the Matari tribes that she cheated to make them. They value DisX as a catalyst for self-exploration and spiritual insight.',1,0.1,0,1,NULL,NULL,1,NULL,3217,NULL,0),(29952,314,'Rebellion Cache','Locked away inside a secure container, this mass stockpile of small arms has somehow managed not to detonate following the explosion of Angel Lieutenant Orien Hakk\'s vessel. There must be tens of thousands of rifles and pistols here, all of them fully loaded and ready for immediate use. The weapons are supplemented by a deadly assortment of explosives and blunt weapons. Emblazoned on the cover of the container is what appears to be a parachute mechanism and the words Rebel Cache.',1000,50,0,1,NULL,NULL,1,NULL,1366,NULL,0),(29953,314,'PDW-09FX Data Shell','This data storage unit must have contained invaluable insights into ongoing Sansha\'s Nation operations. However, it is encased within a neodymium trigger mechanism which caused it to auto-delete every single file in its database the moment it was exposed to the cold vacuum of space. A design utilizing the atmospheric reactivity of neodymium lies at the cutting edge of technology, requiring a level of ingenuity and craftsmanship well outside a True Slave\'s capabilities and indeed even beyond that of its former owner, Sansha\'s Nation Captain Toriiko Aanai. Stranger still, however, is the fact that this shell was also clearly designed to survive the explosion of her ship.',1,0.1,0,1,NULL,NULL,1,NULL,2889,NULL,0),(29954,314,'PDW-09FX Tactical Subroutines','This appears to be the logical nexus of the Phantasm-class cruiser once piloted by what was most probably a True Slave. Although heavily damaged following the explosion that freed it from the vessel, there are several semi-functional tactical subroutines still in operation now, seemingly unaware of their disconnection. The circuitry appears to have at one point been integrated into the pilot in some way, forming a frighteningly efficient harmony of mind and machine. Most disconcerting however, is the fact that various aspects of the software technology could only be a few years old. ',1,0.1,0,1,NULL,NULL,1,NULL,2886,NULL,0),(29955,314,'Address #298 Audio Fragment','Unmistakably the voice of Sansha Kuvakei, this audio fragment captures a brief glimpse of a low-key speech he made over a century ago. Dating from the height of his fame, Kuvakei\'s speech is riddled with self-indulgent rhetoric and delusions of grandeur. As the speech\'s intensity reaches its peak, his final line I am the answer loops repeatedly for a few minutes before the process begins all over again. ',1,0.1,0,1,NULL,NULL,1,NULL,2184,NULL,0),(29964,954,'Legion Defensive - Adaptive Augmenter','Capitalizing on the exceptional defensive capabilities of fullerene-based components, this subsystem allows a pilot to augment their Legion\'s armor resistance, dramatically enhancing its survivability in combat. Tiny molecular-level conduits play a crucial role in orchestrating the flow of nano-assemblers beneath the armor\'s surface, guarding the flow of vital repairs against disruptive impact. \r\n\r\nSubsystem Skill Bonus: \r\n4% bonus to all armor resistances per level \r\n10% bonus to remote armor repair system effectiveness per level',1400000,40,300,1,4,NULL,1,1126,3631,NULL,3631),(29965,954,'Legion Defensive - Nanobot Injector','The advanced Sleeper-based technology in this subsystem is focused on increasing the effectiveness of a vessel\'s armor nanobots. When integrated into the hull of a Legion, it offers a substantial increase in the armor output of any local repair modules fitted. Although the subsystem offers the same end result as other built-in armor repair augmentations, the technology driving it operates in a vastly different way, allowing for easy removal from its host vessel. \n\nSubsystem Skill Bonus: \n10% bonus to armor repairer effectiveness per level',1400000,40,300,1,4,NULL,1,1126,3631,NULL,3632),(29966,954,'Legion Defensive - Augmented Plating','Although this subsystem uses the same armor nano-assemblers as standard empire technology, various optimizations have been made. Taking full advantage of recently discovered Sleeper designs, the use of fullerene-based technology has allowed for the combination of far smaller and more resilient components.  \r\n\r\nSubsystem Skill Bonus: \r\n7.5% bonus to armor hitpoints per level.\r\n',1400000,40,340,1,4,NULL,1,1126,3631,NULL,3633),(29967,954,'Legion Defensive - Warfare Processor','After countless failed projects over the years, the dream of linking fleets with sub-Battlecruiser hulls was eventually shelved and relegated to the realm of engineering theory. It remained this way for some time, tempting few starship manufacturers to revisit the challenge, even after the discovery of ancient Sleeper designs and the influx of fullerene-based technology. It was not until the first Strategic Cruiser hulls began appearing in small numbers across the empires that they began to truly appreciate the potential Tech III vessels had for modifications.  \r\n\r\nNot long after, the first warfare processor housing became a reality. Although what it delivered as a standalone unit was undoubtedly impressive, what would count more in time was the way it served as a catalyst. The unit demonstrated to the wider spacefaring industry that the possibilities for Tech III ships were broader than first imagined, and in doing so, it heralded the beginning of even more radical and innovative designs.\r\n\r\nSubsystem Skill Bonus:\r\n2% bonus to strength and duration of Armored Command, Information Command, and Skirmish Command Bursts per subsystem skill level\r\n\r\nRole Bonus:\r\nCan fit one Command Burst module\r\n+50% bonus to Command Burst Area of Effect Range',1400000,40,300,1,4,NULL,1,1126,3631,NULL,3634),(29969,954,'Tengu Defensive - Adaptive Shielding','Based on the same advanced technology employed by Sleeper drones to harden their armor plating, these tiny nano-assemblers have been reconfigured to improve a shield\'s resistance to damage. The influx of superior construction materials and the modularity of Sleeper components have made even this drastic redesign into a fairly simple process.   \r\n\r\nSubsystem Skill Bonus: \r\n4% bonus to all shield resistances per level\r\n10% bonus to shield transporter effectiveness per level\r\n',1400000,40,420,1,1,NULL,1,1127,3631,NULL,3606),(29970,954,'Tengu Defensive - Amplification Node','When confronted with the challenge of adapting Sleeper designs to produce shield boost amplification systems, Caldari engineers turned to the defense systems used by certain Talocan structures that had also been found in a few ancient ruins. In some rare cases, the shielding systems on Talocan facilities were constructed using a harmony of Sleeper and Talocan designs. The first successful production of a shield boost amplification node drew heavily upon early study of this particular combination. \n\nSubsystem Skill Bonus: \n10% bonus to shield booster effectiveness per level\n',1400000,40,440,1,1,NULL,1,1127,3631,NULL,3607),(29971,954,'Tengu Defensive - Supplemental Screening','Making full use of recent scientific advances afforded by the discovery of ancient technologies, Caldari starship designers have reverse engineered the equipment behind the Sleeper\'s metallofullerene armor plating. Through a complex substitution method, skilled engineers and physicists have been able to supplement a Tengu\'s shields, offering increased survivability for a pilot under heavy fire. \r\n\r\nSubsystem Skill Bonus: \r\n5% bonus to shield hitpoints per level.\r\n3% bonus to passive shield recharge rate per level.\r\n',1400000,40,410,1,1,NULL,1,1127,3631,NULL,3608),(29972,954,'Tengu Defensive - Warfare Processor','After countless failed projects over the years, the dream of linking fleets with sub-Battlecruiser hulls was eventually shelved and relegated to the realm of engineering theory. It remained this way for some time, tempting few starship manufacturers to revisit the challenge, even after the discovery of ancient Sleeper designs and the influx of fullerene-based technology. It was not until the first Strategic Cruiser hulls began appearing in small numbers across the empires that they began to truly appreciate the potential Tech III vessels had for modifications.  \r\n\r\nNot long after, the first warfare processor housing became a reality. Although what it delivered as a standalone unit was undoubtedly impressive, what would count more in time was the way it served as a catalyst. The unit demonstrated to the wider spacefaring industry that the possibilities for Tech III ships were broader than first imagined, and in doing so, it heralded the beginning of even more radical and innovative designs. \r\n\r\nSubsystem Skill Bonus:\r\n2% bonus to strength and duration of Shield Command, Information Command, and Skirmish Command Bursts per subsystem skill level\r\n\r\nRole Bonus:\r\nCan fit one Command Burst module\r\n+50% bonus to Command Burst Area of Effect Range',1400000,40,290,1,1,NULL,1,1127,3631,NULL,3609),(29974,954,'Loki Defensive - Adaptive Shielding','Based on the same advanced technology employed by Sleeper drones to harden their armor plating, these tiny nano-assemblers have been reconfigured to improve a shield\'s resistance to damage. The influx of superior construction materials and the modularity of Sleeper components have made even this drastic redesign into a fairly simple process.   \r\n\r\nSubsystem Skill Bonus: \r\n4% bonus to all shield resistances per level\r\n10% bonus to shield transporter effectiveness per level\r\n',1400000,40,280,1,2,NULL,1,1128,3631,NULL,3681),(29975,954,'Loki Defensive - Adaptive Augmenter','Capitalizing on the exceptional defensive capabilities of fullerene-based components, this subsystem allows a pilot to augment their Loki\' armor resistance, dramatically enhancing its survivability in combat. Tiny molecular-level conduits play a crucial role in orchestrating the flow of nano-assemblers beneath the armor\'s surface, guarding the flow of vital repairs against disruptive impact.\r\n\r\nSubsystem Skill Bonus: \r\n4% bonus to all armor resistances per level.',1400000,40,270,1,2,NULL,1,1128,3631,NULL,3682),(29976,954,'Loki Defensive - Amplification Node','When confronted with the challenge of adapting Sleeper designs to produce signature reduction systems, Sebiestor engineers turned to the defense systems used by certain Talocan structures that had also been found amongst a few ancient ruins. An unexpected harmony of Sleeper and Talocan design was discovered after extensive reverse engineering attempts and this new method was born soon after. \n\nBased around the amplification of noise in surrounding local space, the subsystem allows a pilot to passively emit such significant electromagnetic interference that hostile sensors, tracking subroutines and missile detonation triggers will all treat the ship as if it is significantly smaller than it actually is.  \n\nSubsystem Skill Bonus: \n5% reduction in signature radius per level.\n',1400000,40,300,1,2,NULL,1,1128,3631,NULL,3683),(29977,954,'Loki Defensive - Warfare Processor','After countless failed projects over the years, the dream of linking fleets with sub-Battlecruiser hulls was eventually shelved and relegated to the realm of engineering theory. It remained this way for some time, tempting few starship manufacturers to revisit the challenge, even after the discovery of ancient Sleeper designs and the influx of fullerene-based technology. It was not until the first Strategic Cruiser hulls began appearing in small numbers across the empires that they began to truly appreciate the potential Tech III vessels had for modifications.  \r\n\r\nNot long after, the first warfare processor housing became a reality. Although what it delivered as a standalone unit was undoubtedly impressive, what would count more in time was the way it served as a catalyst. The unit demonstrated to the wider spacefaring industry that the possibilities for Tech III ships were broader than first imagined, and in doing so, it heralded the beginning of even more radical and innovative designs. \r\n\r\nSubsystem Skill Bonus:\r\n2% bonus to strength and duration of Skirmish Command, Shield Command, and Armored Command Bursts per subsystem skill level\r\n\r\nRole Bonus:\r\nCan fit one Command Burst module\r\n+50% bonus to Command Burst Area of Effect Range',1400000,40,200,1,2,NULL,1,1128,3631,NULL,3684),(29979,954,'Proteus Defensive - Adaptive Augmenter','Capitalizing on the exceptional defensive capabilities of fullerene-based components, this subsystem allows a pilot to augment their Proteus\' armor resistance, dramatically enhancing its survivability in combat. Tiny molecular-level conduits play a crucial role in orchestrating the flow of nano-assemblers beneath the armor\'s surface, guarding the flow of vital repairs against disruptive impact.\r\n\r\nSubsystem Skill Bonus: \r\n4% bonus to all armor resistances per level.\r\n10% bonus to remote armor repair system effectiveness per level\r\n',1400000,40,320,1,8,NULL,1,1129,3631,NULL,3656),(29980,954,'Proteus Defensive - Nanobot Injector','The advanced Sleeper-based technology in this subsystem is focused on increasing the effectiveness of a vessel\'s armor nanobots. When integrated into the hull of a Proteus, it offers a substantial increase in the armor output of any local repair modules fitted. Although the subsystem offers the same end result as other built-in armor repair augmentations, the technology driving it operates in a vastly different way, allowing for easy removal from its host vessel.  \n\nSubsystem Skill Bonus: \n10% bonus to armor repairer effectiveness per level',1400000,40,300,1,8,NULL,1,1129,3631,NULL,3657),(29981,954,'Proteus Defensive - Augmented Plating','Although this subsystem uses the same armor nano-assemblers as standard empire technology, various optimizations have been made. Taking full advantage of recently discovered Sleeper designs, the use of fullerene-based technology has allowed for the combination of far smaller and more resilient components.  \r\n\r\nSubsystem Skill Bonus: \r\n7.5% bonus to armor hitpoints per level.',1400000,40,280,1,8,NULL,1,1129,3631,NULL,3658),(29982,954,'Proteus Defensive - Warfare Processor','After countless failed projects over the years, the dream of linking fleets with sub-Battlecruiser hulls was eventually shelved and relegated to the realm of engineering theory. It remained this way for some time, tempting few starship manufacturers to revisit the challenge, even after the discovery of ancient Sleeper designs and the influx of fullerene-based technology. It was not until the first Strategic Cruiser hulls began appearing in small numbers across the empires that they began to truly appreciate the potential Tech III vessels had for modifications.  \r\n\r\nNot long after, the first warfare processor housing became a reality. Although what it delivered as a standalone unit was undoubtedly impressive, what would count more in time was the way it served as a catalyst. The unit demonstrated to the wider spacefaring industry that the possibilities for Tech III ships were broader than first imagined, and in doing so, it heralded the beginning of even more radical and innovative designs. \r\n\r\nSubsystem Skill Bonus:\r\n2% bonus to strength and duration of Armored Command, Skirmish Command, and Information Command Bursts per subsystem skill level\r\n\r\nRole Bonus:\r\nCan fit one Command Burst module\r\n+50% bonus to Command Burst Area of Effect Range',1400000,40,220,1,8,NULL,1,1129,3631,NULL,3659),(29984,963,'Tengu','<b>Important CONCORD announcement:</b> At 11:00 EveTime on July 11th all Strategic Cruisers will receive an automatic upgrade into the latest technology. This upgrade process may cause modules to go offline.\r\n<b>CONCORD encourages all Strategic Cruiser pilots to get themselves into a safe location (such as a friendly starbase or docked within a structure) on or before July 11th.</b>\r\n\r\nWhen we first saw the flock, we were surrounded, caught in a spectacle of stimuli. Brilliant colors, dancing lights, beautiful cacophonies, wafting ambrosia. Those birds surrounded us, each one a different shape, an altered species, a new wonder. I tried to follow a single bird, but my efforts were futile: Transformation is natural to their existence. Imagine it: an undulating mass, a changing mob, all those beasts partaking in wonderful transmogrification.  \r\n\r\nThese were our augurs, our deliverers, our saviors. Standing amidst the flock, we should have feared their glory; instead, we drew hope. This moment is the first time I understood what it meant to be Caldari: Divinity in the flock, delivery in flux, one being, many changes.\r\n\r\n   - Janto Sitarbe, <i>The Legendary Flock</i>\r\n',8201000,92000,0,1,1,NULL,1,1140,3762,20068,20215),(29985,996,'Tengu Blueprint','',0,0.01,0,1,NULL,45600000.0000,1,NULL,NULL,NULL,42),(29986,963,'Legion','<b>Important CONCORD announcement:</b> At 11:00 EveTime on July 11th all Strategic Cruisers will receive an automatic upgrade into the latest technology. This upgrade process may cause modules to go offline.\r\n<b>CONCORD encourages all Strategic Cruiser pilots to get themselves into a safe location (such as a friendly starbase or docked within a structure) on or before July 11th.</b>\r\n\r\nRevelation burrows through the material world, devours creation\'s soil, digests the thoughtless void, and produces significance with God\'s grace. From emptiness comes meaning, essence from existence, soul from matter.\r\n\r\nIs God through the wormhole? Did God grant us this boon, this new technology, a revelation from on high? These weapons are God\'s new prophecy, domain, and blessing. Let us use God\'s grace and prepare New Eden. We are God\'s soldiers, weapons, glory. Our people are God\'s army. Together, we are the legion.\r\n\r\n    -<i>The Heresies of Hinketsu</i>',6815000,118000,0,1,4,NULL,1,1139,3763,20061,20216),(29987,996,'Legion Blueprint','',0,0.01,0,1,NULL,45275000.0000,1,NULL,NULL,NULL,1065),(29988,963,'Proteus','<b>Important CONCORD announcement:</b> At 11:00 EveTime on July 11th all Strategic Cruisers will receive an automatic upgrade into the latest technology. This upgrade process may cause modules to go offline.\r\n<b>CONCORD encourages all Strategic Cruiser pilots to get themselves into a safe location (such as a friendly starbase or docked within a structure) on or before July 11th.</b>\r\n\r\nFreedom is liquid, supple, mellifluous. It surrounds us, engulfs our bodies, drowns our fear. We plumb freedom\'s depths and consume the nourishment within. From these waters, we are born; when we die, we shall return to those waters. \r\n\r\nOut there, among the stars, are the waters, freedom incarnate. That dark, endless void is our destiny, our path, our goal. We must not fear it, nor should we control it. Rather, we should embrace it, trust it, love it. Its ever-changing face, its protean existence, is our very essence. We are those stars, the void, the awesome waters of space: ancient, forever, free.\r\n\r\n    - Jinsente Parmen, <i>The Gallente in New Eden</i>\r\n\r\n',5341000,115000,0,1,8,NULL,1,1141,3765,20072,20217),(29989,996,'Proteus Blueprint','',0,0.01,0,1,NULL,43775000.0000,1,NULL,NULL,NULL,62),(29990,963,'Loki','<b>Important CONCORD announcement:</b> At 11:00 EveTime on July 11th all Strategic Cruisers will receive an automatic upgrade into the latest technology. This upgrade process may cause modules to go offline.\r\n<b>CONCORD encourages all Strategic Cruiser pilots to get themselves into a safe location (such as a friendly starbase or docked within a structure) on or before July 11th.</b>\r\n\r\nFor many Minmatar, the high mountains of Matar hold wonders unknown to the rest of New Eden: hidden glens, beautiful creatures, buried customs. Not surprisingly, the Krusual tribe lay claim to these mountains, their home for generations and base to their machinations.\r\n\r\nKrusual elders whisper ancient tales among their huddled tribes, describing the glory of heroes past and enigmatic prophecies of old. On the darkest day, at the most hopeless moments, an elder may speak of <i>Loki</i>, in reverent tones and excited hushes. In the ancient tongue, the <i>Loki</i> are the crux of Krusual thought. There is no direct translation for this word; in fact, <i>Loki</i> translates differently among the elders. It can mean hidden wonder or secret passage, changing mask or unseen dagger. Regardless of its context, <i>Loki</i> has one meaning common to all its tales across all the elders: hope.\r\n',6540000,80000,0,1,2,NULL,1,1142,3764,20076,20218),(29991,996,'Loki Blueprint','',0,0.01,0,1,NULL,44500000.0000,1,NULL,NULL,NULL,47),(29992,964,'Optimized Nano-Engines','Forming the beating heart of the Sleeper\'s automated drones, these tiny engines count in the billions. When fully intact, they deliver levels of power efficiency unrivalled by current technology. Unfortunately, whenever a Sleeper drone is destroyed, these engines are the first to go with them, making it difficult to emulate their functionality without the addition of other materials. \r\n\r\nTo recreate a functional nanoengine housing, PPD fullerene fibers are combined with metallofullerenes and fullerene fiber conduits to rebuild the basic structures that once housed them. After that, the fused nanomechanical engines are connected to one another, forming a composite whole. \r\n\r\nAlthough mechanical engineers have theorized about this construction method for many decades, the process was always held back by a lack of fullerene material. It is said that only hours after the discovery of fullerite clouds in wormhole space, the empires used significant amounts of their fullerene stockpiles to produce these engines. The reasoning behind this is simply the staggering breadth of potential applications these engines have. When it comes to engineering, there isn\'t much they can\'t do.',1,10,0,1,NULL,400000.0000,1,1147,3720,NULL,0),(29993,965,'Optimized Nano-Engines Blueprint','',0,0.01,0,1,NULL,10000000.0000,1,1191,96,NULL,0),(29994,964,'Warfare Computation Core','Warfare computation cores begin as basic microprocessors that handle the flow of data between various combat analyzers, prioritizing vital information and calculations. The cores are first built around salvaged Sleeper warfare processors which are then further enhanced by the integration of fullerene polymers and other Sleeper technology. The addition of emergent combat analyzers expands the functionality to include more abstract combat calculations, such as comparative analyses of fleets and predictive IFF identifications. \r\n\r\nWhen encased in thermophased metallofullerene plating, the cores can be embedded directly into the ship\'s hull. This allows for a far more efficient production method of Tech III vessels, enabling any subsystem variation to integrate into a hull without the need for further redesign in the combat electronics systems. ',1,10,0,1,NULL,400000.0000,1,1147,3719,NULL,0),(29995,965,'Warfare Computation Core Blueprint','',0,0.01,0,1,NULL,10000000.0000,1,1191,96,NULL,0),(29996,964,'Emergent Neurovisual Interface','As a capsuleer, few things are more important in space flight than the ability to instantly gauge one\'s surroundings and make decisions accordingly. For this reason, capsules inside starships make frequent use of neurovisual reproductions; emulations that recreate external stimuli using the most low-latency processor available  the human brain. This process relies on digital relays from camera drones and monitoring systems embedded into the hull. After capturing the data, they then feed it directly into the brain, at which point the external surrounds are recreated almost instantaneously. Functions familiar to any capsuleer such as the overview, tactical overlay and hostile threat indicators are just a few examples of the device\'s capabilities. \r\n\r\nAlthough NVI technology has been around since the inception of the capsule, the addition of salvaged Sleeper drone components and the now widely available fullerene polymers has carried the functionality forward into the new Tech III paradigm. Even before the first Strategic Cruiser was built, engineers hypothesized about potential issues with an NVI trying to communicate with an almost limitless combination of subsystems. Fortunately, the solution to the problem came wrapped up in the same technology that moved Tech III vessels from the world of scientific theory into reality.',1,20,0,1,NULL,400000.0000,1,1147,3716,NULL,0),(29997,965,'Emergent Neurovisual Interface Blueprint','',0,0.01,0,1,NULL,10000000.0000,1,1191,96,NULL,0),(29998,967,'Neuroprotectant Injector Array','Tech III Component used in the manufacture of advanced hulls and subsystems. ',1,5,0,1,NULL,100000.0000,0,NULL,1186,NULL,0),(30000,967,'defunct item 8','Tech III Component used in the manufacture of advanced hulls and subsystems. ',1,5,0,1,NULL,100000.0000,0,NULL,1186,NULL,0),(30002,964,'Fullerene Intercalated Sheets','The manufacture of this component requires the rarest and most valuable technology salvageable from Sleeper drones. These sheets represent some of the most advanced composite materials known to New Eden. When other, more valuable devices are embedded into the structure at the molecular level, the sheets\' performance enhances tremendously. The end result is a component with an almost endless number of applications in starship design. \r\n\r\nUltra-resilient armor plating, defensive nanoassemblers, electronics housing, and even the molecular-level circuitry itself are only a few of the near-countless roles that fullerene intercalated sheets can perform. Although unrivalled in their modularity, the cost of construction remains a barrier on supply; consequently, they remain a component to be used only when absolutely necessary. \r\n\r\nScientists and engineers alike claim that a steadier supply of these rare Sleeper pieces would instantly advance starship design ten years. Other experts have made even more interesting claims, stating that the staggering utility of the components suggests a level of technological advancement sufficient for capsule production.',1,5,0,1,NULL,400000.0000,1,1147,3718,NULL,0),(30003,965,'Fullerene Intercalated Sheets Blueprint','',0,0.01,0,1,NULL,10000000.0000,1,1191,96,NULL,0),(30008,964,'Reinforced Metallofullerene Alloys','These ultra-hard alloys are initially created from lanthanum metallofullerenes and heuristic selfassemblers; a combination that makes for an incredibly resilient base material. From there, fulleroferrocene and graphene nanoribbons are integrated into the metals, forming alloys that have unprecedented levels of structural strength. Although they have many uses in the manufacture of armor plating, the distinguishing feature of the alloys is the level of modularity they allow in starship design. A hull section comprised of metallofullerene alloys is able to accommodate a virtually endless array of subsystems around it, no matter how different their shape is.',1,10,0,1,NULL,400000.0000,1,1147,3721,NULL,0),(30009,965,'Reinforced Metallofullerene Alloys Blueprint','',0,0.01,0,1,NULL,10000000.0000,1,1191,96,NULL,0),(30013,479,'Core Scanner Probe I','A scanner probe used for scanning down Cosmic Signatures in space.\r\n\r\nCan be launched from <a href=showinfo:17938>Core Probe Launchers</a> and <a href=showinfo:18639>Expanded Probe Launchers</a>.',1,0.1,0,1,NULL,23442.0000,1,1199,1723,NULL,3767),(30014,486,'Core Scanner Probe I Blueprint','',0,0.01,0,1,NULL,5000000.0000,1,320,1007,NULL,0),(30016,967,'Nozzle Reinforcements','A strange piece of equipment recovered from a Sleeper drone. ',0,0.01,0,1,NULL,NULL,0,NULL,3732,NULL,0),(30017,967,'Thruster Mounts','A strange piece of equipment recovered from a Sleeper drone. ',0,0.01,0,1,NULL,NULL,0,NULL,3732,NULL,0),(30018,966,'Fused Nanomechanical Engines','The beating heart of the Sleeper\'s automated drones, these tiny engines count in the billions. When fully intact, they deliver levels of power efficiency unrivaled by current technology. Unfortunately, whenever a Sleeper drone goes down, these engines are the first to go with them, making it difficult to emulate their functionality without the addition of other components.',0,0.01,0,1,NULL,NULL,1,1862,3726,NULL,0),(30019,966,'Powdered C-540 Graphite','This white, dusty substance was extracted from the center of high impact craters in the Sleeper drone\'s armor. When mixed with other materials it forms a stiff resin that can either be used to hold various pieces of hull sheets together or to coat them for additional protection against radiation and heat.',0,0.01,0,1,NULL,NULL,1,1862,3727,NULL,0),(30020,967,'Thermoelectric Power Core','Since it has no moving parts, this solid-state power core can operate for extremely long amounts of time without the need for maintenance, offering an unlimited amount of energy regeneration in the process. Although the resilience of the Sleeper design is drastically different from other technology, the same fundamental principles have been used in capacitor production for centuries.  ',0,0.01,0,1,NULL,NULL,0,NULL,3727,NULL,0),(30021,966,'Modified Fluid Router','The backbones of communication across New Eden, fluid routers play a crucial role in all faster-than-light (FTL) transmissions. The Sleeper drones have been equipped with much the same communications equipment as contemporary starships. The only major difference observable with the Sleeper Fluid Routers is in the way transmissions are translated. The drones must be talking in their own proprietary language.',0,0.01,0,1,NULL,NULL,1,1862,3723,NULL,0),(30022,966,'Heuristic Selfassemblers','These advanced nanoassemblers appear to be able to change their molecular structure on the fly, adapting to incoming damage. Without any understanding of how to properly operate them however, they only offer their default formations. Even in such a state, they add a significant amount of resilience to armor plating.',0,0.01,0,1,NULL,NULL,1,1862,3725,NULL,0),(30023,967,'generic item 40','Most of these tiny circuits have fused together from the heat and force of the Sleeper drone\'s explosion. The detonation of the drone\'s power core must have been immense to have had such an effect on these resilient nanostructures. ',0,0.01,0,1,NULL,NULL,0,NULL,3723,NULL,0),(30024,966,'Cartesian Temporal Coordinator','At first glance this coordinator appears to be a common enough piece of equipment, albeit an odd one to be found inside a drone. Designed to plot various points in time across a potentially infinite period, these devices are often used for scientific calculations. \r\n\r\nFor some unknown reason, this particular coordinator is configured to synchronize its processing speed in time with the distance travelled between two points. What purpose this serves remains a mystery, but the object\'s basic functionality can be reconfigured. With the addition of a few other components, it would allow electronics systems to more easily withstand the interference from subspace distortion. ',0,0.01,0,1,NULL,NULL,1,1862,3722,NULL,0),(30025,967,'Thermophased Metallofullerenes','A strange piece of equipment recovered from a Sleeper drone. ',0,0.01,0,1,NULL,NULL,0,NULL,3728,NULL,0),(30027,967,'Isogen V','Morphite is a highly unorthodox mineral that can only be found in the hard-to-get Mercoxit ore. It is hard to use Morphite as a basic building material, but when it is joined with existing structures it can enhance the performance and durability manifold. This astounding quality makes this the material responsible for ushering in a new age in technology breakthroughs. ',0,0.01,0,1,NULL,32768.0000,0,NULL,2103,NULL,0),(30028,479,'Combat Scanner Probe I','A scanner probe used for scanning down Cosmic Signatures, starships, structures and drones.\r\n\r\nCan be launched from <a href=showinfo:18639>Expanded Probe Launchers</a>.',1,1,0,1,NULL,23442.0000,1,1199,1722,NULL,3767),(30029,486,'Combat Scanner Probe I Blueprint','',0,0.01,0,1,NULL,5000000.0000,1,320,1007,NULL,0),(30036,955,'Legion Electronics - Energy Parasitic Complex','During some of the first conflicts with them, Amarr engineers noticed a remarkable feature in Sleeper drone technology: the ability of drones to transfer power between one another without the need for specialized equipment. This technology seemed to be innate to every drone in some capacity, and while the engineers could not reproduce this system in modern space vessels, they were able to adapt the technology into modular Tech III designs. The energy parasitic complex turns the Sleeper tech on its head, changing the energy transfer from a symbiotic function to a vampiric one by providing a boost to energy neutralizer and energy nosferatu equipment.\n\nSubsystem Skill Bonus: \n10% bonus to energy nosferatu and energy neutralizer drain amount per level\n',1200000,40,0,1,4,NULL,1,1611,3626,NULL,3626),(30037,973,'Legion Electronics - Energy Parasitic Complex Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,21,NULL,0),(30038,955,'Legion Electronics - Tactical Targeting Network','Many engineers have attempted to reproduce the precision of the Sleeper drones\' weapon systems, but with very few results. The closest reproduction achieved thus far is this targeting network, a complex system of neurovisual interlays, automated trigger response units, and microscanning resolution ordinances. The combination of these processes produces a bonus to scan resolution, easing the targeting of enemies in space.\r\n\r\nSubsystem Skill Bonus:\r\n15% bonus to scan resolution per level\r\n',1200000,40,0,1,4,NULL,1,1611,3626,NULL,3627),(30039,973,'Legion Electronics - Tactical Targeting Network Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,21,NULL,0),(30040,955,'Legion Electronics - Dissolution Sequencer','This subsystems employs a nano-electromechanical dispersion field to strengthen a vessel\'s sensor systems. Made from billions of advanced molecular-level circuits, the subsystem offers improved protection against hostile ECM. \r\n\r\nSubsystem Skill Bonus:\r\n15% bonus to ship sensor strength, 5% bonus to max targeting range per level.\r\n',1200000,40,0,1,4,NULL,1,1611,3626,NULL,3628),(30041,973,'Legion Electronics - Dissolution Sequencer Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,21,NULL,0),(30042,955,'Legion Electronics - Emergent Locus Analyzer','Emboldened by the development of other, more specialized subsystems, engineers and astrophysicists alike began to investigate modifications to a Strategic Cruiser that could aid their fellow scientists and explorers. The first reverse-engineering projects were predominantly focused on ways to improve a vessel\'s astrometrics capabilities. The two-pronged solution of boosting both the strength of the launchers and the probes they deployed proved to be the most popular design in the end. It was not long after the first designs were sold that others took notice and began to reverse-engineer their own. Soon enough, the subsystem was catapulted into mainstream Tech III subsystem manufacture, although perhaps for more than just that one reason.  \r\n\r\nThe first designers of the emergent locus analyzer noted an additional  and entirely unintended  effect in tractor beams. Not only did they reach further, but they would also pull in their cargo more quickly than normal tractor beams. It was an unexpected by-product of the processes that increased scan probe strength, but far from an undesirable one. Although it is not fully clear what part of the construction process enables this additional benefit, so long as the subsystem is built in that exact fashion, it will continue to provide it.  \r\n\r\nSubsystem Skill Bonus:\r\n10% increase to scan strength of probes per level.\r\n20% bonus to range and velocity of tractor beams per level.\r\n\r\nRole Bonus:\r\n-99% reduced CPU need for Scan Probe Launchers.\r\n+10 Virus Strength to Relic and Data Analyzers.',1200000,40,0,1,4,NULL,1,1611,3626,NULL,3629),(30043,973,'Legion Electronics - Emergent Locus Analyzer Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,21,NULL,0),(30046,955,'Tengu Electronics - Obfuscation Manifold','This subsystem operates using the same fundamental mechanics as the signal distortion amplifier. When installed into a Tech III vessel, the fullerene-based components resonate with any ECM modules fitted, bolstering their disruptive strength.\r\n\r\nSubsystem Skill Bonus: \r\n12.5% bonus to ECM target jammer optimal range per level.\r\n',1200000,40,0,1,1,NULL,1,1630,3626,NULL,3601),(30047,973,'Tengu Electronics - Obfuscation Manifold Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,21,NULL,0),(30048,955,'Tengu Electronics - CPU Efficiency Gate','New technologies have resulted in a noticeable increase in CPU efficiency, as better nanotech enables further miniaturization of circuits, the result of which is a marked decrease in system bottlenecking. This CPU efficiency gate capitalizes on that technology, offering a pilot greater CPU output.\n\nSubsystem Skill Bonus: \n5% bonus to CPU per level.\n',1200000,40,0,1,1,NULL,1,1630,3626,NULL,3603),(30049,973,'Tengu Electronics - CPU Efficiency Gate Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,21,NULL,0),(30050,955,'Tengu Electronics - Dissolution Sequencer','This subsystems employs a nano-electromechanical dispersion field to strengthen a vessel\'s sensor systems. Made from billions of advanced molecular-level circuits, the subsystem offers improved protection against hostile ECM. \r\n\r\nSubsystem Skill Bonus:\r\n15% bonus to ship sensor strength, 5% bonus to targeting range per level.\r\n',1200000,40,0,1,1,NULL,1,1630,3626,NULL,3602),(30051,973,'Tengu Electronics - Dissolution Sequencer Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,21,NULL,0),(30052,955,'Tengu Electronics - Emergent Locus Analyzer','Emboldened by the development of other, more specialized subsystems, engineers and astrophysicists alike began to investigate modifications to a Strategic Cruiser that could aid their fellow scientists and explorers. The first reverse-engineering projects were predominantly focused on ways to improve a vessel\'s astrometrics capabilities. The two-pronged solution of boosting both the strength of the launchers and the probes they deployed proved to be the most popular design in the end. It was not long after the first designs were sold that others took notice and began to reverse-engineer their own. Soon enough, the 