 Friction Extension Processor Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,21,NULL,0),(30058,955,'Proteus Electronics - CPU Efficiency Gate','New technologies have resulted in a noticeable increase in CPU efficiency, as better nanotech enables further miniaturization of circuits, the result of which is a marked decrease in system bottlenecking. This CPU efficiency gate capitalizes on that technology, offering a pilot greater CPU output.\n\nSubsystem Skill Bonus: \n5% bonus to CPU per level',1200000,40,0,1,8,NULL,1,1628,3626,NULL,3653),(30059,973,'Proteus Electronics - CPU Efficiency Gate Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,21,NULL,0),(30060,955,'Proteus Electronics - Dissolution Sequencer','This subsystems employs a nano-electromechanical dispersion field to strengthen a vessel\'s sensor systems. Made from billions of advanced molecular-level circuits, the subsystem offers improved protection against hostile ECM. \r\n\r\nSubsystem Skill Bonus:\r\n15% bonus to ship sensor strength, 5% bonus to max targeting range per level.\r\n',1200000,40,0,1,8,NULL,1,1628,3626,NULL,3652),(30061,973,'Proteus Electronics - Dissolution Sequencer Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,21,NULL,0),(30062,955,'Proteus Electronics - Emergent Locus Analyzer','Emboldened by the development of other, more specialized subsystems, engineers and astrophysicists alike began to investigate modifications to a Strategic Cruiser that could aid their fellow scientists and explorers. The first reverse-engineering projects were predominantly focused on ways to improve a vessel\'s astrometrics capabilities. The two-pronged solution of boosting both the strength of the launchers and the probes they deployed proved to be the most popular design in the end. It was not long after the first designs were sold that others took notice and began to reverse-engineer their own. Soon enough, the subsystem was catapulted into mainstream Tech III subsystem manufacture, although perhaps for more than just that on