argeting Network','Many engineers have attempted to reproduce the precision of the Sleeper drones\' weapon systems, but with very few results. The closest reproduction achieved thus far is this targeting network, a complex system of neurovisual interlays, automated trigger response units, and microscanning resolution ordinances. The combination of these processes produces a bonus to scan resolution, easing the targeting of enemies in space.\r\n\r\nSubsystem Skill Bonus:\r\n15% bonus to scan resolution per level\r\n',1200000,40,0,1,2,NULL,1,1629,3626,NULL,3677),(30069,973,'Loki Electronics - Tactical Targeting Network Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,21,NULL,0),(30070,955,'Loki Electronics - Dissolution Sequencer','This subsystems employs a nano-electromechanical dispersion field to strengthen a vessel\'s sensor systems. Made from billions of advanced molecular-level circuits, the subsystem offers improved protection against hostile ECM. \r\n\r\nSubsystem Skill Bonus:\r\n15% bonus to ship sensor strength, 5% bonus to max targeting range per level.\r\n',1200000,40,0,1,2,NULL,1,1629,3626,NULL,3678),(30071,973,'Loki Electronics - Dissolution Sequencer Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,21,NULL,0),(30072,955,'Loki Electronics - Emergent Locus Analyzer','Emboldened by the development of other, more specialized subsystems, engineers and astrophysicists alike began to investigate modifications to a Strategic Cruiser that could aid their fellow scientists and explorers. The first reverse-engineering projects were predominantly focused on ways to improve a vessel\'s astrometrics capabilities. The two-pronged solution of boosting both the strength of the launchers and the probes they deployed proved to be the most popular design in the end. It was not long after the first designs were sold that others took notice and began to reverse-engineer their own. Soon enough, the subsystem was catapulted into mainstream Tech III subsystem manufacture, although perhaps for more than just that one reason.  \r\n\r\nThe first designers of the emergent locus analyzer noted an additional  and entirely unintended  effect in tractor beams. Not only did they reach further, but they would also pull in their cargo more quickly than normal tractor beams. It was an unexpected by-product of the processes that increased scan probe strength, but far from an undesirable one. Although it is not fully clear what part of the construction process enables this additional benefit, so long as the subsystem is built in that exact fashion, it will continue to provide it.  \r\n\r\nSubsystem Skill Bonus:\r\n10% increase to scan strength of probes per level.\r\n20% bonus to range and velocity of tractor beams per level.\r\n\r\nRole Bonus:\r\n-99% reduced CPU need for Scan Probe Launchers.\r\n+10 Virus Strength to Relic and Data Analyzers.',1200000,40,0,1,2,NULL,1,1629,3626,NULL,3679),(30073,973,'Loki Electronics - Emergent Locus Analyzer Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,21,NULL,0),(30076,957,'Legion Propulsion - Chassis Optimization','This subsystem exploits the latest technological advances afforded by discovery of the ancient Sleeper race\'s own designs. Optimizations made to the chassis allow for vast improvements to be made to a Legion\'s base velocity. Although the various layout optimizations sacrifice other options for propulsion customization, the flow-on effects from an increase in base velocity make it an attractive upgrade for those whose Tech III vessels are in need of an overall speed increase.\n\nSubsystem Skill Bonus: \n5% bonus to max velocity per level.',1400000,40,0,1,4,6450.0000,1,1134,3646,NULL,3646),(30077,973,'Legion Propulsion - Chassis Optimization Blueprint','',0,0.01,0,1,NULL,64500.0000,1,NULL,96,NULL,0),(30078,957,'Legion Propulsion - Fuel Catalyst','The ancient Sleeper race was known to have mastered various sustainable energy technologies including thermoelectric systems, which they usually built directly into a vessel\'s hull. Capsuleer reverse-engineers took little time to adapt salvaged versions of these Sleeper energy systems into their own modular Tech III vessel pieces. \n\nThanks to widespread demand in the Amarrian transport industry, fuel catalyst systems were one of the first to be developed for the Empire. Making full use of locally generated thermoelectric power, they are able to supplement the fuel needs of an afterburner. This process makes it possible to inject fuel in larger amounts for the same capacitor cost, offering pilots a significant boost to the velocity increase from afterburners. \n\nSubsystem Skill Bonus: \n10% bonus to afterburner speed per level.',1400000,40,0,1,4,6450.0000,1,1134,3646,NULL,3647),(30079,973,'Legion Propulsion - Fuel Catalyst Blueprint','',0,0.01,0,1,NULL,64500.0000,1,NULL,96,NULL,0),(30080,957,'Legion Propulsion - Wake Limiter','This subsystem limits the wake left behind by a starship\'s microwarpdrive, allowing a pilot to maintain a lowered signature radius while still moving at high speed. The underlying design is based on the same technology used by smaller Sleeper drones and empire-produced Interceptors. Although the engineering processes behind wake limiters have existed for quite some time in the empires, their application in modular subsystems has only become a possibility after fullerene polymers became more widely available. \r\n\r\nSubsystem Skill Bonus:\r\n5% reduction in microwarpdrive signature radius penalty per level.\r\n',1400000,40,0,1,4,6450.0000,1,1134,3646,NULL,3648),(30081,973,'Legion Propulsion - Wake Limiter Blueprint','',0,0.01,0,1,NULL,64500.0000,1,NULL,96,NULL,0),(30082,957,'Legion Propulsion - Interdiction Nullifier','Dubbed the interdiction nullifier by the Guristas, who suffered its first introduction on the battlefield, this subsystem grants a startling and unprecedented capability; an immunity to non-targeted interdiction such as mobile warp disruptors and interdiction spheres. \n\nThe origins of the first nullifier designs are shrouded in mystery, but the subsystem\'s initial production of is thought to have taken place soon after the wormhole openings, and well before the technology became widespread knowledge. Not long after the first Tengu were designed, the Caldari Navy intercepted emergency transmissions from Guristas fleets across Venal, Tenal and Vale of the Silent. All of the reports made mention of Loki-class vessels slipping past defensive deployments and into core Guristas territory despite all efforts to stop the ships or slow them down.  \n\nFollowing these reports, rumors spread that other groups began to discover and implement this extraordinary new technology, and yet of all the factions that leapt upon the opportunity, none were so eager or ruthless in their own race to capitalize as the independent capsuleer and pirate organizations that make the nullsec frontiers their home.  \n\nSubsystem Skill Bonus:\n5% increased agility per level\n\nRole Bonus:\nImmunity to non-targeted interdiction',1400000,40,0,1,4,6450.0000,1,1134,3646,NULL,3649),(30083,973,'Legion Propulsion - Interdiction Nullifier Blueprint','',0,0.01,0,1,NULL,64500.0000,1,NULL,96,NULL,0),(30086,957,'Tengu Propulsion - Intercalated Nanofibers','Constructed from hard yet lightweight fullerene polymers, these intercalated fibers boost the agility of a starship without compromising its structural resilience. Even though basic nanofibers have existed for hundreds of years, the integration of various Sleeper-based salvage and other polymers takes the technology to a completely new level of modularity. This has allowed the same centuries-old technology to be ported over to the new Tech III paradigm. \n\nSubsystem Skill Bonus: \n5% increased agility per level.\n',1400000,40,0,1,1,6450.0000,1,1135,3646,NULL,3621),(30087,973,'Tengu Propulsion - Intercalated Nanofibers Blueprint','',0,0.01,0,1,NULL,64500.0000,1,NULL,96,NULL,0),(30088,957,'Tengu Propulsion - Gravitational Capacitor','This subsystem lowers the capacitor cost of warping and increases actual warp speed. With the influx of fullerene-based polymers and the discovery of Sleeper drone technology, the same fundamental principles once only sparingly employed in advance scout vessels such as Covert Ops and Interceptors could be re-applied to modular Tech III vessels. The Caldari are said to have been the first empire to benefit from reverse-engineering attempts aimed at producing these subsystems, something which the Gallente Federation\'s own scientists flatly deny.\r\n\r\nSubsystem Skill Bonus: \r\n12.5% bonus to warp speed per level\r\n15% reduction in capacitor need when initiating warp per level\r\n',1400000,40,0,1,1,6450.0000,1,1135,3646,NULL,3622),(30089,973,'Tengu Propulsion - Gravitational Capacitor Blueprint','',0,0.01,0,1,NULL,64500.0000,1,NULL,96,NULL,0),(30090,957,'Tengu Propulsion - Fuel Catalyst','The ancient Sleeper race was known to have mastered various sustainable energy technologies including thermoelectric systems, which they usually built directly into a vessel\'s hull. Capsuleer reverse-engineers took little time to adapt salvaged versions of these Sleeper energy systems into their own modular Tech III vessel pieces. \n\nThanks to widespread demand in the Caldari transport industry, fuel catalyst systems were one of the first to be developed. Making full use of locally generated thermoelectric power, they are able to supplement the fuel needs of an afterburner. This process makes it possible to inject fuel in larger amounts for the same capacitor cost, offering pilots a significant boost to the velocity increase from afterburners.\n\nSubsystem Skill Bonus: \n10% bonus to afterburner speed per level.\n',1400000,40,0,1,1,6450.0000,1,1135,3646,NULL,3623),(30091,973,'Tengu Propulsion - Fuel Catalyst Blueprint','',0,0.01,0,1,NULL,64500.0000,1,NULL,96,NULL,0),(30092,957,'Tengu Propulsion - Interdiction Nullifier','Dubbed the interdiction nullifier by the Guristas, who suffered its first 