3696),(30107,973,'Loki Propulsion - Chassis Optimization Blueprint','',0,0.01,0,1,NULL,64500.0000,1,NULL,96,NULL,0),(30108,957,'Loki Propulsion - Intercalated Nanofibers','Constructed from hard yet lightweight fullerene polymers, these intercalated fibers boost the agility of a starship without compromising its structural resilience. Even though basic nanofibers have existed for hundreds of years, the integration of various Sleeper-based salvage and other polymers takes the technology to a completely new level of modularity. This has allowed the same centuries-old technology to be ported over to the new Tech III paradigm. \n\nSubsystem Skill Bonus: \n5% increased agility per level.\n',1400000,40,0,1,2,6450.0000,1,1137,3646,NULL,3697),(30109,973,'Loki Propulsion - Intercalated Nanofibers Blueprint','',0,0.01,0,1,NULL,64500.0000,1,NULL,96,NULL,0),(30110,957,'Loki Propulsion - Fuel Catalyst','The ancient Sleeper race was known to have mastered various sustainable energy technologies including thermoelectric systems, which they usually built directly into a vessel\'s hull. Capsuleer reverse-engineers took little time to adapt salvaged versions of these Sleeper energy systems into their own modular Tech III vessel pieces. \n\nThanks to widespread demand in many Minmatar industries, fuel catalyst systems were one of the first to be developed. Making full use of locally generated thermoelectric power, they are able to partially meet the fuel needs of an afterburner. This process makes it possible to inject fuel in larger amounts for the same capacitor cost, offering pilots a significant boost to the velocity increase from afterburners. \n\nSubsystem Skill Bonus: \n10% bonus to afterburner speed per level.\n',1400000,40,0,1,2,6450.0000,1,1137,3646,NULL,3698),(30111,973,'Loki Propulsion - Fuel Catalyst Blueprint','',0,0.01,0,1,NULL,64500.0000,1,NULL,96,NULL,0),(30112,957,'Loki Propulsion - Interdiction Nullifier','Dubbed the interdiction nullifier by the Guristas, who suffered its first introduction on the battlefield, this subsystem grants a startling and unprecedented capability; an immunity to non-targeted interdiction such as mobile warp disruptors and interdiction spheres. \n\nThe origins of the first nullifier designs are shrouded in mystery, but the subsystem\'s initial production of is thought to have taken place soon after the wormhole openings, and well before the technology became widespread knowledge. Not long after the first Tengu were designed, the Caldari Navy intercepted emergency transmissions from Guristas fleets across Venal, Tenal and Vale of the Silent. All of the reports made mention of Loki-class vessels slipping past defensive deployments and into core Guristas territory despite all efforts to stop the ships or slow them down.  \n\nFollowing these reports, rumors spread that other groups began to discover and implement this extraordinary new technology, and yet of all the factions that leapt upon the opportunity, none were so eager or ruthless in their own race to capitalize as the independent capsuleer and pirate organizations that make the nullsec frontiers their home.  \n\nSubsystem Skill Bonus:\n5% increased agility per level\n\nRole Bonus:\nImmunity to non-targeted interdiction',1400000,40,0,1,2,6450.0000,1,1137,3646,NULL,3699),(30113,973,'Loki Propulsion - Interdiction Nullifier Blueprint','',0,0.01,0,1,NULL,64500.0000,1,NULL,96,NULL,0),(30117,956,'Legion Offensive - Drone Synthesis Projector','Sleeper drones, while completely devoid of modern shielding technology, are nonetheless sturdy, mainly due to their metallofullerene armor plating and hull composition. When drones are docked into this system, the projection system enhances their damage capabilities, both in absorbing and delivering damage, through the creation of a fullerene-based field around the drones.  \n\nSubsystem Skill Bonus: \n10% bonus to medium energy turret capacitor use per level\n10% bonus to drone damage per level\n7.5% bonus to drone hitpoints per level',800000,40,0,1,4,NULL,1,1130,3641,NULL,3641),(30118,956,'Legion Offensive - Assault Optimization','Originally a laser-based weapons system, Amarrian starship engineers were forced to seek alternative construction methods when several fatal flaws were discovered in their design. Khanid Innovations was quick to offer a missile-based solution that benefitted greatly from their years of experience working on Sacrilege cruisers. The reapplication of their previously successful technology was so fast and effective that the more traditional Amarrian engineers could do little but watch as the knowledge and consequent implementation of these new engineering methodologies proliferated across the cluster. \r\n\r\nSubsystem Skill Bonus:\r\n5% bonus to Heavy Assault missile damage per level\r\n5% bonus to Heavy, Heavy Assault and Rapid Light Missile Launcher rate of fire per level',800000,40,0,1,4,NULL,1,1130,3641,NULL,3642),(30119,956,'Legion Offensive - Liquid Crystal Magnifiers','One of the many gems discovered amidst Sleeper technology was the creation of more efficient liquid crystal lenses. Amarr researchers have engineered these lenses to increase a laser\'s focus for longer stretches, both in distance and in timing, allowing a laser to reach farther targets with more efficiency of energy output. Additionally, the fullerene-infused lenses can generate higher temperatures and stronger, more damaging beams and pulses. \n\nSubsystem Skill Bonus: \n10% bonus to medium energy turret capacitor use per level \n10% bonus to medium energy turret damage per level\n10% bonus to medium energy turret optimal range per level\n',800000,40,0,1,4,NULL,1,1130,3641,NULL,3643),(30120,956,'Legion Offensive - Covert Reconfiguration','From the moment Strategic Cruisers became a reality, there were whispers amongst the scientific community about the potential for advances in cloaking technology. They remained that alone for the longest time, with few involved in the reverse-engineering process willing to share any news of their discoveries. Everyone knew that, should the technology ever become a reality, the capabilities of the new Strategic Cruisers would change overnight.\n\nThe Amarrians are suspected to have developed cloaking technology for the Legion around the same time as the first capsuleer designs began to surface. For almost a full week, Minmatar rebel camps deep inside Heimatar and Metropolis were subjected to ruthless guerilla attacks, almost unprecedented in their ferocity and viciousness.  Although initially confused by such a marked changed in their opponent\'s warfare philosophy, the Matari knew that each target had been a high profile objective for the Imperial Navy, and noted with deep suspicion how all of the squads had been spearheaded by Legions that could hit and fade with alarming ease. Few doubted who was behind the bloodshed. The Amarrians remained silent for the most part, the only official statement; that God\'s will had manifested itself in the heart of evil. \n\nSubsystem Skill Bonus:\n10% bonus to medium energy turret capacitor use per level\n\nRole Bonus:\n100% reduction in Cloaking Device CPU use\n\nNotes: Can fit covert ops cloaks and covert cynosural field generators. Cloak reactivation delay reduced to 5 seconds.',800000,40,0,1,4,NULL,1,1130,3641,NULL,3644),(30122,956,'Tengu Offensive - Accelerated Ejection Bay','This missile launcher system was formed not from the missile bays of Sleeper drones, but from the direct-fire turrets and hardpoints salvaged from them instead. Adapting the underlying technology behind the drones\' rapid-firing turrets for their own missile systems, Caldari engineers have managed to revolutionize modular launching mechanisms, improving launch speed and kinetic warhead payloads. \r\n\r\nSubsystem Skill Bonus: \r\n5% bonus to Kinetic Missile Damage per level\r\n7.5% bonus to Heavy, Heavy Assault and Rapid Light missile launcher rate of fire per level\r\n10% bonus to Heavy Missile and Heavy Assault missile velocity per level\r\n\r\n',800000,40,0,1,1,NULL,1,1131,3641,NULL,3616),(30123,956,'Tengu Offensive - Rifling Launcher Pattern','An odd bit of technology garnered from the Sleepers is missile rifling, a method adapted from more primitive projectile technology. The launcher bays in this missile pattern contain long, microscopic grooves that spiral through the launcher and can fit any known missile shape. Once the missile is launched, these grooves give additional velocity and accuracy to the missile. Additionally, the shallow cuts contain wiring that enhances the missile\'s guidance system, creating another conduit for communication between ship, missile, and target.\r\n\r\nSubsystem Skill Bonus: \r\n10% bonus to ECM target jammer strength per level\r\n5% bonus to Heavy Assault Launcher, Heavy Missile Launcher and Rapid Light Missile Launcher Rate of Fire per level\r\n',800000,40,0,1,1,NULL,1,1131,3641,NULL,3617),(30124,956,'Tengu Offensive - Magnetic Infusion Basin','This subsystem serves as a specialized storage bin for a ship\'s hybrid ammo. The basin, however, also serves as a cyclotron, infusing the ammo with magnetic energy immediately before it is injected into the turret. The amplified ammo has an increased range and damage potential. \n\nSubsystem Skill Bonus: \n5% bonus to medium hybrid turret damage per level\n20% bonus to medium hybrid turret optimal range per level',800000,40,0,1,1,NULL,1,1131,3641,NULL,3618),(30125,956,'Tengu Offensive - Covert Reconfiguration','From the moment Strategic Cruisers became a reality, there were whispers amongst the scientific community about the potential for advances in cloaking technology. They remained that alone for the longest time, with few involved in the reverse engineering process willing to share any news of their discoveries. Everyone knew that, should the technology ever become a reality, the capabilities of the new Strategic Cruisers would change overnight.\r\n\r\nWhen some of the State\'s first cloaking subsystems were unveiled at a secure Caldari military complex, those select few spectators did not understand for a moment, the reason behind the comparatively underwhelming offense. When the first Tengu broke from its attack and vanished in front of hundreds of onlookers  not only from the field of battle, but from the system itself  the reasons behind a conservative weapons design suddenly became clear. \r\n\r\nSubsystem Skill Bonus:\r\n5% bonus to missile launcher rate of fire per level\r\n\r\nRole Bonus:\r\n100% reduction in Cloaking Device CPU use\r\n\r\nNotes: Can fit covert ops cloaks and covert cynosural field generators. Cloak reactivation delay reduced to 5 seconds.',800000,40,0,1,1,NULL,1,1131,3641,NULL,3619),(30127,956,'Proteus Offensive - Dissonic Encoding Platform','A unique application of fullerene material can be found in this platform, where vibrations from the metallic plating  transfer from turret to hybrid charge. Discharged ammo immersed in this dissonic frequency maintains its shape and velocity pattern once launched towards a target. However, upon impact, the ammo undulates in an unstable fashion, transfering the frequency to its target and thereby causing more damage.\n\nSubsystem Skill Bonus: \n10% bonus to medium hybrid turret damage per level\n10% bonus to medium hybrid turret falloff per level\n7.5% bonus to medium hybrid turret tracking per level',800000,40,0,1,8,NULL,1,1132,3641,NULL,3666),(30128,956,'Proteus Offensive - Hybrid Propulsion Armature','This complex armature is composed of fullerene composites and based upon the understood weapons mechanics of salvaged Sleeper drones. Gallente researchers have fused this technology with the emerging theories on magnetic resonance and microwarp capabilities to power the kinetic energy systems of hybrid turrets. With these mechanics in place, the propulsion armature creates an effective distribution module for hybrid charges, bolstering their damage output and their falloff range.\n\nSubsystem Skill Bonus: \n10% bonus to medium hybrid turret damage per level \n10% bonus to medium hybrid turret falloff per level\n',800000,40,0,1,8,NULL,1,1132,3641,NULL,3667),(30129,956,'Proteus Offensive - Drone Synthesis Projector','Sleeper drones, while completely devoid of modern shielding technology, are nonetheless sturdy, mainly due to their metallofullerene armor plating and hull composition. Most of these technological applications are for capsuleer vessels, but a few rogue Gallente firms have quietly created this bay for use with contemporary drones. When drones are docked into this system, the projection system enhances their damage capabilities, both in absorbing and delivering damage, through the creation of a fullerene-based field around the drones.  \n\nSubsystem Skill Bonus: \n5% bonus to medium hybrid turret damage per level \n10% bonus to drone damage per level\n7.5% bonus to drone hitpoints per level\n',800000,40,0,1,8,NULL,1,1132,3641,NULL,3668),(30130,956,'Proteus Offensive - Covert Reconfiguration','From the moment Strategic Cruisers became a reality, there were whispers amongst the scientific community about the potential for advances in cloaking technology. They remained that alone for the longest time, with few involved in the reverse engineering process willing to share any news of their discoveries. Everyone knew that, should the technology ever become a reality, the capabilities of the new Strategic Cruisers would change overnight.\r\n\r\nTo many Gallente and Caldari, the development of the Proteus covert reconfiguration signaled a repeat of the technological arms race that arose from the ashes of Crielere. Once again seeking a balance of power, and entirely convinced that the Caldari were attempting to reverse-engineer their own cloak-capable Strategic Cruisers, the Federation diverted immense resources to their research. Private firms and the largest of conglomerates all played a role in development, offering up prototype designs and speculative theories that collectively resulted in some of the first Covert-Capable Proteus produced. It is not known who, or what organization led the project. Nor is known when, or where, the first Covert Reconfigurations were deployed. If it had not been for capsuleers developing the same designs, most people would have remained oblivious to their existence, just the way the Federation would have preferred.\r\n\r\nSubsystem Skill Bonus:\r\n5% bonus to medium hybrid turret damage per level\r\n\r\nRole Bonus:\r\n100% reduction in Cloaking Device CPU use\r\n\r\nNotes: Can fit covert ops cloaks and covert cynosural field generators. Cloak reactivation delay reduced to 5 seconds.',800000,40,0,1,8,NULL,1,1132,3641,NULL,3669),(30132,956,'Loki Offensive - Turret Concurrence Registry','Increasing the tracking capabilities of projectile weaponry has never been an easy task, yet the introduction of Sleeper technology has made this job more achievable. This registry is based on the idea of concurrence, where firing mechanisms can recycle energy among multiple turret emissions. This recycled energy is not only sustainable, but more powerful as well, a marvel considering its normal power output relative to other turret systems. Projectile turrets can be modified to use this surplus power to not only augment projectile damage output, but also to make minute adjustments on the fly, offering increasing tracking speed and optimal range.\n\nSubsystem Skill Bonus: \n10% bonus to medium projectile turret damage per level \n10% bonus to medium projectile turret optimal range per level\n7.5% bonus to medium projectile turret tracking per level\n',800000,40,0,1,2,NULL,1,1133,3641,NULL,3691),(30133,956,'Loki Offensive - Projectile Scoping Array','Scoping arrays were mostly out of fashion in recent ship design, but Sleeper technology has brought them somewhat back into vogue. Based upon the remarkable flexibility fullerene-based technology, Sleeper-based scoping arrays allowed projectile weaponry to produce longer-ranged accuracy without reducing the weapon\'s rate-of-fire. While a resurgence of scoping arrays is not expected, this subsystem certainly shows its uses in modern warfare.\n\nSubsystem Skill Bonus: \n7.5% bonus to medium projectile turret rate of fire per level\n10% bonus to medium projectile falloff per level.\n',800000,40,0,1,2,NULL,1,1133,3641,NULL,3692),(30134,956,'Loki Offensive - Hardpoint Efficiency Configuration','Adaptation and innovation go hand-in-hand, and this subsystem is a prime example of both ideas. While researching Sleeper drone weapon systems, a group of Minmatar engineers discovered special similarities to the technology behind all Sleeper weapon types. Distilling the underlying mechanic to its essence produced this hardpoint configuration, which enabled projectile weapons and missile launchers to share power sources and energy supplies (most of which were advanced beyond modern standards). This offers a vast increase to the rate of fire of both weapon types. Attempts to merge this technology to other weapon groups have, as yet, proven unsuccessful.\r\n\r\nSubsystem Skill Bonus: \r\n7.5% bonus to medium projectile turret rate of fire per level\r\n7.5% bonus to Heavy, Heavy Assault and Rapid Light Missile Launcher rate of fire per level\r\n',800000,40,0,1,2,NULL,1,1133,3641,NULL,3693),(30135,956,'Loki Offensive - Covert Reconfiguration','From the moment Strategic Cruisers became a reality, there were whispers amongst the scientific community about the potential for advances in cloaking technology. They remained that alone for the longest time, with few involved in the reverse engineering process willing to share any news of their discoveries. Everyone knew that, should the technology ever become a reality, the capabilities of the new Strategic Cruisers would change overnight.    \r\n\r\nThe Loki\'s Covert Reconfiguration designs arose out of a collective will to respond to what was thought to be Amarrian aggression deep inside their home regions. Unlike many scientific and technological breakthroughs, it was not the Sebiestor tribe alone who ushered in the paradigm shift to covert-capable Strategic Cruisers. It was only through consultation and collaboration with many other tribes and sub-factions that something substantial began to take shape. \r\n\r\nThe Krusual and Thukker are said to have played the most important roles, however, in realizing the final design; the Thukker by providing the cloaking technology, and the Krusual by convincing them to do so. How they achieved this, or what they may have promised remains a secret; the two tribes are notorious for having many, and keeping them all.\r\n\r\nSubsystem Skill Bonus:\r\n5% bonus to medium projectile turret rate of fire per level\r\n\r\nRole Bonus:\r\n100% reduction in Cloaking Device CPU use\r\n\r\nNotes: Can fit covert ops cloaks and covert cynosural field generators. Cloak reactivation delay reduced to 5 seconds.',800000,40,0,1,2,NULL,1,1133,3641,NULL,3694),(30139,958,'Tengu Engineering - Power Core Multiplier','Comprised of countless nanomachines that enhance the energy flow from a ship\'s reactor core, this engineering subsystem offers a pilot the option of increasing the power grid of their vessel. Although the empires mastered energy grid upgrades many centuries ago, the adaptation of old designs to the new Tech III paradigm has been a more recent breakthrough. \n\nSubsystem Skill Bonus: \n5% bonus to power output per level.\n',1200000,40,0,1,1,NULL,1,1123,3636,NULL,3611),(30140,973,'Tengu Engineering - Power Core Multiplier Blueprint','',0,0.01,0,1,NULL,99200.0000,1,NULL,70,NULL,0),(30141,958,'Tengu Engineering - Augmented Capacitor Reservoir','Another example of an old technology re-worked to fit the new Tech III paradigm, augmented capacitor subsystems improve upon the size of a vessel\'s capacitor. Designers of Tech III vessels were initially hampered by the problem of how to design a modular ship that could swap out basic engineering upgrades on a per-need basis. This proved particularly true when it came to increasing a vessel\'s capacitor size without the use of batteries. In the end, the provision of fullerene-based polymers allowed for solutions that had only existed in theory up until that point. \n\nSubsystem Skill Bonus: \n5% bonus to capacitor capacity per level.\n',1200000,40,0,1,1,NULL,1,1123,3636,NULL,3612),(30142,973,'Tengu Engineering - Augmented Capacitor Reservoir Blueprint','',0,0.01,0,1,NULL,99200.0000,1,NULL,70,NULL,0),(30143,958,'Tengu Engineering - Capacitor Regeneration Matrix','Using the same technology that can be found inside the ancient Sleeper race\'s guardian drones, this regeneration matrix greatly improves the recharge rate of a Tech III vessel\'s capacitor. Even though empire-based designs have achieved this effect for centuries, the way in which this system works is markedly different.  \n\nRather than the usual tweaking of capacitor fluid formulas, this design simply triples the number of nanotubes inside  something not possible until the recent influx of fullerene polymers from which this subsystem is made. This results in a drastic increase in the speed and efficiency of energy flow throughout a ship. The quicker that the surplus power can be redirected back to the core, the more that it can contribute to the overall recharge rate of the capacitor.\n\nSubsystem Skill Bonus: \n5% bonus to capacitor recharge time per level.\n',1200000,40,0,1,1,NULL,1,1123,3636,NULL,3613),(30144,973,'Tengu Engineering - Capacitor Regeneration Matrix Blueprint','',0,0.01,0,1,NULL,99200.0000,1,NULL,70,NULL,0),(30145,958,'Tengu Engineering - Supplemental Coolant Injector','When it came to overheating modules on Tech III vessels, the spaceship engineering industry always knew, or at the very least suspected, that a larger breakthrough was on its way. Those first small advances made by reverse-engineering ancient Sleeper hulls were seen by many as simply the beginning of something greater. For these and other reasons, few were surprised by the introduction of a subsystem focused purely on pushing the heat envelope. \n\nVarious designs surfaced in the weeks and months following the opening of the new wormholes, each offering increasingly smaller improvements on the last. Research seemed to stagnate for a while and it was not until the idea of additional, localized coolant injectors became widespread that heat-focused subsystems truly began to perform in a class of their own. The current iterations offer pilots truly unprecedented abilities when it comes to overheating and pushing modules to their limits. Military experts and even capsuleers alike have been left wondering just how drastically this new design, along with so many other radical new entries to the subsystems field, will reshape interstellar warfare.   \n\nSubsystem Skill Bonus:\n5% Reduction in the amount of heat damage absorbed by modules per level. ',1200000,40,0,1,1,NULL,1,1123,3636,NULL,3614),(30146,973,'Tengu Engineering - Supplemental Coolant Injector Blueprint','',0,0.01,0,1,NULL,99200.0000,1,NULL,70,NULL,0),(30149,958,'Proteus Engineering - Power Core Multiplier','Comprised of countless nanomachines that enhance the energy flow from a ship\'s reactor core, this engineering subsystem offers a pilot the option of increasing the power grid of their vessel. Although the empires mastered energy grid upgrades many centuries ago, the adaptation of old designs to the new Tech III paradigm has been a more recent breakthrough. \n\nSubsystem Skill Bonus: \n5% bonus to power output per level.\n',1200000,40,0,1,8,NULL,1,1124,3636,NULL,3661),(30150,973,'Proteus Engineering - Power Core Multiplier Blueprint','',0,0.01,0,1,NULL,99200.0000,1,NULL,70,NULL,0),(30151,958,'Proteus Engineering - Augmented Capacitor Reservoir','Another example of an old technology re-worked to fit the new Tech III paradigm, augmented capacitor subsystems redirect large segments of the capacitor to power other modules. In this case, reverse engineers have redesigned the ship\'s power flow to augment the systems responsible for microwarpdrive capacitor injection and drone control. Collectively, they combine to allow for a greater overall MWD speed, and increased resilience of a pilot\'s drones.\n\nSubsystem Skill Bonus: \n5% bonus to drone MWD speed per level \n7.5% bonus to drone hitpoints per level\n',1200000,40,0,1,8,NULL,1,1124,3636,NULL,3662),(30152,973,'Proteus Engineering - Augmented Capacitor Reservoir Blueprint','',0,0.01,0,1,NULL,99200.0000,1,NULL,70,NULL,0),(30153,958,'Proteus Engineering - Capacitor Regeneration Matrix','Using the same technology that can be found inside the ancient Sleeper race\'s guardian drones, this regeneration matrix greatly improves the recharge rate and size of a Tech III vessel\'s capacitor. Even though empire-based designs have achieved this effect for centuries, the way in which this system works is markedly different. \n\nRather than the usual tweaking of capacitor fluid formulas, this design simply triples the number of nanotubes inside  something not possible until the recent influx of fullerene polymers from which this subsystem is made. The end result is a drastic increase in the speed and efficiency of energy flow throughout a ship, as well as a much larger surface area, which allows for above average capacitor size. The faster that the surplus power can be redirected back to the core, the more that it can contribute to the overall recharge rate of the capacitor. \n\nSubsystem Skill Bonus:\n5% Reduction to capacitor recharge time per level.',1200000,40,0,1,8,NULL,1,1124,3636,NULL,3663),(30154,973,'Proteus Engineering - Capacitor Regeneration Matrix Blueprint','',0,0.01,0,1,NULL,99200.0000,1,NULL,70,NULL,0),(30155,958,'Proteus Engineering - Supplemental Coolant Injector','When it came to overheating modules on Tech III vessels, the spaceship engineering industry always knew, or at the very least suspected, that a larger breakthrough was on its way. Those first small advances made by reverse-engineering ancient Sleeper hulls were seen by many as simply the beginning of something greater. For these and other reasons, few were surprised by the introduction of a subsystem focused purely on pushing the heat envelope. \n\nVarious designs surfaced in the weeks and months following the opening of the new wormholes, each offering increasingly smaller improvements on the last. Research seemed to stagnate for a while and it was not until the idea of additional, localized coolant injectors became widespread that heat-focused subsystems truly began to perform in a class of their own. The current iterations offer pilots truly unprecedented abilities when it comes to overheating and pushing modules to their limits. Military experts and even capsuleers alike have been left wondering just how drastically this new design, along with so many other radical new entries to the subsystems field, will reshape interstellar warfare.   \n\nSubsystem Skill Bonus:\n5% Reduction in the amount of heat damage absorbed by modules per level. ',1200000,40,0,1,8,NULL,1,1124,3636,NULL,3664),(30156,973,'Proteus Engineering - Supplemental Coolant Injector Blueprint','',0,0.01,0,1,NULL,99200.0000,1,NULL,70,NULL,0),(30159,958,'Loki Engineering - Power Core Multiplier','Comprised of countless nanomachines that enhance the energy flow from a ship\'s reactor core, this engineering subsystem offers a pilot the option of increasing the power grid of their vessel. Although the empires mastered energy grid upgrades many centuries ago, the adaptation of old designs to the new Tech III paradigm has been a more recent breakthrough. \n\nSubsystem Skill Bonus: \n5% bonus to power output per level.\n',1200000,40,0,1,2,NULL,1,1125,3636,NULL,3686),(30160,973,'Loki Engineering - Power Core Multiplier Blueprint','',0,0.01,0,1,NULL,99200.0000,1,NULL,70,NULL,0),(30161,958,'Loki Engineering - Augmented Capacitor Reservoir','Another example of an old technology re-worked to fit the new Tech III paradigm, augmented capacitor subsystems improve upon the size of a vessel\'s capacitor. Designers of Tech III vessels were initially hampered by the problem of how to design a modular ship that could swap out basic engineering upgrades on a per-need basis. This proved particularly true when it came to increasing a vessel\'s capacitor size without the use of batteries. In the end, the provision of fullerene-based polymers allowed for solutions that had only existed in theory up until that point. \n\nSubsystem Skill Bonus: \n5% bonus to capacitor capacity per level.\n',1200000,40,0,1,2,NULL,1,1125,3636,NULL,3687),(30162,973,'Loki Engineering - Augmented Capacitor Reservoir Blueprint','',0,0.01,0,1,NULL,99200.0000,1,NULL,70,NULL,0),(30163,958,'Loki Engineering - Capacitor Regeneration Matrix','Using the same technology that can be found inside the ancient Sleeper race\'s guardian drones, this regeneration matrix greatly improves the recharge rate of a Tech III vessel\'s capacitor. Even though empire-based designs have achieved this effect for centuries, the way in which this system works is markedly different. \n\nRather than the usual tweaking of capacitor fluid formulas, this design simply triples the number of nanotubes inside  something not possible until the recent influx of fullerene polymers from which this subsystem is made. This results in a drastic increase in the speed and efficiency of energy flow throughout a ship. The quicker that the surplus power can be redirected back to the core, the more that it can contribute to the overall recharge rate of the capacitor.\n\nSubsystem Skill Bonus: \n5% bonus to capacitor recharge time per level.\n',1200000,40,0,1,2,NULL,1,1125,3636,NULL,3688),(30164,973,'Loki Engineering - Capacitor Regeneration Matrix Blueprint','',0,0.01,0,1,NULL,99200.0000,1,NULL,70,NULL,0),(30165,958,'Loki Engineering - Supplemental Coolant Injector','When it came to overheating modules on Tech III vessels, the spaceship engineering industry always knew, or at the very least suspected, that a larger breakthrough was on its way. Those first small advances made by reverse-engineering ancient Sleeper hulls were seen by many as simply the beginning of something greater. For these and other reasons, few were surprised by the introduction of a subsystem focused purely on pushing the heat envelope. \n\nVarious designs surfaced in the weeks and months following the opening of the new wormholes, each offering increasingly smaller improvements on the last. Research seemed to stagnate for a while and it was not until the idea of additional, localized coolant injectors became widespread that heat-focused subsystems truly began to perform in a class of their own. The current iterations offer pilots truly unprecedented abilities when it comes to overheating and pushing modules to their limits. Military experts and even capsuleers alike have been left wondering just how drastically this new design, along with so many other radical new entries to the subsystems field, will reshape interstellar warfare.   \n\nSubsystem Skill Bonus:\n5% Reduction in the amount of heat damage absorbed by modules per level. ',1200000,40,0,1,2,NULL,1,1125,3636,NULL,3689),(30166,973,'Loki Engineering - Supplemental Coolant Injector Blueprint','',0,0.01,0,1,NULL,99200.0000,1,NULL,70,NULL,0),(30169,958,'Legion Engineering - Power Core Multiplier','Comprised of countless nanomachines that enhance the energy flow from a ship\'s reactor core, this engineering subsystem offers a pilot the option of increasing the power grid of their vessel. Although the empires mastered energy grid upgrades many centuries ago, the adaptation of old designs to the new Tech III paradigm has been a more recent breakthrough.\n\nSubsystem Skill Bonus: \n5% bonus to power output per level.\n',1200000,40,0,1,4,NULL,1,1122,3636,NULL,3636),(30170,973,'Legion Engineering - Power Core Multiplier Blueprint','',0,0.01,0,1,NULL,99200.0000,1,NULL,70,NULL,0),(30171,958,'Legion Engineering - Augmented Capacitor Reservoir','Another example of an old technology re-worked to fit the new Tech III paradigm, augmented capacitor subsystems improve upon the size of a vessel\'s capacitor. Designers of Tech III vessels were initially hampered by the problem of how to design a modular ship that could swap out basic engineering upgrades on a per-need basis. This proved particularly true when it came to increasing a vessel\'s capacitor size without the use of batteries. In the end, the provision of fullerene-based polymers allowed for solutions that had only existed in theory up until that point.\n\nSubsystem Skill Bonus: \n5% bonus to capacitor capacity per level.\n',1200000,40,0,1,4,NULL,1,1122,3636,NULL,3637),(30172,973,'Legion Engineering - Augmented Capacitor Reservoir Blueprint','',0,0.01,0,1,NULL,99200.0000,1,NULL,70,NULL,0),(30173,958,'Legion Engineering - Capacitor Regeneration Matrix','Using the same technology that can be found inside the ancient Sleeper race\'s guardian drones, this regeneration matrix greatly improves the recharge rate of a Tech III vessel\'s capacitor. Even though empire-based designs have achieved this effect for centuries, the way in which this system works is markedly different. \n\nRather than the usual tweaking of capacitor fluid formulas, this design simply triples the number of nanotubes inside  something not possible until the recent influx of fullerene polymers from which this subsystem is made. This results in a drastic increase in the speed and efficiency of energy flow throughout a ship. The quicker that the surplus power can be redirected back to the core, the more that it can contribute to the overall recharge rate of the capacitor.\n\nSubsystem Skill Bonus: \n5% bonus to capacitor recharge time per level.\n',1200000,40,0,1,4,NULL,1,1122,3636,NULL,3638),(30174,973,'Legion Engineering - Capacitor Regeneration Matrix Blueprint','',0,0