NULL,NULL,1,NULL,2536,NULL,0),(30187,971,'Intact Thruster Sections','Even after millennia of exposure to space, these thruster sections show barely any signs of mechanical wear and appear to be completely functional. The modular design of Sleeper propulsion systems is similar to that of the empires, but deviates in a few interesting areas. \r\n\r\nPristine, working examples of Sleeper technology such as this are extremely rare and even more valuable. With the right skills and equipment, they can offer great insights into the scientific pursuits of the ancient race that designed them. ',0,10,0,1,NULL,NULL,1,1909,3738,NULL,0),(30188,983,'Sleepless Patroller','An abundance of repair seams in this Sleeper drone\'s armor tell the story of millennia spent on duty, protecting the same unchanging area. The drone moves about with a mechanical indifference to the monotony of its task, executing each new maneuver with a flawless, unthinking precision.',19000000,19000000,120,1,64,NULL,0,NULL,NULL,12,3516),(30189,983,'Sleepless Watchman','An abundance of repair seams in this Sleeper drone\'s armor tell the story of millennia spent on duty, protecting the same unchanging area. The drone moves about with a mechanical indifference to the monotony of its task, executing each new maneuver with a flawless, unthinking precision.',19000000,19000000,120,1,64,NULL,0,NULL,NULL,12,3559),(30190,983,'Sleepless Escort','An abundance of repair seams in this Sleeper drone\'s armor tell the story of millennia spent on duty, protecting the same unchanging area. The drone moves about with a mechanical indifference to the monotony of its task, executing each new maneuver with a flawless, unthinking precision.',19000000,19000000,120,1,64,NULL,0,NULL,NULL,12,3559),(30191,983,'Sleepless Outguard','An abundance of repair seams in this Sleeper drone\'s armor tell the story of millennia spent on duty, protecting the same unchanging area. The drone moves about with a mechanical indifference to the monotony