SmallStructure01','',0,0,0,1,2,NULL,0,NULL,NULL,NULL,3600),(30457,186,'Sleeper Small Advanced Wreck','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it. ',10000,27500,27500,1,NULL,NULL,0,NULL,NULL,NULL,3117),(30458,186,'Sleeper Medium Advanced Wreck','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it. ',10000,27500,27500,1,NULL,NULL,0,NULL,NULL,NULL,3116),(30459,186,'Sleeper Large Wreck','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it. ',10000,27500,27500,1,NULL,NULL,0,NULL,NULL,NULL,3117),(30460,383,'Vigilant Sentry Tower','These fearsome sentry towers have remained the faithful and dangerous guardians of their sleeping masters, even after countless years of constant duty. As unpredictable as they are powerful, the towers have been expertly designed to provide lasting vigilance with an unquestioning, mechanical loyalty. The weapons systems on board are frighteningly precise and devastating upon impact.',1000,1000,1000,1,64,NULL,0,NULL,NULL,NULL,3533),(30461,383,'Wakeful Sentry Tower','These fearsome sentry towers have remained the faithful and dangerous guardians of their sleeping masters, even after countless years of constant duty. As unpredictable as they are powerful, the towers have been expertly designed to provide lasting vigilance with an unquestioning, mechanical loyalty. The weapons systems on board are frighteningly precise and devastating upon impact.',1000,1000,1000,1,64,NULL,0,NULL,NULL,NULL,3533),(30462,383,'Restless Sentry Tower','These fearsome sentry towers have remained the faithful and dangerous guardians of their sleeping masters, even after countless years of constant duty. As unpredictable as they are powerful, the towers have been expertly designed to provide lasting vigilance with an unquestioning, mechanical loyalty. The weapons systems on board are frighteningly precise and devastating upon impact.',1000,1000,1000,1,64,NULL,0,NULL,NULL,NULL,3533),(30464,964,'Metallofullerene Plating','Metallofullerene plating is used to protect the connective joins in hull and subsystem structures so that Tech III vessels can be taken apart and put back together endlessly, all without the risk of wear. Mechanical engineers first attempted to create the plating using plutonium metallofullerenes, but it was quickly discovered that even miniscule amounts of them had a sizeable impact on ship mass. When integrated into armor plating in larger amounts, they also risked turning the vessel into a giant warhead, something even less desirable. \r\n\r\nA solution was finally found. Tiny amounts of metallofullerenes would be integrated in conjunction with far larger quantities of graphene nanoribbons and then coated in powdered C-540 graphite. This process allowed the material to maintain structural durability whilst keeping mass down. The last and most ingenious addition was to incorporate fulleroferrocene into the metal beneath layers of electromechanical hull sheeting. This had the effect of turning the normally dangerous explosive reactions into kinetic energy, which could then be used to supplement the power supply to local nanoassemblers.',1,5,0,1,NULL,400000.0000,1,1147,3721,NULL,0),(30465,965,'Metallofullerene Plating Blueprint','',0,0.01,0,1,NULL,10000000.0000,1,1191,96,NULL,0),(30466,964,'Electromechanical Interface Nexus','When integrated into a starship with other components, an EMI Nexus is used to facilitate manual control over numerous electromechanical systems which, by default, run in an automated manner according to their programmed roles. Typically, the EMI Nexus acts as a conduit between a capsuleer and their ship, serving as an interface through which they can operate normally automated electromechanical systems, such as a Central System Controller. Other more simple tasks, such as the activation of a ship\'s modules, also frequently rely on these components.',1,10,0,1,NULL,400000.0000,1,1147,3716,NULL,0),(30467,965,'Electromechanical Interface Nexus Blueprint','',0,0.01,0,1,NULL,10000000.0000,1,1191,96,NULL,0),(30470,964,'Neurovisual Output Analyzer','As a capsuleer, few things are more important in space-flight than the ability to instantly gauge one\'s surroundings and make decisions accordingly. For this reason, capsules inside starships make frequent use of neurovisual reproductions; emulations that recreate external stimuli using the most low-latency processor available: the human brain. This process relies on digital relays from camera drones and monitoring systems embedded into the hull. After the data is captured, it is then relayed directly into the brain, at which point the external surrounds are recreated almost instantaneously.\r\n\r\nThe synthetic translation of external stimuli into neurovisual imagery is incredibly risky, even relative to the standard hazards of pod piloting. Even though capsuleers have an innate resistance to neurobiological damage from these sorts of processes, the near- constant exposure to them has been linked to increased risk of aggressive neurodegenerative diseases. In recent years, engineers have begun to integrate neurovisual output analyzers into a starship\'s electronics systems. These devices monitor the pilot\'s status and, if necessary, take measures to protect against anything from mild headaches to catastrophic neural failure.',1,5,0,1,NULL,400000.0000,1,1147,3716,NULL,0),(30471,965,'Neurovisual Output Analyzer Blueprint','',0,0.01,0,1,NULL,10000000.0000,1,1191,96,NULL,0),(30474,964,'Nanowire Composites','Nanowire composites function as connective links between subsystems. Graphene nanoribbons form the base of the components, carrying electrical power between other devices integrated into electromechanical hull sheets. A final coating of thermal diffusion film ensures efficient heat dispersion, allowing a starship captain to overload modules connected to subsystems without risking the entire vessel.',1,5,0,1,NULL,400000.0000,1,1147,3718,NULL,0),(30475,965,'Nanowire Composites Blueprint','',0,0.01,0,1,NULL,10000000.0000,1,1191,96,NULL,0),(30476,964,'Fulleroferrocene Power Conduits','These conduits supply power to minute, molecular-level devices. Extremely strong and yet surprising flexible, they have traditionally been used in rare situations where the normal methods of power supply were rendered impossible. The advent of Tech III starship technology and the influx of fullerene-based materials have seen the conduits take on new and more widespread roles. \r\n\r\nThe addition or removal of a single subsystem in a Tech III vessel can drastically change the ship\'s structure, and with it the internal wiring and available power supply routes.  Fulleroferrocene power conduits have become an essential component in the construction of these new vessels for this very reason. The conduits can be remapped through a ship with relative ease, allowing for the near-endless variations of subsystems to be completely interchangeable without posing any problems of how to power them.',1,5,0,1,NULL,400000.0000,1,1147,3720,NULL,0),(30477,965,'Fulleroferrocene Power Conduits Blueprint','',0,0.01,0,1,NULL,10000000.0000,1,1191,96,NULL,0),(30478,964,'Reconfigured Subspace Calibrator','Subspace calibrators perform the crucial role of tuning in on subspace frequencies. Being able to accurately pinpoint a destination on the other side of a wormhole is vital to interstellar travel, as it allows pilots to traverse wormholes safe in the knowledge that they won\'t accidentally arrive out the other side at the centre of a sun. \r\n\r\nThis particular calibrator was produced from a combination of fullerene polymers and salvaged Sleeper technology. The unique grouping enables some drastic reconfigurations to the basic design. The end result is a vastly increased efficiency in calculation time. Due to the modular design of Tech III vessels, tuning into subspace frequencies must be done individually for each subsystem. The development of this particular component has been an important time-saver in an area where mere seconds can mean life or death.',1,10,0,1,NULL,400000.0000,1,1147,3717,NULL,0),(30479,965,'Reconfigured Subspace Calibrator Blueprint','',0,0.01,0,1,NULL,10000000.0000,1,1191,96,NULL,0),(30484,186,'Sleeper Small Basic Wreck','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it. ',10000,27500,27500,1,NULL,NULL,0,NULL,NULL,NULL,3117),(30485,186,'Sleeper Small Intermediate Wreck','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it. ',10000,27500,27500,1,NULL,NULL,0,NULL,NULL,NULL,3117),(30486,479,'Sisters Combat Scanner Probe','A scanner probe used for scanning down Cosmic Signatures, starships, structures and drones.\r\n\r\nCan be launched from <a href=showinfo:18639>Expanded Probe Launchers</a>.',1,1,0,1,NULL,23442.0000,1,1199,1722,NULL,3767),(30488,479,'Sisters Core Scanner Probe','A scanner probe used for scanning down Cosmic Signatures in space.\r\n\r\nCan be launched from <a href=showinfo:17938>Core Probe Launchers</a> and <a href=showinfo:18639>Expanded Probe Launchers</a>.',1,0.1,0,1,NULL,23442.0000,1,1199,1723,NULL,3767),(30492,186,'Sleeper Medium Basic Wreck','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it. ',10000,27500,27500,1,NULL,NULL,0,NULL,NULL,NULL,3116),(30493,186,'Sleeper Medium Intermediate Wreck','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it. ',10000,27500,27500,1,NULL,NULL,0,NULL,NULL,NULL,3116),(30494,186,'Sleeper Large Basic Wreck','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it. ',10000,27500,27500,1,NULL,NULL,0,NULL,NULL,NULL,3115),(30495,186,'Sleeper Large Intermediate Wreck','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it. ',10000,27500,27500,1,NULL,NULL,0,NULL,NULL,NULL,3115),(30496,186,'Sleeper Large Advanced Wreck','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it. ',10000,27500,27500,1,NULL,NULL,0,NULL,NULL,NULL,3115),(30497,526,'Reinforced Metal Scraps','This mechanical hardware has obviously outlived its use, and is now ready to be recycled. Many station maintenance departments use the material gained from recycling these scraps to manufacture steel plates which replace worn out existing plates in the station hull. Most station managers consider this a cost-effective approach, rather than to send out a costly mining expedition for the ore, although these scraps rarely are enough to satisfy demand.\n\nThis commodity is not affected by the scrap metal processing skill any more than any other recyclable item.',10000,0.01,0,1,NULL,20.0000,1,NULL,2529,NULL,0),(30502,226,'Talocan Polestar','The central piece of this Talocan station is the Polestar, the nerve center of the complex and the heart of Talocan survival. Though dilapidated and unusable, the Polestar\'s outer hull holds many propulsion jets and mini-generators, implying its use as a self-sufficient structure with independent capabilities. From the burn marks around the propulsion thrusters, this Polestar has been jettisoned many times as a necessary structure for a migrant culture.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,3561),(30503,226,'Talocan Coupling Array','The long capsules in the coupling array offer no hints as to their purpose. Archaeologists conjecture that the Array contained escape vessels, food bins, fuel resources or equipment for punishment. Some theories purport that all of the above are true.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,3570),(30504,226,'Talocan Static Gate','This standing structure shares many similar aspects with modern acceleration gates. Whispers among Talocan lore-keepers tell of the Talocan\'s firm grasp of astronautical engineering, and this gate may offer some insight into this ancient race\'s knowledge.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,3572),(30505,226,'Talocan Exchange Depot','Amidst the ruins of this Talocan outpost, the exchange depot looms, its presence foreboding. Judging from the wreckage inside, the depot was either used for imprisonment or cultural exchange; eerily, there seems to be very little difference between the two. Whatever its purpose, this structure is rather prevalent among the outposts, displaying its importance in Talocan society.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,3573),(30506,226,'Talocan Extraction Silo','This towering structure contains all the basic elements of a regular silo: cavernous storage areas, thick walls, extensive ventilation, etc. Based on the scans of this silo, however, the silo\'s previous contents are unknown. The residue from inside reveals nothing known in modern times, or even odd genetic combinations. Whatever its contents, the silo emits an unfamiliar  and uneasy  presence.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,3574),(30507,319,'Worn Talocan Static Gate','This standing structure shares many similar aspects with modern acceleration gates. Whispers among Talocan lore-keepers tell of the Talocan\'s firm grasp of astronautical engineering. This gate may offer some insight into this ancient race\'s knowledge, if only it could be fully repaired. Eons in space have worn the static gate completely down.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,3572),(30508,319,'Inverted Talocan Exchange Depot','Amidst the ruins of this Talocan outpost, the exchange depot looms, its presence foreboding. Judging from the wreckage inside, the depot was either used for imprisonment or cultural exchange; eerily, there seems to be very little difference between the two. Whatever its purpose, this structure is rather prevalent among the outposts, displaying its importance in Talocan society.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,3573),(30509,319,'Disrupted Talocan Polestar','The central piece of this Talocan station is the Polestar, the nerve center of the complex and the heart of Talocan survival. Though dilapidated and unusable, the Polestar\'s outer hull is breached in many parts. Its propulsion jets and mini-generators are destroyed and decaying. From the burn marks around the propulsion thrusters, this Polestar has been jettisoned many times as a necessary structure for a migrant culture, but in this condition the Polestar\'s current location will remain its last. ',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,3561),(30510,319,'Broken Talocan Coupling Array','The long capsules in the coupling array offer no hints as to their purpose. Archaeologists conjecture that the Array contained escape vessels, food bins, fuel resources or equipment for punishment. Some theories purport that all of the above are true. Cracked and worn, the coupling array won\'t function as any of these, as its fragile frame is completely broken inside and out. ',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,3570),(30511,319,'Hollow Talocan Extraction Silo','This towering structure contains all the basic elements of a regular silo: cavernous storage areas, thick walls, extensive ventilation, etc. Based on the scans of this silo, however, the silo\'s previous contents are unknown. The residue from inside reveals nothing known in modern times, or even odd genetic combinations. Whatever its contents, the silo emits an unfamiliar  and uneasy  presence.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,3574),(30512,319,'Weakened Sleeper Drone Hangar','Clearly built to serve the needs of the Sleeper\'s automated defense drones, this ominous structure functions as one of their central docking points. The hangar\'s defensive capabilities have degraded over the millennia, leaving a thin outer shell that offers only token resistance to attack.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,3585),(30513,226,'Sleeper Drone Hangar','Clearly built to serve the needs of the Sleeper\'s automated defense drones, this ominous structure functions as one of their central docking points. Despite its age, the facility shows few signs of decay, suggesting that it is perhaps maintained by its residents.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,3585),(30514,226,'Talocan Wreckage','This appears to be the much-mangled remains of a Talocan vessel. It\'s too damaged to recover anything useful from',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,3581),(30515,226,'Unidentified Wreckage','There\'s no telling what this used to be; now though it\'s definitely scrap',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,3582),(30516,1207,'Malfunctioning Sleeper Databank','This databank has clearly been the site of a serious impact, but it remains online. You may be able to extract something with your Data Analyzer.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,3705),(30517,1207,'Ejected Sleeper Databank','Ejected Sleeper Databank: This modular structure was long ago subjected to some sort of emergency ejection procedure, but you can detect an intact databank concealed under its heavy plating. You may be able to extract something with your Data Analyzer.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,3704),(30518,1207,'Deformed Sleeper Databank','Deformed Sleeper Databank: This section of hull plating once shielded an auxiliary databank on its obverse. The databank has been exposed to space for some time now, but you may still be able to extract something with your Data Analyzer.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,3707),(30519,1207,'Obsolete Sleeper Databank','Obsolete Sleeper Databank: This could once have been an airlock. Or an essential component of a ventilation system. Or some kind of stasis pod. Whatever it was, the only thing of value that remains is the databank you can detect concealed within.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,3706),(30520,1207,'Broken Sleeper Databank','This object was severed from some larger structure in the distant past, perhaps as the result of an asteroid strike. Fortunately, a once-redundant power source has provided just enough energy to keep its databank operable. You may be able to extract something with your Data Analyzer.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,3705),(30521,1207,'Spavined Sleeper Databank','This hull plate still has an unobstructed access point for the databank it holds. You may be able to extract something with your Data Analyzer.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,3704),(30522,1207,'Forgotten Sleeper Artifact','Your analyzer is picking up something of interest in this piece of twisted wreckage, though you can\'t for the life of you see what it is.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,3707),(30523,1207,'Lost Sleeper Artifact','You suspect this battered hunk of metal may conceal some kind of relic.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,3706),(30524,1207,'Abandoned Sleeper Artifact','This might once have been an important piece of an engine, but now you\'re not getting anything out of it without the help of an analyzer.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,3705),(30525,1207,'Sleeper Artifact','You think there might be something concealed here that an analyzer could discover.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,3704),(30526,1207,'Decrepit Sleeper Artifact','This mangled sheet of hull plating contains something of interest to your analyzer.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,3707),(30527,1207,'Forlorn Sleeper Artifact','Analysis could yield something valuable.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,3706),(30528,1207,'Abandoned Talocan Battleship','It looks like this ship was gutted, then left to drift.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,3529),(30529,1207,'Deserted Talocan Cruiser','It looks like this ship was gutted, then left to drift.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,3530),(30530,1207,'Derelict Talocan Frigate','It looks like this ship was gutted, then left to drift.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,3532),(30532,1240,'Amarr Defensive Systems','Skill in the operation of Amarr Defensive Subsystems used on Tech III ships.',0,0.01,0,1,4,5000000.0000,1,1824,33,NULL,0),(30536,1240,'Amarr Electronic Systems','Skill in the operation of Amarr Electronic Subsystems used on Tech III ships.',0,0.01,0,1,4,5000000.0000,1,1824,33,NULL,0),(30537,1240,'Amarr Offensive Systems','Skill in the operation of Amarr Offensive Subsystems used on Tech III ships.',0,0.01,0,1,4,5000000.0000,1,1824,33,NULL,0),(30538,1240,'Amarr Propulsion Systems','Skill in the operation of Amarr Propulsion Subsystems used on Tech III ships.',0,0.01,0,1,4,5000000.0000,1,1824,33,NULL,0),(30539,1240,'Amarr Engineering Systems','Skill in the operation of Amarr Engineering Subsystems used on Tech III ships.',0,0.01,0,1,4,5000000.0000,1,1824,33,NULL,0),(30540,1240,'Gallente Defensive Systems','Skill in the operation of Gallente Defensive Subsystems used on Tech III ships.',0,0.01,0,1,4,5000000.0000,1,1824,33,NULL,0),(30541,1240,'Gallente Electronic Systems','Skill in the operation of Gallente Electronic Subsystems used on Tech III ships.',0,0.01,0,1,4,5000000.0000,1,1824,33,NULL,0),(30542,1240,'Caldari Electronic Systems','Skill in the operation of Caldari Electronic Subsystems used on Tech III ships.',0,0.01,0,1,4,5000000.0000,1,1824,33,NULL,0),(30543,1240,'Minmatar Electronic Systems','Skill in the operation of Minmatar Electronic Subsystems used on Tech III ships.',0,0.01,0,1,4,5000000.0000,1,1824,33,NULL,0),(30544,1240,'Caldari Defensive Systems','Skill in the operation of Caldari Defensive Subsystems used on Tech III ships.',0,0.01,0,1,4,500