otably similar to that of the empires, only deviating in a few interesting areas.\r\n\r\nA determined and lucky researcher could still successfully reverse engineer something useful from this, but they would certainly stand a better chance with a more functional design. ',0,10,0,1,NULL,NULL,1,1909,3738,NULL,0),(30562,971,'Wrecked Thruster Sections','Originally misidentified by the analyzers as nothing more than scrap, these ancient thruster sections are only marginally more than that. Whether it was centuries of radiation or some violent explosion countless years ago, these thrusters have been damaged long ago and are now in a state of advanced erosion as a result. \r\n\r\nThe modular design of the Sleeper propulsion systems appears to be similar to empire technology, with only slight deviations observable. Perhaps there are secrets to the Sleeper propulsion designs locked away inside these broken relics, but it would take a significant amount of luck for even a skilled researcher to successfully reverse engineer them and find out. ',0,10,0,1,NULL,NULL,1,1909,3738,NULL,0),(30574,995,'Magnetar','',1e35,1,0,1,NULL,NULL,0,NULL,NULL,NULL,3711),(30575,995,'Black Hole','',1e35,1,0,1,NULL,NULL,0,NULL,NULL,NULL,3708),(30576,995,'Red Giant','',1e35,1,0,1,NULL,NULL,0,NULL,NULL,NULL,3713),(30577,995,'Pulsar','',1e35,1,0,1,NULL,NULL,0,NULL,NULL,NULL,3709),(30579,988,'Wormhole Z971','An unstable wormhole, deep in space. Wormholes of this kind usually collapse after a few days, and can lead to anywhere.',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,3715),(30582,992,'Intact Power Cores','Rescued from a crumbling Sleeper structure, these ancient power cores stand as an excellent example of Sleeper engineering. Unlike everything else that surrounded them, these cores appeared to be almost newly-manufactured.\r\n\r\nPristine, working examples of Sleeper technology such as this are extremely rare and even more valuable. With the right skills and equipment, they can offer great insights into the scientific pursuits of the ancient race that designed them. ',0,10,0,1,NULL,NULL,1,1909,3736,NULL,0),(30583,988,'Wormhole R943','An unstable wormhole, deep in space. Wormholes of this kind usually collapse after a few days, and can lead to anywhere.',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,3715),(30584,988,'Wormhole X702','An unstable wormhole, deep in space. Wormholes of this kind usually collapse after a few days, and can lead to anywhere.',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,3715),(30586,992,'Malfunctioning Power Cores','Taken from amongst countless other ruined devices that cluttered the Sleeper facility once housing them, these ancient Sleeper power cores are still intact, yet extremely defective. Unlocking the technological secrets behind them would be a difficult task in their current state. Only those researchers who are skilled in reverse engineering would have a chance, and even then, not a great one. ',0,10,0,1,NULL,NULL,1,1909,3736,NULL,0),(30588,992,'Wrecked Power Cores','These ancient power cores have all but succumbed to millennia of neglect and disuse. A few elements of their basic design remain intact, offering a skilled researcher some small hope that the secrets locked away inside may still be reverse engineered into something more functional.',0,10,0,1,NULL,NULL,1,1909,3736,NULL,0),(30599,990,'Intact Electromechanical Component','This ancient piece of electronics equipment is in near-perfect condition, untarnished by centuries of disuse. The design of the circuitry appears to be highly modular, offering a wide-ranging insight into Sleeper electronics systems.\r\n\r\nPristine, working examples of Sleeper technology such as this are extremely rare and even more valuable. With the right skills and equipment, they can offer great insights into the scientific pursuits of the ancient race that designed them. ',0,10,0,1,NULL,NULL,1,1909,3735,NULL,0),(30600,990,'Malfunctioning Electromechanical Component','This ancient piece of electronics equipment has long since begun to malfunction. Despite centuries of disuse having taken a heavy toll on the device, the design of the circuitry remains clear enough to form the basis of scientific study. A skilled researcher could have a decent chance at unlocking the secrets of Sleeper electronics design within. ',0,10,0,1,NULL,NULL,1,1909,3735,NULL,0),(30605,990,'Wrecked Electromechanical Component','This ancient piece of electronics equipment has all but disintegrated after centuries of disuse. Much of the circuitry has been claimed by decay, leaving only the most fundamental information available for reverse engineering attempts. Even despite the low chance of success, in the hands of a skilled researcher these components could still help unlock the secrets of Sleeper electronics design.',0,10,0,1,NULL,NULL,1,1909,3735,NULL,0),(30614,993,'Intact Armor Nanobot','Recovered from amongst the debris of a Sleeper facility, this ancient device is somehow still entirely functional. Just one of these items holds countless nanoassemblers inside, offering a comprehensive view of the finer details in the Sleeper\'s defensive systems.\r\n\r\nPristine, working examples of Sleeper technology such as this are extremely rare and even more valuable. With the right skills and equipment, they can offer great insights into the scientific pursuits of the ancient race that designed them. ',0,10,0,1,NULL,NULL,1,1909,3734,NULL,0),(30615,993,'Malfunctioning Armor Nanobot','Recovered from amongst the debris of a Sleeper facility, this ancient device is locked into a slow decline. Just one of these items holds countless nanoassemblers inside, offering a comprehensive view of the finer details in the Sleeper\'s defensive systems. Unfortunately, a great deal of the assemblers inside this one have fused together, causing a terminal chain reaction inside the device.\r\n\r\nEven though it is badly damaged, a skilled scientist could still possibly extract enough information to try and reverse engineer it. ',0,10,0,1,NULL,NULL,1,1909,3734,NULL,0),(30618,993,'Wrecked Armor Nanobot','Recovered from amongst the debris of a Sleeper facility, this ancient device is almost entirely shut down. Just one of these items would normally hold countless nanoassemblers inside, offering a comprehensive view of the finer details in the Sleeper\'s defensive systems. Unfortunately, all of the assemblers inside this one have fused together, causing a terminal chain reaction inside the device.\r\n\r\nEven though it is only a shell of what it once used to be, with a bit of guesswork and luck, a skilled scientist might still be able to extract enough information to try and reverse engineer it. ',0,10,0,1,NULL,NULL,1,1909,3734,NULL,0),(30628,991,'Intact Weapon Subroutines','This collection of electronic devices represents the core of the computerized functionality behind the Sleeper weapons systems. An amalgam of advanced calibration and tracking devices, they are the driving force behind the frightening accuracy and efficiency of Sleeper armaments. \r\n\r\nThe subroutines have been coded into various devices which were then secreted away inside an ultra-hard metallofullerene alloy container. They show barely any sign of age, serving as an almost perfect example of Sleeper weapons design. \r\n\r\nPristine, working examples of Sleeper technology such as this are extremely rare and even more valuable. With the right skills and equipment, they can offer great insights into the scientific pursuits of the ancient race that designed them. ',0,10,0,1,NULL,NULL,1,1909,3737,NULL,0),(30632,991,'Malfunctioning Weapon Subroutines','This collection of electronic devices represents the core of the computerized functionality behind the Sleeper weapons systems. An amalgam of advanced calibration and tracking devices, they are the driving force behind the frightening accuracy and efficiency of Sleeper armaments. \r\n\r\nThe subroutines have been coded into various devices which were then secreted away inside an ultra-hard metallofullerene alloy container. A small tear in the container\'s seal has exposed them to centuries of radiation however, leaving them barely functional.\r\n\r\nEven despite this, a skilled scientist could still possibly extract enough information to reverse engineer one. ',0,10,0,1,NULL,NULL,1,1909,3737,NULL,0),(30633,991,'Wrecked Weapon Subroutines','This collection of electronic devices represents the core of the computerized functionality behind the Sleeper weapons systems. An amalgam of advanced calibration and tracking devices, they are the driving force behind the frightening accuracy and efficiency of Sleeper armaments. \r\n\r\nThe subroutines have been coded into various devices which were then stored inside the facility from which they came. Exposed to countless centuries of radiation after its walls began to erode, the subroutines are barely recognizable, offering only the most rudimentary glimpses into Sleeper weapons design. It would take a skilled researcher and a good amount of luck to successfully reverse engineer anything functional from such a broken mess. ',0,10,0,1,NULL,NULL,1,1909,3737,NULL,0),(30642,988,'Wormhole O128','An unstable wormhole, deep in space. Wormholes of this kind usually collapse after a few days, and can lead to anywhere.',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,3715),(30643,988,'Wormhole N432','An unstable wormhole, deep in space. Wormholes of this kind usually collapse after a few days, and can lead to anywhere.',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,3715),(30644,988,'Wormhole M555','An unstable wormhole, deep in space. Wormholes of this kind usually collapse after a few days, and can lead to anywhere.',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,3715),(30645,988,'Wormhole B041','An unstable wormhole, deep in space. Wormholes of this kind usually collapse after a few days, and can lead to anywhere.',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,3715),(30646,988,'Wormhole U319','An unstable wormhole, deep in space. Wormholes of this kind usually