LL,NULL,0,NULL,10140,20184,202),(30894,226,'Amarr Armageddon Battleship','The mighty Armageddon class is one of the enduring warhorses of the Amarr Empire. Once a juggernaut that steamrolled its way into battle, it has now taken on a more stately and calculated approach, sending out a web of drones in its place while it drains the enemy from a distance.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,297),(30895,226,'Caldari Raven Battleship','The Raven is the powerhouse of the Caldari Navy. With its myriad launcher slots and powerful shields, few ships can rival it in strength or majesty.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,43),(30896,226,'Minmatar Tempest Battleship','The Tempest is one of the Republic Fleet\'s key vessels; a versatile gunship proficient at long-range bombardment and capable of dishing out specialized types of damage with great effectiveness. A well-rounded squadron of Tempests has been proven time and time again to be an invaluable wild card in a fleet battle, one which opponents should ignore at their own peril.',0,0,0,1,2,NULL,0,NULL,NULL,NULL,48),(30897,226,'Gallente Dominix Battleship','A Dominix-class battleship.',105000000,1010000,600,1,8,NULL,0,NULL,NULL,NULL,318),(30898,226,'Minmatar Wreathe industrial','A Wreathe-class industrial.',0,0,0,1,2,NULL,0,NULL,NULL,NULL,310),(30899,952,'Cargo Wreathe','A Wreathe-class industrial awaiting cargo.',0,0,500,1,2,NULL,0,NULL,NULL,NULL,310),(30900,226,'Fortified Drone Structure I','This gigantic superstructure was built by the effort of thousands of rogue drones. While the structure appears to be incomplete, its intended shape remains a mystery to the clueless carbon-based lifeforms.',100000,100000000,10000,1,4,NULL,0,NULL,NULL,NULL,2407),(30901,226,'Sleeper Engineering Station','This enigmatic structure appears to house numerous engineering subsystems. An outer defense system is still online, shielding the installation from any hostile actions. Inside the facility there is a maze of data networks tangled amongst the cables and conduits that sustain them.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,20187,3567),(30902,226,'Talocan Embarkment Destroyer','This Talocan ship wreckage drifts in space with surprising grace and efficiency. Even completely offline and abandoned, the embarkment destroyer appears to have been created for just this function, or at least for survival across vast stretches of unknown space for extended periods of time. Despite its incapacitated status, the wreckage looks sturdy enough to be rebuilt; perhaps its appearance is merely a ruse, a trap set long ago by a dead civilization. Regardless, caution is recommended.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,3531),(30903,226,'Talocan Disruption Tower','The Talocan disruption tower is the most mysterious of the Talocan structures. Although certainly a part of the Talocan station, its hinges and propulsion systems imply ready removal from stations, but the peaks and points are unlike any current weapon grouping or turret structure. The tower appears as more of a mechanical syringe than a defense turret, but that may be just speculation. Regardless of the theories, the disruption tower is an unsettling relic of the Talocans.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,3569),(30904,226,'Talocan Engineering Station','This is a Talocan engineering station',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,3568),(30905,226,'Sleeper linkage structure','This is a Sleeper linkage structure',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,3534),(30906,526,'Letter of Recommendation','<i>For the eyes of Militia recruitment officers:\r\n\r\n<p>Sir,\r\n<br>I do hereby certify and vouchsafe that the bearer of this document is a newly-certified capsuleer of good character and firm disposition, whom I do rightly judge is a fine and worthy candidate for enrolment into our most esteemed and successful Militia organization.\r\n\r\n<p>Furthermore, I have verified that, at time of issuance, the bearer does meet the criteria for Fast Track recruitment, namely that:\r\n<ul>\r\n<li>The pilot\'s sign-in account is less than thirty (30) days old\r\n<li>The pilot\'s standings with our faction are not lower than zero (0)\r\n<li>The pilot\'s standings with our faction are below the standard zero-point-five (0.5) threshold for recruitment\r\n</ul>\r\n\r\nPlease verify that these details are correct at time of your receipt of this document. If everything is in order then I formally request that you enroll the bearer into the Militia without hesitation or delay, that they might further serve the just and righteous cause of our people.</i>',0.5,0.1,0,1,NULL,150.0000,1,NULL,2908,NULL,0),(30907,314,'Smuggler\'s Warning About Sister Alitura','Good news from Kirus. Remember that Sisters of EVE agent, Alitura, who nearly caught our trail? The boss called in some favors and got her reassigned to Arnon IX in Essence. The good Sister Alitura may be resourceful, but she\'d need a capsuleer with clearance to all four empires to be any threat, and we know how much the Sisters love capsuleers. ',1,1,0,1,NULL,NULL,1,NULL,1192,NULL,0),(30908,715,'Gue Mouey\'s Vindicator','This station is being used as a Syndicate trade hub.  It was recently erected as the Syndicates answer to the growing demand for drugs and weapons in this constellation.  It also acts as a neutral bargaining ground between Caldari vendors from Kois City and the pirate elements.',0,0,0,1,8,NULL,0,NULL,NULL,27,1257),(30927,319,'Sleeper Archive Terminal','This structure appears to be a modified engineering station, although it contains more instruments for information-gathering than commonly seen in stations of its ilk. Currently inactive, the terminal sports a great number of antechambers and libraries both digital and physical, as well as innumerable laboratories of all shapes and sizes.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,3567),(30948,927,'State Transport','Industrials are a common sight in the universe of EVE, connecting supply points to each other.',13500000,270000,5250,1,1,NULL,0,NULL,NULL,NULL,52),(30949,952,'Josameto Verification Center','To more rapidly assist capsuleers in their employ, Nugoeihuvi has recently established verification centers such as this one, which operate as a one-stop destination where pilots can receive future orders, sensitive cargo and secure information.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,1708),(30950,673,'Corporate Liaison','These corporate agents act as intermediaries between spacefaring pilots and their station-bound counterparts. Anything from the assignment of work to intelligence provision can be handled by authorized liaisons. ',9600000,96000,450,1,1,NULL,0,NULL,NULL,NULL,49),(30951,314,'Verification Key','These keys are used by many corporations in the Caldari State to more easily and efficiently identify the bearer as a trusted employee, often granting them access to exclusive or classified information.',10,3,0,1,NULL,NULL,1,NULL,2037,NULL,0),(30952,314,'Dossier  Author Unknown','This dossier appears to be an excerpt of  internal employee profiling done by Nugoeihuvi Corporation.<br><br>Isha is something of an enigma, even to the few of us who know him. Apparently he\'s spent over 30 years here at NOH. Nobody has many details since he doesn\'t seem to keep any staff. I\'ve heard he makes use of pod pilots whenever he needs anything done but I\'ve no idea where the funds for that come from, perhaps the NOH directorate. <br><br>My House of Records contacts tell me he started work here in the Internal Security division of NOH. He now works in another department, unofficially titled as Advisory. It\'s anyone\'s guess when he moved across or what his work entails. In situations like these nobody asks questions.\r\n',10,0.1,0,1,NULL,NULL,1,NULL,2886,NULL,0),(30953,952,'Cargo Facility 7A-21','This industrial structure serves as a platform for warehouses and the sorting of cargo containers.',100000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,2403),(30954,314,'Hyasyoda Captain','Recovered from a battered security compound, this Hyasyoda captain met an untimely end. His demise suggests that perhaps Hyasyoda wasn\'t in total agreement with Serpentis about the arrangements made in Onirvura.',1,0.1,0,1,NULL,NULL,1,NULL,2855,NULL,0),(30955,314,'S.I Formula Sheet','Nothing in this file is decipherable, only the name. Serpentis could be using any one of a million different decryption methods. The good news is that a brute force attack could take as little as a few days, the bad news is that it could also take as long as a few decades. It all depends on how esoteric the cipher is, or if it\'s even a known, documented one. If it\'s a hybrid cipher, then it depends on how unique or distinctive both - assuming it\'s only two, of course - original parent ciphers were. A hybrid decryption analysis alone can take weeks, assuming that an original identifier for one single method is found.<br><br>It\'s probably best to just take this back to Isha.',1,0.1,0,1,NULL,NULL,1,NULL,2853,NULL,0),(30956,306,'Hyasyoda Security Compound','This minor defense facility reveals that heavy fighting took place here not long ago. Giant holes in the outer armor have still not been properly repaired, and heat signatures coming from inside the compound show that some fires within have not even been extinguished; only contained, as they slowly burn themselves out of oxygen.',100000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,2372),(30957,517,'Aursa Kunivuri\'s Tayra','A Tayra piloted by an agent.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,52),(30964,314,'CPF.HYA LogInt Facility POI-26: Data Cache','Found amongst the rubble of the Hyasyoda Logistics Center, this heavily encrypted data cache reveals very little. There is however, one dysfunctional and damaged data partition that can be easily read. Although much of the information is banal and uninteresting administrative jargon, there is one small report included that touches upon the Serpentis facility. Strangely enough, according to the official documentation here, the last time any Hyasyoda personnel visited the area was almost a year ago.',10,3,0,1,NULL,NULL,1,NULL,2886,NULL,0),(30965,952,'Communications Array','Communications Array',100000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,2505),(30966,526,'NOH Signal Operators','Trusted with secrets that at times, are shared only with the uppermost echelons of Nugoeihuvi, these signal operators are the very definition of insiders. For these men and women, there will be no other career in their life. The classified information they transmit on a daily basis ensures that much.<br><br>Although Caldari in positions like this tend to lead lives as happy as any other citizen, those lives can also quite easily come to an end if they ever decide the grass is greener elsewhere, or cave to an offer of ISK for information. Those who are identified as potential risks are frequently targeted by Nugoeihuvi\'s own Internal Security department, if not immediately removed. Nugoeihuvi\'s defense force is called Internal Security for a reason; they practically invented the concept, refining it to the level of ruthless self-scrutiny inherent in every corporate infrastructure today.',1,1,0,1,NULL,58624.0000,1,NULL,2536,NULL,0),(30967,314,'Questionable Cargo','This small container has been welded shut and then covered in a thin red film of hardened fullerene alloys. Gaining access would require a plethora of specialized scientific equipment. Why an entertainment company like Nugoeihuvi would be interested in such an item is anyone\'s guess.   ',10,3,0,1,NULL,NULL,1,NULL,1173,NULL,1173),(30968,283,'CPF Security Personnel','Corporate Police Force personnel pride themselves on the reputation they have for remaining calm in even the most pressing times. This crew hardly looks shaken, despite having been pulled from a facility that just moments after their departure, became a ball of flame and debris. For them, such things are likely a frequent occurrence.',85,3,0,1,NULL,NULL,1,NULL,2536,NULL,0),(30969,306,'CPF Habitation Module','The architectural design for the CreoDron Habitation Module started out as a contract deal from the Expert Housing Corporation to standardize the modular drifter homes normally used by miners and deep space explorers. When the project was cancelled due to insufficient funding, CreoDron utilized their design for the open market as high-orbit department buildings for commercial use. The marketing was a tremendous hit, making the Habitation Module a common sight across the universe. Common uses include anything from bars, casinos and brothels, to police stations and interrogation facilities.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,2515),(30970,875,'State Transport Freighter','The large navy forces of the Empires regularly use freighters to transport a wide variety of military items and personnel en masse.',1200000000,16250000,785000,1,1,NULL,0,NULL,NULL,NULL,2740),(30974,670,'Civilian Amarr Bestower','The Bestower has for decades been used by the Empire as a slave transport, shipping human labor between cultivated planets in Imperial space. As a proof to how reliable this class has been through the years, the Emperor himself has used an upgraded version of this very same class as transports for the Imperial Treasury. The Bestower has very thick armor and large cargo space.\r\n\r\nThis ship poses no immediate threat.',13500000,260000,5100,1,4,NULL,0,NULL,NULL,NULL,1064),(30975,474,'FedNav F.O.F Identifier Tag AC-106V:FNSBR','This device is granted to Federation Navy pilots in the Black Rise theatre of operations, where it helps avoid friendly-fire incidents against undercover Gallente pilots flying Caldari and Amarr ships. Once placed inside the cargo bay, it integrates itself through short-range wireless transponders into the host vessel\'s electronics systems, marking it as a friendly to Federation Navy ships.<br><br>Given the obvious exploitability of such a system, these ID tags represent just one part of the Federation Navy\'s sophisticated F.O.F tracking methods, and any hostile pilots attempting to rely on this alone to infiltrate Federation borders will find that the ruse only lasts so long. ',1,0.1,0,1,NULL,NULL,1,NULL,2885,NULL,0),(30976,306,'Federation Navy Shipyard','Large construction tasks can be undertaken at this shipyard.',100000,100000000,10000,1,2,NULL,0,NULL,NULL,NULL,2625),(30980,283,'Caldari Prisoners of War','All of these Caldari P.O.Ws show the signs of appalling treatment over an extended period of time. Even the most well-off are still suffering from starvation and serious malnourishment. The worst of them are barely alive after enduring sleep deprivation, physical abuse and other more excessive forms of torture. The women in particular, have not fared well under their Gallente jail masters, who have remorselessly taken whatever they desired from their captured prey.',100,0.5,0,1,NULL,NULL,1,NULL,2545,NULL,0),(30981,306,'Federation Detention Facility FNSBR-106V.1','The architectural design for the CreoDron Habitation Module started out as a contract deal from the Expert Housing Corporation to standardize the modular drifter homes normally used by miners and deep space explorers. When the project was cancelled due to insufficient funding, CreoDron utilized their design for the open market as high-orbit department buildings for commercial use. The marketing was a tremendous hit, making the Habitation Module a common sight across the universe. Common uses include anything from bars, casinos and brothels, to police stations and interrogation facilities.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,2520),(30982,306,'Encrypted Communications Array','Dull, tedious treasure lies within.',100000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,2505),(30987,773,'Small Trimark Armor Pump I','This ship modification is designed to increase a ship\'s total armor hit points at the expense of max velocity.\r\n\r\nThe drawbacks of fitting this rig may be reduced by training the <a href=showinfo:26253>Armor Rigging</a> skill.',200,5,0,1,NULL,NULL,1,1206,3194,NULL,0),(30988,787,'Small Trimark Armor Pump I Blueprint','',0,0.01,0,1,NULL,125000.0000,1,1203,76,NULL,0),(30991,226,'Pandemic Legion - Winners of Alliance Tournament VI','Constructed in honor of the capsuleers of Pandemic Legion who fought and defeated their opponents, in a series of gruelling and murderous fights, to claim their place as winners of the sixth round of the great Alliance Tournament. Pandemic Legion can truly claim to be among the true elite, the best of the best.',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,1266),(30992,517,'Sinas Egassuo\'s Chimera','The Chimera\'s design is based upon the Kairiola, a vessel holding tremendous historical significance for the Caldari. Initially a water freighter, the Kairiola was refitted in the days of the Gallente-Caldari war to act as a fighter carrier during the orbital bombardment of Caldari Prime. It was most famously flown by the legendary Admiral Yakia Tovil-Toba directly into Gallente Prime\'s atmosphere, where it fragmented and struck several key locations on the planet. This event, where the good Admiral gave his life, marked the culmination of a week\'s concentrated campaign of distraction which enabled the Caldari to evacuate their people from their besieged home planet. Where the Chimera roams, the Caldari remember.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,2931),(30993,773,'Capital Trimark Armor Pump I','This ship modification is designed to increase a ship\'s total armor hit points at the expense of max velocity.\r\n\r\nThe drawbacks of fitting this rig may be reduced by training the <a href=showinfo:26253>Armor Rigging</a> skill.',200,40,0,1,NULL,NULL,1,1730,3194,NULL,0),(30994,787,'Capital Trimark Armor Pump I Blueprint','',0,0.01,0,1,NULL,50000000.0000,1,1719,76,NULL,0),(30995,861,'Gallente Federation Civilians','A Gallente Federation shuttle.',1600000,5000,10,1,8,NULL,0,NULL,N