,0,1,0,1,NULL,NULL,1,619,2061,NULL,0),(32119,300,'Low-grade Jackal Delta','This cybernetic subprocessor has been modified by Minmatar scientists for use by their elite officers. \r\n\r\nPrimary Effect: +2 Bonus to Intelligence\r\n\r\nSecondary Effect: Adds an additional 1 point of ladar sensor strength to piloted ship',0,1,0,1,NULL,NULL,1,621,2062,NULL,0),(32120,300,'Low-grade Jackal Epsilon','This social adaptation chip has been modified by Minmatar scientists for use by their elite officers. \r\n\r\nPrimary Effect: +2 Bonus to Charisma\r\n\r\nSecondary Effect: Adds an additional 1 point of ladar sensor strength to piloted ship',0,1,0,1,NULL,NULL,1,622,2060,NULL,0),(32121,300,'Low-grade Jackal Gamma','This neural boost has been modified by Minmatar scientists for use by their elite officers. \r\n\r\nPrimary Effect: +2 Bonus to Willpower\r\n\r\nSecondary Effect: Adds an additional 1 point of ladar sensor strength to piloted ship',0,1,0,1,NULL,NULL,1,620,2054,NULL,0),(32122,300,'Low-grade Grail Omega','This implant does nothing in and of itself, but when used in conjunction with other low-grade Grail implants it will boost their effect.\r\n\r\n40% bonus to the strength of all low-grade Grail implant secondary effects.\r\n\r\nNot cumulative with high-tier Grail implant set.',0,1,0,1,NULL,NULL,1,1506,2224,NULL,0),(32123,300,'Low-grade Jackal Omega','This implant does nothing in and of itself, but when used in conjunction with other low-grade Jackal implants it will boost their effect. \r\n\r\n40% bonus to the strength of all low-grade Jackal implant secondary effects.\r\n\r\nNot cumulative with high-tier Jackal implant set.',0,1,0,1,NULL,NULL,1,1506,2224,NULL,0),(32124,300,'Low-grade Spur Omega','This implant does nothing in and of itself, but when used in conjunction with other low-grade Spur implants it will boost their effect. \r\n\r\n40% bonus to the strength of all low-grade Spur implant secondary effects.\r\n\r\nNot cumulative with high-tier Spur implant set.',0,1,0,1,NULL,NULL,1,1506,2224,NULL,0),(32125,300,'Low-grade Talon Omega','This implant does nothing in and of itself, but when used in conjunction with other low-grade Talon implants it will boost their effect. \r\n\r\n40% bonus to the strength of all low-grade Talon implant secondary effects.\r\n\r\nNot cumulative with high-tier Talon implant set.',0,1,0,1,NULL,NULL,1,1506,2224,NULL,0),(32126,526,'Homemade Sansha Beacon','This wonder of science was made with a Sansha command signal receiver, the head of Rahsa, and pounds of electrician\'s tape.',1,1,0,1,NULL,NULL,1,NULL,2553,NULL,0),(32127,952,'Linked Broadcast Array Hub','These arrays provide considerable added power output, allowing for an increased number of deployable structures in the starbase\'s field of operation.',100,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,2374),(32128,226,'Fortified Partially Constructed Megathron','This Megathron battleship is partially complete, with decks and inner-hull systems exposed to the cold of surrounding space.',100000,100000000,10000,1,4,NULL,0,NULL,NULL,NULL,2408),(32129,226,'Small Armory','This small armory has a thick layer of reinforced tritanium and a customized shield module for deflecting incoming fire.',100000,100000000,10000,1,1,NULL,0,NULL,NULL,NULL,2372),(32131,226,'Fortified Starbase Capital Shipyard','A large hangar structure with divisional compartments, for easy separation and storage of materials and modules.',100000,4000,200000,1,4,NULL,0,NULL,NULL,NULL,2601),(32132,226,'Fortified Starbase Hangar','A stand-alone deep-space construction designed to allow pilots to dock and refit their ships on the fly.',100000,1150,8850,1,4,NULL,0,NULL,NULL,NULL,2595),(32133,226,'Gallente Megathron Battleship','The Megathron has established itself as one of the most feared and respected battleships around. Since its first appearance almost two decades ago it has seen considerable service in the troublesome regions on the outskirts of the Federation, helping to expand and defend Gallentean influence there.',0,0,0,1,8,NULL,0,NULL,NULL,NULL,64),(32134,226,'Gallente Thorax Cruiser','The Thorax-class cruiser is the latest combat ship commissioned by the Federation. While the Thorax is a very effective ship at any range, typical of modern Gallente design philosophy it is most effective when working at extreme close range where its blasters and hordes of combat drones tear through even the toughest of enemies.',0,0,0,1,8,NULL,0,NULL,NULL,NULL,63),(32135,226,'Gallente Occator Industrial','Roden Shipyards Deep space transports are designed with the depths of lawless space in mind. Possessing defensive capabilities far in excess of standard industrial ships, they provide great protection for whatever cargo is being transported in their massive holds. They are, however, some of the slowest ships to be found floating through space.',0,0,0,1,8,NULL,0,NULL,NULL,NULL,2711),(32136,226,'Gallente Incursus Frigate','The Incursus is commonly found spearheading Gallentean military operations. Its speed and surprising strength make it excellent for skirmishing duties. Incursus-class ships move together in groups and can quickly and effectively gang up on ships many times their size and overwhelm them. In recent years the Incursus has increasingly found its way into the hands of pirates, who love its aggressive appearance.',0,0,0,1,8,NULL,0,NULL,NULL,NULL,61),(32137,226,'Gallente Obelisk Freighter','The Obelisk was designed by the Federation in response to the Caldari State\'s Charon freighter. Possessing similar characteristics but placing a greater emphasis on resilience, this massive juggernaut represents the latest, and arguably finest, step in Gallente transport technology.',11150000,190000,0,1,8,NULL,0,NULL,NULL,NULL,2739),(32138,517,'Roineron Aviviere\'s Epithal','An Epithal piloted by an agent.',0,0,0,1,8,NULL,0,NULL,NULL,NULL,326),(32139,517,'Mourmarie Mone\'s Helios','The preservation of the Federation, its interests abroad, its culture and peoples, and the respect and pride in its traditions, are priority one for any true Gallente citizen. We are here to ensure that our way of life is not threatened, our livelihood is extant, and the freedom that we so love is available to every citizen. For this purpose, the freedom to enforce security is at our disposal.<br><br>- Mourmarie Mone, Constellation Director, Black Eagles ',1700000,19700,305,1,8,NULL,0,NULL,NULL,NULL,1841),(32140,517,'Karde Romu \'s Armageddon','An Armageddon piloted by Karde Romu of the MIO.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,297),(32189,474,'Shanty Town Gate Clearance','This gate clearance allows the user to unlock a specific acceleration gate.',1,0.1,0,1,NULL,NULL,1,NULL,2040,NULL,0),(32190,705,'The Elder','The Elder of the shanty town colony, and the representative of this group.',10900000,109000,120,1,2,NULL,0,NULL,NULL,NULL,1885),(32192,631,'Underground Circus Ringmaster','The owner and operator of the Underground Circus.',11200000,112000,480,1,8,NULL,0,NULL,NULL,31,1815),(32193,283,'The Ringmaster','A strong, lithe Jin-Mei, scantily clad and badly bruised. She refuses to take the feminine name of her position, preferring the masculine Ringmaster more disconcerting to authorities. Though defeated, she smiles constantly, her eyes burning with something akin to desire and yet, at the same time, cold, bitter hatred.',50,1,0,1,NULL,NULL,1,NULL,2543,NULL,0),(32194,319,'Gallente Starbase Control Tower Tough','Gallente Control Towers are more pleasing to the eye than they are strong or powerful. They have above average electronic countermeasures, average CPU output, and decent power output compared to towers from the other races, but are quite lacking in sophisticated defenses.',100000,1150,8850,1,8,NULL,0,NULL,NULL,NULL,2594),(32195,517,'Riff Hebian\'s Armageddon','This battleship is commanded by Riff Hebian, head of Lord Miyan\'s security forces.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,297),(32196,517,'Krethar Mann\'s Crusader','A vacationing Amarr noble.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,1921),(32198,474,'Destablizer Datacore','The Pator 6 stole this technology from Matari scientists and use it to keep outsiders away from their hideouts.',1,0.1,0,1,NULL,NULL,1,NULL,3231,NULL,0),(32199,520,'Scope Interceptor','An investigative reporter for the Scope.',2650000,26500,140,1,8,NULL,0,NULL,NULL,NULL,1773),(32200,314,'Covert Recording Device','When planted in the mainframe of any structure, this device will record all communications, no matter how encrypted they may be.',1,1,0,1,NULL,58624.0000,1,NULL,2225,NULL,0),(32201,314,'Archives Passkey','These electronic devices are commonly used as long-range digital passkeys, allowing access to secure facilities directly from space.',1,0.1,0,1,NULL,NULL,1,NULL,2885,NULL,0),(32202,314,'Hauteker Memoirs','Painstakingly written by hand in an antiquated Nefantar script, these memoirs outline the short-lived fortunes of an Ammatar clan known as the Hauteker  long since lost to time. The memoir\'s focus seems to be on the preservation of family tradition; the highly detailed passages document everything from the way the Hauteker family dressed to where they were all buried.',1,0.1,0,1,NULL,NULL,1,NULL,33,NULL,0),(32204,314,'Wildfire Khumaak','This fragile Khumaak appears to be over a century old, and could perhaps date back to the Starkmanir rebellion itself. <br><br>There are unique markings along the side; tiny holes that appear to have fastened the scepter to a wall at one point. In the centre of the flared orb there is another unique distinguishing mark, the visage of an Amarrian man draped in the robes of a Saint. His name, Torus Arzad, is not mentioned in any contemporary history, Amarrian or otherwise. Below his face a single line of text reads:<br><br>Understand His mercy, and you will know enough.\r\n',2,0.3,0,1,NULL,10000.0000,1,NULL,2206,NULL,0),(32205,306,'Central Burial Tomb','This shrine entombs someone of significant standing within the Hauteker family, most likely one of their last leaders before the bloodline vanished into obscurity.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,1266),(32206,952,'Defiants Storage Facility','Storage warehouses like this are a common sight in space, and are employed by all kinds of people for all kinds of reasons. From storing wheat for Empire colonies to hiding vast stockpiles of drugs for resale, storage facilities serve a number of roles and as a result they are one of the most frequently deployed structures.',100000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,2706),(32207,324,'Freki','Developed along with the first wave of Minmatar assault frigates but later abandoned due to cost, the Freki is known for its extremely well designed warp core that enables it to arrive first on the scene to snare and eliminate its target.\r\n\r\nIt is rarely seen on the battlefield, as only a limited number have ever gone into production. It is usually given to pilots as a reward for their excellence in combat.',1309000,27289,165,1,2,NULL,1,1623,NULL,20078,3799),(32208,105,'Freki Blueprint','',0,0.01,0,1,NULL,1500000.0000,0,NULL,NULL,NULL,1066),(32209,358,'Mimir','A highly experimental prototype created by Minmatar scientists, intended to combine the qualities of their front line heavy assault cruisers. Heavily plated and sporting additional thrusters, this ship is not to be taken lightly.\r\n\r\nRarely seen these days, the ship is typically given out only to select pilots as a reward for their excellence in combat.\r\n\r\n',11650000,96000,450,1,2,NULL,1,1621,NULL,20076,3800),(32210,106,'Mimir Blueprint','',0,0.01,0,1,NULL,68750000.0000,0,NULL,NULL,NULL,302),(32211,306,'Archives','Archival facilities can sometimes be found dotted around the spacelanes of New Eden. Although it is rare for them to be established out here, it is not unknown for various companies and individuals to store valuable documents in such places. Some are motivated by logistical factors; it\'s always easier to move things from system to system when they\'re already in space. Others simply favor the privacy and security that endless kilometers of darkness and vacuum offers. ',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,1176),(32216,226,'Fortified Amarr Cathedral','This impressive structure operates as a place for religious practice and the throne of a high ranking member within the clergy.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,2400),(32217,306,'Damaged Radio Telescope','Communications Array',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,2505),(32218,314,'Encrypted Data Fragment','This data node guards its secrets with a powerful encryption cipher. The unique design of the encryption is clearly proprietary and not something used elsewhere. The security software driving the protection represents a strange mixture of Gallente and Caldari designs. ',1,0.1,0,1,NULL,NULL,1,NULL,2037,NULL,0),(32219,319,'Pator 6 HQ','A decrepit wreck of a structure, the HQ for the Pator 6 is full of junk, debris, and rubble. Children\'s clothes are strewn throughout the headquarters. This gang may be behind more kidnappings and human trafficking cases than at first glance.',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,3792),(32220,314,'Ralie Ardanne\'s Belongings','Though only a teenager, Ralie Ardanne has quite a few endorsement deals with major clothing labels. This jacket is part of his signature look. Based on your file on him, you know that Ralie goes nowhere without his jacket. The bloodstains and other marks on the fabric do not bode well, but at least this will provide evidence that the authorities can track.',1,1,0,1,NULL,NULL,1,NULL,2991,NULL,0),(32221,319,'Scope Station','One of Scope\'s satellite stations in the area.',0,0,0,1,8,NULL,0,NULL,NULL,22,1256),(32222,520,'Mourmarie Mone\'s Covert Ops Frigate','Mourmarie Mone, Constellation Director, Black Eagles.',2650000,26500,140,1,8,NULL,0,NULL,NULL,NULL,1841),(32223,314,'Kidnapping Evidence','Veine Coructie has collected the evidence you collected from the Pator 6, as well as some of the data found from the bug you planted. With this in hand, they\'re ready to smoke the kid out by causing a big media stir. There\'s no hiding when an entire population is out to get you. Sure, you should probably take this to the FIO, but who knows how effective this will be?',0.75,0.1,0,1,NULL,NULL,1,NULL,3233,NULL,0),(32224,952,'Conference Center ','The architectural design for the CreoDron Habitation Module started out as a contract deal from the Expert Housing Corporation to standardize the modular drifter homes normally used by miners and deep space explorers. When the project was cancelled due to insufficient funding, CreoDron utilized their design for the open market as high-orbit department buildings for commercial use. The marketing was a tremendous hit, making the Habitation Module a common sight across the universe. Common uses include anything from bars, casinos and brothels, to police stations and interrogation facilities.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,2515),(32225,314,'Encoded Message','This message is encoded in a familiar hybrid cipher. Only those who are already in the know about the arrangements in Black Rise will be able to make sense of it.',1,0.1,0,1,NULL,NULL,1,NULL,1192,NULL,0),(32226,1003,'Territorial Claim Unit','This unit contains a large fluid router array. By establishing an alternate data route to CONCORD networks, it grants de-facto administrative control of the system it\'s in to its owners. The Territorial Claim Unit declares to all of New Eden that the owning alliance intends to enforce their will upon this star system. Whether other alliances respect and defer to that claim is another question entirely.\n\nTo declare your alliance\'s Sovereignty over an unclaimed system, deploy the Territorial Claim Unit close to a planet and activate an Entosis Link on the TCU until your alliance has full control.\n\nYou must be a member of a valid Capsuleer alliance to deploy and/or take control of a TCU. A maximum of one TCU may be deployed in any star system. TCUs cannot be deployed in systems under non-Capsuleer Sovereignty. TCUs cannot be deployed in Wormhole space.',1000000,5000,0,1,NULL,100000000.0000,1,1273,NULL,34,3822),(32228,283,'Vira Mikano','Although looking slightly shaken, this Deteis man appears calm and resigned to his fate. Said to be one of Ishukone Watch\'s best cryptographers, Mikano represents everything that is admired about the Watch; efficiency, loyalty and honor. There would be severe repercussions for anyone found responsible for his disappearance.',85,3,0,1,NULL,NULL,1,NULL,2538,NULL,0),(32229,314,'Singed Datapad','This barely-functioning piece of personal electronics turns out to contain ledger upon ledger of financial statements, high-level meeting transcripts and company rosters from several public and private Minmatar organizations. A large portion of the data is encoded in some sort of advanced cipher, leaving it completely unintelligible.',1,0.1,0,1,NULL,NULL,1,NULL,1435,NULL,0),(32230,875,'Republic Freighter Vessels','The large navy forces of the Empires regularly use freighters to transport a wide variety of military items and personnel en masse.  Such vulnerable ships are usually heavily guarded as they traverse the space lanes.',1025000000,15500000,720000,1,2,NULL,0,NULL,NULL,NULL,2737),(32233,306,'Tili\'s Brothel','The architectural design for the CreoDron Habitation Module started out as a contract deal from the Expert Housing Corporation to standardize the modular drifter homes normally used by miners and deep space explorers. When the project was cancelled due to insufficient funding, CreoDron utilized their design for the open market as high-orbit department buildings for commercial use. The marketing was a tremendous hit, making the Habitation Module a common sight across the universe. Common uses include anything from bars, casinos and brothels, to police stations and interrogation facilities.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,2515),(32234,314,'Encrypted Transmission','This is an encrypted transmission from the RSS agent\'s Ammatar spy. It is a wholly incomprehensible string of 1s and 0s.',1,0.1,0,1,NULL,NULL,1,NULL,2037,NULL,0),(32235,314,'Tattered Doll','Formerly belonging to a young child, this doll has been through rough times. Tattered and worn, the synthetic material is stained with odd markings, presumably blood or tears from the doll\'s former owner.',10,3,0,1,NULL,NULL,1,NULL,2992,NULL,0),(32237,314,'Octomet Dog Tags','These dog tags are crudely constructed and chipped at the edges. The words are scrawled across the metal in a rough fashion, which feel hasty in their inscription. The name on the dog tag appears to be Caldari, though it is difficult to tell. A serial number also appears, as well as the acronym D-IDS/IS.',10,3,0,1,NULL,NULL,1,NULL,2040,NULL,0),(32238,319,'Biodome','This biodome is used for cultivation of plants and animals alike.',100000,100000000,10000,1,8,NULL,0,NULL,NULL,19,2782),(32239,319,'Gallentean Deadspace Mansion','Though not quite large enough to be a station, this ornate, lavish establishment contains furnishings for any multi-purpose deadspace location. From cutting edge laboratories, to private studios and entertainment facilities, the services available in this structure are applicable for professionals and elite socialites alike.',100000,100000000,10000,1,8,NULL,0,NULL,NULL,14,1712),(32240,306,'Data Bank','If you have the right equipment you might be able to hack into the databank and get some valuable information.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,2431),(32241,314,'Drive Cluster EDF-285','This is a cluster of drives, each of which contains several exabytes worth of encoded data. Somewhere in here is vital information on the Wildfire Khumaak.',1,0.1,0,1,NULL,NULL,1,NULL,1365,NULL,0),(32242,474,'Carry On Token','This item appears to be either a medal or a token of some kind. Either way, it\'s shiny.',1,0.1,0,1,NULL,NULL,0,NULL,1655,NULL,0),(32243,517,'Cosmos Rapier','A Rapier piloted by an agent.',0,0,0,1,2,NULL,0,NULL,NULL,NULL,1777),(32244,517,'Nilf Abruskur\'s Rapier','A Rapier piloted by an agent.',0,0,0,1,2,NULL,0,NULL,NULL,NULL,1777),(32245,413,'Hyasyoda Research Laboratory','Portable laboratory facilities, anchorable within control tower fields. This structure has Material Efficiency research and Time Efficiency research activities.\r\n\r\nActivity bonuses:\r\n35% reduction in research ME required time\r\n35% reduction in research TE required time',100000000,3000,25000,1,NULL,100000000.0000,1,933,NULL,NULL,2373),(32246,479,'RSS Core Scanner Probe','A scanner probe used for scanning down Cosmic Signatures in space.\r\n\r\nCan be launched from <a href=showinfo:17938>Core Probe Launchers</a> and <a href=showinfo:18639>Expanded Probe Launchers</a>.',1,0.1,0,1,NULL,23442.0000,1,1199,1723,NULL,3767),(32248,303,'Nugoehuvi Synth Blue Pill Booster','This booster relaxes a pilot\'s ability to control certain shield functions, among other things. It creates a temporary feeling of euphoria that counteracts the unpleasantness inherent in activating shield boosters, and permits the pilot to force the boosters to better performance without suffering undue pain.',1,1,0,1,NULL,8192.0000,1,977,3215,NULL,0),(32250,1005,'Sovereignty Blockade Unit','This structure is a relic, designed to interact with obsolete Sovereignty technology. When deployed into space it will be unable to make the necessary network connections and will self-destruct automatically. Major corporations throughout New Eden are engaging in buyback programs to recycle these structures safely.',1000000,2500,0,1,NULL,150000000.0000,0,NULL,NULL,33,3826),(32252,314,'Amphere 9','A synthetic drug long banned by the Empires, Amphere 9 can still be found in the border regions and outlawed territories of New Eden. The drug contains bits of nitrazepam, amphetamine, sodium pentothal, and synthetically rendered dopamine, plus a number of other potentially lethal substances. <br><br>\r\n\r\nThere is still a thriving black market for the pill, which many consider to be a dirtier version of Vitoc, keeping workers sedate and stable yet remarkably open to suggestion by others. The drug is especially effective on children under the age of twelve with no serious physical side effects, though no conclusive medical study has been conducted to support this claim.',10,1,0,1,NULL,NULL,1,NULL,1206,NULL,0),(32253,314,'Counterfeit Minmatar Faction Ammo','Crafted in illicit child labor factories, this counterfeit ammo is designed to mirror the ammo utilized in the Minmatar Navy in look, feel, and power. Because of its black market creation, though, the ammo is highly unstable, and not suitable for use in any ship. Black marketers make a modest fortune selling this ammo to unsuspecting customers with no eye for high-powered munitions.',10,2.5,0,1,NULL,NULL,0,NULL,1294,NULL,1294),(32254,738,'Imperial Navy Modified \'Noble\' Implant','A neural Interface upgrade that boosts the pilot\'s skill at maintaining their ship\'s midlevel defenses and analyzing and repairing starship damage.\r\n\r\n3% bonus to armor hit points.\r\n3% bonus to repair system repair amount.\r\n\r\nNote: Has no effect on capital sized modules.',0,1,0,1,NULL,200000.0000,1,1518,2224,NULL,0),(32255,749,'Sansha Modified \'Gnome\' Implant','Improved skill at regulating shield capacity and recharge rate.\r\n\r\n3% bonus to shield capacity.\r\n3% bonus to shield recharge rate.',0,1,0,1,NULL,200000.0000,1,1481,2224,NULL,0),(32256,306,'RSS Radio Telescope','Communications Array',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,2505),(32257,314,'Report R:081-9560','This data fragment was pulled from an RSS Radio Telescope. It appears to be just one part of a larger intelligence dossier. <br><br>The Consulate is able to, of course, but I\'m confident that the current situation won\'t escalate. Even still, we need to keep pushing for the location of the [unidentified encryption  string undecipherable]  the Angels have smelled Jovian involvement and are now throwing all kinds of ISK around to catch up to us. They will, eventually. Don\'t doubt it. I almost wish Boufin sold us out to them in the end, they\'d realize there is nothing of value to them there and screw off. But then I guess anything we value, they\'ll want to lord over us too. I\'ve noticed a few people of theirs are assigned to me too. I\'ll be taking slightly longer to get to our meetings as a result; I don\'t want to be leading them anywhere we don\'t want. <br><br>She asked to meet Boufin again today by the way, and again I had to explain the risks and make her promise to lie low. I\'m not completely trusting that she will let me handle things. She needs to keep up her public appearances in court, not go off meeting Gallentean historians in secret. Her career would be over in a second if we got made, and I\'d have serious problems of my own. <br><br>She\'s growing increasingly frustrated though, so we may have to look into some kind of arrangement. Surely we can set up a secure FTL line for them both? I know how to do it myself; I just need your clearance to proceed.',1,0.1,0,1,NULL,NULL,1,NULL,2853,NULL,0),(32258,314,'Report R:081-9568 ','This data fragment was pulled from an RSS Radio Telescope. It appears to be just one part of a larger communication. The intended recipient is unknown, but is presumably someone within the upper echelons of the Republic Security Services. <br><br>you dare try and cut me out of the loop again. If you wanted to run operations without me knowing or caring then you should\'ve brought in someone with half my skill. <br><br>I\'ve given six years of my life to this. Try that shit again and I\'ll be out of here. The last thing you\'ll see before the sip of Pator Whiskey you keep in the 2nd drawer kills you will be me waving a Wildfire Khumaak on The Scope news.',1,0.1,0,1,NULL,NULL,1,NULL,2853,NULL,0),(32259,314,'Operation Stillwater: Synopsis','This small data storage unit contains a swathe of operational information, offering insights into an ongoing RSS investigation known as Stillwater. <br><br>Although the report logs number in the hundreds of pages, a few key details become immediately apparent. The name of a highly-ranked Ammatar Consulate official recurs frequently, and references to her as sister reveal a secret loyalty to the Republic. Despite the prominence of this Ammatar defector in the reports, her name and any other identifying details have been omitted. <br><br>Page after page of the synopsis is filled with meticulous documentation of the agent\'s daily life; every meeting they had, every stakeout they sat through, and every other lead they chased up  it is all here. The problem isn\'t the lack of detail, more the overwhelming amount of it. It will take some time to make sense of it all.\r\n',1,0.1,0,1,NULL,NULL,1,NULL,2853,NULL,0),(32260,330,'Syndicate Cloaking Device','This prototype of an advanced cloaking mechanism was one of the last major technological breakthroughs to come out of Crielere Labs. Although it does work it is not really a finished product and has some serious drawbacks, most notably the fact that the module creates high sensor disruption while fitted and can not operate unless at minimum velocity.\r\n\r\nNote: Fitting two or more cloaking devices to a ship negates their use, as unsynchronized light deflection causes interference.',0,100,0,1,NULL,802680.0000,1,675,2106,NULL,0),(32262,647,'Black Eagle Drone Link Augmentor','Increases drone control range.',200,25,0,1,NULL,213360.0000,1,938,2989,NULL,0),(32264,319,'Warp Core Hotel','Formerly an old  armory, this building has been refurbished to accommodate weary travelers for a peaceful nights rest, or at least a temporary reprieve while on the jump between systems. The accommodations are efficient, designed to maintain a steady stream of customers. The rooms are sparse, the staff light, and the entire structure is rather unkempt. An odd smell permeates the walls, and most everything operates by ISK-slots. Older men and women loom around the lobby. Their attire would be provocative if they weren\'t so haggard and worn, though they always seem ready for a good time.<br><BR>\r\n\r\nWarp Core Hotel: Hourly rates only',100000,100000000,10000,1,1,NULL,0,NULL,NULL,NULL,2372),(32265,314,'Spintric Coin','A curious feature of The Spintrix is their admission system. The men and women working at this establishment do not accept ISK or any other sort of planetary currency. Rather, these workers accept only Spintrix coins, specially designed and highly desirable copper coins purchased through the agents of the Spintrix\'s owners.',10,1,0,1,NULL,NULL,1,NULL,2994,NULL,0),(32266,314,'Spintrixiate Rewards Coin','Special customers to the Spintrix are often rewarded with this unique coin, dubbed the Spintrixiate.  Little is known about the benefits of this rewards token, though rumors among former clients circulate that the coin allows access to the mysterious Room B.',10,1,0,1,NULL,NULL,0,NULL,2563,NULL,0),(32267,314,'Ishukone Operational Reports','Bluechip devices like these serve a similar role to the \"black boxes\" used aboard planetary aircraft. They are capable of storing vast amounts of information, and protecting it in a secure shell that can withstand immense destructive forces. Due to their resilience, they are also the favored data storage unit of military companies who need vital operational data to be safeguarded from attack. <br><br>\r\n\r\nThis particular bluechip has been modified to protect the contents in even more ways. A distinctively unique hybrid cipher has reduced the contents of each report to a series of 1\'s and 0\'s. \r\n',1,0.1,0,1,NULL,NULL,1,NULL,2885,NULL,0),(32268,667,'Harkan\'s Behemoth','Lord Harkan\'s ship is an impressive example of Amarr engineering. It appears after his retirement his ship was refit with cobalt-plated armor. It is unclear if this was a personal decision or the sign of an even darker alliance.',20500000,1100000,525,1,4,NULL,0,NULL,NULL,NULL,2508),(32269,668,'Lord Miyan','Lord Miyan\'s cruiser is packed with the latest Amarr technology. Still not advanced enough to stop the guns of a capsuleer.',11800000,118000,235,1,4,NULL,0,NULL,NULL,NULL,1864),(32270,283,'Artificial Miyan','This amalgamation of Amarr and Sansha technology is the spitting image of Lord Miyan. Once activated it could fool anyone into believe it was the real, living Holder.',90,2,0,1,NULL,NULL,1,NULL,2538,NULL,0),(32271,952,'Business Associate','Business Associate.',13500000,27500,2700,1,4,NULL,0,NULL,NULL,NULL,1064),(32272,314,'Primordial Biomass','This vat of biomass is slightly soupier than most.',1,1,0,1,NULL,NULL,0,NULL,2302,NULL,0),(32273,952,'Safe House Ruins','This structure has seen better days.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,3776),(32275,226,'Fortified Amarr Chapel','This decorated structure serves as a place for religious practice.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,2404),(32276,306,'Office Facility','These small compounds can house hundreds of office workers, and are typically used as a cost-efficient temporary solution for large corporations moving their workforce between stations.  ',100000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,2515),(32277,314,'Deteis Family','A normal, if somewhat familiar-looking Deteis family. ',1,0.1,0,1,NULL,NULL,1,NULL,1204,NULL,0),(32278,517,'Hiva Shesha\'s Shuttle','The sands of time is a complex metaphor, and as historians, we must understand its meaning. We are not here to play in a sandbox and find all the hidden rocks. History is not the unraveling of truth or unearthing forgotten knowledge. Rather, \'the sands of time\' are mixed with our rational minds to form glass. We are opticians, further carving that glass into lenses, which are layered together. Sometimes the view becomes clearer; other times, opaque. We cannot change the sands of time: We can only sharpen our lenses.<Br><Br>-Hiva Sheesha, <i>A History of the Matari People</i>',0,0,0,1,2,NULL,0,NULL,NULL,NULL,2045),(32279,306,'Chapel of the Obsidian ','Chapel of the Obsidian',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,2404),(32280,314,'Blood Obsidian Orb','The Church of the Obsidian has kept this relic for nearly four hundred years, though its original meaning was never truly discovered. The orb is carved from blood obsidian, the same material found in the head of the Wildfire Khumaak. The orb\'s surface is completely smooth, though it is lighter than it appears. ',1,0.1,0,1,NULL,NULL,1,NULL,2103,NULL,0),(32281,306,'Secure Communications Tower','This huge communications tower contains fragile but advanced sensory equipment.',100000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,2505),(32282,1207,'Ammatar Relics','This massive hulk of debris seems to have once been a part of the outer hull of a battleship or station.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,3704),(32283,314,'Engraved Blood Obsidian tablet','A small tablet, made entirely of blood obsidian, engraved with writing. The words on the tablet are not entirely clear, and the dialect is familiar, though unreadable. ',1,0.1,0,1,NULL,NULL,1,NULL,2103,NULL,0),(32284,314,'St. Arzad','A tattered document, presumably a part of a larger manuscript. The text is written neatly, though much of it is faded. An excerpt from this piece, titled Chapter 1  St. Arzad reads as follows:<br><br>\r\nAnd so it was that Arzad Hamri, son of Ezzara Hamri, grandson of Yuzier Hamri, ascended to the title of Holder of the most holy grounds on Starkman Prime. Though only a young man, Arzad held the wisdom of the ages, granted to him by the celestial Maker, and carried with him the burden of creation. <br><br>\r\nHis first act as Holder was to grant a day of celebration to all his slaves, calling that day holy by the Amarr religion. The slaves, members of the Starkmanir tribe, referred to that day as the Hand of Solace or Khu-arzad. Unlike his father before him, Arzad was instantly loved by his slaves, and his benevolence sowed the seeds of righteous love between Holder and slave.\r\n',1,0.1,0,1,NULL,NULL,1,NULL,2886,NULL,0),(32285,314,'The Benevolent','A tattered document, presumably a part of a larger manuscript. The text is written neatly, though much of it is faded. An excerpt from this piece, titled Chapter 6  The Benevolent reads as follows:<br><br>\r\nThe fields and hills of Starkman Prime are harsh and demanding, especially for those working indentured servants tied directly to the land by the holy bonds of slavery. Arzad Hamri understood their plight and pitied them. As a boy, he would often work alongside the Starkmanir in the fields, immersing himself with the tribe to better understand their customs and traditions, much to the chagrin of his father and elders. <br><br>\r\nAs a Holder, Arzad offered many forms of restitution and bereavement for the Starkmanir during their often long and difficult days. Regular rest periods were common during his rule, as well as days of parlay and rest, including high holy days and other Amarr religious festivals, deeming these occasions to be too holy. The Starkmanir loved him for these decisions, often working extra hours when necessary because they respected Arzad and wished for him to be pleased with their efforts.\r\n',1,0.1,0,1,NULL,NULL,1,NULL,2886,NULL,0),(32286,314,'The Education of the Starkmanir','A tattered document, presumably a part of a larger manuscript. The text is written neatly, though much of it is faded. An excerpt from this piece, titled Chapter 12  The Education of the Starkmanir reads as follows:<br><br>\r\nBy the end of his tenth year as Holder on Starkman Prime, Arzad had finished the educational infrastructure for the Starkmanir with the establishment of the final slave college on his continent. The focus of these education centers, aimed at young members of the Starkmanir tribes, was in assimilating the slaves into the greater Amarr society. The focus was primarily in basic business matters, science and technology, and all aspects of the Amarr religion. Attendance at this school was not entirely elective, and slaves were given time to study, though they would often have to make up for lost time in the fields. Despite this, many Starkmanir entered into the slave colleges in order to better their station in life, especially with respect to the high, holy Amarr religion.<br><Br>\r\nThe Starkmanir also educated their beloved Holder in kind, as well as other members of the Hamri family. The tradeoff in education was often mutual between the tribal leaders and Arzad. When the slave colleges began teaching business matters, the Holder learned ancient Starkmanir woodworking; astronomy education led to the Starkmanir martial arts; and the teaching of the Amarr religion initiated Arzad\'s own edification of the Starkmanir\'s tribal spiritualism.\r\n',1,0.1,0,1,NULL,NULL,1,NULL,2886,NULL,0),(32287,314,'Hand of Arzad','A tattered document, presumably a part of a larger manuscript. The text is written neatly, though much of it is faded. An excerpt from this piece, titled Chapter 20  Hand of Arzad reads as follows:<br><br>\r\nThe Hand of Arzad grew to become the most popular festival on Starkman Prime, so beloved was this day of rest granted by Arzad Hamri. On this day, Hamri presided acted as pastor of religious services, in which most of the Starkmanir attended. His sermons from these festivals were collected and distributed among the tribe, often used by the elders to educate the young people of the importance of benevolence and good grace to people of all stations. <br><br>\r\nThe theme of Arzad\'s sermons was almost always of the inherent dignity of the Starkmanir, their precious qualities, and the hope of salvation through servitude. This message did not fall on deaf ears, and many ambitious, young Starkmanir took his words as inspiration for independence and rebellion against the greater Amarr Empire, though Arzad was always able to quell the burgeoning pride and self-esteem of the slaves. Salvation comes through servitude, the grace of your masters, the dignity of your being,\' was Arzad\'s common response, his refrain found throughout his sermons. \r\n',1,0.1,0,1,NULL,NULL,1,NULL,2886,NULL,0),(32288,314,'The Fire in Our Hearts','A tattered document, presumably a part of a larger manuscript. The text is written neatly, though much of it is faded. An excerpt from this piece, titled Chapter 37  The Fire in Our Hearts reads as follows:<br><br>\r\nLord Arkon Ardishapur, though a longtime friend of Arzad, oversaw the popular Holder\'s execution for treason and blasphemy. Arzad had requisitioned an Amarr symbol of authority, a scepter,  as a symbol for lowly slaves. Arzad\'s granted the scepter to his slaves as a symbol for enlightenment and salvation. Ardishapur ordered that all copies of this scepter  dubbed Wildfire scepters for its blood obsidian orb, a rock native to Starkman Prime  be destroyed. The Starkmanir were angry at his execution. Arzad\'s book of sermons inspired the troubled tribe. <br><br>\r\nThree months after his death, Arzad appeared to Drupar Maak while the slave was alone in the fields. The Starkmanir youth was afraid at first, though once he saw the shimmering eyes of his former Holder, he was at peace. Arzad handed a Wildfire scepter to Maak, telling him, The fire in our hearts burns for salvation, redemption, and grace. May the Word of God grant you the courage to save yourself and your people.\' With those words, Arzad disappeared, but the scepter was still with Maak. Years later, he would wield a similar item and avenge the death of his beloved Holder on the day of Khu-arzad. After that day, the scepter would be forever known as Khumaak.\r\n',1,0.1,0,1,NULL,NULL,1,NULL,2886,NULL,0),(32289,314,'Holoreel: Wanted for Love','A low-quality holoreel titled Wanted for Love. The description on the back of the shoddy packaging reads: <br><br>\r\n\r\nA Gallente women, recently divorced and fired from her high-paying job at Combined Harvest, is framed for murdering her ex-husband. On the run from CONCORD, she delves deep into the heart of New Eden\'s underworld, where she discovers what she\'s truly made of. Hot on her trails is her ex-lover, a deputy officer in the Directive Enforcement Department. Inspired by love, he goes undercover in search of his one and only soulmate, who is truly wanted for love. This sultry, uncensored journey of self-discovery and the limits of romance stimulates mind, body, and soul. Starring Elois Ottin in her most scintillating performance yet.',10,1,0,1,NULL,NULL,1,NULL,1177,NULL,0),(32290,314,'Obsidian Datacore','Found inside the Blood Obsidian Orb, this datacore is supposed to reveal the location of the lost <i>Book of St. Arzad</i>.',1,0.1,0,1,NULL,NULL,1,NULL,2885,NULL,0),(32291,952,'Chapel Container','This decorated structure serves as a place for religious practice.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,2404),(32292,283,'Ralie Ardanne','Battered, bruised, worn, but ultimately alive. Ralie sits there, staring straight in front of him, his eyes glazed over. The kid\'s alive, but who knows how long he will be recovering from these scars.',60,1,0,1,NULL,NULL,1,NULL,2536,NULL,0),(32293,706,'Rosulf Fririk','This variant of the frontline battleship of the Minmatar Republic has been heavily modified with only one purpose in mind: Destruction.  It has been supplemented with decks of top-of the-line-fire control systems, and its entire power distribution structure has been redesigned to provide as much power as possible to its weapons, resulting in a truly fearsome battleship.',19000000,850000,550,1,2,NULL,0,NULL,NULL,NULL,2642),(32294,314,'Book of St. Arzad','This book is in tatters, and some of its page are worn or missing, but much of its contents is still readable. The book describes the life of Arzad Hamri, an Amarr Holder on Starkman Prime. It is supposedly a relic from the Starkmanir Rebellion.',1,0.1,0,1,NULL,NULL,1,NULL,33,NULL,0),(32296,674,'Ishukone Watch Commander','In every Ishukone Watch base there is a single Commander who oversees operations. The men and women selected for this honored duty represent the most capable military minds outside of the Caldari Navy. The service records of these Commanders typically show a long and distinguished career fighting against the many threats facing their parent Corporation, and often the Caldari people as a whole. It is not uncommon for people in such positions to rise into minor celebrity status, as their deeds grant them a glimpse of the almost mythological status held by the State\'s great military names.',1080000,22000000,235,1,1,NULL,0,NULL,NULL,30,20338),(32297,674,'Nugoeihuvi Caretaker','Those who watch over Nugoeihuvi\'s secret storage facilities are entrusted with secrets that run deep inside the shadowed histories of the NOH staff. Valued for their loyalty, discretion and endless hunger for ISK, these men and women serve Nugoeihuvi\'s darkest interests without question.',1080000,22000000,235,1,1,NULL,0,NULL,NULL,30,50),(32298,594,'Karkoti Rend','A rogue RSS agent, working for the Cartel.',19000000,19000000,120,1,2,NULL,0,NULL,NULL,31,2642),(32299,952,'Senator Pillius Ardanne','Senator\'s Viator.',13500000,27500,2700,1,4,NULL,0,NULL,NULL,NULL,2712),(32300,1003,'QA Territorial Claim Unit','This structure does not exist.',65000,1,10,1,NULL,100000000.0000,0,NULL,NULL,NULL,3822),(32302,1005,'QA Sovereignty Blockade Unit','This structure does not exist.',32000,1,10,1,NULL,250000000.0000,0,NULL,NULL,NULL,3826),(32304,517,'Harkan\'s Apocalypse','An Apocalypse piloted by an agent.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,296),(32305,27,'Armageddon Navy Issue','An improved version of the feared Armageddon-class battleship, this vessel is probably one of the deadliest war machines ever built by the hand of man. Commanding one is among the greatest honors one can attain in the Amarr Empire, and suffering the fury of its turret batteries is surely the fastest way to reunite with the void.',105200000,486000,700,1,4,66250000.0000,1,1379,NULL,20061,3814),(32306,107,'Armageddon Navy Issue Blueprint','',0,0.01,0,1,NULL,662500000.0000,1,NULL,NULL,NULL,297),(32307,27,'Dominix Navy Issue','The Dominix Navy Issue\'s past is prominently interwoven with history, as it is known to have directly participated in the blockade and bombardment of Caldari Prime along with the Dracofeu orbital-class bomber two centuries ago. Engineered for capsule compliance, and refitted to serve more traditional combat roles, the Dominix Navy Issue today remains an extremely effective vessel and an invaluable asset in close- to mid-range battle situations.',97100000,454500,675,1,8,62500000.0000,1,1379,NULL,20072,2138),(32308,107,'Dominix Navy Issue Blueprint','',0,0.01,0,1,NULL,625000000.0000,1,NULL,NULL,NULL,318),(32309,27,'Scorpion Navy Issue','This ship\'s design represents a radical turnaround in Caldari philosophy, particularly when compared to that of its regular Scorpion-class counterpart. Abandoning the concept of an electronic warfare platform, this vessel\'s creators instead set their sights on direct combat, with superior shielding and offensive capabilities giving this monster the undeniable upper hand in a vast range of tactical situations.',103600000,468000,650,1,1,71250000.0000,1,1379,NULL,20068,3815),(32310,107,'Scorpion Navy Issue Blueprint','',0,0.01,0,1,NULL,712500000.0000,1,NULL,NULL,NULL,50),(32311,27,'Typhoon Fleet Issue','Possibly the most versatile vessel in New Eden, the Typhoon Fleet Issue is a true wonder in design adaptability. Boasting improved fittings, speed and weapon hardpoints over its standard counterpart, this ship is widely known as an invaluable wild card in any small-scale engagement.',102600000,414000,600,1,2,75000000.0000,1,1379,NULL,20076,2160),(32312,107,'Typhoon Fleet Issue Blueprint','',0,0.01,0,1,NULL,750000000.0000,1,NULL,NULL,NULL,301),(32313,1012,'QA Infrastructure Hub','This structure does not exist.',100,1,110,1,NULL,40.0000,0,NULL,NULL,NULL,3827),(32325,1653,'Cyclops I','<b>Type:</b> Heavy Fighter\r\n<b>Role:</b> Heavy Attack\r\n<b>Description:</b> The Cyclops is purpose designed for anti-capital and anti-structure combat.\r\n\r\n<b>Blaster Cannon</b>: This weapon-system does large amounts of damage, but its tracking systems limit its effectiveness against fast moving targets.\r\n<b>Microwarpdrive</b>: Giving a significant speed boost at the cost of higher signature radius. The Microwarpdrive has a long cool-down cycle between uses.\r\n<b>Torpedo Salvo</b>: A salvo of super heavy unguided torpedoes. These weapons do significant damage against capital class starships and structures. They are unsuited to firing against sub-capital class starships.',2000,1800,0,1,8,21394992.0000,1,1310,NULL,NULL,3818),(32326,1145,'Cyclops I Blueprint','',0,0.01,0,1,NULL,300000000.0000,1,1313,NULL,NULL,0),(32339,273,'Heavy Fighters','Allows operation of heavy fighter craft. 5% increase in heavy fighter damage per level.',0,0.01,0,1,NULL,100000000.0000,1,366,33,NULL,0),(32340,1653,'Malleus I','<b>Type:</b> Heavy Fighter\r\n<b>Role:</b> Heavy Attack\r\n<b>Description:</b> The Malleus is purpose designed for anti-capital and anti-structure combat.\r\n\r\n<b>Pulse Cannon</b>: This weapon-system does large amounts of damage, but its tracking systems limit its effectiveness against fast moving targets.\r\n<b>Microwarpdrive</b>: Giving a significant speed boost at the cost of higher signature radius. The Microwarpdrive has a long cool-down cycle between uses.\r\n<b>Torpedo Salvo</b>: A salvo of super heavy unguided torpedoes. These weapons do significant damage against capital class starships and structures. They are unsuited to firing against sub-capital class starships.',2000,1800,0,1,4,20047340.0000,1,1310,NULL,NULL,3825),(32341,1145,'Malleus I Blueprint','',0,0.01,0,1,NULL,300000000.0000,1,1313,NULL,NULL,0),(32342,1653,'Tyrfing I','<b>Type:</b> Heav