roximity Charge','Standard mine with nuclear payload.',100000,100000000,10000,1,1,NULL,0,NULL,NULL,NULL,1217),(32350,314,'Proof of Discovery: Anomalies','This document has been placed inside a Cosmic Anomaly secured by Empire agents. It serves as physical proof that a capsuleer-in-training has been able to locate the anomaly through the use of On-Board Scanning.',1,1,0,1,NULL,NULL,1,NULL,2908,NULL,0),(32351,314,'Proof of Discovery: Ore','This document has been placed inside a Ore site secured by Empire agents. It serves as physical proof that a capsuleer-in-training has been able to locate the signature through the use of Core Scanner Probes.',1,1,0,1,NULL,NULL,1,NULL,2908,NULL,0),(32352,314,'Proof of Discovery: Ore Passkey','This electronic passkey is provided by tutorial agents as part of a capsuleer training program. It is used to unlock an acceleration gate inside the Ore site training area, where the Proof of Discovery documents can be found stored inside containers. The Proof of Discovery documents serve as physical evidence that the capsuleer was able to discover a particular type of site. \r\n\r\nThis passkey is used to unlock Acceleration gates found inside <b>Ore</b> sites only.',1,1,0,1,NULL,NULL,1,NULL,2038,NULL,0),(32353,306,'Training Container - Anomalies','This container houses the <b>Proof of Discovery: Anomalies</b> document, which serves as physical proof that a capsuleer-in-training has been able to locate the anomaly through the use of On-Board Scanning. It must be retrieved to complete the first tutorial mission. \r\n\r\nIf at first the container appears empty, please wait a few minutes for a new document to be provided.',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,1176),(32357,1010,'Compact Doom Torpedo I','Representing the latest in miniaturization technology, Compact XL Torpedoes are designed specifically to be used by Fighter Bombers.\n\nNocxium atoms captured in morphite matrices form this missile\'s devastating payload. A volley of these is able to completely obliterate most everything that floats in space, be it vehicle or structure.',1500,0.3,0,100,NULL,250000.0000,0,NULL,1348,NULL,0),(32359,1010,'Compact Purgatory Torpedo I','Representing the latest in miniaturization technology, Compact XL Torpedoes are designed specifically to be used by Fighter Bombers.\n\nPlasma suspended in an electromagnetic field gives this torpedo the ability to deliver a flaming inferno of destruction, wreaking almost unimaginable havoc.',1500,0.3,0,100,NULL,325000.0000,0,NULL,1347,NULL,0),(32361,1010,'Compact Rift Torpedo I','Representing the latest in miniaturization technology, Compact XL Torpedoes are designed specifically to be used by Fighter Bombers.\n\nFitted with a graviton pulse generator, this weapon causes massive damage as it overwhelms ships\' internal structures, tearing bulkheads and armor plating apart with frightening ease.',1500,0.3,0,100,NULL,300000.0000,0,NULL,1346,NULL,0),(32363,1010,'Compact Thor Torpedo I','Representing the latest in miniaturization technology, Compact XL Torpedoes are designed specifically to be used by Fighter Bombers.\n\nNothing more than a baby nuclear warhead, this guided missile wreaks havoc with the delicate electronic systems aboard a starship. Specifically designed to damage shield systems, it is able to ravage heavily shielded targets in no time.',1500,0.3,0,100,NULL,350000.0000,0,NULL,1349,NULL,0),(32365,314,'Proof of Discovery: Relic','This document has been placed inside a Relic site secured by Empire agents. It serves as physical proof that a capsuleer-in-training has been able to locate the signature and properly performed analysis in the area.',1,1,0,1,NULL,NULL,1,NULL,2908,NULL,0),(32366,314,'Proof of Discovery: Data','This document has been placed inside a Data site secured by Empire agents. It serves as physical proof that a capsuleer-in-training has been able to locate the signature and successfully perform a hacking attempt inside the area.',1,1,0,1,NULL,NULL,1,NULL,2908,NULL,0),(32367,1207,'Training Container - Relic','This container must be accessed using a <b>Civilian Relic Analyzer</b>. As soon as a successful attempt is detected, it will unlock. Inside, the <b>Proof of Discovery: Relic</b> document can be retrieved.\r\n\r\nIf at first the container appears empty, please wait a few minutes for a new document to be provided.',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,1176),(32368,306,'Training Container - Salvaging','This container must be accessed using a <b>Civilian Salvager</b>. As soon as a successful salvage attempt is detected, it will unlock. Inside, the <b>Proof of Discovery: Magnetometric</b> document can be retrieved.\r\n\r\nIf at first the container appears empty, please wait a few minutes for a new document to be provided.',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,1176),(32369,1207,'Training Container - Data','This container must be accessed using a <b>Civilian Data Analyzer</b>. As soon as a successful hacking attempt is detected, it will unlock. Inside, the <b>Proof of Discovery: Data</b> document can be retrieved.\r\n\r\nIf at first the container appears empty, please wait a few minutes for a new document to be provided.',10000,27500,2700,1,1,NULL,0,NULL,16,NULL,1176),(32370,306,'Assembly Station DC105-A','This shipyard was probably moved here recently. For now, parts for large vessels are stored in easily accessible silos jutting from the station\'s surface.',100000,100000000,10000,1,2,NULL,0,NULL,NULL,NULL,2625),(32371,314,'Capital Ship Design  Dictator','The Caldari Navy have purportedly worked on this project for the past decade, but lack of funding has kept this new type of capital ship from reaching the pre-production stage. These designs are deemed highly classified and have been kept under wraps in this remote station.',1,0.1,0,1,NULL,NULL,1,NULL,2853,NULL,0),(32372,283,'Minedrill  E518 Crew','This unfortunate crew will supply the Guristas with the intelligence for future raids, assuming they can be made to cooperate. That shouldn\'t be an issue, though.',100,3,0,1,NULL,NULL,1,NULL,2536,NULL,0),(32374,280,'Holoreel GRS-81A','The holoreel plays a short message. A man\'s voice can be heard: \r\n\r\nI need you to listen very carefully, because I don\'t have much time. When I was with her, she had a woman there, as well. I know this to be true because I could hear her interrogating the crew. I couldn\'t see her until the last days, but when I got loose and crossed to where they were holding her, I saw that there wasn\'t much left. It was like that egger had ordered her face to be burnt away or removed.\r\n\r\nI don\'t know what she\'s planning. Since the accident, she could very well have assumed any identity. It\'s possible she doesn\'t even-\r\n\r\nThe message ends abruptly. There is something scrawled on the back: Even devils will have their day.\r\n',100,0.5,0,1,NULL,250.0000,1,NULL,1177,NULL,0),(32375,314,'Proof of Discovery: Gas Passkey','This electronic passkey is provided by tutorial agents as part of a capsuleer training programming. It is used to unlock an acceleration gate inside the Gas site training area, where the Proof of Discovery documents can be found stored inside containers. The Proof of Discovery documents serve as physical evidence that the capsuleer was able to discover a particular type of site. \r\n\r\nThis passkey is used to unlock Acceleration gates found inside <b>Gas</b> sites only.',1,1,0,1,NULL,NULL,1,NULL,2038,NULL,0),(32376,314,'Proof of Discovery: Gas','This document has been placed inside a Gas site secured by Empire agents. It serves as physical proof that a capsuleer-in-training has been able to locate the signature through the use of Core Scanner Probes.',1,1,0,1,NULL,NULL,1,NULL,2908,NULL,0),(32377,306,'Venal Regional Comms Tower','A structure tasked with relaying, boosting, and encrypting data. It seems to be operating at full capacity.',100000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,2505),(32378,306,'Training Container - Ore','This container houses the <b>Proof of Discovery: Ore</b> document, which serves as physical proof that a capsuleer-in-training has been able to locate the site through the use of Core Scanner Probes. It must be retrieved to complete the Ore site training mission. \r\n\r\nIf at first the container appears empty, please wait a few minutes for a new document to be provided.',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,1176),(32379,306,'Training Container - Gas','This container houses the <b>Proof of Discovery: Gas</b> document, which serves as physical proof that a capsuleer-in-training has been able to locate the Gas site through the use of Core Scanner Probes. It must be retrieved to complete the Gas training mission.  \n\nIf at first the container appears empty, please wait a few minutes for a new document to be provided.',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,1176),(32380,182,'Roden Police Major','The Gallente government contracted this vessel from Roden Shipyards in order to bolster security in Federation space. It is patrolling this sector and will respond to any combat it detects. It can call in reinforcements from nearby sectors if the need arises. Threat level: Extreme',20000000,1080000,14000,1,8,NULL,0,NULL,NULL,30,3809),(32381,182,'Roden Police Sergeant','The Gallente government contracted this vessel from Roden Shipyards in order to bolster the security in Federation space . It is patrolling this sector and will respond to any combat it detects. It can call in reinforcements from nearby sectors if the need arises. Threat level: Very high',2040000,20400,160,1,8,NULL,0,NULL,NULL,30,3812),(32382,306,'Damaged Caldari Shuttle','This tiny craft is badly damaged. All propulsion units have been completely disabled.',1450000,16120,145,1,1,NULL,0,NULL,NULL,NULL,317),(32383,314,'Guristas Dirty\' Explosive System','A rudimentary, though effective, explosion matrix, used specifically for Guristas special operation tactical strikes. Once inside a ship\'s cargo bay, this dirty bomb will, upon detonation, cause massive damage to any ship, structure, or starship base. It\'s volatility, however, is also a liability: Getting the bomb to its destination is more dangerous than actually utilizing the explosion system.',1,0.1,0,1,NULL,NULL,1,NULL,2863,NULL,0),(32384,671,'Captured Caldari State Shuttle','A captured Caldari state shuttle',1600000,5000,10,1,1,NULL,0,NULL,NULL,NULL,317),(32385,612,'Guristas Battleship Vessel','This is a fighter for the Guristas. It is protecting the assets of Guristas and may attack anyone it perceives as a threat or easy pickings. Threat level: Deadly',21000000,1040000,235,1,1,NULL,0,NULL,NULL,31,2159),(32386,226,'Violent Wormhole','Though the wormhole seems stable, the exotic radicals pouring from the tear imply that using it would be catastrophic.',1,0,0,1,NULL,NULL,0,NULL,NULL,20222,20956),(32387,226,'Stable Wormhole','This wormhole appears to be relatively new. For the time being, it is stable, though excessive traffic and time will eventually cause it to vanish.',1,0,0,1,NULL,NULL,0,NULL,NULL,NULL,3715),(32388,927,'Angel Recovery Team','Sometimes a combat encounter doesn\'t go the Cartel\'s way, and men and resources are left behind. Rather than leave their fates to scavengers, the Cartel employs its own recovery teams specializing in battlefield salvage and extraction.',12500000,255000,5625,1,NULL,NULL,0,NULL,NULL,NULL,2713),(32389,283,'Dread Guristas Strike Force','A troupe of trained specialists, skilled at overtaking stations for the Guristas. This team, calling themselves the Dread Naughts, are a rough bunch, hellfires in the restrictive confines of your cargohold, hardly a disciplined lot during downtime. However, once they are in action, they have the precision to match any elite Empire task force.',80,1,0,1,NULL,NULL,1,NULL,2544,NULL,0),(32390,672,'Gath Renton','Renton is the CEO of a small capsuleer corporation. For years, he\'s managed to stay off the radar of the major alliances. One day, he may achieve his dreams of bigger things; but today, all he has to look forward to is the wrath of the Cartel.',10100000,101000,235,1,1,NULL,0,NULL,NULL,NULL,3169),(32391,615,'Yukiro Demense','One of the younger commanders in the Guristas Fleet, Yukiro Demense has proven himself capable and aggressive. He and his wingmen are known for their daring raids into State space, as well as their constant harassment of CONCORD and other police forces. Lately, he\'s been leading raids on the Angel Cartel and Serpentis in Fountain, becoming quite a thorn in the side of the two larger criminal factions. As yet, he hasn\'t drawn any special attention, but it won\'t be long until his powerful enemies do something about him.',1650000,16500,235,1,1,NULL,0,NULL,NULL,31,1831),(32392,671,'Eroma Eralen','For whatever reason, Eroma Eralen has never risen very far within the Guristas ranks, despite his nearly twenty year membership in the pirate organization. His superiors blame his erratic behavior, particularly in dealing with small group operations, though others fault his addictions, ranging from interspatial radio technology to low-end boosters to black market pornographic holoreels. He currently acts as Kori Latamaki\'s operative, specializing in covert techno-raids and synthaesthetic manipulation schemes. He can barely be trusted, but he knows what he\'s doing, though he could just be creating an elaborate practical joke for his own amusement.',1600000,5000,10,1,1,NULL,0,NULL,NULL,NULL,1831),(32393,314,'Sealed Research Cache','The contents of this container remain sealed behind some kind of proprietary Cartel technology. A thin, red film of hardened fullerene alloys forms a perfect, unbreakable seal around the contents. As if that wasn\'t enough to deter attackers, the surface underneath the film is covered in tiny nanite-plasma explosives. Any attempt at forced entry past the film would produce enough explosive power to level a small town.',10,2,0,1,NULL,NULL,1,NULL,2225,NULL,0),(32394,952,'Serpentis Transport Hub','This facility is used by Serpentis research teams to ship goods out of Cartel space and back towards Fountain.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,2706),(32395,517,'Atma Aulato\'s Falcon','A Falcon piloted by an agent.\r\n\r\n\r\n',0,0,0,1,1,NULL,0,NULL,NULL,NULL,20614),(32396,517,'Arment Caute\'s Lachesis','A Lachesis piloted by an agent.',12500000,116000,320,1,8,NULL,0,NULL,NULL,NULL,2140),(32397,517,'Yada Vinjivas\'s Gila','A Gila piloted by an agent.',10100000,101000,250,1,1,NULL,0,NULL,NULL,NULL,1824),(32398,283,'Lieutenant Kipo Foxfire Tekira','Cilis Leglise\'s missing Lieutenant is barely conscious. His legs are no longer functional, and a great deal of his right arm has been removed, almost to the shoulder. Irichi said he\'s modified this man the same way he\'d been modified by Cilis, but this is a bit extreme.<br><br>Kipo is obviously under heavy medication. He stares at you, and though he is drugged, his eyes relate a sickening uncertainty. Though he cannot talk, his body language insinuates that he is begging for mercy.',80,1,0,1,NULL,100.0000,1,NULL,2545,NULL,0),(32399,226,'Statehood Incarnate Monument','The Guristas erected this monument years ago, in direct mockery of the massive State-funded public works programs, beautification initiatives, and patriotic displays seen throughout Caldari space. Dubbing this monument, Statehood Incarnate, the entire area is a mockery of the sacred, the glorification of the profane, littered with the true ideals of the Gurista pirates: abject nihilism.',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,1266),(32400,597,'Angel Frigate Vessel','This is a fighter for the Angel Cartel. It is protecting the assets of the Angel Cartel and may attack anyone it perceives as a threat or easy pickings. Threat level: Very high',1970000,19700,235,1,2,NULL,0,NULL,NULL,31,338),(32401,595,'Angel Cruiser Vessel','This is a fighter for the Angel Cartel. It is protecting the assets of the Angel Cartel and may attack anyone it perceives as a threat or easy pickings. Threat level: Very high',10100000,101000,235,1,1,NULL,0,NULL,NULL,31,337),(32402,594,'Angel Battleship Vessel','This is a fighter for the Arch Angels. It is protecting the assets of Arch Angels and may attack anyone it perceives as a threat or easy pickings. Threat level: Deadly',19000000,19000000,120,1,2,NULL,0,NULL,NULL,31,335),(32403,314,'Caldari Navy Overlay Transponder','This transponder, taken from Kori\'s operative, is your ticket to the rendezvous with the Navy. Barely functional after the destruction of the operative\'s ship, it contains identification data that will scramble security frequencies, tricking them into identifying your ship as Eroma\'s. ',1,0.1,0,1,NULL,NULL,1,NULL,2037,NULL,0),(32404,952,'Cilis Leglise\'s Headquarters','Cilis Leglise\'s Headquarters.',100000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,1991),(32405,226,'Serpentis Research Facility','This research facility is use by the Serpentis to conduct dangerous and secretive experiments.',0,0,0,1,8,NULL,0,NULL,NULL,14,1712),(32406,306,'Caldari Storage Warehouse','This is a standard storage facility.',1000000,1150,8850,1,NULL,NULL,0,NULL,NULL,NULL,2301),(32407,314,'Holoreel  Torture Log I15B','The grainy footage on this holoreel depicts a young man standing in a small room, his arms bound and his legs chained to the ground, spread apart as far as they can go. His face cannot be seen. The man is bleeding from cuts all across his body. A woman\'s voice asks him an inaudible question. He answers, No. The voice asks another question, also inaudible. The man gives the same response. <br><br>\r\nThis repeats for a few more questions. After the last question, a woman dressed in a Gallente Federation uniform appears. She approaches the man. The man lifts his head, showing his face: It is Irichi. The woman holds his face in his hands, kisses him softly on the lips, and turns to the holoprojector: It is Cilis. She reaches off camera for something. Behind her, Irichi\'s head drops, tears streaming down his face. Cilis returns, holding a remote in her hands. She pushes a button. Mechanical noises reverberate throughout the room. A panel opens beneath Irichi\'s feet. He winces, screams in pain. Loud sawing noises interrupt the scene. The footage goes blank.\r\n',100,0.5,0,1,NULL,250.0000,1,NULL,1177,NULL,0),(32408,314,'Correspondence Log KL-513','A collection of datacores, holoreels, dossiers, and assorted recordings logging the interactions between Kori Latamaki and the Caldari Navy. This information is vital in establishing a treason case against Kori for his dealings with the Navy, with which he has forsaken his brethren in the Guristas. ',1,0.5,0,1,NULL,100.0000,1,NULL,1192,NULL,0),(32409,517,'Aton Hordner\'s Tempest','Despite flying with a Republic license, this agent radiates \"shady.\"',0,0,0,1,2,NULL,0,NULL,NULL,NULL,48),(32410,517,'Arajna Ashia\'s Arbitrator','Arajna is known to have contacts within the Angel Cartel for those willing to expand their horizons.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,298),(32411,517,'Ellar Stin\'s Dramiel','Ellar Stin, unapologetic Angel.',0,0,0,1,8,NULL,0,NULL,NULL,NULL,338),(32412,319,'Boundless Creations Data Center','This massive complex houses hundreds of supercomputers, all dedicated to research and storage. One such superconductor contains the latest Sleepers research from Boundless Creations.',100000,100000000,10000,1,1,NULL,0,NULL,NULL,NULL,2372),(32413,208,'Shadow Serpentis Remote Sensor Dampener','Reduces the range and speed of a targeted ship\'s sensors. This module can be loaded with scripts to increase its effectiveness in certain areas. \r\n\r\nPenalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',0,5,1,1,8,13948.0000,0,NULL,105,NULL,0),(32414,379,'Domination Target Painter','A targeting subsystem that projects an electronic \"Tag\" on the target thus making it easie