ch mining operations can be more easily managed. The Orca uses much of the technology developed by ORE for the Rorqual and integrated with the latest advancements from Deep Core Mining research division has developed a vessel which offers a diverse role to all sizes of operations and needs.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,3466),(32421,226,'Fortified Hulk','The Hulk is the largest craft in the second generation of mining vessels created by the ORE Syndicate. Exhumers, like their mining barge cousins, are equipped with electronic subsystems specifically designed to accommodate Strip Mining modules. They are also far more resilient, better able to handle the dangers of deep space. The Hulk is, bar none, the most efficient mining vessel available. ',11500000,195000,0,1,4,NULL,0,NULL,NULL,NULL,2938),(32422,1016,'Advanced Logistics Network','This upgrade allows alliances to anchor Jump Bridges at their starbases in a solar system.',1000,200000,0,1,NULL,150000000.0000,1,1282,3952,NULL,0),(32423,226,'Caldari Kestrel Frigate','The Kestrel is a heavy missile boat with a fairly large cargo space and one of the most sophisticated sensor arrays around. Interestingly enough, it has been used by both the Caldari Navy and several wealthy trade corporations as a cargo-hauling vessel. It is one of few trading vessels with good punching power, making it ideal for solo trade-runs in dangerous areas. The Kestrel was designed so that it could take up to four missile launchers but instead it can not be equipped with turret weapons nor mining lasers.',1700000,19700,305,1,1,NULL,0,NULL,NULL,NULL,313),(32435,256,'XL Cruise Missiles','Skill at the handling and firing of XL Cruise Missiles. 5% bonus to XL Cruise Missile damage per skill level.',0,0.01,0,1,4,15000000.0000,1,373,33,NULL,0),(32436,1019,'Scourge XL Cruise Missile','XL Cruise Missiles are designed for long range bombardment of capital ships and installations. They are a specialized design usable only by capital ships.\n\nFitted wi