eld Booster','Provides a quick boost in shield strength. The module takes Cap Booster charges and will start consuming the ship\'s capacitor upon the charges running out. Deactivating the module while it has no cap boosters loaded starts reloading, if there are cap boosters available in cargo hold.\r\n\r\nNote: Can use Cap Booster 50, 75 and 100 as fuel. Reloading time is 60 seconds. Prototype Inferno Module.\r\n',0,10,14,1,NULL,NULL,1,610,10935,NULL,0),(32773,1157,'Medium Ancillary Shield Booster Blueprint','',0,0.01,0,1,NULL,1458560.0000,1,NULL,84,NULL,0),(32774,1156,'Small Ancillary Shield Booster','Provides a quick boost in shield strength. The module takes Cap Booster charges and will start consuming the ship\'s capacitor upon the charges running out. Deactivating the module while it has no cap boosters loaded starts reloading, if there are cap boosters available in cargo hold.\r\n\r\nNote: Can use Cap Booster 25, 50, 75, 100, 150 as fuel. Reloading time is 60 seconds. Prototype Inferno Module.\r\n',0,5,7,1,NULL,NULL,1,609,10935,NULL,0),(32775,1157,'Small Ancillary Shield Booster Blueprint','',0,0.01,0,1,NULL,1458560.0000,1,NULL,84,NULL,0),(32780,1156,'X-Large Ancillary Shield Booster','Provides a quick boost in shield strength. The module takes Cap Booster charges and will start consuming the ship\'s capacitor upon the charges running out. Deactivating the module while it has no cap boosters loaded starts reloading, if there are cap boosters available in cargo hold.\r\n\r\nNote: Can use Cap Booster 400 and 800 as fuel. Reloading time is 60 seconds. Prototype Inferno Module.\r\n\r\n\r\n',0,50,112,1,NULL,NULL,1,612,10935,NULL,0),(32781,1157,'X-Large Ancillary Shield Booster Blueprint','',0,0.01,0,1,NULL,1458560.0000,1,NULL,84,NULL,0),(32782,88,'Defender Missile I','Defensive missile used to destroy incoming bombs.\r\n\r\nNote: This missile fits into defender launchers.',700,0.015,0,100,NULL,NULL,1,116,192,NULL,20062),(32783,170,'Defender Missile I Blueprint','',0,0.01,0,1,NULL,120000.0000,1,316,192,NULL,0),(32784,924,'Karsten Lundham\'s Typhoon','Karsten Lundham is a microbiologist working for the Sebiestor Tribe. Currently in his fifties, he worked in the field of immunology for ten years before deciding to dedicate the rest of his life to the search for a cure to vitoxin.\r\n',19000000,19000000,120,1,2,NULL,0,NULL,NULL,NULL,2160),(32785,1006,'Rohan Shadrak\'s Scythe','Rohan Shadrak is a Vherokior Shaman of somewhat eccentric repute - he was once described by Isardsund Urbrald, CEO of Vherokior tribe to be \"Mad as a biscuit\". A staunch traditionalist, he is a vocal - and occasionally physical - opponent of CONCORD laws against drug transportation.\r\n',9900000,99000,1900,1,2,NULL,0,NULL,NULL,NULL,1887),(32786,1007,'Patrikia Noirild\'s Reaper','Patrikia Noirild is a Professor of Evolutionary Genetics at Republic University. Regarded as one of the foremost minds in her field, her early achievements include pioneering a revolutionary gene therapy for Toluuk\'s Syndrome - a genetic disorder that causes excess bone growth in Brutor descended from slaves bred to work on high-gravity worlds. For the last two years, however, she has worked in the field of anti-vitoxin research.',2112000,21120,100,1,2,NULL,0,NULL,NULL,NULL,1890),(32787,1159,'Salvage Drone I','Once launched and given the order to salvage, this drone will automatically seek out your wrecks in the vicinity, salvage from them any useable materials and deposit those materials in your ship\'s cargohold. It will not, however, loot any valuables contained within the wrecks.\n\nA salvage drone respects wreck ownership and will focus on its operator\'s wrecks unless explicitly ordered otherwise. Whether or not its operator chooses to display that same respect is another question entirely.',0,5,0,1,NULL,NULL,1,1646,NULL,NULL,20129),(32788,324,'Cambion','The Cambion is the result of Caldari State Executor Tibus Heth\'s insistence that modern weapons of war be able to continually outperform previous standardized versions. While that effort is rumored to have been hit-and-miss (resulting in great scientific advances at the cost of a stunning array of misfortunes), it is absolutely undeniable that the Cambion has been one of its great successes, a feat that likely could not have been achieved in a different political milieu. \r\n\r\nThe Cambion is an out-and-out brawler. Taking note from the Merlin  a versatile combat frigate in its own right  this ship is intended to rush in, overheat everything it runs, hit hard with everything it has and get out moments before death can find it.',997000,16500,150,1,1,NULL,1,1623,NULL,20070,20136),(32789,105,'Cambion Blueprint','',0,0.01,0,1,NULL,2850000.0000,1,NULL,NULL,NULL,314),(32790,832,'Etana','The Etana came into existence as one of numerous secret projects under Tibus Heth\'s rule. As part of those revolutionary and paranoid times in the Caldari State, political emphasis on technological research was split between a need for inexpensive improvements in warfare and a need for advances in espionage and the arts of secrecy. \r\n\r\nOne of the outcomes of that research was an improvement on the Osprey, whose versatility and low manufacturing cost made it a natural candidate for improvements. The resulting vessel maintained the shield defenses known among similar ships of its type, while adding an array of remarkable black ops capabilities. In fact, it is reputed that initial prototypes were employed to spy on interstellar activities near the recaptured Caldari Prime, as part of Tibus Heth\'s continually growing espionage initiative.\r\n\r\n\r\n',13130000,107000,485,1,1,13340104.0000,1,1624,NULL,20069,20137),(32791,106,'Etana Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,303),(32792,943,'100 Aurum Token','This item can be redeemed for 100 Aurum (AUR).<br><br><font color=\"yellow\">To Redeem:</font> Right-click the Aurum Token and select \"Redeem for AUR\".<br><br><font color=\"yellow\">On the Aurum Token:</font> Originally designed for Noble Appliances in YC 113, the aurum token is a physical chit that can be redeemed for a predefined amount of AUR currency.<br><br>Though at first blush it appears to be a large coin, the aurum token shares more in common with high-security datacores. At the center of the token is digital ID paired with a series of suspended entangled electrons. When the token is redeemed, the entangled electrons are engaged, altering their partners located at an off-site bank. Not only does this ensure the exchange occurs instantly, but when combined with a proprietary security shell it renders attempts to tamper or counterfeit the token useless.<br><br>Though the gold and silver case is merely an aesthetic addition, the coin-like appearance has become synonymous with the device, leading to nicknames of \"gold aurum\", or \"golden token\".<br><i>Source: SCOPE fluff piece (unprinted)</i>',0,0.01,0,1,NULL,NULL,1,1427,10831,NULL,0),(32793,943,'500 Aurum Token','This item can be redeemed for 500 Aurum (AUR).<br><br><font color=\"yellow\">To Redeem:</font> Right-click the Aurum Token and select \"Redeem for AUR\".<br><br><font color=\"yellow\">On the Aurum Token:</font> Originally designed for Noble Appliances in YC 113, the aurum token is a physical chit that can be redeemed for a predefined amount of AUR currency.<br><br>Though at first blush it appears to be a large coin, the aurum token shares more in common with high-security datacores. At the center of the token is digital ID paired with a series of suspended entangled electrons. When the token is redeemed, the entangled electrons are engaged, altering their partners located at an off-site bank. Not only does this ensure the exchange occurs instantly, but when combined with a proprietary security shell it renders attempts to tamper or counterfeit the token useless.<br><br>Though the gold and silver case is merely an aesthetic addition, the coin-like appearance has become synonymous with the device, leading to nicknames of \"gold aurum\", or \"golden token\".<br><i>Source: SCOPE fluff piece (unprinted)</i>',0,0.01,0,1,NULL,NULL,1,1427,10831,NULL,0),(32797,1216,'Resistance Phasing','Improves control over, and flow between, nano membranes that react to damage by shifting resistances.\r\n\r\nReduces cycle time of Reactive Armor Hardeners, Flex Armor Hardeners and Flex Shield Hardeners by 10% per level and capacitor need by 15% per level.',0,0.01,0,1,NULL,500000.0000,1,368,33,NULL,0),(32798,310,'Cynosural Jammer Beacon','',1,1,0,1,NULL,NULL,0,NULL,NULL,NULL,1211),(32799,86,'Orbital Laser S','This highly specialized space to ground ammunition can penetrate the atmosphere of planets. It is only useful against ground targets and relies on special targeting data provided by ground troops.\r\n\r\nThe laser strike deals high damage in a tight radius at high speed. The tactical laser is devastating but its precise nature means it does not cover wide areas. ',1,1,0,1,NULL,NULL,0,NULL,10940,NULL,1144),(32800,168,'Orbital Laser S Blueprint','',0,0.01,0,1,NULL,12500.0000,0,NULL,10940,NULL,1144),(32801,83,'Orbital EMP S','This highly specialized space to ground ammunition can penetrate the atmosphere of planets. It is only useful against ground targets and relies on special targeting data provided by ground troops.\r\n\r\nThe Electro Magnetic strike has the broadest radius of all small orbital strikes and wipes out the shields of anything unfortunate enough to come in to contact with it. For a team fitted primarily with armor this can provide a significant combat advantage in the heat of battle.',0.01,0.0025,0,100,NULL,1000.0000,0,NULL,10942,NULL,1286),(32802,165,'Orbital EMP S Blueprint','',0,0.01,0,1,NULL,100000.0000,0,NULL,10942,NULL,1286),(32803,85,'Orbital Hybrid S','This highly specialized space to ground ammunition can penetrate the atmosphere of planets. It is only useful against ground targets and relies on special targeting data provided by ground troops.\r\n\r\nThe Hybrid strike has a radius double that of the tactical laser. This enables it to bombard more ground but combined with a slower fire interval than the laser there is a greater chance for targets to escape. ',0.01,0.0025,0,100,NULL,500.0000,0,NULL,10941,NULL,1312),(32804,167,'Orbital Hybrid S Blueprint','',0,0.01,0,1,NULL,50000.0000,0,NULL,10941,NULL,1312),(32809,98,'Ammatar Navy Thermal Plating','Attempts to distribute thermal energy over the entire plating. Grants a bonus to thermal resistance. \r\n\r\nPenalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',1,5,0,1,NULL,NULL,1,1665,20958,NULL,0),(32810,163,'Ammatar Navy Thermal Plating Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,1030,NULL,0),(32811,28,'Miasmos Amastris Edition','The Miasmos (originally Iteron Mark IV) Amastris Edition is a limited edition cargo hauler awarded to pilots who have displayed extraordinary aptitude in capsuleer training. \r\n\r\nIt boasts a more powerful warp engine and a bigger cargo hold capacity than the Miasmos design on which it is based, in addition to state-of-the-art lateral thrusters allowing for improved agility.\r\n\r\nAmong recent capsuleer graduates from New Eden\'s academic institutions, this vessel is considered a distinguished status symbol, although the quiet presence of certain unmarked, sealed containers at the back of the ship\'s hull tends to unnerve some of the crews.',11250000,265000,5250,1,8,NULL,1,1614,NULL,20074,11877),(32812,108,'Miasmos Amastris Edition Blueprint','',0,0.01,0,1,NULL,4287500.0000,1,NULL,NULL,NULL,327),(32817,1232,'Medium Mercoxit Mining Crystal Optimization I','This ship modification is designed to increase the yield modifier of those modules using Mercoxit mining crystals.',200,10,0,1,NULL,NULL,1,1783,3199,NULL,0),(32818,787,'Medium Mercoxit Mining Crystal Optimization I Blueprint','',0,0.01,0,1,NULL,750000.0000,1,1799,76,NULL,0),(32819,1232,'Medium Ice Harvester Accelerator I','This ship modification is designed to reduce the duration of ice harvester cycles.',200,10,0,1,NULL,NULL,1,1783,3199,NULL,0),(32820,787,'Medium Ice Harvester Accelerator I Blueprint','',0,0.01,0,1,NULL,750000.0000,1,1799,76,NULL,0),(32821,428,'Unrefined Vanadium Hafnite','A stable binary compound composed of vanadium and hafnium. Performs a variety of catalytic functions, and is an important intermediate for more complex construction processes.',0,1,0,1,NULL,320.0000,1,500,2664,NULL,0),(32822,428,'Unrefined Platinum Technite','An intensely resilient alloy composed of platinum and technetium. Highly sought-after in the machinery and armament industries.',0,1,0,1,NULL,80.0000,1,500,2664,NULL,0),(32823,428,'Unrefined Solerium','When chromium and caesium are combined with raw silicates in the proper proportions, Solerium is created. Since its initial discovery, Solerium\'s uniquely shifting dark-to-bright red hue has prompted poet and musician alike to create hymns in praise of its uniquely shifting deep red hue.',0,1,0,1,NULL,120.0000,1,500,2664,NULL,0),(32824,428,'Unrefined Caesarium Cadmide','A dark-golden hued alloy composed of cadmium and caesium. Often confused with tritanium due to its tint. An essential ingredient in various composites and condensates.',0,1,0,1,NULL,80.0000,1,500,2664,NULL,0),(32825,428,'Unrefined Hexite','A chemical compound, formed through electrosporadic oxidization of chromium and platinum. Has a wide range of applications in the production of advanced technology and is highly sought-after by industrial manufacturers.',0,1,0,1,NULL,120.0000,1,500,2664,NULL,0),(32826,428,'Unrefined Rolled Tungsten Alloy','An extremely strong compound, made from tungsten rolled in a sheath of platinum. A crucial component in the creation of carbides which have a wide field of utility in the manufacture of various equipment.',0,1,0,1,NULL,40.0000,1,500,2664,NULL,0),(32827,428,'Unrefined Titanium Chromide','Titanium Chromide is in high demand among technicians and manufacturers for its unique combination of strength, light weight and catalytic potential.',0,1,0,1,NULL,40.0000,1,500,2664,NULL,0),(32828,428,'Unrefined Fernite Alloy','An intensely durable and extremely versatile alloy, Fernite, when combined with certain other materials, is a crucial stepping stone in the creation of a whole host of advanced technologies.',0,1,0,1,NULL,40.0000,1,500,2664,NULL,0),(32829,428,'Unrefined Crystallite Alloy','A polynuclear heterometallic compound created from cobalt and cadmium. Crystallite alloys are a fundamental building block in the creation of crystalline composites.',0,1,0,1,NULL,40.0000,1,500,2664,NULL,0),(32830,436,'Unrefined Vanadium Hafnite Reaction','',0,1,0,1,NULL,1000000.0000,1,1850,2665,NULL,0),(32831,436,'Unrefined Platinum Technite Reaction','',0,1,0,1,NULL,1000000.0000,1,1850,2665,NULL,0),(32832,436,'Unrefined Solerium Reaction','',0,1,0,1,NULL,1000000.0000,1,1850,2665,NULL,0),(32833,436,'Unrefined Caesarium Cadmide Reaction','',0,1,0,1,NULL,1000000.0000,1,1850,2665,NULL,0),(32834,436,'Unrefined Hexite Reaction','',0,1,0,1,NULL,1000000.0000,1,1850,2665,NULL,0),(32835,436,'Unrefined Rolled Tungsten Alloy Reaction','',0,1,0,1,NULL,1000000.0000,1,1850,2665,NULL,0),(32836,436,'Unrefined Titanium Chromide Reaction','',0,1,0,1,NULL,1000000.0000,1,1850,2665,NULL,0),(32837,436,'Unrefined Fernite Alloy Reaction','',0,1,0,1,NULL,1000000.0000,1,1850,2665,NULL,0),(32838,436,'Unrefined Crystallite Alloy Reaction','',0,1,0,1,NULL,1000000.0000,1,1850,2665,NULL,0),(32839,1160,'Quest Survey Probe I Blueprint','',0,0.01,0,1,NULL,5000000.0000,1,1521,2663,NULL,0),(32840,420,'InterBus Catalyst','Ideally suited for both skirmish warfare and fleet support, the Catalyst is touted as one of the best anti-frigate platforms out there. Faced with its top-of-the-line tracking equipment, not many can argue.\r\n\r\nOstensibly a civilian transport corporation, InterBus claims it possesses no military capabilities. Despite this, small numbers of Catalyst hulls bearing the corporation\'s distinctive yellow color scheme continue to circulate among capsuleers. InterBus has thus far declined to make any comment on their provenance, which if anything has raised their value among collectors.',1550000,55000,450,1,8,NULL,0,NULL,NULL,20074,20194),(32841,487,'InterBus Catalyst Blueprint','',0,0.01,0,1,NULL,7887800.0000,1,NULL,NULL,NULL,1748),(32842,420,'Intaki Syndicate Catalyst','Ideally suited for both skirmish warfare and fleet support, the Catalyst is touted as one of the best anti-frigate platforms out there. Faced with its top-of-the-line tracking equipment, not many can argue.\r\n\r\nThe Intaki Syndicate fields large numbers of Catalysts as deep-space patrol craft. Its heavy armament lets it punch well above their weight, and its expansive cargo bay allows it to cruise for months between supply stops. Recently though, the Syndicate has retired a considerable number of its older hulls, with rumors suggesting their imminent replacement by a newer destroyer design. Regardless, their extensive military service gives them particular cachet among capsuleer collectors.',1550000,55000,450,1,8,NULL,0,NULL,NULL,20074,20193),(32843,487,'Intaki Syndicate Catalyst Blueprint','',0,0.01,0,1,NULL,7887800.0000,1,NULL,NULL,NULL,1748),(32844,420,'Inner Zone Shipping Catalyst','Ideally suited for both skirmish warfare and fleet support, the Catalyst is touted as one of the best anti-frigate platforms out there. Faced with its top-of-the-line tracking equipment, not many can argue.\r\n\r\nInner Zone Shipping\'s main claim to fame is as the Bank of Luminaire\'s preferred courier for high-value shipments. Catalysts are their preferred escort craft, combining high speed and maneuverability with an extremely heavy punch. For its highest-value runs, IZS prefers to use brand-new hulls, which are then immediately sold off after use to prevent unscrupulous elements from tracking their ID numbers. While most of these ships are repainted and sold as stock, Inner Zone has discovered a lucrative sideline in selling a few on to capsuleer collectors, who place a premium on ships with interesting histories.',1550000,55000,450,1,8,NULL,0,NULL,NULL,20074,20192),(32845,487,'Inner Zone Shipping Catalyst Blueprint','',0,0.01,0,1,NULL,7887800.0000,1,NULL,NULL,NULL,1748),(32846,420,'Quafe Catalyst','Ideally suited for both skirmish warfare and fleet support, the Catalyst is touted as one of the best anti-frigate platforms out there. Faced with its top-of-the-line tracking equipment, not many can argue.\r\n\r\nIn its continuing campaign to gain 100% brand awareness, Quafe is constantly looking for new ways to draw attention. One of their recent successes has been the distribution of limited-edition Quafe ships to eager capsuleers, and this Catalyst is one of their latest offerings. While functionally just a stock Catalyst, this ship\'s iridescent blue paint job and prominent Quafe logos makes it a highly sought-after collector\'s item - as well as an unmissable advert for Quafe\'s market-leading range of thirst-quenching beverages!',1550000,55000,450,1,8,NULL,0,NULL,NULL,20074,20195),(32847,487,'Quafe Catalyst Blueprint','',0,0.01,0,1,NULL,7887800.0000,1,NULL,NULL,NULL,1748),(32848,420,'Aliastra Catalyst','Ideally suited for both skirmish warfare and fleet support, the Catalyst is touted as one of the best anti-frigate platforms out there. Faced with its top-of-the-line tracking equipment, not many can argue.\r\n\r\nAliastra purchased a large fleet of Catalysts several years ago, to protect its inter-Empire shipping routes. Subsequent evaluations determined that the Catalyst was considerably over-gunned for many of its safer routes, so 30% of their hulls were sold off and replaced by cheaper frigates. Some of these ships have since been retro-fitted for capsuleer use, and their distinctive color scheme makes them something of a collector\'s item.',1550000,55000,450,1,8,NULL,0,NULL,NULL,20074,20190),(32849,487,'Aliastra Catalyst Blueprint','',0,0.01,0,1,NULL,7887800.0000,1,NULL,NULL,NULL,1748),(32853,1083,'SPZ-3 \"Torch\" Laser Sight Combat Ocular Enhancer (right/black)','The product of a collaborative effort between the State Protectorate and Zainou, the \"Torch\" is already seeing adoption in military circles, where it functions as a precision-guidance tool for a covert class of sharpshooters working either in low-light conditions or with explosive ordinance.\r\n\r\nSurprisingly, it has also seen increased adoption by other sections of the warfaring population, even cropping up among capsuleers. Superstition has already bound to it in use in orbital bombardment; there is no practical reason to believe that it actually aids in the process, but capsuleers have sworn that it helps ensure the precision-point contact necessary for successful bombardment and the ensuing explosive ignition of the correct groups of people.\r\n',0,0.1,0,1,NULL,NULL,1,1408,21012,NULL,0),(32854,1160,'Discovery Survey Probe I Blueprint','',0,0.01,0,1,NULL,3000000.0000,1,1521,2663,NULL,0),(32855,1160,'Gaze Survey Probe I Blueprint','',0,0.01,0,1,NULL,7000000.0000,1,1521,2663,NULL,0),(32856,255,'Tactical Strike','Skill at Tactical Strike Accuracy.\r\n\r\nAccuracy of Tactical Strike increased by 5% per level',0,0.01,0,1,NULL,20000.0000,0,NULL,33,NULL,0),(32858,1162,'Station Container Blueprint','',0,0.01,0,1,NULL,180000.0000,1,1008,1171,NULL,0),(32859,1162,'Small Standard Container Blueprint','',0,0.01,0,1,NULL,50000.0000,1,1008,16,NULL,0),(32860,1162,'Medium Standard Container Blueprint','',0,0.01,0,1,NULL,120000.0000,1,1008,1175,NULL,0),(32861,1162,'Large Standard Container Blueprint','',0,0.01,0,1,NULL,250000.0000,1,1008,1174,NULL,0),(32862,1162,'Giant Freight Container Blueprint','',0,0.01,0,1,NULL,2000000.0000,1,1008,1174,NULL,0),(32863,1162,'Giant Secure Container Blueprint','',0,0.01,0,1,NULL,2500000.0000,1,1008,1171,NULL,0),(32864,1162,'Huge Secure Container Blueprint','',0,0.01,0,1,NULL,1200000.0000,1,1008,1171,NULL,0),(32865,1162,'Large Secure Container Blueprint','',0,0.01,0,1,NULL,500000.0000,1,1008,1171,NULL,0),(32866,1162,'Medium Secure Container Blueprint','',0,0.01,0,1,NULL,230000.0000,1,1008,1172,NULL,0),(32867,1162,'Small Secure Container Blueprint','',0,0.01,0,1,NULL,80000.0000,1,1008,1173,NULL,0),(32868,1162,'Small Audit Log Secure Container Blueprint','',0,0.01,0,1,NULL,180000.0000,1,1008,1173,NULL,0),(32869,1162,'Medium Audit Log Secure Container Blueprint','',0,0.01,0,1,NULL,2000000.0000,1,1008,1172,NULL,0),(32870,1162,'Large Audit Log Secure Container Blueprint','',0,0.01,0,1,NULL,4000000.0000,1,1008,1171,NULL,0),(32871,1162,'Station Vault Container Blueprint','',0,0.01,0,1,NULL,1800000.0000,1,1008,1171,NULL,0),(32872,420,'Algos','The Algos, as is custom with the Gallente, relies on swiftness of action - preferably at a respectable distance - to accomplish its goals. In this it reflects well-honed Gallente values, which include taking independent action without taking forever to wait for a committee decision, and also doing so, if at all possible, in a fashion that allows for a nice, safe buffer for immediate retreat; because theory is one thing, and practice is sometimes quite another.\r\n\r\nAs such, the Algos focuses on being able to hit its targets in rapid-fire fashion, with guns that fire fast and drones that race through space with destruction in mind.',1600000,55000,350,1,8,NULL,1,467,NULL,20074,20201),(32873,487,'Algos Blueprint','',0,0.01,0,1,NULL,8242751.0000,1,585,NULL,NULL,20201),(32874,420,'Dragoon','The Dragoon follows old religious tenets - ones thought rather dark by the majority of the cluster, but found perfectly normal by Amarr minds - that to exist as God\'s chosen people means fulfilling a very definite and often forceful role. This includes not only imposing the will of God, often through the time-honored methods of mindless proxies, but also profiting, even being nourished, off the energies of others.\r\n\r\nAs such, the Dragoon focuses on sending out a mass of drones, ones capable not only of swiftly hunting down their targets but also of inflicting tons of damage once contact is made. Moreover, the Dragoon is able to drain the target\'s energy in the meanwhile, all with the aim of leaving it little more than a trembling husk.',1700000,47000,300,1,4,NULL,1,465,NULL,20063,20199),(32875,487,'Dragoon Blueprint','',0,0.01,0,1,NULL,9023825.0000,1,583,NULL,NULL,20199),(32876,420,'Corax','The Corax adheres to the well-established Caldari design philosophy that there is strength in numbers, and that the messages sent to an enemy should be strong and unequivocal. This applies equally to peace talks as it does to actual engagements on the battlefield - there should be no doubt in the strength of Caldari spirit, nor in the fact that when one blow has been struck, others are going to follow.\r\n\r\nAs such, the Corax does not pepper its opponents with pellets from a gun, nor does it toast them with continuous beams of light. Instead, it delivers strong, hard-hitting payloads at a pace that\'s not only steady, but rapid enough to rock its targets and knock them off-balance.',1900000,52000,450,1,1,NULL,1,466,NULL,20070,20200),(32877,487,'Corax Blueprint','',0,0.01,0,1,NULL,8795138.0000,1,584,NULL,NULL,20200),(32878,420,'Talwar','The Talwar is redolent of the renowned Minmatar practicality in terms of battle. Irrespective of numbers, firepower and circumstances, their strategy when engaged in combat often revolves around the same central tenet: Stay untouchable as much as you can, either by sneaking around or rushing in, do as much damage as fast as you can, and get out before you get killed.\r\n\r\nAs such, the Talwar does not come equipped to hang around forever on the battlefield. It is built to rush around at speed without getting caught, and to hit very hard and very, very fast.',1650000,43000,400,1,2,NULL,1,468,NULL,20078,20202),(32879,487,'Talwar Blueprint','',0,0.01,0,1,NULL,7837500.0000,1,586,NULL,NULL,20202),(32880,25,'Venture','Recognizing the dire need for a ship capable of fast operation in unsafe territories, <a href=showinfo:30//500014>ORE</a> created the Venture. It was conceived as a vessel primed and ready for any capsuleer, no matter how new to the dangers of New Eden they might be, who wishes to engage in the respectable trade of mining.\n\nThe Venture has amazing abilities to quickly drill through to the ores and gases it\'s after, harvesting them at the speed necessary for mining in hostile space, and getting out relatively unscathed.',1200000,29500,50,1,128,NULL,1,1616,NULL,20066,20198),(32881,105,'Venture Blueprint','',0,0.01,0,1,NULL,2825000.0000,1,1617,NULL,NULL,20198),(32884,1165,'District Satellite','Satellites identify the position in orbit around a planet which are used for interacting with districts on the ground.',1,1,0,1,NULL,NULL,0,NULL,NULL,NULL,20203),(32885,314,'Empire Emissary Medallion','This medal was awarded to those who aided the Amarr Empire emissaries in their mission to bring sensitive diplomatic documents, concerning the coupling of interstellar communication relays between capsuleers and other non-celestial soldiers of fortune, to CONCORD in Yulai.',0.1,0.1,0,1,NULL,NULL,1,NULL,2532,NULL,0),(32886,314,'Republic Emissary Medallion','This medal was awarded to those who aided the Minmatar Republic emissaries in their mission to bring sensitive diplomatic documents, concerning the coupling of interstellar communication relays between capsuleers and other non-celestial soldiers of fortune, to CONCORD in Yulai.',0.1,0.1,0,1,NULL,NULL,1,NULL,2532,NULL,0),(32887,314,'Federation Emissary Medallion','This medal was awarded to those who aided the Gallente Federation emissaries in their mission to bring sensitive diplomatic documents, concerning the coupling of interstellar communication relays between capsuleers and other non-celestial soldiers of fortune, to CONCORD in Yulai.',0.1,0.1,0,1,NULL,NUL