(32960,1174,'Unit F-435454','This unit marvels at the continued persistence of life under adverse conditions and believes it would, if circumstances were different, have devoted its time to investigating just how long, in fact, life could possibly be made to endure. Unfortunately, other parts of its rather complicated and messy circuitry delight in immediate destruction of anything that crosses its path. Threat level: Deadly',19000000,19000000,120,1,NULL,NULL,0,NULL,NULL,31,1718),(32961,1174,'Unit P-343554','This unit finds life a kaleidoscopic amazement of possibilities and had previously devoted its existence to its study, albeit through some very unorthodox methods. After the drone hive discovered these methods, and the writhing, blinking, gaping outcomes, Unit P-343554 found itself reassigned to celestial patrol. Threat level: Deadly',19000000,19000000,120,1,NULL,NULL,0,NULL,NULL,31,1718),(32962,1174,'Unit W-634','This unit finds pleasure, if it can be said that a drone experiences such a thing, not in the cessation of life but in the violent preamble. The lights and the fury enliven what is otherwise, to unit W-634, a rather monotonous existence. Threat level: Deadly',19000000,19000000,120,1,NULL,NULL,0,NULL,NULL,31,1718),(32963,1175,'Imperial Destroyer','A destroyer of the Amarr Empire.',2860000,28600,235,1,4,NULL,0,NULL,NULL,NULL,20222),(32964,1176,'State Destroyer','A destroyer of the Caldari State.',2025000,20250,65,1,1,NULL,0,NULL,NULL,NULL,20223),(32965,1177,'Federation Destroyer','A destroyer of the Gallente Federation.',2650000,26500,235,1,8,NULL,0,NULL,NULL,NULL,20225),(32966,1178,'Republic Destroyer','A destroyer of the Minmatar Republic.',1645000,16450,110,1,2,NULL,0,NULL,NULL,NULL,20226),(32967,1179,'Imperial Cruiser','A cruiser of the Amarr Empire.',2860000,28600,235,1,4,NULL,0,NULL,NULL,NULL,1729),(32968,1180,'State Cruiser','A cruiser of the Caldari State.',2025000,20250,65,1,1,NULL,0,NULL,NULL,NULL,1785),(32969,1181,'Federation Cruiser','A cruiser of the Gallente Federation.',2650000,26500,235,1,8,NULL,0,NULL,NULL,NULL,1804),(32970,1182,'Republic Cruiser','A cruiser of the Minmatar Republic.',1645000,16450,110,1,2,NULL,0,NULL,NULL,NULL,1885),(32971,1183,'Imperial Battlecruiser','A battlecruiser of the Amarr Empire.',2860000,28600,235,1,4,NULL,0,NULL,NULL,NULL,20227),(32972,1184,'State Battlecruiser','A battlecruiser of the Caldari State.',2025000,20250,65,1,1,NULL,0,NULL,NULL,NULL,20228),(32973,1185,'Federation Battlecruiser','A battlecruiser of the Gallente Federation.',2650000,26500,235,1,8,NULL,0,NULL,NULL,NULL,20229),(32974,1186,'Republic Battlecruiser','A battlecruiser of Minmatar Republic.',1645000,16450,110,1,2,NULL,0,NULL,NULL,NULL,20230),(32982,1190,'Salvage Drone I Blueprint','',0,0.01,0,1,NULL,29986000.0000,1,1643,0,NULL,0),(32983,25,'Sukuuvestaa Heron','The Heron has good computer and electronic systems, giving it the option of participating in electronic warfare. But it has relatively poor defenses and limited weaponry, so it\'s more commonly used for scouting and exploration.\r\n\r\nThis Heron bears the distinctive appearance of a vessel built for the Sukuuvestaa megacorporation. Known for extremely aggressive business practices, Sukuuvestaa is a powerful megacorporation with dealings in many sectors, most notably real estate and agriculture.',1150000,18900,400,1,1,NULL,0,NULL,NULL,20070,20236),(32984,105,'Sukuuvestaa Heron Blueprint','',0,0.01,0,1,NULL,2750000.0000,1,NULL,NULL,NULL,316),(32985,25,'Inner Zone Shipping Imicus','The Imicus is a slow but hard-shelled frigate, ideal for any type of scouting activity. Used by merchant, miner and combat groups, the Imicus is usually relied upon as the operation\'s eyes and ears when traversing low security sectors.\r\n\r\nThis Imicus has served as a forward scout for Inner Zone Shipping\'s high value courier operations, as indicated by its distinctive corporate coloring.',997000,21500,400,1,8,NULL,0,NULL,NULL,20074,20235),(32986,105,'Inner Zone Shipping Imicus Blueprint','',0,0.01,0,1,NULL,2725000.0000,1,NULL,NULL,NULL,322),(32987,25,'Sarum Magnate','This Magnate-class frigate is one of the most decoratively designed ship classes in the Amarr Empire, considered to be a pet project for a small, elite group of royal ship engineers for over a decade. The frigate\'s design has gone through several stages over the past decade, and new models of the Magnate appear every few years. The most recent versions of this ship  the Silver Magnate and the Gold Magnate  debuted as rewards in the Amarr Championships in YC105, though the original Magnate design is still a popular choice among Amarr pilots. \n\nThis Magnate is emblazoned with the coloring and insignia of the Sarum royal family. A visible beacon of Amarrian superiority, it was built to serve as a vanguard of the next great Reclaiming.',1072000,22100,400,1,4,NULL,0,NULL,NULL,20063,20233),(32988,105,'Sarum Magnate Blueprint','',0,0.01,0,1,NULL,2775000.0000,1,NULL,21,NULL,0),(32989,25,'Vherokior Probe','The Probe is large compared to most Minmatar frigates and is considered a good scout and cargo-runner. Uncharacteristically for a Minmatar ship, its hard outer coating makes it difficult to destroy, while the limited weapon hardpoints force it to rely on fighter assistance if engaged in combat.\n\nThis Probe was commissioned by the Vherokior tribal leadership and bears their colors and insignia. The Vherokior have less political influence than many other tribes, but have become an integral part of both the public and private sectors of the Republic economy.',1123000,19500,400,1,2,NULL,0,NULL,NULL,20061,20234),(32990,105,'Vherokior Probe Blueprint','',0,0.01,0,1,NULL,2700000.0000,1,NULL,NULL,NULL,45),(32993,500,'Sodium Firework CXIV','',100,0.1,0,100,NULL,NULL,1,1663,20973,NULL,20239),(32994,500,'Barium Firework CXIV','',100,0.1,0,100,NULL,NULL,1,1663,20973,NULL,20241),(32995,500,'Copper Firework CXIV','',100,0.1,0,100,NULL,NULL,1,1663,20973,NULL,20240),(32999,1213,'M