eep in mind that shuttles can\'t web targets, their lock time is slow, they can be shot, and if perhaps you were unaware, I hear they don\'t tank particularly well.',0,0.01,0,1,NULL,NULL,1,1661,2038,NULL,0),(33060,1194,'*Sneaks in a classic*','A comic series released to New Eden from YC 110 onward. In certain elite circles the comic was regarded as one of the best pieces of comedy entertainment written in recent times. Critics everywhere else never seemed to grasp its particular brand of jokes and as a result it never truly took off outside the capsuleer community.',0,0.01,0,1,NULL,NULL,1,1661,10159,NULL,0),(33061,1194,'Public Portrait: How To','During the year YC 111 there was an incident in which a capsuleer posted a truly legitimate question on the public network and asked for some assistance in answering it. Shortly after posting his question the public network was filled with jokes about the man\'s chin. It is unknown if he ever got an answer to his question but we know for sure that for a period of time after his public post the only words to follow the man were \"dude, your chin!\"\r\n\r\nIt is for reasons like this that one must be careful about choosing what portrait they present to the public. By the end of this book you will understand how to properly select a good public portrait that properly represents you.\r\n\r\nThe person in the above story has since had surgery that changed his appearance and so we dedicate the cover of this book to his original look.',0,0.01,0,1,NULL,NULL,1,1661,20976,NULL,0),(33062,1089,'Men\'s \'Red Star\' T-shirt','Stand out in a crowd with this crisp, elegant design, designed exclusively for those who want their wear to be casual and comfortable while simultaneously having it send a stark message of the celebration of freedom and brotherhood. This t-shirt, pitch black as the dark of space, is adorned with a single red star, standing as the symbol both of a dying sun in the last throes of its cooling embers, and a rebirth of life in star-lit New Eden.',0.5,0.1,0,1,NULL,NULL,1,1398,20982,NULL,0),(33063,1089,'Women\'s \'Red Star\' T-shirt','Stand out in a crowd with this crisp, elegant design, designed exclusively for those who want their wear to be casual and comfortable while simultaneously having it send a stark message of the celebration of freedom and brotherhood. This t-shirt, pitch black as the dark of space, is adorned with a single red star, standing as the symbol both of a dying sun in the last throes of its cooling embers, and a rebirth of life in star-lit New Eden.',0.5,0.1,0,1,NULL,NULL,1,1406,20979,NULL,0),(33064,1091,'Boots.ini','We found where they all went.',0.5,0.1,0,1,NULL,NULL,1,1662,20977,NULL,0),(33065,1194,'Donut Holder','Finally a place to put the donuts.',0,0.01,0,1,NULL,NULL,1,1661,2304,NULL,0),(33066,1194,'New Eden Soundbox','This antiquated music-playing device sure has seen better days. Not only is the outer shell cracked, with wires and inner circuitry running loose, but some power cells seem to be missing as well. All attempts to fix or reconnect this strange device have failed, resulting only in a deafeningly loud static noise coming out of the ship\'s sound synthesizers. Better leave this off, then.',0,0.01,0,1,NULL,NULL,1,1661,3439,NULL,0),(33067,1197,'Deactivated Station Key Pass Blueprint','',0,0.01,0,1,NULL,NULL,1,1664,2943,NULL,0),(33068,300,'QA SpaceAnchor Implant','This implant does not exist',0,1,0,1,NULL,NULL,0,NULL,2053,NULL,0),(33069,1198,'Orbital Target','Telemetry broadcast by forces fighting on a nearby planetary body enables allied ships in range to unleash a terrifying orbital bombardment against the designated target.',0,0,0,1,NULL,NULL,1,NULL,10847,NULL,0),(33070,314,'New Eden Open Gold Medal','Awarded to the first place team in the New Eden Open.',1,0.1,0,1,NULL,NULL,1,NULL,2093,NULL,0),(33071,314,'New Eden Open Silver Medal','Awarded to the second place team in the New Eden Open.',1,0.1,0,1,NULL,NULL,1,NULL,2093,NULL,0),(33072,314,'New Eden Open Bronze Medal','Awarded to the third place team in the New Eden Open.',1,0.1,0,1,NULL,NULL,1,NULL,2093,NULL,0),(33073,314,'New Eden Open Fourth Place Medal','Because in the game of self respect, everyone\'s a winner!',1,0.1,0,1,NULL,NULL,1,NULL,2093,NULL,0),(33076,1199,'Small Ancillary Armor Repairer','This module uses nano-assemblers to repair damage done to the armor of the ship. The module can optionally use Nanite Repair Paste to increase repair effectiveness. Deactivating the module while it has no Nanite Repair Paste loaded starts reloading, if there is Nanite Repair Paste available in cargo hold. \r\n\r\nNote: Can use Nanite Repair Paste as fuel. Reloading time is 60 seconds. Prototype Inferno Module.',500,5,0.08,1,NULL,NULL,1,1049,80,NULL,0),(33077,1200,'Small Ancillary Armor Repairer Blueprint','',0,0.01,0,1,NULL,200000.0000,1,NULL,80,NULL,0),(33078,1210,'Armor Layering','Skill at installing upgraded armor plates efficiently and securely, reducing the impact they have on agility and speed. Grants a 5% reduction to armor plate mass penalty per level.',0,0.01,0,1,NULL,1000000.0000,1,1745,33,NULL,0),(33079,237,'Hematos','The Hematos is one of the smallest Blood Raider vessels in existence, though that doesn\'t make its appearance any less terrifying to the hapless innocents it may encounter. Like a spider, it is built to trap and drain any victim careless enough to wander into its clutches.\r\n\r\nThe Hematos is often employed by novice ship captains and staffed with crew that may not quite have mastered the art of bloodletting, which goes some way to explain its saturation of onboard cleaning systems.',1148000,28100,115,1,4,NULL,1,1619,NULL,20063,1762),(33080,105,'Hematos Blueprint','',0,0.01,0,1,4,9999999.0000,0,NULL,NULL,NULL,299),(33081,237,'Taipan','The Taipan is one of the smaller types of Gurista vessels. While the design is based on a pre-existing Caldari ship type - the Guristas delight in stealing anything they can from their hated enemies - its internal workings have been heavily modified. Not content to rely on the Caldari\'s focus on missile combat, the Guristas have added the drone power of the Gallente.',1163000,15000,125,1,1,NULL,1,1619,NULL,20070,1829),(33082,105,'Taipan Blueprint','',0,0.01,0,1,1,9999999.0000,0,NULL,NULL,NULL,312),(33083,237,'Violator','The Violator is one of the smallest of the Serpentis vessels. Its design was unceremoniously stolen from the Gallente, though its inner workings have been adapted to fit the piratical lifestyle of the Serpentis: In addition to its excellent hybrid damage, it is capable of webbing its opponents and holding them down for a further beating.',1148000,24500,135,1,8,NULL,1,1619,NULL,20074,1816),(33084,105,'Violator Blueprint','',0,0.01,0,1,8,9999999.0000,0,NULL,NULL,NULL,321),(33087,303,'Advanced Cerebral Accelerator','Cerebral accelerators are military-grade boosters that significantly increase a new pilot\'s skill development. This technology is usually available only to naval officers, but CONCORD has authorized the release of a small number to particularly promising freelance capsuleers.<br><br>This booster primes the brain\'s neural pathways and hippocampus, making it much more receptive to intensive remapping. This allows new capsuleers to more rapidly absorb information of all kinds.<br><br>The only drawback to this booster is that capsuleer training renders it ineffective after a while; as such, it will cease to function for pilots who have been registered for more than 7 days.<br><br>\r\nBonuses: +17 to all attributes',1,1,0,1,NULL,32768.0000,1,NULL,10144,NULL,0),(33088,718,'Advanced Cerebral Accelerator Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,21,NULL,0),(33091,257,'Amarr Destroyer','Skill at operating Amarr destroyers.',0,0.01,0,1,4,100000.0000,1,377,33,NULL,0),(33092,257,'Caldari Destroyer','Skill at operating Caldari destroyers.',0,0.01,0,1,1,100000.0000,1,377,33,NULL,0),(33093,257,'Gallente Destroyer','Skill at operating Gallente destroyers.',0,0.01,0,1,8,100000.0000,1,377,33,NULL,0),(33094,257,'Minmatar Destroyer','Skill at operating Minmatar destroyers.',0,0.01,0,1,2,100000.0000,1,377,33,NULL,0),(33095,257,'Amarr Battlecruiser','Skill at operating Amarr battlecruisers.',0,0.01,0,1,4,1000000.0000,1,377,33,NULL,0),(33096,257,'Caldari Battlecruiser','Skill at operating Caldari battlecruisers.',0,0.01,0,1,1,1000000.0000,1,377,33,NULL,0),(33097,257,'Gallente Battlecruiser','Skill at operating Gallente battlecruisers.',0,0.01,0,1,8,1000000.0000,1,377,33,NULL,0),(33098,257,'Minmatar Battlecruiser','Skill at operating Minmatar battlecruisers.',0,0.01,0,1,2,1000000.0000,1,377,33,NULL,0),(33099,420,'Nefantar Thrasher','Engineered as a supplement to its big brother the Cyclone, the Thrasher\'s tremendous turret capabilities and advanced tracking computers allow it to protect its larger counterpart from smaller, faster menaces. The integration of the newly re-established <a href=\"http://wiki.eveonline.com/en/wiki/Nefantar\">Nefantar tribe</a> into Minmatar society has been a trying process for all involved. One recent success has been the commissioning of a fledgling patrol fleet to protect the tribe\'s new spaceborne assets: as other tribes have stocked up on newer Talwar-class destroyers, the Nefantar have managed to acquire a large stock of older Thrashers for their own use. Keen to raise their visibility within the Minmatar Republic, they have been more than happy to allow willing capsuleers to acquire surplus hulls on the condition that they remain painted in Nefantar colors.',1600000,43000,400,1,2,NULL,0,NULL,NULL,20078,20245),(33101,1199,'Medium Ancillary Armor Repairer','This module uses nano-assemblers to repair damage done to the armor of the ship. The module can optionally use Nanite Repair Paste to increase repair effectiveness. Deactivating the module while it has no Nanite Repair Paste loaded starts reloading, if there is Nanite Repair Paste available in cargo hold. \r\n\r\nNote: Can use Nanite Repair Paste as fuel. Reloading time is 60 seconds. Prototype Inferno Module.',500,10,0.32,1,NULL,NULL,1,1050,80,NULL,0),(33102,1200,'Medium Ancillary Armor Repairer Blueprint','',0,0.01,0,1,NULL,200000.0000,1,NULL,80,NULL,0),(33103,1199,'Large Ancillary Armor Repairer','This module uses nano-assemblers to repair damage done to the armor of the ship. The module can optionally use Nanite Repair Paste to increase repair effectiveness. Deactivating the module while it has no Nanite Repair Paste loaded starts reloading, if there is Nanite Repair Paste available in cargo hold. \r\n\r\nNote: Can use Nanite Repair Paste as fuel. Reloading time is 60 seconds. ',500,50,0.64,1,NULL,NULL,1,1051,80,NULL,0),(33104,1200,'Large Ancillary Armor Repairer Blueprint','',0,0.01,0,1,NULL,200000.0000,1,NULL,80,NULL,0),(33107,1089,'Men\'s \'Quafe\' T-shirt YC 115','Stand out in a crowd with your comfortable new Quafe Commemorative Casual Wear, designed exclusively for attendees of the YC 115 Impetus Annual Holoreel Convention. \r\n\r\nNote: While occasionally worn by holoreel stars, Quafe Commemorative Casual Wear is not guaranteed to net you a role in any kind of visual production, at least not one that involves any dialogue. ',0.5,0.1,0,1,4,NULL,1,1398,21013,NULL,0),(33109,1089,'Women\'s \'Quafe\' T-shirt YC 115','Stand out in a crowd with your comfortable new Quafe Commemorative Casual Wear, designed exclusively for attendees of the YC 115 Impetus Annual Holoreel Convention. \r\n\r\nNote: While occasionally worn by holoreel stars, Quafe Commemorative Casual Wear is not guaranteed to net you a role in any kind of visual production, at least not one that involves any dialogue. ',0.5,0.1,0,1,4,NULL,1,1406,21014,NULL,0),(33111,303,'Prototype Cerebral Accelerator','Cerebral accelerators are military-grade boosters that significantly increase a new pilot\'s skill development. This technology is usually available only to naval officers, but CONCORD has authorized the release of a small number to particularly promising freelance capsuleers.<br><br>This booster primes the brain\'s neural pathways and hippocampus, making it much more receptive to intensive remapping. This allows new capsuleers to more rapidly absorb information of all kinds.<br><br>The only drawback to this booster is that capsuleer training renders it ineffective after a while; as such, it will cease to function for pilots who have been registered for more than 14 days.<br><br>\r\nBonuses: +9 to all attributes',1,1,0,1,NULL,32768.0000,1,NULL,10144,NULL,0),(33112,718,'Prototype Cerebral Accelerator Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,21,NULL,0),(33117,314,'Bronze Order of the Mountain','The Bronze Order of the Mountain is an ancient Caldari establishment, dating back to the Raata Empire. Those who did great service were inducted into its ranks and initiated into the rites of Mountain Wind. While it has lost the mystic aspects over the centuries, it remains a high honor to be inducted into its ranks.<br><br>\r\nOnly I can make myself fail. - Caldari proverb\r\n',0.1,0.1,0,1,NULL,NULL,1,NULL,2532,NULL,0),(33118,314,'Iron Order of the Storm','Made up of those Caldari who stand resolute in the face of great hardship, the Iron Order of the Storm is considered one of the greatest awards the State can bestow. It draws on the imagery of Storm Wind, whose ferocity cannot be stopped, no matter how many stand against him.<br><br> \r\nI shall not stand aside. I must hold; not for my own sake, but for the sake of others.  Yakiya Tovil-Toba\r\n',0.1,0.1,0,1,NULL,NULL,1,NULL,2532,NULL,0),(33119,314,'Steel Order of the Cold','Created in the early days of the Caldari-Gallente War, the Steel Order of the Cold was awarded to those brave men and women who sacrificed themselves for the Caldari people. It is the greatest capsuleer honor that can be awarded in the State, being given to those who stand resolute and persevere despite all risk.<br><br> \r\nDoes it matter if we are remembered? Our sacrifice matters. - Admiral Yakiya Tovil-Toba\'s last speech',0.1,0.1,0,1,NULL,NULL,1,NULL,2532,NULL,0),(33120,314,'Badge of Prophet Kuria','The Badge of Prophet Kuria is given to those who show dedication and loyalty to the Amarr Empire. In recent years it has been given to capsuleers who assist the Empire in tasks of great importance.<br><br>\r\nThough dissuaded, I came. Though perilous, I served. Though beset, I persevered. Though denied, I believed. - The Scriptures, Prophet Kuria 12:18\r\n',1,0.1,0,1,NULL,NULL,1,NULL,2705,NULL,0),(33121,314,'Star of the Sefrim','The Star of the Sefrim is awarded to those who go above and beyond the call of duty in service to the Empire, particularly those whose actions place them into mortal danger. While capsuleers rarely risk permanent death, the Empire sometimes acknowledges the loss of body regardless.<br><br>\r\nFrom on high, they came with wisdom and mercy. They delivered greatness to the people. But when provoked, their wroth was immutable.- The Scriptures, Book of Missions, 45:3\r\n',1,0.1,0,1,NULL,NULL,1,NULL,2705,NULL,0),(33122,314,'Senatorial Silver Star','Traditionally, the Senatorial Silver Star was awarded only to those who passed a special vote of the entire Senate. In recent decades, however, a special committee was formed to award it to any capsuleer who toiled to spread and encourage the ideals of the Gallente Federation.<br><br>  \r\nNever falter in your ideals. - Senator Fronte Belliare ',0.1,1,0,1,NULL,NULL,1,NULL,2096,NULL,0),(33123,314,'Gold Medallion of Liberty','The Federation has long encouraged its citizens to stand up against oppression, plight, and wrongdoing. For those capsuleers who, at promise of no gain to themselves, stand brave against tyranny, the Gold Medallion of Liberty is a small acknowledgment of the Federation\'s gratitude.<br><br> \r\nIt is our duty to spread justice. We cannot allow anyone to oppose that. - President Arlette Villers \r\n',0.1,1,0,1,NULL,NULL,1,NULL,2096,NULL,0),(33124,314,'Platinum Medallion of Freedom','Freedom is the highest ideal of the Gallente Federation and the Platinum Medallion of Freedom is bestowed only on those selected by the President himself. To be awarded this prestigious honor requires the potential for extreme personal harm in order to advance the Federation\'s values throughout New Eden.<br><br> \r\nIf we do not stand up for peace, how can anyone else? - President Aidonis Elabon',0.1,1,0,1,NULL,NULL,1,NULL,2096,NULL,0),(33125,314,'Dagger of Coricia','Representing those who have gone through hardship and persevered, the Dagger of Coricia is awarded to individuals who do great service to the Minmatar people. While normally awarded to civil servants, it has been extended to others who fight and suffer on behalf of the Republic as well.<br><br> \r\nFrom the Sobaki Sands a man came with but rags and a dagger. Yet he lived still. - Excerpt from Vherokior Oral History',1,0.1,0,1,NULL,NULL,1,NULL,2093,NULL,0),(33126,314,'Spear of Matar','It is a rare combination of courage and dedication that earns an individual the Spear of Matar. It is awarded to any person a tribal elder considers worthy of great respect and reverence for their duties to the tribes or the Minmatar people.<br><br>  \r\nWhen the day was dark, it was the million flickers of firelight off the spearheads that gave us courage. - Excerpt from Krusual Oral History\r\n',1,0.1,0,1,NULL,NULL,1,NULL,2093,NULL,0),(33127,314,'Sword of Pator','Only recently created by act of Sanmatar Shakor, the Sword of Pator is the highest honor that can be awarded capsuleers for service to the Republic. At least four of the seven tribes must be in agreement before it can be awarded, making its conferment a rare and auspicious occasion.<br><br>  \r\nTribe, clan, and family. Together, they are our home. And when they are taken, we will stop at nothing to reclaim them. - Excerpt from Starkmanir Oral History\r\n',1,0.1,0,1,NULL,NULL,1,NULL,2093,NULL,0),(33128,314,'Defense of Caldari Prime Ribbon','This ribbon was awarded to the brave patriots who aided the most against the unprovoked assault against the Titan in orbit of Caldari Prime by the Gallente Federation in YC115. Your bravery and courage will not go unforgotten.<br><br> \r\n\"We will not permit you to tell us how to be Caldari, and so you leave us with no choice.\" - Excerpt from the Caldari Proclamation of Secession. CE 23154.11.22',0.1,0.1,0,1,NULL,NULL,1,NULL,2532,NULL,0),(33129,314,'Assault on Caldari Prime Ribbon','This ribbon was awarded to the righteous capsuleers who most ably answered the call of duty and assaulted the Titan in orbit of Caldari Prime in YC115. Your efforts to safeguard the lives of Federal citizens will always be remembered.<br><br> \r\n\"The savages have murdered the only ones with any sense among them. They lit the fire, now they will burn in it.\" - Senator Fronte Belliare, Morning of Reasoning. CE 23155.2.10\r\n',0.1,0.1,0,1,NULL,NULL,1,NULL,2532,NULL,0),(33132,551,'Angel Clone Soldier Trainer ','With the advent of clone soldiers, a new breed of pirate has arisen to take advantage of their existence. CONCORD, which had been content to leave the pirates be so long as they remained within their own territories, sees the presence of pirate-affiliated clone soldiers as a major threat to the safety of the cluster, and will go to extraordinary means to disrupt their operations.\r\n\r\nThis Angel Cartel pirate is a trainer, in charge of funds, equipment and locales used in the preparation and deployment of clone soldiers loyal to the faction. For the Cartel this primarily means keeping the requisite technologies up to date, so that the clone soldiers gain experience with advanced weaponry and learn to operate - or dismantle and destroy - complex machineries while under fire.\r\n\r\n\r\n',10900000,109000,120,1,2,NULL,0,NULL,NULL,31,337),(33134,561,'Guristas Clone Soldier Trainer','With the advent of clone soldiers, a new breed of pirate has arisen to take advantage of their existence. CONCORD, which had been content to leave the pirates be so long as they remained within their own territories, sees the presence of pirate-affiliated clone soldiers as a major threat to the safety of the cluster, and will go to extraordinary means to disrupt their operations.\r\n\r\nThis Guristas pirate is a trainer, in charge of funds, equipment and locales used in the preparation and deployment of clone soldiers loyal to the faction. For the Guristas this involves overseeing training for high-risk high-return operations and ensuring that for the soldiers in training, every shred of the fear of death will be eradicated from their minds by the time they leave the program. For those who survive the training, that is. ',10100000,101000,235,1,1,NULL,0,NULL,NULL,31,1824),(33135,555,'Blood Clone Soldier Trainer','With the advent of clone soldiers, a new breed of pirate has arisen to take advantage of their existence. CONCORD, which had been content to leave the pirates be so long as they remained within their own territories, sees the presence of pirate-affiliated clone soldiers as a major threat to the safety of the cluster, and will go to extraordinary means to disrupt their operations.\r\n\r\nThis Blood Raider pirate is a trainer, in charge of funds, equipment and locales used in the preparation and deployment of clone soldiers loyal to the faction. For the Blood Raiders this mainly involves keeping up a steady supply of nourishing blood of the absolute highest quality, preferably tapped from capsuleers. Or children. ',11800000,118000,235,1,4,NULL,0,NULL,NULL,31,1759),(33136,566,'Sansha Clone Soldier Trainer','With the advent of clone soldiers, a new breed of pirate has arisen to take advantage of their existence. CONCORD, which had been content to leave the pirates be so long as they remained within their own territories, sees the presence of pirate-affiliated clone soldiers as a major threat to the safety of the cluster, and will go to extraordinary means to disrupt their operations.\r\n\r\nThis Sansha\'s Nation pirate is a trainer, in charge of funds, equipment and locales used in the preparation and deployment of clone soldiers loyal to the faction. For the Sansha this involves making sure there\'s a steady supply of slaves who are able to function in various ancillary services, up to and including equipment checks, training grounds maintenance, and training dummies.',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,1236),(33137,571,'Serpentis Clone Soldier Trainer','With the advent of clone soldiers, a new breed of pirate has arisen to take advantage of their existence. CONCORD, which had been content to leave the pirates be so long as they remained within their own territories, sees the presence of pirate-affiliated clone soldiers as a major threat to the safety of the cluster, and will go to extraordinary means to disrupt their operations.\r\n\r\nThis Serpentis pirate is a trainer, in charge of funds, equipment and locales used in the preparation and deployment of clone soldiers loyal to the faction. For the Serpentis this means heavy training in highly involved tactics so that the troops - which are expected to be used extensively - can bring success in a myriad of different circumstances. ',11200000,112000,480,1,8,NULL,0,NULL,NULL,31,1815),(33138,1206,'Clone Soldier Trainer Tag','This tag came from a pirate who had been negotiating combat contracts for pirate-trained clone soldiers.\r\n\r\nGiven the extraordinary dangers that result from clone soldiers, CONCORD has taken a firm stance against anyone involved with them, and will award a security status boost to the person who brings in these tags. They may be handed in at station Security Offices in low-security space.',0.1,0.1,0,1,NULL,1500000.0000,1,1700,21028,NULL,0),(33139,1206,'Clone Soldier Recruiter Tag','This tag came from a pirate who had been negotiating combat contracts for pirate-trained clone soldiers.\r\n\r\nGiven the extraordinary dangers that result from clone soldiers, CONCORD has taken a firm stance against anyone involved with them, and will award a security status boost to the person who brings in these tags. They may be handed in at station Security Offices in low-security space.',0.1,0.1,0,1,NULL,2000000.0000,1,1700,21029,NULL,0),(33140,1206,'Clone Soldier Transporter Tag','This tag came from a pirate who had been negotiating combat contracts for pirate-trained clone soldiers.\r\n\r\nGiven the extraordinary dangers that result from clone soldiers, CONCORD has taken a firm stance against anyone involved with them, and will award a security status boost to the person who brings in these tags. They may be handed in at station Security Offices in low-security space.',0.1,0.1,0,1,NULL,2500000.0000,1,1700,21030,NULL,0),(33141,1206,'Clone Soldier Negotiator Tag','This tag came from a pirate who had been negotiating combat contracts for pirate-trained clone soldiers.\r\n\r\nGiven the extraordinary dangers that result from clone soldiers, CONCORD has taken a firm stance against anyone involved with them, and will award a security status boost to the person who brings in these tags. They may be handed in at station Security Offices in low-security space.',0.1,0.1,0,1,NULL,3000000.0000,1,1700,21032,NULL,0),(33142,566,'Sansha Clone Soldier Recruiter','With the advent of clone soldiers, a new breed of pirate has arisen to take advantage of their existence. CONCORD, which had been content to leave the pirates be so long as they remained within their own territories, sees the presence of pirate-affiliated clone soldiers as a major threat to the safety of the cluster, and will go to extraordinary means to disrupt their operations. \r\n\r\nThis Sansha\'s Nation pirate is a recruiter, in charge of scouting vulnerable areas - remote planets, isolated outposts, interstellar colonies and other places that hold human life - with the aim of bringing in new recruits for the pirates\' clone soldier programs. The Sansha have trouble acquiring voluntary recruits at the best of times, and so they\'ve put a lot of effort in finding and training people who can continue fighting beyond even death itself. ',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,1236),(33143,551,'Angel Clone Soldier Recruiter','With the advent of clone soldiers, a new breed of pirate has arisen to take advantage of their existence. CONCORD, which had been content to leave the pirates be so long as they remained within their own territories, sees the presence of pirate-affiliated clone soldiers as a major threat to the safety of the cluster, and will go to extraordinary means to disrupt their operations. \r\n\r\nThis Angel Cartel pirate is a recruiter, in charge of scouting vulnerable areas - remote planets, isolated outposts, interstellar colonies and other places that hold human life - with the aim of bringing in new recruits for the pirates\' clone soldier programs. The Cartel are always trying to perfect their technologies, the clone soldier program included, and need new people to test their theories on. \r\n\r\n',10900000,109000,120,1,2,NULL,0,NULL,NULL,31,337),(33144,555,'Blood Clone Soldier Recruiter ','With the advent of clone soldiers, a new breed of pirate has arisen to take advantage of their existence. CONCORD, which had been content to leave the pirates be so long as they remained within their own territories, sees the presence of pirate-affiliated clone soldiers as a major threat to the safety of the cluster, and will go to extraordinary means to disrupt their operations. \r\n\r\nThis Blood Raider pirate is a recruiter, in charge of scouting vulnerable areas - remote planets, isolated outposts, interstellar colonies and other places that hold human life - with the aim of bringing in new recruits for the pirates\' clone soldier programs. The Blood Raiders are always hungry for new blood. ',11800000,118000,235,1,4,NULL,0,NULL,NULL,31,1759),(33145,561,'Guristas Clone Soldier Recruiter','With the advent of clone soldiers, a new breed of pirate has arisen to take advantage of their existence. CONCORD, which had been content to leave the pirates be so long as they remained within their own territories, sees the presence of pirate-affiliated clone soldiers as a major threat to the safety of the cluster, and will go to extraordinary means to disrupt their operations. \r\n\r\nThis Guristas pirate is a recruiter, in charge of scouting vulnerable areas - remote planets, isolated outposts, interstellar colonies and other places that hold human life - with the aim of bringing in new recruits for the pirates\' clone soldier programs. The Guristas are constantly in need of those who dare go further than most, and who have no fear of death. ',10100000,101000,235,1,1,NULL,0,NULL,NULL,31,1824),(33146,571,'Serpentis Clone Soldier Recruiter ','With the advent of clone soldiers, a new breed of pirate has arisen to take advantage of their existence. CONCORD, which had been content to leave the pirates be so long as they remained within their own territories, sees the presence of pirate-affiliated clone soldiers as a major threat to the safety of the cluster, and will go to extraordinary means to disrupt their operations.\r\n\r\nThis Serpentis pirate is a recruiter, in charge of scouting vulnerable areas - remote planets, isolated outposts, interstellar colonies and other places that hold human life - with the aim of bringing in new recruits for the pirates\' clone soldier programs. The Serpentis are involved in a complex web of warfare and need a constant supply of good, loyal soldiers to back up their devious plans. ',11200000,112000,480,1,8,NULL,0,NULL,NULL,31,1815),(33147,1207,'Angel Remains','This piece of floating remains look intriguing, but requires analyzing equipment before it yields any of its secrets.',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,20295),(33149,1212,'Personal Hangar Array','A large hangar structure, for easy storage of materials and modules.\r\n\r\nThis hangar is designed for personal storage of moderate volume items, and each individual only has access to their own section of the storage space.',100000000,4000,50000,1,NULL,10000000.0000,1,1702,NULL,NULL,2601),(33150,1048,'Personal Hangar Array Blueprint','',0,0.01,0,1,NULL,300000000.0000,1,1701,0,NULL,0),(33151,419,'Brutix Navy Issue','This ship was born out of the experience gained by the Federation after the launch of the Talos-Class Attack Battlecruiser. Sensing that the Brutix hull could be refined further, it was decided to remove all notion of active defense from it to favor improvements to its already significant damage potential. The final outcome of this experiment resulted in the Brutix Navy Issue, a vessel that already shows great potential from the few skirmishes it has been into so far.',11800000,270000,475,1,8,27000000.0000,1,1704,NULL,20072,20229),(33152,489,'Brutix Navy Issue Blueprint','',0,0.01,0,1,NULL,570000000.0000,1,NULL,NULL,NULL,0),(33153,419,'Drake Navy Issue','After the resounding success tied to the launch of the Drake-class Battlecruiser, the Caldari Navy signed up a massive order to acquire a specific version for its own arsenals. The outcome, the Drake Navy Issue, while sharing a similar look with its step-father, serves a completely different purpose on the battlefield. Being more mobile, able to project missiles more effectively at range, against smaller targets and on a wider selection of damage types, this ship is ideal to support small scale conflicts and raids.',13500000,252000,450,1,1,38000000.0000,1,1704,NULL,20068,20283),(33154,489,'Drake Navy Issue Blueprint','',0,0.01,0,1,NULL,580000000.0000,1,NULL,NULL,NULL,0),(33155,419,'Harbinger Navy Issue','While the Harbinger is a formidable vessel on its own, recent reports have raised its lack of flexibility as a noteworthy concern in the ever-shifting fleet tactic doctrines. Working hard to correct this problem, Imperial engineers came up with the improved Navy Issue variant. Boasting upgraded tracking systems, enhanced resilience and an advanced medium slot configuration layout, the Harbinger Navy Issue is a radical change over its predecessor, capable of astounding performance in a much wider spectrum of engagements.',15500000,234000,375,1,4,38500000.0000,1,1704,NULL,20061,20227),(33156,489,'Harbinger Navy Issue Blueprint','',0,0.01,0,1,NULL,585000000.0000,1,NULL,NULL,NULL,0),(33157,419,'Hurricane Fleet Issue','In YC 115, after much heated discussion, CONCORD issued a decree stating the Hurricane-Class Battlecruiser was far too effective to stay under its current technological label, and demanded the Minmatar Republic to either cease production or sort it as a more technologically advanced craft. The Tribal Council grudgingly complied by releasing a simplified version of the Hurricane, then quickly exploited a loophole in the legislation and began using the original overpowered hull as part of its active fleet force. And that is how, after a new paint coat and renaming fees that the Hurricane Fleet Issue came to be.',12800000,216000,425,1,2,36500000.0000,1,1704,NULL,20076,20230),(33158,489,'Hurricane Fleet Issue Blueprint','',0,0.01,0,1,NULL,565000000.0000,1,NULL,NULL,NULL,0),(33163,566,'Sansha Clone Soldier Transporter','With the advent of clone soldiers, a new breed of pirate has arisen to take advantage of their existence. CONCORD, which had been content to leave the pirates be so long as they remained within their own territories, sees the presence of pirate-affiliated clone soldiers as a major threat to the safety of the cluster, and will go to extraordinary means to disrupt their operations. \r\n\r\nThis Sansha\'s Nation pirate is a transporter, responsible for the swift conveyance of clone soldiers to their intended destination. With the Sansha this tends to involve small clusters of isolated populations that are fighting back with every shred of strength they have, and need to be softened up before Nation comes in to bring a final, quiet peace.  ',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,1236),(33164,571,'Serpentis Clone Soldier Transporter','With the advent of clone soldiers, a new breed of pirate has arisen to take advantage of their existence. CONCORD, which had been content to leave the pirates be so long as they remained within their own territories, sees the presence of pirate-affiliated clone soldiers as a major threat to the safety of the cluster, and will go to extraordinary means to disrupt their operations.\r\n\r\nThis Serpentis pirate is a transporter, responsible for the swift conveyance of clone soldiers to their intended destination. With the Serpentis this generally involves areas that, due to high risk, strategic importance or various other cryptic military reasons, need to be assaulted by groups that are small, highly qualified and utterly unrelenting. ',11200000,112000,480,1,8,NULL,0,NULL,NULL,31,1815),(33172,555,'Blood Clone Soldier Transporter','With the advent of clone soldiers, a new breed of pirate has arisen to take advantage of their existence. CONCORD, which had been content to leave the pirates be so long as they remained within their own territories, sees the presence of pirate-affiliated clone soldiers as a major threat to the safety of the cluster, and will go to extraordinary means to disrupt their operations. \r\n\r\nThis Blood Raider pirate is a transporter, responsible for the swift conveyance of clone soldiers to their intended destination. With the Blood Raiders that usually means dropping in on areas whose citizens possess an abundance of valuable blood, particularly in the bodies of young children, but who have proven irritatingly resistant to invasion until now.',11800000,118000,235,1,4,NULL,0,NULL,NULL,31,1759),(33173,551,'Angel Clone Soldier Transporter','With the advent of clone soldiers, a new breed of pirate has arisen to take advantage of their existence. CONCORD, which had been content to leave the pirates be so long as they remained within their own territories, sees the presence of pirate-affiliated clone soldiers as a major threat to the safety of the cluster, and will go to extraordinary means to disrupt their operations. \r\n\r\nThis Angel Cartel pirate is a transporter, responsible for the swift conveyance of clone soldiers to their intended destination. With the Cartel that usually involves places containing a preponderance of unknown and possibly dangerous technologies to salvage, under circumstances where the enemy is scrambling either to hide those technologies or use them on the Angels.\r\n\r\n',10900000,109000,120,1,2,NULL,0,NULL,NULL,31,337),(33174,561,'Guristas Clone Soldier Transporter','With the advent of clone soldiers, a new breed of pirate has arisen to take advantage of their existence. CONCORD, which had been content to leave the pirates be so long as they remained within their own territories, sees the presence of pirate-affiliated clone soldiers as a major threat to the safety of the cluster, and will go to extraordinary means to disrupt their operations. \r\n\r\nThis Guristas pirate is a transporter, responsible for the swift conveyance of clone soldiers to their intended destination. With the Guristas those destinations tend to be areas so thoroughly abundant in danger, shrouded in uncertainty, and densely populated with enemy numbers that even the most hotheaded pirate faction in the cluster still hesitates to enter the fray with anything less than immortal soldiers.',10100000,101000,235,1,1,NULL,0,NULL,NULL,31,1824),(33175,551,'Angel Clone Soldier Negotiator','With the advent of clone soldiers, a new breed of pirate has arisen to take advantage of their existence. CONCORD, which had been content to leave the pirates be so long as they remained within their own territories, sees the presence of pirate-affiliated clone soldiers as a major threat to the safety of the cluster, and will go to extraordinary means to disrupt their operations. \r\n\r\nThis Angel Cartel pirate is a negotiator, a fixer who establishes contracts between pirate-trained clone soldiers and those who have sought out the most technologically advanced pirate faction for a reason - often to do with the extraction of delicate materials under adverse conditions - and who will only trust the most technologically complex forces that the faction has to offer.\r\n\r\n',10900000,109000,120,1,2,NULL,0,NULL,NULL,31,337),(33176,1238,'Scan Acquisition Array I','Reduces the scan time of scan probes.\r\n\r\nOnly one Scan Acquisition Array module can be fitted at max.\r\n\r\n',0,5,1,1,NULL,9870.0000,1,1709,21025,NULL,0),(33177,1239,'Scan Acquisition Array I Blueprint','',0,0.01,0,1,NULL,600000.0000,1,1707,21,NULL,0),(33178,1223,'Scan Pinpointing Array I','Reduces the scan deviation when scanning with scan probes.\r\n\r\nPenalty: Using more than one type of this module or similar modules or rigs that affect the same attribute on the ship will result in diminishing returns.',0,5,1,1,NULL,9870.0000,1,1709,21026,NULL,0),(33179,1224,'Scan Pinpointing Array I Blueprint','',0,0.01,0,1,NULL,600000.0000,1,1707,21,NULL,0),(33180,1223,'Scan Rangefinding Array I','Increases the scan strength when scanning with scan probes.\r\n\r\nPenalty: Using more than one type of this module or similar modules or rigs that affect the same attribute on the ship will result in diminishing returns.',0,5,1,1,NULL,9870.0000,1,1709,21027,NULL,0),(33181,1224,'Scan Rangefinding Array I Blueprint','',0,0.01,0,1,NULL,600000.0000,1,1707,21,NULL,0),(33182,555,'Blood Clone Soldier Negotiator','With the advent of clone soldiers, a new breed of pirate has arisen to take advantage of their existence. CONCORD, which had been content to leave the pirates be so long as they remained within their own territories, sees the presence of pirate-affiliated clone soldiers as a major threat to the safety of the cluster, and will go to extraordinary means to disrupt their operations. \r\n\r\nThis Blood Raider pirate is a negotiator, a fixer who establishes contracts between pirate-trained clone soldiers and those whose ways of acquiring fresh blood are too dark, violent or dangerous to be stomached by regular soldiers, even in a faction renowned for its gruesome brutality.',11800000,118000,235,1,4,NULL,0,NULL,NULL,31,1759),(33183,566,'Sansha Clone Soldier Negotiator','With the advent of clone soldiers, a new breed of pirate has arisen to take advantage of their existence. CONCORD, which had been content to leave the pirates be so long as they remained within their own territories, sees the presence of pirate-affiliated clone soldiers as a major threat to the safety of the cluster, and will go to extraordinary means to disrupt their operations. \r\n\r\nThis Sansha\'s Nation pirate is a negotiator, a fixer who establishes contracts between pirate-trained clone soldiers and those who, despite the horrors of Nation, are drawn like flies to a powerful, unyielding empire staffed by an upper level of geniuses, a lower level of unstoppable drones, and now a section of soldiers that cannot be killed.',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,1236),(33185,571,'Serpentis Clone Soldier Negotiator','With the advent of clone soldiers, a new breed of pirate has arisen to take advantage of their existence. CONCORD, which had been content to leave the pirates be so long as they remained within their own territories, sees the presence of pirate-affiliated clone soldiers as a major threat to the safety of the cluster, and will go to extraordinary means to disrupt their operations.\r\n\r\nThis Serpentis pirate is a negotiator, a fixer who establishes contracts between pirate-trained clone soldiers and those who, like the Serpentis, are playing the long game of strategy and counter-strategy, and whose tactical needs are served best by shadowy associations with a small but unstoppable force of death.',11200000,112000,480,1,8,NULL,0,NULL,NULL,31,1815),(33186,1207,'Angel Debris','This piece of floating debris looks intriguing, but requires analyzing equipment before it yields any of its secrets.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,20296),(33187,1207,'Angel Mainframe','If you have the right equipment you might be able to hack into the mainframe and get some valuable information.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,20182,20298),(33188,1207,'Angel Info Shard','If you have the right equipment you might be able to hack into the info shard and get some valuable information.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,20182,20297),(33189,561,'Guristas Clone Soldier Negotiator','With the advent of clone soldiers, a new breed of pirate has arisen to take advantage of their existence. CONCORD, which had been content to leave the pirates be so long as they remained within their own territories, sees the presence of pirate-affiliated clone soldiers as a major threat to the safety of the cluster, and will go to extraordinary means to disrupt their operations. \r\n\r\nThis Guristas pirate is a negotiator, a fixer who establishes contracts between pirate-trained clone soldiers and those whose missions are so dangerous, so volatile or outright crazy that even the notorious faction of thrillseekers and madmen won\'t dare risk them - except for the small but rapidly growing section that no longer truly needs have any fear of death.',10100000,101000,235,1,1,NULL,0,NULL,NULL,31,1824),(33190,25,'Tash-Murkon Magnate','This Magnate-class frigate is one of the most decoratively designed ship classes in the Amarr Empire, considered to be a pet project for a small, elite group of royal ship engineers for over a decade. The frigate\'s design has gone through several stages over the past decade, and new models of the Magnate appear every few years.<br><br>In recent times the royal Amarr Houses have shown increased interest in the design. House Tash-Murkon came to the fore in Amarr politics only after the fall of another, disgraced house, and while they possess great wealth and considerable power, some feel they do not command the respect of the original, highborn royal Houses. This Magnate is a clear statement by house Tash-Murkon that they possess all the grandeur and powerful grace required to stand beside the most pious of Amarr, and despite a few nattering voices claiming they are yet again trying to purchase divinity, most people applaud the vessel as a proper effort to honor the glory of the Almighty.',1072000,22100,400,1,4,NULL,0,NULL,NULL,20063,20300),(33191,105,'Tash-Murkon Magnate Blueprint','',0,0.01,0,1,NULL,2775000.0000,1,NULL,NULL,NULL,0),(33195,334,'Spatial Attunement Unit','Sensor Component used primarily for scanning equipment. \r\n\r\nMainly found in Relic sites.     ',1,1,0,1,NULL,NULL,1,1147,2185,NULL,0),(33196,447,'Spatial Attunement Unit Blueprint','',0,0.01,0,1,NULL,5000000.0000,1,NULL,96,NULL,0),(33197,1238,'Scan Acquisition Array II','Reduces the scan time of scan probes.\r\n\r\nOnly one Scan Acquisition Array module can be fitted at max.\r\n',0,5,1,1,NULL,9870.0000,1,1709,21025,NULL,0),(33198,1239,'Scan Acquisition Array II Blueprint','',0,0.01,0,1,NULL,600000.0000,1,NULL,21,NULL,0),(33199,1223,'Scan Pinpointing Array II','Reduces the scan deviation when scanning with scan probes.\r\n\r\nPenalty: Using more than one type of this module or similar modules or rigs that affect the same attribute on the ship will result in diminishing returns.',0,5,1,1,NULL,9870.0000,1,1709,21026,NULL,0),(33200,1224,'Scan Pinpointing Array II Blueprint','',0,0.01,0,1,NULL,600000.0000,1,NULL,21,NULL,0),(33201,1223,'Scan Rangefinding Array II','Increases the scan strength when scanning with scan probes.\r\n\r\nPenalty: Using more than one type of this module or similar modules or rigs that affect the same attribute on the ship will result in diminishing returns.',0,5,1,1,NULL,9870.0000,1,1709,21027,NULL,0),(33202,1224,'Scan Rangefinding Array II Blueprint','',0,0.01,0,1,NULL,600000.0000,1,NULL,21,NULL,0),(33213,1194,'A piece of Steve','Metal scrap retrieved from the destroyed <url=showinfo:11567>Avatar</url> class Titan named Steve.\r\n\r\nConstructed by the <url=showinfo:16159//327815755>Ascendant Frontier</url> (ASCN) capsuleer alliance with final construction completed on September 9th 2006. Steve was the first ever Titan vessel to be constructed and piloted by a capsuleer.\r\n\r\nIts primary pilot was <url=showinfo:1376//211311803>CYVOK</url>, <url=showinfo:16159//327815755>ASCN\'</url> executor. Steve was eventually destroyed by the <url=showinfo:16159//632866070>Band of Brothers</url> capsuleer alliance on December 11th 2006 at 18:36 in the <url=showinfo:5//30003109>C9N-CC</url> solar system.',0,0.01,0,1,NULL,NULL,1,1661,21062,NULL,0),(33214,1194,'Band of Brothers Director Access Key','A director level access key for the now closed <url=showinfo:16159//632866070>Band of Brothers</url> capsuleer alliance.\r\n\r\nNormally deactivated upon the respected owners departure from an alliance, historical events have shown that certain access keys sometimes just never get deactivated.\r\n\r\nSince the alliance is closed these keys are of no value except to historians.',0,0.01,0,1,NULL,NULL,1,1661,21063,NULL,0),(33215,1194,'Press pass to Prometheus Station opening','An old press pass to the grand opening of the first capsuleer built outpost in New Eden.\r\n\r\n<url=showinfo:21646//61000002>Prometheus Station</url>, a <url=showinfo:21646>Minmatar Service Outpost</url>, was constructed by the <url=showinfo:16159//327815755>Ascendant Frontier</url> alliance and opened for operational use on August 20th 2005 above <url=showinfo:2016//40283493>planet X</url> of the <url=showinfo:5//30004477>5P-AIP</url> solar system.\r\n\r\nNote: The stations name has changed since it\'s initial opening and may continue to change over time.',0,0.01,0,1,NULL,NULL,1,1661,21061,NULL,0),(33217,1194,'Lost reminder to pay sov bill','On January 26th 2010 <url=showinfo:2//1000125>CONCORD</url> collected ISK from capsuleer alliances claiming territory in null security space. While most alliances received the reminder to pay their bills certain alliances either chose to ignore it or claimed to have never gotten the reminder.\n\nDue to these lost reminders and the subsequent failure to pay by several alliances <loc><url=showinfo:2//1000125>CONCORD</url> revoked their territorial claim on multiple solar systems. Several alliances were affected by this including <url=showinfo:16159//1899990246>Wildly Inappropriate.</url>, <url=showinfo:16159//1411711376>Legion of xXDEATHXx</url>, and most notably <url=showinfo:16159//824518128>GoonSwarm</url>. For both <url=showinfo:16159//1899990246>Wildly Inappropriate.</url> and <url=showinfo:16159//1411711376>Legion of xXDEATHXx</url> the response was simply to pay the bills and reclaim the solar systems. <url=showinfo:16159//824518128>GoonSwarm</url> however was in the middle of a war with <url=showinfo:16159//878776074>IT Alliance</url> over the ownership of <url=showinfo:3//10000060>Delve</url>.\n\n<url=showinfo:16159//878776074>IT Alliance</url> used <url=showinfo:16159//824518128>GoonSwarm\'s</url> failure to pay as an opportunity to conquer key systems including what many considered to be the core system of Delve, <url=showinfo:5//30004712>NOL-M9</url>.',0,0.01,0,1,NULL,NULL,1,1661,21060,NULL,0),(33218,1194,'Assassination Contract: Mirial','Target: <url=showinfo:1373//147548395>Mirial</url>\r\nContractor: <url=showinfo:2//1280094373>Guiding Hand Social Club</url>\r\nFee: 1,000,000,000 ISK\r\nRequired proof: Frozen corpse of <url=showinfo:1373//147548395>Mirial</url>\r\n\r\nDetails: To assassinate and deal as much financial and emotional damage as possible to <url=showinfo:1373//147548395>Mirial</url> - CEO of <url=showinfo:2//1859190473>Ubiqua Seraph</url> and executor of the <url=showinfo:16159//239739827>Aegis Militia</url> alliance.',0,0.01,0,1,NULL,NULL,1,1661,21066,NULL,0),(33219,1194,'Premier ticket for: The last G campaign','Chronicles of War: The last G campaign was released on June 22, 2006 by the capsuleer <url=showinfo:1377//1116448155>Bratwurst0r</url> to great critical acclaim.\r\n\r\n<url=showinfo:1377//1116448155>Bratwurst0r</url> describes the video as being \"not about ganks, its not about small fights, its not about action only...its more about how the last campaign evolved to the ending of <url=showinfo:16159//521550159>G Alliance</url> and <url=showinfo:16159//295773986>Imperial Republic Of the North</url>.\"\r\n\r\nThe director of this film wished to offer special thanks to fellow capsuleers <url=showinfo:1377//816290058>RaYmEn</url>, Wuzz, and <url=showinfo:1378//422248131>Seppel da\'FinNI</url>.',0,0.01,0,1,NULL,NULL,1,1661,21064,NULL,0),(33220,1194,'Premier ticket for: Clear Skies','Clear Skies is a three part story created by director <url=showinfo:1376//144571276>John Rourke</url>.\r\n\r\nUpon the initial release of Clear Skies on May 29, 2008 <url=showinfo:1376//144571276>John Rourke</url> had this to say: \"Two years of my hard work culminated in this, I\'m very proud of it and I hope you like it.\"\r\n\r\nA year later New Eden was graced with the release of Clear Skies 2 on May 10, 2009. It would be another two years until finally, Clear Skies 3, was released on May 29, 2011; 3 years to the day from when the first Clear Skies was released.\r\n\r\nUnfortunately for those wanting more Clear Skies <url=showinfo:1376//144571276>John Rourke</url> announced that Clear Skies 3 would be the last and final film in the series.',0,0.01,0,1,NULL,NULL,1,1661,21064,NULL,0),(33221,1194,'Premier ticket for: Day of Darkness','Released by <url=showinfo:1376//700586825>Dire Lauthris</url> (deceased) on April 23, 2007.\r\n\r\nLater followed by the even more successful Day of Darkness II which was released on March 30, 2009.',0,0.01,0,1,NULL,NULL,1,1661,21064,NULL,0),(33223,1225,'Alliance Tournament I: Band of Brothers','In claiming the title of the first ever Alliance Tournament Champions, <url=showinfo:16159//632866070>Band of Brothers</url> began the first great Tournament dynasty. They would remain undefeated in tournament play for the next two years.',0,0.01,0,1,NULL,NULL,1,1812,21065,NULL,0),(33224,1225,'Alliance Tournament II: Band of Brothers','Establishing themselves as the dominant force in the early tournament years, <url=showinfo:16159//632866070>Band of Brothers</url> had a stellar run in the Second Alliance Tournament capped off with their victory in the first and only Tournament final decided by a 1v1 Interceptor duel tiebreaker.',0,0.01,0,1,NULL,NULL,1,1812,21065,NULL,0),(33225,1225,'Alliance Tournament III: Band of Brothers','<url=showinfo:16159//632866070>Band of Brothers</url> ensured their place in Alliance Tournament history by securing the gold medal in the Third Alliance Tournament. Their three consecutive victories stands as a record that has been tied, but never broken as of YC 115.',0,0.01,0,1,NULL,NULL,1,1812,21065,NULL,0),(33226,1225,'Alliance Tournament III: Cult of War','<url=showinfo:16159//99001003>Cult of War</url> stunned the population of New Eden in their quarter-final match of the Third Alliance Tournament against <url=showinfo:16159//2031941852>Interstellar Alcohol Conglomerate</url> when they destroyed <url=showinfo:16159//2031941852>IAC\'s</url> rare and priceless <url=showinfo:11936>Apocalypse Imperial Issue</url> live on air. The dramatic destruction of this legendary vessel has gone down as one of the memorable moments in Alliance Tournament history.',0,0.01,0,1,NULL,NULL,1,1812,21065,NULL,0),(33227,1225,'Alliance Tournament IV: HUN Reloaded','<url=showinfo:16159//1399057309>HUN Reloaded</url> came out of nowhere to dominate and win the Fourth Alliance Tournament using a novel and effective strategy based around stealth bombers. This performance forever cemented the role of creative setup design as a key focus of top contender teams.',0,0.01,0,1,NULL,NULL,1,1812,21065,NULL,0),(33228,1225,'Alliance Tournament IV: Star Fraction','By the time the Fourth Alliance Tournament began, many pundits in New Eden considered the <url=showinfo:16159//632866070>Band of Brothers</url> team unstoppable. After three years of undefeated dominance and running a team setup claimed as unbeatable by their captain, it seemed like nobody could defeat <url=showinfo:16159//632866070>Band of Brothers</url>. That is, until the former champions came up against the <url=showinfo:16159//1439416485>The Star Fraction</url> on the final day of the tournament. With a swift charge of <url=showinfo:627>Thorax</url> cruisers in one of the most memorable matches to ever grace EVE TV, <url=showinfo:16159//1439416485>The Star Fraction</url> defeated the undefeatable and ended the first great Tournament dynasty.',0,0.01,0,1,NULL,NULL,1,1812,21065,NULL,0),(33229,1225,'Alliance Tournament V: Ev0ke','After an excellent run that included victories over defending champions <url=showinfo:16159//1399057309>HUN Reloaded</url> in the quarter-finals and upstart contender <url=showinfo:16159//703129312>Cry Havoc.</url> in the semi-finals, <url=showinfo:16159//1438160193>Ev0ke</url> took the gold medal in the Fifth Alliance Tournament with a viscous <url=showinfo:629>Rupture</url> charge in one of the most exciting finals in Tournament history.',0,0.01,0,1,NULL,NULL,1,1812,21065,NULL,0),(33230,1225,'Alliance Tournament VI: Pandemic Legion','After narrowly missing the crown in the Fourth and Fifth Tournaments, <url=showinfo:16159//386292982>Pandemic Legion</url> began their run of championships with an spectacularly close victory over the venerable  <url=showinfo:16159//627268059>R.U.R.</url> in the finals.',0,0.01,0,1,NULL,NULL,1,1812,21065,NULL,0),(33231,1225,'Alliance Tournament VII: Pandemic Legion','Firmly establishing themselves as one of the great Tournament dynasties, <url=showinfo:16159//386292982>Pandemic Legion</url> appeared to effortlessly push aside their competition in the Seventh Alliance Tournament, punctuated by masterful use of the underrated stealth bombers.',0,0.01,0,1,NULL,NULL,1,1812,21065,NULL,0),(33232,1225,'Alliance Tournament VIII: Pandemic Legion','In the Eighth Alliance Tournament <url=showinfo:16159//386292982>Pandemic Legion</url> became the first alliance to tie the <url=showinfo:16159//632866070>Band of Brothers</url> record with three consecutive gold medals. Their dominant performance was capped off with a finals victory over the emerging Tournament superpower of <url=showinfo:16159//551692893>HYDRA RELOADED</url>.',0,0.01,0,1,NULL,NULL,1,1812,21065,NULL,0),(33233,1207,'Angel Ruins','This piece of floating ruins looks intriguing, but requires analyzing equipment before it yields any of its secrets.',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,20295),(33234,1207,'Angel Rubble','This piece of floating rubble looks intriguing, but requires analyzing equipment before it yields any of its secrets.',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,20296),(33235,1207,'Angel Databank','If you have the right equipment you might be able to hack into the databank and get some valuable information.',10000,27500,2700,1,NULL,NULL,0,NULL,16,20182,20298),(33236,1207,'Angel Com Tower','If you have the right equipment you might be able to hack into the com tower and get some valuable information.',10000,27500,2700,1,NULL,NULL,0,NULL,16,20182,20297),(33237,1207,'Blood Debris','This piece of floating debris looks intriguing, but requires analyzing equipment before it yields any of its secrets.',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,20296),(33238,1207,'Blood Rubble','This piece of floating rubble looks intriguing, but requires analyzing equipment before it yields any of its secrets.',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,20296),(33239,1207,'Blood Remains','This piece of floating remains look intriguing, but requires analyzing equipment before it yields any of its secrets.',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,20295),(33240,1207,'Blood Ruins','This piece of floating ruins looks intriguing, but requires a