er: +2 <br>Material Efficiency Modifier: +1 <br>Time Efficiency Modifier: -2',1,1,0,1,NULL,NULL,1,NULL,2885,NULL,0),(33326,730,'Optimized Incognito Attainment','A rare and valuable Gallente decryptor that dramatically increases your chance for success at invention. Gives minor benefit to material efficiency at the expense of slight increase in production time.<br><br>Probability Multiplier: +90% <br>Max. Run Modifier: +2 <br>Material Efficiency Modifier: +1 <br>Time Efficiency Modifier: -2',1,1,0,1,NULL,NULL,1,NULL,2885,NULL,0),(33327,489,'Gnosis Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,0),(33328,29,'Capsule - Genolution \'Auroral\' 197-variant','This hydrostatic capsule is a unique variant on the standard model. Its golden sheen is nominally decorative material, whose role and purpose are highly classified and which dissipates entirely upon reprocessing. It is known that the capsule\'s regular building materials are intermixed with traces of another matter, the exact nature of which remains unknown to everyone outside Genolution\'s research facilities, even the capsuleers themselves. \r\n\r\nTheories on the subject include Fullerene Intercalated Graphite polymer for better function of internal parts without the added heat of internal friction; a meld of Fullerite-C320 and Fullerite-C540 for an extra-strength shell that can better withstand the rigors of continued operation under stress (albeit not, sadly, withstand a few direct hits from another vessel\'s weapon), or just a thin coating of some newly invented sheen compound.\r\n\r\nThe capsule\'s primary function remains to keep the capsuleer alive - even to the point of sending their consciousness to a nearby cloning vat, in the event of imminent obliteration - and allowing for the operation of the massive interstellar vessels in which the capsule is usually encased. This variant can only be operated by those capsuleers wearing the <a href=showinfo:33329>Genolution \'Auroral\' AU-79</a> implant, and will be automatically replaced upon destruction.',32000,1000,0,1,16,NULL,0,NULL,NULL,20128,20307),(33329,1730,'Genolution \'Auroral\' AU-79','This implant allows the bearer to operate the <a href=showinfo:33328>Genolution \'Auroral\' 197-variant</a> capsule instead of the standard type. Once installed, the implant is a permanent part of the capsuleer\'s brain (unless intentionally removed by the wearer), and according to contracts with the Genolution corp a fresh copy will be reinserted in every new clone activated by the capsuleer.\r\n\r\nThis implant is not removed during podding or clone jumping.',0,1,0,1,16,800000.0000,1,1814,21047,NULL,0),(33330,87,'Navy Cap Booster 25','Provides a quick injection of power into your capacitor. Good for tight situations!',2.5,0.75,100,10,NULL,1000.0000,1,139,1033,NULL,0),(33332,87,'Navy Cap Booster 50','Provides a quick injection of power into your capacitor. Good for tight situations!',5,1.5,100,10,NULL,2500.0000,1,139,1033,NULL,0),(33334,87,'Navy Cap Booster 75','Provides a quick injection of power into your capacitor. Good for tight situations!',7.5,2.25,100,10,NULL,5000.0000,1,139,1033,NULL,0),(33336,428,'Thulium Hafnite','Despite its unremarkable gray appearance, Thulium Hafnite has proven to be extremely effective as shielding against electromagnetic radiation and free neutrons. It is a valuable component in the production of processor and capacitor technologies, especially in the Gallente Federation.',0,1,0,1,NULL,320.0000,1,500,2664,NULL,0),(33337,428,'Promethium Mercurite','A metallic radioactive compound, Promethium Mercurite emits a faint green glow visible to the naked eye. It is a crucial part of a new generation of processors and capacitor units being developed by the Amarr Empire.',0,1,0,1,NULL,320.0000,1,500,2664,NULL,0),(33338,428,'Unrefined Promethium Mercurite','A metallic radioactive compound, Promethium Mercurite emits a faint green glow visible to the naked eye. It is a crucial part of a new generation of processors and capacitor units being developed by the Amarr Empire.',0,1,0,1,NULL,320.0000,1,500,2664,NULL,0),(33339,428,'Unrefined Thulium Hafnite','Despite its unremarkable gray appearance, Thulium Hafnite has proven to be extremely effective as shielding against electromagnetic radiation and free neutrons. It is a valuable component in the production of processor and capacitor technologies, especially in the Gallente Federation.',0,1,0,1,NULL,320.0000,1,500,2664,NULL,0),(33340,436,'Thulium Hafnite Reaction','',0,1,0,1,NULL,1000000.0000,1,1850,2665,NULL,0),(33341,436,'Promethium Mercurite Reaction','',0,1,0,1,NULL,1000000.0000,1,1850,2665,NULL,0),(33342,436,'Unrefined Thulium Hafnite Reaction','',0,1,0,1,NULL,1000000.0000,1,1850,2665,NULL,0),(33343,436,'Unrefined Promethium Mercurite Reaction','',0,1,0,1,NULL,1000000.0000,1,1850,2665,NULL,0),(33352,571,'Serpentis Cruiser','This is a fighter for the Serpentis Corporation. It is protecting the assets of the Serpentis Corporation and may attack anyone it perceives as a threat or easy pickings. Threat level: Deadly',11200000,112000,480,1,8,NULL,0,NULL,NULL,31,1815),(33359,429,'Photonic Metamaterials','A carefully engineered latticework designed for precise optical control, photonic metamaterials are a component in advanced Gallente microprocessors and capacitor units.',0,1,0,1,NULL,3500.0000,1,499,2678,NULL,0),(33360,429,'Terahertz Metamaterials','An advanced composite designed to manipulate electromagnetic waves just beyond the microwave band, terahertz metamaterials are found in the latest generation of processors and capacitor units in the Amarr Empire.',0,1,0,1,NULL,3500.0000,1,499,2678,NULL,0),(33361,429,'Plasmonic Metamaterials','Carefully fabricated composites of neo mercurite and fernite alloy, plasmonic metamaterials are a key component in advanced Minmatar processors and capacitor units.',0,1,0,1,NULL,3500.0000,1,499,2678,NULL,0),(33362,429,'Nonlinear Metamaterials','Labs in the Caldari State have recently managed to construct the first known composites with negative refractive indexes. Known as nonlinear metamaterials, these advanced composites are finding increasing use in the State\'s latest capacitor units and microprocessors.',0,1,0,1,NULL,3500.0000,1,499,2678,NULL,0),(33363,484,'Nonlinear Metamaterials Reaction','',0,1,0,1,NULL,5000000.0000,1,1851,2666,NULL,0),(33364,484,'Photonic Metamaterials Reaction','',0,1,0,1,NULL,5000000.0000,1,1851,2666,NULL,0),(33365,484,'Plasmonic Metamaterials Reaction','',0,1,0,1,NULL,5000000.0000,1,1851,2666,NULL,0),(33366,484,'Terahertz Metamaterials Reaction','',0,1,0,1,NULL,5000000.0000,1,1851,2666,NULL,0),(33367,1207,'Tutorial Hacking','The wrecked container drifts silently amongst the stars, giving no hint to what treasures it may hide.',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,1176),(33368,1207,'Tutorial Archaeology','The wrecked container drifts silently amongst the stars, giving no hint to what treasures it may hide.',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,1176),(33373,1225,'Alliance Tournament IX: HYDRA RELOADED and 0utbreak','After a bitter finals defeat the previous year, <url=showinfo:16159//551692893>HYDRA RELOADED</url> entered the Ninth Alliance Tournament with something to prove. They played the field and metagame masterfully, shrugging aside all their opponents and ensuring a first-second place finish for themselves and their close allies in <url=showinfo:16159//99000648>Outbreak.</url>. A botched attempt to put on a show finals created controversy and forced changes to future Tournament rules, but the skill and dedication of the pilots in these two alliances was undeniable.',0,0.01,0,1,NULL,NULL,1,1812,21065,NULL,0),(33374,1225,'Alliance Tournament X: Verge of Collapse','Underestimated all throughout the Tenth Alliance Tournament, <url=showinfo:16159//99001968>Verge of Collapse</url> proved the power of the underdog with their stunning victories over such heavyweights as <url=showinfo:16159//605845106>DarkSide.</url>, <url=showinfo:16159//1354830081>Goonswarm Federation</url>, <url=showinfo:16159//927292903>Rote Kapelle</url>, <url=showinfo:16159//99000964>Mildly Intoxicated</url> and <url=showinfo:16159//99000852>Exodus.</url>. Their victory over <url=showinfo:16159//1399057309>HUN Reloaded</url> in the finals demonstrated their mastery of the format, and it is unlikely that anyone will underestimate them again. ',0,0.01,0,1,NULL,NULL,1,1812,21065,NULL,0),(33375,353,'QA Cross Protocol Analyzer','This module does not exist',0,5,0,1,NULL,33264.0000,0,NULL,2856,NULL,0),(33377,1084,'Sleeve - \'Drone\' (left)','After they merged with the controls of gargantuan space vessels and moved beyond the confines of death itself, it\'s an open question whether capsuleers can even be considered purely human. This tattoo resembles one of New Eden\'s most nightmarish creatures, a relentless force of destruction whose mind has become entirely alien to the civilizations of New Eden. It\'s no wonder some capsuleers feel a strange fellowship with them.',0,0.1,0,1,NULL,NULL,1,1822,21048,NULL,0),(33378,1084,'Sleeve - \'Wreckage\' (left)','For an immortal master of dangerous technological wonders, it can be hard to retain or even recall the connection to the natural cycle of life. This tattoo is a reminder that death for a capsuleer, though only fleeting, is omnipresent and will always leave its mark, and that one person\'s precious, perfect engine of war will eventually - through accident, scheming, or a second\'s forgetfulness  - become someone else\'s wreckage to calmly pick clean.',0,0.1,0,1,NULL,NULL,1,1822,21050,NULL,0),(33379,1084,'Sleeve - \'Prototype\' (left)','The entwining of human and machine defines a capsuleer\'s life - each can\'t function without the other - and it may be argued that together they compose a new organism, one that shucks off both of its skins for fresh ones when needed. Some capsuleers try to express that even though parts of them are composed of machinery - from the implants in their heads all the way up to the massive ships they control - all of it is really only a cover for a human being. Or the other way around.',0,0.1,0,1,NULL,NULL,1,1822,21051,NULL,0),(33380,1084,'Sleeve - \'Nature\' (left)','Amidst all the carnage they see (and sometimes create), capsuleers also rejoice in the beauty of the natural world. In this tattoo, some see the Achuran songbird flitting through the air, amidst the trills of song. Some see the Slaver Hound, its senses like deadly radar, leaping over the grounds of a sunbaked colony. Some even see a thousand stars looking down on living planets hurtling through their orbits. And a few, because there\'s always a few of that sort, doggedly persist in seeing a Fedo.',0,0.1,0,1,NULL,NULL,1,1822,21052,NULL,0),(33381,1084,'Sleeve - \'Drone\' (right)','After they merged with the controls of gargantuan space vessels and moved beyond the confines of death itself, it\'s an open question whether capsuleers can even be considered purely human. This tattoo resembles one of New Eden\'s most nightmarish creatures, a relentless force of destruction whose mind has become entirely alien to the civilizations of New Eden. It\'s no wonder some capsuleers feel a strange fellowship with them.',0,0.1,0,1,NULL,NULL,1,1822,21053,NULL,0),(33382,1084,'Sleeve - \'Wreckage\' (right)','For an immortal master of dangerous technological wonders, it can be hard to retain or even recall the connection to the natural cycle of life. This tattoo is a reminder that death for a capsuleer, though only fleeting, is omnipresent and will always leave its mark, and that one person\'s precious, perfect engine of war will eventually - through accident, scheming, or a second\'s forgetfulness  - become someone else\'s wreckage to calmly pick clean.',0,0.1,0,1,NULL,NULL,1,1822,21054,NULL,0),(33383,1084,'Sleeve - \'Prototype\' (right)','The entwining of human and machine defines a capsuleer\'s life - each can\'t function without the other - and it may be argued that together they compose a new organism, one that shucks off both of its skins for fresh ones when needed. Some capsuleers try to express that even though parts of them are composed of machinery - from the implants in their heads all the way up to the massive ships they control - all of it is really only a cover for a human being. Or the other way around.',0,0.1,0,1,NULL,NULL,1,1822,21055,NULL,0),(33384,1084,'Sleeve - \'Nature\' (right)','Amidst all the carnage they see (and sometimes create), capsuleers also rejoice in the beauty of the natural world. In this tattoo, some see the Achuran songbird flitting through the air, amidst the trills of song. Some see the Slaver Hound, its senses like deadly radar, leaping over the grounds of a sunbaked colony. Some even see a thousand stars looking down on living planets hurtling through their orbits. And a few, because there\'s always a few of that sort, doggedly persist in seeing a Fedo.',0,0.1,0,1,NULL,NULL,1,1822,21056,NULL,0),(33385,1225,'Alliance Tournament I: KAOS Empire','Making their mark in the first ever Alliance Tournament, <url=showinfo:16159//900209169>Kaos Empire</url> won victory after victory with stunning efficiency and coordination. After defeating well respected opponents like <url=showinfo:16159//1220922756>Red Alliance</url> and <url=showinfo:16159//497302911>The Five</url>, <url=showinfo:16159//900209169>Kaos</url> finally met their match in a nailbiter final match against <url=showinfo:16159//632866070>Band of Brothers</url>, winning the first ever Alliance Tournament Silver Medal.',0,0.01,0,1,NULL,NULL,1,1812,21065,NULL,0),(33386,1225,'Alliance Tournament III: Interstellar Alcohol Conglomerate','The <url=showinfo:2//1280094373>Guiding Hand Social Club</url> and <url=showinfo:1373//144870255>Tyrrax Thorrk</url> have flown in the Tournament under multiple alliance banners. They have had a strong presence in the Alliance Tournament from the beginning, including a semi-final performance for their <url=showinfo:16159//2031941852>Interstellar Alcohol Conglomerate</url> team in the Second Alliance Tournament. However it is their ATIII <url=showinfo:16159//2031941852>IAC</url> team that made the biggest mark on history. Building their core strategy around cap warfare supported by the massive capacitor pool of a rare and priceless <url=showinfo:11936>Apocalypse Imperial Issue</url>, <url=showinfo:16159//2031941852>IAC</url> made short work of most opponents until facing off against <url=showinfo:16159//99001003>Cult of War</url> who managed to counter the <url=showinfo:16159//2031941852>IAC</url> nosferatu and destroy the <url=showinfo:11936>Apocalypse Imperial Issue</url> to the amazement of the crowd. No Tournament team before or since has put such a rare ship on the line in their pursuit of victory.',0,0.01,0,1,NULL,NULL,1,1812,21065,NULL,0),(33387,1225,'Alliance Tournament IV: Pandemic Legion','Entering the Tournament world with a bang, <url=showinfo:16159//386292982>Pandemic Legion\'s</url> first ever team took great advantage of sensor dampener tactics to go on an impressive run to the finals, knocking out Tournament stalwarts <url=showinfo:16159//2031941852>Interstellar Alcohol Conglomerate</url>, ending <url=showinfo:16159//1439416485>The Star Fraction\'s</url> string of heroic victories, and defeating a <url=showinfo:16159//488282414>Terra Incognita.</url> team full of legendary PVP pilots. They were swiftly defeated in the finals by <url=showinfo:16159//1399057309>HUN Reloaded</url>, but this early silver medal would turn out to be a portent of future success.',0,0.01,0,1,NULL,NULL,1,1812,21065,NULL,0),(33388,1225,'Alliance Tournament V: Triumvirate','Well known PVP alliance <url=showinfo:16159//933731581>Triumvirate.</url> entered the Fifth Alliance Tournament with high expectations and did not disappoint. <url=showinfo:16159//933731581>Triumvirate.</url> relied on Battleships supported by Disruption Frigates for many victories, including a nail-biter semi-final win over <url=showinfo:16159//386292982>Pandemic Legion</url>. They were narrowly defeated by <url=showinfo:16159//1438160193>Ev0ke\'s</url> <url=showinfo:629>Rupture</url> Cruisers in one of the closest and most exciting finals in Tournament history.',0,0.01,0,1,NULL,NULL,1,1812,21065,NULL,0),(33389,1225,'Alliance Tournament VIII: HYDRA RELOADED','Emerging as a new powerhouse on the Tournament landscape, the <url=showinfo:16159//551692893>HYDRA RELOADED</url> team in the Eighth Alliance Tournament easily stood out from the pack both on and off the field. They crushed all opposition until the finals, and their metagame duels of will with arch-nemesis <url=showinfo:16159//386292982>Pandemic Legion</url> between the matches became the stuff of legend. Although defeated by <url=showinfo:16159//386292982>Pandemic Legion</url> in the finals, they would eventually have their revenge in the subsequent year.',0,0.01,0,1,NULL,NULL,1,1812,21065,NULL,0),(33390,1225,'Alliance Tournament VI: R.U.R.','Alternating between the alliances <url=showinfo:16159//627268059>R.U.R.</url> and <url=showinfo:16159//1002884793>THE R0NIN</url> but remaining a powerful Tournament threat, the members of <url=showinfo:16159//627268059>R.U.R.</url> are the most accomplished tournament team to not yet have a Gold medal (as of YC 115). One of their many strong performances was in the Sixth Alliance Tournament where their impressive run was only ended by <url=showinfo:16159//386292982>Pandemic Legion</url> in an extremely memorable final match that came down to the wire.',0,0.01,0,1,NULL,NULL,1,1812,21065,NULL,0),(33391,1225,'Alliance Tournament IX: Darkside.','Newcomers a year before in the Eighth Alliance Tournament, <url=showinfo:16159//605845106>DarkSide.</url> had quickly made a name for themselves with a quarter-final performance that year. In the Ninth Alliance Tournament they catapulted themselves into Tournament history by ending the reign of <url=showinfo:16159//386292982>Pandemic Legion</url> and knocking them out in convincing fashion. In one fell swoop they blew the Tournament field wide open and made <url=showinfo:1378//717397234>Shadoo</url> the happiest man in the world.',0,0.01,0,1,NULL,NULL,1,1812,21065,NULL,0),(33392,1225,'Alliance Tournament X: HUN Reloaded','After their victory in the Fourth Alliance Tournament, <url=showinfo:16159//1399057309>HUN Reloaded</url> had struggled to return to the top tier of teams for years. By the Tenth Alliance Tournament many had begun to discount them as old news. They proved their stature as long-term Tournament heavyweights with a brilliant performance in ATX, riding a versatile core of <url=showinfo:28665>Vargur</url> Marauders with ever-shifting support to the finals, including a strategic outmaneuvering of <url=showinfo:16159//386292982>Pandemic Legion</url> in the semi-finals. They will be looking to improve on their Silver medal performance in YC 115s ATXI and return to the pinnacle they once ruled.',0,0.01,0,1,NULL,NULL,1,1812,21065,NULL,0),(33393,1730,'Genolution Core Augmentation CA-3','<font color=\"yellow\"><b>Traits</b></font><br>Slot 3<br>Primary Effect: +3 bonus to Willpower<br>Secondary Effect: +1.5% bonus to ship velocity and shield capacity<br>Implant Set Effect: 30% bonus to the strength of all Genolution implant secondary effects<br><br><font color=\"yellow\"><b>Development</b></font><br>\r\nSince the introduction of the groundbreaking \"Core Augmentation\" series in YC 113, all eyes have been on Genolution\'s advanced R&D department in anticipation of their next release. Few if any were disappointed with the announcement of the CA-3.<br><br>Rumors that Genolution had managed to reverse-engineer Angel Cartel implant technology continued to spread as the CA-3 successfully allows a capsuleer increased ship velocity, complemented by extra shield capacity and a parietal lobe enhancement for stronger Willpower. Like the CA-1 and CA-2 before them, these new additions to the \"Core Augmentation\" line contain advanced interoperability functions that allows their sum to be greater than their parts.<br><br>Genolution\'s press releases indicated that this new batch of implants would be available to capsuleers in limited numbers, but after the experience of the CA-1 and CA-2 nobody believes them.',0,1,0,1,NULL,800000.0000,1,620,2054,NULL,0),(33394,1730,'Genolution Core Augmentation CA-4','<font color=\"yellow\"><b>Traits</b></font><br>Slot 2<br>Primary Effect: +3 bonus to Memory<br>Secondary Effect: +1.5% bonus to ship agility and armor hit points<br>Implant Set Effect: 20% bonus to the strength of all Genolution implant secondary effects<br><br><font color=\"yellow\"><b>Development</b></font><br>\r\nAlongside the introduction of the CA-3 implant, Genolution further expanded its \"Core Augmentation\" line with the new CA-4. Taking full advantage of Genolution\'s formidable research and development team, the CA-4 continues to squeeze even more powerful features into the most significant implant collection to be released in years.<br><br>The combination of a temporal lobe implant for extra memory augmentation and a new series of armor and agility enhancements makes the CA-4 stand out from the crowd. However, the most impressive feature of the implant is that Genolution has managed to squeeze even more benefits out of their implant integration technology to ensure that each part of the \"Core Augmentation\" line enhances the benefits of each of its peers.<br><br>After the release of these groundbreaking implants there is only one question left on everyone\'s mind: How much further can Genolution safely push the limits of their technology?',0,1,0,1,NULL,800000.0000,1,619,2061,NULL,0),(33395,833,'Moracha','The Moracha is what goes bump in the night. Built to be the ultimate tool of piracy and terror, this Recon Ship combines the electronic warfare and covert abilities of its class with the speed and ferocity that Angel Cartel cruisers are known for. The first ever capsuleer ship to use the Ixion ship hull, the distinctive appearance of the Moracha goes along with incredible combat capabilities that make it ideal for both solo and wolfpack hunting.\r\n\r\n',8700000,100000,320,1,2,NULL,1,1837,NULL,20079,20345),(33396,106,'Moracha Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,49),(33397,830,'Chremoas','The Chremoas is the Angel Cartel\'s take on the Covert Ops ship. Don\'t let the class designation fool you, the Chremoas is a more than capable combat vessel that takes advantage of a covert cloak, advanced targeting systems previously only seen on stealth bombers, and ample medium power module slots to pick and control the fights it knows it can win. By the time you see a Chremoas decloak, the fight is already over.',930000,28000,190,1,2,NULL,1,1838,NULL,20070,20344),(33398,105,'Chremoas Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,46),(33399,1220,'Infomorph Synchronizing','Psychological training that strengthens the pilot\'s mental tenacity. Improved ability to synchronize with new clones allows pilots to jump-clone more frequently without risk of neural damage.\r\n\r\nReduced time between clone jumps by 1 hour per level.\r\n\r\nNote: Clones can only be installed in stations with medical facilities or in ships with clone vat bays. Installed clones are listed in the character sheet.',0,0.01,0,1,NULL,5000000.0000,1,1746,33,NULL,0),(33400,515,'Bastion Module I','An electronic interface designed to augment and enhance a marauder\'s siege abilities. Through a series of electromagnetic polarity field shifts, the bastion module diverts energy from the ship\'s propulsion and warp systems to lend additional power to its defensive capabilities.\r\n\r\nThis results in a greatly increased rate of defensive self-sustenance and a boost to the ship\'s overall damage resistances. It also extends the reach of all the vessel\'s weapon systems, allowing it to engage targets at farther ranges. Due to the ionic field created by the bastion module, most electronic warfare effects - from friend or foe both - will not affect the ship while in bastion mode.  All weapons, including energy nosferatus and destabilizers, are unaffected by this field leaving the ship capacitor as one of the only vulnerable points to be found.\r\n \r\n\r\nIn addition, the lack of power to mobility subsystems means that neither standard propulsion nor warp travel are available to the ship, nor is it allowed to dock or jump until out of bastion mode.\r\n\r\nNote: Only one bastion module can be fitted to a marauder-class ship. The increased shield boosting and armor repairing gained from the bastion module is subject to a stacking penalty when used with other modules that affect the same attribute on the ship.',1,200,0,1,NULL,5000000.0000,1,801,21075,NULL,0),(33401,516,'Bastion Module I Blueprint','',0,0.01,0,1,NULL,50000000.0000,1,343,21,NULL,0),(33403,744,'Imperial Navy Command Mindlink','This advanced interface link produced for the Imperial Navy and its allies drastically improves a commander\'s Armored Command and Information Command abilities by directly linking to the nanites launched by the command burst charge.\r\n\r\n+25% bonus to Armor and Information Command Burst effect strength and duration.',0,1,0,1,4,200000.0000,1,1505,2096,NULL,0),(33404,744,'Federation Navy Command Mindlink','This advanced interface link produced for the Federation Navy and its allies drastically improves a commander\'s Armored Command and Skirmish Command abilities by directly linking to the nanites launched by the command burst charge.\r\n\r\n+25% bonus to Armor and Skirmish Command Burst effect strength and duration.',0,1,0,1,8,200000.0000,1,1505,2096,NULL,0),(33405,744,'Republic Fleet Command Mindlink','This advanced interface link produced for the Republic Fleet and its allies drastically improves a commander\'s Shield Command and Skirmish Command abilities by directly linking to the nanites launched by the command burst charge.\r\n\r\n+25% bonus to Shield and Skirmish Command Burst effect strength and duration.',0,1,0,1,2,NULL,1,1505,2096,NULL,0),(33406,744,'Caldari Navy Command Mindlink','This advanced interface link produced for the Caldari Navy drastically improves a commander\'s Shield Command and Information Command abilities by directly linking to the nanites launched by the command burst charge.\r\n\r\n+25% bonus to Shield and Information Command Burst effect strength and duration.',0,1,0,1,1,NULL,1,1505,2096,NULL,0),(33407,1220,'Advanced Infomorph Psychology','Advanced training for those Capsuleers who want to push clone technology to its limits.\r\n\r\nAllows 1 additional jump clone per level.\r\n\r\nNote: Clones can only be installed in stations with medical facilities or in ships with clone vat bays. Installed clones are listed in the character sheet.',0,0.01,0,1,4,36000000.0000,1,1746,33,NULL,0),(33440,1245,'\'Arbalest\' Rapid Heavy Missile Launcher I','Launcher for battleships intended to counter smaller combat ships such as frigates and cruisers, can only be loaded with heavy missiles.',0,20,0.72,1,NULL,80118.0000,1,1827,21074,NULL,20395),(33441,1245,'\'Limos\' Rapid Heavy Missile Launcher I','Launcher for battleships intended to counter smaller combat ships such as frigates and cruisers, can only be loaded with heavy missiles.',0,20,0.72,1,NULL,80118.0000,1,1827,21074,NULL,20395),(33442,1245,'\'Malkuth\' Rapid Heavy Missile Launcher I','Launcher for battleships intended to counter smaller combat ships such as frigates and cruisers, can only be loaded with heavy missiles.',0,20,0.72,1,NULL,80118.0000,1,1827,21074,NULL,20395),(33446,1245,'Caldari Navy Rapid Heavy Missile Launcher','Launcher for battleships intended to counter smaller combat ships such as frigates and cruisers, can only be loaded with heavy missiles.',0,20,0.78,1,NULL,99996.0000,1,1827,21074,NULL,20394),(33447,136,'Caldari Navy Rapid Heavy Missile Launcher Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,1