le Launcher','Launcher for battleships intended to counter smaller combat ships such as frigates and cruisers, can only be loaded with heavy missiles.',0,20,0.85,1,NULL,99996.0000,1,1827,21074,NULL,20395),(33458,1245,'Mizuro\'s Modified Rapid Heavy Missile Launcher','Launcher for battleships intended to counter smaller combat ships such as frigates and cruisers, can only be loaded with heavy missiles.',0,20,0.85,1,NULL,99996.0000,1,1827,21074,NULL,20395),(33459,1245,'Republic Fleet Rapid Heavy Missile Launcher','Launcher for battleships intended to counter smaller combat ships such as frigates and cruisers, can only be loaded with heavy missiles.',0,20,0.78,1,NULL,99996.0000,1,1827,21074,NULL,20394),(33460,136,'Republic Fleet Rapid Heavy Missile Launcher Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,170,NULL,170),(33461,1245,'Shaqil\'s Modified Rapid Heavy Missile Launcher','Launcher for battleships intended to counter smaller combat ships such as frigates and cruisers, can only be loaded with heavy missiles.',0,20,0.85,1,NULL,99996.0000,1,1827,21074,NULL,20395),(33462,1245,'Thon\'s Modified Rapid Heavy Missile Launcher','Launcher for battleships intended to counter smaller combat ships such as frigates and cruisers, can only be loaded with heavy missiles.',0,20,0.85,1,NULL,99996.0000,1,1827,21074,NULL,20395),(33463,1245,'Tobias\' Modified Rapid Heavy Missile Launcher','Launcher for battleships intended to counter smaller combat ships such as frigates and cruisers, can only be loaded with heavy missiles.',0,20,0.85,1,NULL,99996.0000,1,1827,21074,NULL,20395),(33464,1245,'True Sansha Rapid Heavy Missile Launcher','Launcher for battleships intended to counter smaller combat ships such as frigates and cruisers, can only be loaded with heavy missiles.',0,20,0.78,1,NULL,99996.0000,1,1827,21074,NULL,20394),(33465,1245,'Vepas\' Modified Rapid Heavy Missile Launcher','Launcher for battleships intended to counter smaller combat ships such as frigates and cruisers, can only be loaded with heavy missiles.',0,20,0.85,1,NULL,99996.0000,1,1827,21074,NULL,20395),(33466,1245,'YO-5000 Rapid Heavy Missile Launcher','Launcher for battleships intended to counter smaller combat ships such as frigates and cruisers, can only be loaded with heavy missiles.',0,20,0.72,1,NULL,80118.0000,1,1827,21074,NULL,20394),(33467,274,'Customs Code Expertise','Expertise in cutting through the red tape of customs regulations. Reduces Import and Export empire tax in Customs Offices by 10% per level.\r\n\r\nThis does not affect InterBus Customs Offices.\r\n',0,0.01,0,1,NULL,3000000.0000,1,378,33,NULL,0),(33468,25,'Astero','This was one of the first vessels the Sisters of EVE made available to capsuleers. It had been under development by the Sanctuary corporation, whose interest in exploration includes not only search & rescue operations but also a constant inquiry into the nature of the EVE Gate. Thanks to the Sisters\' efforts and the Sanctuary\'s particular expertise, the Astero is an agile, tenacious ship that aptly adheres to the mantra of both rescuers and explorers: Stay safe, stay hidden, and use every tool at your disposal. \r\n\r\nIt is particularly adept at venturing into dangerous territories, not merely in recovering whatever may be of interest but also in being able to safely bring it back. Its engines have alternate power sources that come into play should any of its cargo - for which it has plenty of room - cause serious interference with internal systems. Its carapace is extremely well armored for a ship this agile, and covered in sensors capable of letting its crew track a myriad of different organic signatures. The crew itself is safely protected from any number of transmittable ailments from rescues and other unexpected passengers, thanks to special quarantine bays that are conveniently located near jettisonable openings. \r\n\r\nAnd lastly, an ingenious but cryptic transfer in part of the warp core functionality to an outlying cylindrical structure means the Astero is able to run certain higher-level cloaking functions with very little technical cost, and minimal interference from warp. The Sisters of EVE have refused to comment on this technology, other than to recommend it not be tampered with.',975000,16500,210,1,8,NULL,1,1365,NULL,20126,20386),(33469,105,'Astero Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,314),(33470,26,'Stratios','This was one of the first vessels the Sisters of EVE made available to capsuleers. It had been under development by the Sanctuary corporation, whose interest in exploration includes not only search & rescue operations but also a constant inquiry into the nature of the EVE Gate. Thanks to the Sisters\' efforts and the Sanctuary\'s particular expertise, the Stratios is an agile, tenacious ship that aptly adheres to the mantra of both rescuers and explorers: Stay safe, stay hidden, and use every tool at your disposal. \r\n\r\nIt is particularly adept at venturing into dangerous territories, not merely in recovering whatever may be of interest but also in being able to safely bring it back. Its engines have alternate power sources that come into play should any of its cargo - for which it has plenty of room - cause serious interference with internal systems. Its weaponry runs best on renewable sources, an ideal for a ship that doesn\'t know how long it\'ll be in deep space. Its carapace is extremely well armored for a ship this agile, and covered in sensors capable of letting its crew track a myriad of different organic signatures. The crew itself is safely protected from any number of transmittable ailments from rescues and other unexpected passengers, thanks to special quarantine bays that are conveniently located near jettisonable openings. \r\n\r\nAnd lastly, an ingenious but cryptic transfer in part of the warp core functionality to an outlying cylindrical structure means the Stratios is able to run certain higher-level cloaking functions with very little technical cost, and minimal interference from warp. The Sisters of EVE have refused to comment on this technology, other than to recommend it not be tampered with.',9350000,101000,550,1,8,NULL,1,1371,NULL,20124,20385),(33471,106,'Stratios Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,49);
INSERT INTO `inv_types` VALUES (33472,27,'Nestor','This was one of the first vessels the Sisters of EVE made available to capsuleers. It had been under development by the Sanctuary corporation, whose interest in exploration includes not only search & rescue operations but also a constant inquiry into the nature of the EVE Gate. Thanks to the Sisters\' efforts and the Sanctuary\'s particular expertise, the Nestor is an agile, tenacious ship that aptly adheres to the mantra of both rescuers and explorers: Stay safe, stay hidden, and use every tool at your disposal. \r\n\r\nIt is particularly adept at venturing into dangerous territories, not merely in recovering whatever may be of interest but also in being able to safely bring it back. Its engines have alternate power sources that come into play should any of its cargo - for which it has plenty of room - cause serious interference with internal systems. Its weaponry runs best on renewable sources, an ideal for a ship that doesn\'t know how long it\'ll be in deep space. Its carapace is extremely well armored for a ship this agile, and covered in sensors capable of letting its crew track a myriad of different organic signatures. The crew itself is safely protected from any number of transmittable ailments from rescues and other unexpected passengers, thanks to special quarantine bays that are conveniently located near jettisonable openings. \r\n\r\nThe Sanctuary corporation poured uncountable resources into making the cloaking technology developed for the Stratios fit the Nestor, but were eventually forced to concede that it was impossible. The effort was not without benefit though, as part of their work focused on reducing the Nestor\'s mass enough that it could make its way into unexplored territories that might\'ve been hazardous to bulkier vessels. This paid off by affording the Nestor unmatched access to wormhole space, and meant that the embedded miniature rescue vessel on the ship\'s hull could be relegated to a decommissioned role. With covert function off the table, the Sanctuary turned their eyes on logistics and now the Nestor serves as one of the best support platforms in New Eden.\r\n',20000000,486000,700,1,8,108750000.0000,1,1380,NULL,20127,20384),(33473,107,'Nestor Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,43),(33474,1246,'Mobile Depot','The mobile depot provides capsuleers with their very own base in space. It won\'t offer protection - no one is ever truly safe in New Eden - but once deployed and activated it can, at the very least, allow the capsuleer to store their most valuable belongings when under fire, and to refit their ship to better fight back against assailants.\n\nOne minute activation time.\n\nMay not be deployed within 6km of another Mobile Depot, within 50km of Stargates, Stations or Upwell Structures, or within 40km of a Starbase.\n\nAutomatically decays if abandoned for thirty days.',10000,50,3000,1,NULL,NULL,1,1831,NULL,20133,20390),(33475,1250,'Mobile Tractor Unit','The mobile tractoring unit takes some of the work out of looting the scorched ruins left by capsuleers, be it pulverized asteroids, wrecked ships, or obliterated inhabitation modules of various kinds. Once it has been deployed and completed its automatic activation process, it will lock on to any containers or wrecks within range, reel them in one by one, and empty their contents into its own cargo bay. All the capsuleer needs to do is keep up the pace of destruction.\n\n125km effective range.\n10 second activation time.\n\nMay not be deployed within 5km of another Mobile Tractor Unit, within 50km of Stargates, Stations or Upwell Structures, or within 40km of a Starbase.\nAutomatically decays if abandoned for two days.',10000,100,27000,1,NULL,NULL,1,1833,NULL,NULL,20387),(33476,1249,'Mobile Cynosural Inhibitor','This structure, once deployed and having completed its automatic activation process, will prevent nearly all cynosural fields being activated within its range. Covert fields can still be used, which is why it is up to the intrepid capsuleer to maintain a relaxed situational awareness, go about their daily duties, and mercilessly shoot out of the sky any black ops infiltrators who might have made it through.\n\n100km effective range\nTwo minute activation time.\n\nMay not be deployed within 200km of another Mobile Cynosural Inhibitor, within 75km of Stargates, Stations or Upwell Structures, or within 40km of a Starbase. Cannot be retrieved once deployed.\nSelf-destructs after one hour of operation.',10000,300,0,1,NULL,NULL,1,1832,NULL,20129,20388),(33477,1247,'Small Mobile Siphon Unit','A small personal deployable that steals material from player owned structures (POS). The Small Mobile Siphon Unit can steal Raw Material from Moon Harvesters and Processed Material from Simple Reactors. The stolen materials are stored in the unit and are accessible by anyone.\r\n\r\nThe Siphon Unit uses an advanced morphing technology to mask itself as being part of the POS. This allows it to infiltrate the production line of the POS and escape the attention of its defenses.',10000,35,900,1,NULL,NULL,1,1835,NULL,20131,20389),(33478,1247,'Medium Mobile Siphon Unit','The Siphon Unit uses an advanced morphing technology to mask itself as being part of the POS. This allows it to infiltrate the production line of the POS and escape the attention of its defenses.',10000,100,5000,1,NULL,NULL,0,NULL,NULL,20131,20397),(33479,1247,'Large Mobile Siphon Unit','The Siphon Unit uses an advanced morphing technology to mask itself as being part of the POS. This allows it to infiltrate the production line of the POS and escape the attention of its defenses.',10000,500,10000,1,NULL,NULL,0,NULL,NULL,20131,20398),(33480,319,'Mobile Shipping Unit','A container with internal transportation mechanism. Used for quick shipments of low-volume items.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,2007),(33481,226,'Mobile Shipping Unit','A container with internal transportation mechanism. Used for quick shipments of low-volume items.',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,2007),(33482,1248,'Minmatar 1M Bounty Reimbursement Tag','This tag can be sold at a Republic Fleet station. It is worth 1 million ISK.',0.1,0.01,0,1,2,1000000.0000,1,1846,21095,NULL,0),(33483,1248,'Caldari 10M Bounty Reimbursement Tag','This tag can be sold at a Caldari Navy station. It is worth 10 million ISK.',0.1,0.01,0,1,1,10000000.0000,1,1846,21098,NULL,0),(33484,1248,'Amarr 1M Bounty Reimbursement Tag ','This tag can be sold at an Imperial Navy station. It is worth 1 million ISK.',0.1,0.01,0,1,4,1000000.0000,1,1846,21096,NULL,0),(33485,1248,'Gallente 1M Bounty Reimbursement Tag','This tag can be sold at a Federation Navy station. It is worth 1 million ISK.',0.1,0.01,0,1,8,1000000.0000,1,1846,21097,NULL,0),(33486,747,'QA Warp Accelerator','This implant does not exist.',0,1,0,1,NULL,200000.0000,0,NULL,2224,NULL,0),(33487,1089,'Women\'s \'Luxury\' T-shirt','This item indicates that as part of society\'s very elite - the ones who wear whatever they want, fly wherever they like, and reign over the lives of others like mercurial gods - you are invited to the most exclusive of events in every part of the cluster. Live a life of boundless, reckless, hedonistic luxury, where nothing, not even death itself, stands in the way of your desires.',0.5,0.1,0,1,NULL,NULL,1,1406,21070,NULL,0),(33488,1089,'Men\'s \'Luxury\' T-shirt','This item indicates that as part of society\'s very elite - the ones who wear whatever they want, fly wherever they like, and reign over the lives of others like mercurial gods - you are invited to the most exclusive of events in every part of the cluster. Live a life of boundless, reckless, hedonistic luxury, where nothing, not even death itself, stands in the way of your desires.',0.5,0.1,0,1,NULL,NULL,1,1398,21071,NULL,0),(33489,186,'Ship Maintenance Array Wreck','Destroyed remains of a Ship Maintenance Array; before anything of value can be sa