 of black ops search-and-rescue missions might be executed for key people who were held by the enemy and possessed either special qualities the resistance needed, or information the Republic couldn\'t afford having tortured out of them. It\'s notable that these individuals might not all have been Minmatar, and that the resistance movement is unlikely to have restrained itself from using the same methods on key Amarr people they\'d captured with the help of the Leopard.\r\n\r\nIt is an extremely fast ship, meant for quick and stealthy getaways, and while its origins are covered in rumors, chances are the Minmatar leaked it to the capsuleers in order to curry favor with them.',1600000,5000,10,1,2,7500.0000,1,1618,NULL,20080,20402),(33514,111,'Leopard Blueprint','',0,0.01,0,1,NULL,50000.0000,1,NULL,NULL,NULL,317),(33515,1267,'Small Mobile Siphon Unit Blueprint','',0,0.01,0,1,NULL,100000000.0000,1,1834,0,NULL,0),(33516,300,'High-grade Ascendancy Alpha','This ocular filter has been modified by Sisters of EVE scientists for use by their elite officers.\n\nPrimary Effect: +4 bonus to Perception\n\nSecondary Effect: 1% bonus to warp speed\n\nSet Effect: 15% bonus to the strength of all Ascendancy implant secondary effects',0,1,0,1,NULL,NULL,1,618,2053,NULL,0),(33517,1269,'Mobile Depot Blueprint','',0,0.01,0,1,NULL,1000000.0000,1,1828,0,NULL,0),(33518,1268,'Mobile Cynosural Inhibitor Blueprint','',0,0.01,0,1,NULL,150000000.0000,1,1829,0,NULL,0),(33519,1270,'Mobile Tractor Unit Blueprint','',0,0.01,0,1,NULL,30000000.0000,1,1830,0,NULL,0),(33520,1246,'\'Wetu\' Mobile Depot','The mobile depot provides capsuleers with their very own base in space. It won\'t offer protection - no one is ever truly safe in New Eden - but once deployed and activated it can, at the very least, allow the capsuleer to store their most valuable belongings when under fire, and to refit their ship to better fight back against assailants.\n\nOne minute activation time.\n\nMay not be deployed within 6km of