 Effect: 5% bonus to warp speed\n\nSet Effect: 15% bonus to the strength of all Ascendancy implant secondary effects',0,1,0,1,NULL,800000.0000,1,622,2060,NULL,0),(33528,300,'High-grade Ascendancy Gamma','This neural boost has been modified by Sisters of EVE scientists for use by their elite officers.\n\nPrimary Effect: +4 bonus to Willpower\n\nSecondary Effect: 3% bonus to warp speed\n\nSet Effect: 15% bonus to the strength of all Ascendancy implant secondary effects',0,1,0,1,NULL,800000.0000,1,620,2054,NULL,0),(33529,300,'High-grade Ascendancy Omega','This implant does nothing in and of itself, but when used in conjunction with other Ascendancy implants it will boost their effect.\r\n\r\n70% bonus to the strength of all Ascendancy implant secondary effects.',0,1,0,1,NULL,800000.0000,1,1506,2224,NULL,0),(33530,306,'Secure Depot','If you have the right equipment you might be able to hack into the com tower and get some valuable information.',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,20297),(33531,306,'Secure Lab','If you have the right equipment you might be able to hack into the com tower and get some valuable information.',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,20297),(33532,306,'Secure Databank','If you have the right equipment you might be able to hack into the com tower and get some valuable information.',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,20297),(33533,306,'Secure Mainframe','If you have the right equipment you might be able to hack into the com tower and get some valuable information.',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,20297),(33534,306,'Secure Vault','If you have the right equipment you might be able to hack into the com tower and get some valuable information.',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,20297),(33536,724,'High-grade Ascendancy Alpha Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,2053,NULL,0),(33538,186,'Mobile Structure Wreck','The remains of a destroyed structure. Perhaps with the proper equipment something of value could be salvaged from it.',10000,27500,27500,1,NULL,NULL,0,NULL,NULL,NULL,3117),(33539,526,'Shattered Villard Wheel','This item appears to be a collection of Villard Wheel parts barely hanging together.<br><br>Villard Wheels are believed to have originated thousands of years ago as highly complex wooden contraptions that were embedded in wagon wheels and various other designs, primarily in areas where sparks and heat might cause catastrophic reactions with local materials both earthbound and airborne. The Villard Wheels allowed for an immensly rapid revolution of moving parts with almost no heat from friction, and the principles behind them were later put to use in the space industries of New Eden\'s various factions. Under normal circumstances they are nearly unbreakable.<br><br>This particular unit, however, is completely shattered, scorched and covered in soot. Some subparts may still be useable for those of a tinkering persuasion, but others can only wonder at what type of madman could or would push a Villard Wheel to go too fast, and for what infernal purpose.',25,0.1,0,1,NULL,NULL,1,20,21086,NULL,0),(33543,724,'High-grade Ascendancy Beta Blueprint','',0,0,0,1,NULL,NULL,1,NULL,2061,NULL,0),(33545,724,'High-grade Ascendancy Gamma Blueprint','',0,0,0,1,NULL,NULL,1,NULL,2054,NULL,0),(33546,724,'High-grade Ascendancy Epsilon Blueprint','',0,0,0,1,NULL,NULL,1,NULL,2060,NULL,0),(33547,724,'High-grade Ascendancy Delta Blueprint','',0,0,0,1,NULL,NULL,1,NULL,2062,NULL,0),(33548,724,'High-grade Ascendancy Omega Blueprint','',0,0,0,1,NULL,NULL,1,NULL,2224,NULL,0),(33549,1271,'Women\'s \'Phanca\' Cybernetic Arm (left)','This item, whose full designator is the F-706.574 \'Phanca\' Cybernetic Arm, is unique among heavily mechanized capsuleer accoutrements in that rather than focusing primarily on the future, it draws on a dark part of ancient empire history - one that\'s either completely barbaric or unquestionably devout, depending who you ask.\r\n\r\nIts origins lie in an Amarr decree where a member of the oligarchy - who was whimsical, powerful and, it is speculated, quite astoundingly insane during the tail end of her life- demanded that all current and future heirs of a particular royal house have their right hand amputated. They acquiesced, but had the hands replaced with cybernetic models in a silver coating.\r\n\r\nThe first heir who suffered this fate took great pride in it, and his silver hand is on display in the open court of the Amarr Royal palace. When capsuleers - themselves the unquestionable elite of New Eden - started taking to cybernetic arms, it was only natural that this be one of the first models put into public use.',0,0.1,0,1,NULL,NULL,1,1836,21080,NULL,0),(33550,1271,'Women\'s \'Phanca\' Cybernetic Arm (right)','This item, whose full designator is the F-706.574 \'Phanca\' Cybernetic Arm, is unique among heavily mechanized capsuleer accoutrements in that rather than focusing primarily on the future, it draws on a dark part of ancient empire history - one that\'s either completely barbaric or unquestionably devout, depending who you ask.\r\n\r\nIts origins lie in an Amarr decree where a member of the oligarchy - who was whimsical, powerful and, it is speculated, quite astoundingly insane during the tail end of her life- demanded that all current and future heirs of a particular royal house have their right hand amputated. They acquiesced, but had the hands replaced with cybernetic models in a silver coating.\r\n\r\nThe first heir who suffered this fate took great pride in it, and his silver hand is on display in the open court of the Amarr Royal palace. When capsuleers - themselves the unquestionable elite of New Eden - started taking to cybernetic arms, it was only natural that this be one of the first models put into public use.',0,0.1,0,1,NULL,NULL,1,1836,21081,NULL,0),(33551,1271,'Men\'s \'Phanca\' Cybernetic Arm (left)','This item, whose full designator is the F-706.574 \'Phanca\' Cybernetic Arm, is unique among heavily mechanized capsuleer accoutrements in that rather than focusing primarily on the future, it draws on a dark part of ancient empire history - one that\'s either completely barbaric or unquestionably devout, depending who you ask.\r\n\r\nIts origins lie in an Amarr decree where a member of the oligarchy - who was whimsical, powerful and, it is speculated, quite astoundingly insane during the tail end of her life- demanded that all current and future heirs of a particular royal house have their right hand amputated. They acquiesced, but had the hands replaced with cybernetic models in a silver coating.\r\n\r\nThe first heir who suffered this fate took great pride in it, and his silver hand is on display in the open court of the Amarr Royal palace. When capsuleers - themselves the unquestionable elite of New Eden - started taking to cybernetic arms, it was only natural that this be one of the first models put into public use.',0,0.1,0,1,NULL,NULL,1,1836,21078,NULL,0),(33552,1271,'Men\'s \'Phanca\' Cybernetic Arm (right)','This item, whose full designator is the F-706.574 \'Phanca\' Cybernetic Arm, is unique among heavily mechanized capsuleer accoutrements in that rather than focusing primarily on the future, it draws on a dark part of ancient empire history - one that\'s either completely barbaric or unquestionably devout, depending who you ask.\r\n\r\nIts origins lie in an Amarr decree where a member of the oligarchy - who was whimsical, powerful and, it is speculated, quite astoundingly insane during the tail end of her life- demanded that all current and future heirs of a particular royal house have their right hand amputated. They acquiesced, but had the hands replaced with cybernetic models in a silver coating.\r\n\r\nThe first heir who suffered this fate took great pride in it, and his silver hand is on display in the open court of the Amarr Royal palace. When capsuleers - themselves the unquestionable elite of New Eden - started taking to cybernetic arms, it was only natural that this be one of the first models put into public use.',0,0.1,0,1,NULL,NULL,1,1836,21082,NULL,0),(33553,26,'Stratios Emergency Responder','The Stratios Emergency Responder is a variation on the Stratios designed by the Sanctuary specifically for fast assessment and evaluation of major cosmic events in New Eden.  Its official role to quickly appraise incidents of all kinds and relay information back to the Sisters of EVE also serves as an opportunity to take care of any sensitivities before they become apparent to external parties.\r\n\r\nIt is particularly adept at venturing into dangerous territories, not merely in recovering whatever may be of interest but also in being able to safely bring it back. Its engines have alternate power sources that come into play should any of its cargo - for which it has plenty of room - cause serious interference with internal systems. Its weaponry runs best on renewable sources, an ideal for a ship that doesn\'t know how long it\'ll be in deep space. Its carapace is extremely well armored for a ship this agile, and covered in sensors capable of letting its crew track a myriad of different organic signatures. The crew itself is safely protected from any number of transmittable ailments from rescues and other unexpected passengers, thanks to special quarantine bays that are conveniently located near jettisonable openings. \r\n\r\nAnd lastly, an ingenious but cryptic transfer in part of the warp core functionality to an outlying cylindrical structure means the Stratios Emergency Responder is able to run certain higher-level cloaking functions with very little technical cost, and minimal interference from warp. The Sisters of EVE have refused to comment on this technology, other than to recommend it not be tampered with.',9350000,101000,550,1,8,NULL,1,NULL,NULL,NULL,20403),(33554,106,'Stratios Emergency Responder Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,49),(33555,300,'Mid-grade Ascendancy Alpha',