s seem to have been prepared for use in low-level experiments of a highly cryptic nature. What exactly will be done with them is an open question, but they appear to be intended for some manner of data gathering under adverse and possibly explosive conditions...',1,0.1,0,1,NULL,500000.0000,1,1840,2225,NULL,0),(33578,1089,'Men\'s \'Humanitarian\' T-shirt YC 115','This highly prestigious item of clothing was created in YC 115 and presented to New Eden\'s charitable societies. The shirt stands as undeniable proof that its purchaser is on the side of good in a world that all too often can be cruel and merciless. Wear it with pride, and know that you have made a difference in the lives of strangers.',0,0.1,0,1,NULL,NULL,1,1398,21090,NULL,0),(33579,1089,'Women\'s \'Humanitarian\' T-shirt YC 115','This highly prestigious item of clothing was created in YC 115 and presented to New Eden\'s charitable societies. The shirt stands as undeniable proof that its purchaser is on the side of good in a world that all too often can be cruel and merciless. Wear it with pride, and know that you have made a difference in the lives of strangers.',0,0.1,0,1,NULL,NULL,1,1406,21089,NULL,0),(33581,1247,'Small Mobile \'Hybrid\' Siphon Unit','A small personal deployable that steals material from player owned structures (POS). The Small \'Hybrid\' Mobile Siphon Unit can steal Hybrid Polymers from Polymer Reaction Arrays. The stolen materials are stored in the unit and are accessible by anyone. \r\n\r\nThe Siphon Unit uses an advanced morphing technology to mask itself as being part of the POS. This allows it to infiltrate the production line of the POS and escape the attention of its defenses.',10000,35,1200,1,NULL,NULL,1,1835,NULL,20131,20437),(33582,1267,'Small Mobile \'Hybrid\' Siphon Unit Blueprint','',0,0.01,0,1,NULL,100000000.0000,1,1834,0,NULL,0),(33583,1247,'Small Mobile \'Rote\' Siphon Unit','A small personal deployable that steals material from player owned structures (POS). The Small Mobile \'Rote\' Siphon Unit can steal Processed Material from Simple Reactors and Raw Material from Moon Harvesters. The stolen materials are stored in the unit and are accessible by anyone. \r\n\r\nThe Siphon Unit uses an advanced morphing technology to mask itself as being part of the POS. This allows it to infiltrate the production line of the POS and escape the attention of its defenses.',10000,35,1000,1,NULL,NULL,1,1835,NULL,20131,20436),(33584,1267,'Small Mobile \'Rote\' Siphon Unit Blueprint','',0,0.01,0,1,NULL,120000000.0000,1,1834,0,NULL,0),(33585,1273,'Amarr Encounter Surveillance System','The Encounter Surveillance System can be deployed in any system outside empire jurisdiction. It monitors encounters in the system, allowing the Amarr Empire to supplement the rewards for killing a wanted pirate.\r\n\r\nWith an active ESS in a system the bounty payout values change and a Loyalty Point payout is added. 80% of bounty is paid directly, with 20% being added to a system-wide pool that can be accessed through the ESS. The 20% can rise up to 25% over time, putting the total bounty payout at 5% above base value. The bonus payout resets to 20% if the ESS is accessed, destroyed or scooped up. For each 1000 ISK in bounties, 0.15 LPs are added. This can rise up to 0.2 LPs over time. \r\n\r\n',100000,200,0,1,NULL,25000000.0000,1,1847,NULL,20154,20446),(33586,1277,'Amarr Encounter Surveillance System Blueprint','',0,0.01,0,1,NULL,100000000.0000,1,NULL,0,NULL,0),(33587,1274,'Mobile Decoy Unit','',10000,50,0,1,NULL,NULL,1,NULL,NULL,20150,20438),(33588,1295,'Mobile Decoy Unit Blueprint','',0,0.01,0,1,NULL,150000000.0000,1,NULL,0,NULL,0),(33589,1275,'Mobile Scan Inhibitor','This structure prevents the normal operation of directional scanners and probes within its 30km radius. Any objects within range of the Mobile Scan Inhibitor will not be visible to these sensors and any ship within the radius will also find their own instruments rendered inoperable.\n\nThe massive energy required to project this field causes the Inhibitor structure itself to be extremely visible to combat probes and directional scans.\n\nOne minute activation time. May not be deployed within 100km of another Mobile Scan Inhibitor, within 75km of Stargates, Wormholes, Stations or Upwell Structures, or within 40km of a Starbase. Cannot be retrieved once deployed. Self-destructs after one hour of operation.',10000,100,0,1,NULL,NULL,1,1845,NULL,20152,20439),(33590,1293,'Mobile Scan Inhibitor Blueprint','',0,0.01,0,1,NULL,150000000.0000,1,1843,0,NULL,0),(33591,1276,'Mobile Micro Jump Unit','This small deployable structure provides all nearby ships with the ability to launch themselves 100km in any direction. Twelve seconds after any ship makes use of this structure they will be jumped 100km in their direction of travel.\n\nHundreds of researchers around the New Eden Cluster have spent over a year attempting to expand upon the works of the late Avagher Xarasier after a tragic Micro Jump accident took his life. This structure represents the cutting edge in portable Micro Jump technology and is widely considered to be acceptably safe.\n\nThis structure can be used by any ship with less than 1,000,000,000kg mass.\n\nOne minute activation time. May not be deployed within 6km of another Mobile Micro Jump Unit, within 20km of Stargates, Stations or Upwell Structures, or within 40km of a Starbase. Cannot be retrieved once deployed. Self-destructs after two days of operation.',10000,50,27000,1,NULL,NULL,1,1844,NULL,20151,20450),(33592,1294,'Mobile Micro Jump Unit Blueprint','',0,0.01,0,1,NULL,30000000.0000,1,1842,0,NULL,0),(33595,1273,'Caldari Encounter Surveillance System','The Encounter Surveillance System can be deployed in any system outside empire jurisdiction. It monitors encounters in the system, allowing the Caldari State to supplement the rewards for killing a wanted pirate.\r\n\r\nWith an active ESS in a system the bounty payout values change and a Loyalty Point payou