.  \r\n\r\nThe 43-X chip is designed for cruiser class vessels.',1,0.1,0,1,NULL,2000000.0000,1,738,2038,NULL,0),(33620,314,'Rogue Drone 42-X Nexus Chip','This chip is part of little-understood evolved rogue drone technology. It apparently connects both to the drones\' propulsion systems and to their sensory equipment, and thus plays a part in allowing them to detect and pursue objects, sites, or victims of interest.\r\n\r\nUnfortunately, it is extremely fragile and doesn\'t react well to being forced into any machinery other than its native habitat, meaning that its uses as a research object are strongly limited by its availability. Some organizations in New Eden, particularly those interested in exploration and dark sciences, are rumored to pay well for this kind of item.\r\n\r\nThe 42-X chip is designed for battleship class vessels.',1,0.1,0,1,NULL,8000000.0000,1,738,2038,NULL,0),(33621,310,'Titanomachy','Here lie the wrecks of monstrous ships, commemorating a battle that blotted out the sky on Jan 27-28 in YC 116. \r\n\r\nTwo coalitions of capsuleers clashed in vessels numbering in the thousands, causing destruction on a scale of war never before seen by human eyes. CONCORD elected - after advising with the various empires - to leave a few wrecks left on the field for all spacefarers to see. Ostensibly this was a warning to capsuleers of where their folly would lead them, but those who\'ve encountered the immortals will know it was more likely taken as an ideal of death and destruction to which they can aspire from now until the end of time.\r\n',1,1,0,1,NULL,NULL,0,NULL,NULL,NULL,1211),(33622,226,'Titanomachy Monument','This monument serves to honor the 74 capsuleers who sacrificed their Titan-class starships in the Battle of B-R5RB. It was conceived of and funded by an informal coalition of the Tritanium miners of New Eden.\r\n\r\nAerallo\r\nAiyashia Morgan\r\nAnna Valerios\r\nAnndy\'s Wife\r\nAphillo\r\nArwyon\r\nBjoern\r\nBrother Justice\r\nbushy2\r\nChango A