ameleon Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,303),(33677,25,'Police Pursuit Comet','The Comet\'s design comes from one Arnerore Rylerave, an engineer and researcher of the Roden Shipyards corporation.  Originally created as a standard-issue police patrol vessel, its tremendous maneuverability and great offensive capabilities catapulted it into the Navy\'s ranks, where it is now a widely-used skirmish vessel.',970000,16500,145,1,8,NULL,0,1366,NULL,NULL,66),(33678,105,'Police Pursuit Comet Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,20074,60),(33681,100,'Gecko','The Gecko was one of the results of the explosion in new technology deriving from the covert and highly illegal research labs known as Ghost Sites. It is a superdrone whose structure bears some similarity to Heavy Drones, but whose function is far deadlier.\r\n\r\nThe Gecko uses up twice the bandwidth of a regular drone, and in turn comes with twice the combat capabilities at much less the skill cost. It accomplishes this in part through an enigmatic new advancement in the theory of remote operations, which allows clone pilots much greater control of detached high-velocity equipment than had hereto been possible.',10000,50,0,1,1,500000.0000,1,839,NULL,NULL,20483),(33682,176,'Gecko Blueprint','',0,0.01,0,1,NULL,5000000.0000,1,NULL,NULL,NULL,1079),(33683,543,'Mackinaw ORE Development Edition','The exhumer is the second generation of mining vessels created by <a href=showinfo:30//500014>ORE</a>. Exhumers, like their mining barge cousins, were each created to excel at a specific function, the Mackinaw\'s being storage. A massive ore hold allows the Mackinaw to operate for extended periods without requiring as much support as other exhumers.\r\n\r\nExhumers are equipped with electronic subsystems specifically designed to accommodate Strip Mining and Ice Harvesting modules.',20000000,150000,450,1,128,12634472.0000,0,NULL,NULL,20066,20601),(33684,477,'Mackinaw ORE Development Edition Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,46),(33685,941,'Orca ORE Development Edition','The Orca was developed as a joint venture between Outer Ring Excavations and Deep Core Mining Inc as a vessel to help meet the demands of New Eden\'s industry and provide a flexible platform from which mining operations can be more easily managed.\r\n\r\nThe Orca uses much of the technology developed by ORE for the Rorqual and integrated with the latest advancements from Deep Core Mining research division has developed a vessel which offers a diverse role to all sizes of operations and needs. ',250000000,10250000,30000,1,8,1630025214.0000,0,NULL,NULL,20066,20602),(33686,945,'Orca ORE Development Edition Blueprint','',0,0.01,0,1,NULL,900000000.0000,1,NULL,NULL,NULL,309),(33687,883,'Rorqual ORE Development Edition','The Rorqual was conceived and designed by Outer Ring Excavations in response to a growing need for capital industry platforms with the ability to support and sustain large-scale mining operations in uninhabited areas of space.\r\n\r\nTo that end, the Rorqual\'s primary strength lies in its ability to grind raw ores into particles of smaller size than possible before, while still maintaining their distinctive molecular structure. This means the vessel is able to carry vast amounts of ore in compressed form.\r\n\r\nAdditionally, the Rorqual is able to fit a capital tractor beam unit, capable of pulling in cargo containers from far greater distances and at far greater speeds than smaller beams can. It also possesses a sizeable drone bay, jump drive capability and the capacity to fit a clone vat bay. This combination of elements makes the Rorqual the ideal nexus to build deep space mining operations around.\r\n\r\nDue to its specialization towards industrial operations, its ship maintenance bay is able to accommodate only industrial ships, mining barges and their tech 2 variants',1180000000,14500000,40000,1,8,1520784302.0000,0,NULL,NULL,20067,20603),(33688,944,'Rorqual ORE Development Edition Blueprint','',0,0.01,0,1,NULL,3000000000.0000,1,NULL,NULL,NULL,309),(33689,28,'Iteron Inner Zone Shipping Edition','This lumbering giant is the latest and last iteration in a chain of haulers. It is the only one to retain the original \"Iteron\"-class callsign, but while all the others eventually evolved into specialized versions, the Iteron Mk. V still does what haulers do best: Transporting enormous amounts of goods and commodities between the stars.',13500000,275000,5800,1,8,NULL,0,NULL,NULL,20074,20479),(33690,108,'Iteron Inner Zone Shipping Edition Blueprint','',0,0.01,0,1,NULL,11250000.0000,1,NULL,NULL,NULL,328),(33691,28,'Tayra Wiyrkomi Edition','The Tayra, an evolution of the now-defunct Badger Mark II, focuses entirely on reaching the highest potential capacity that Caldari engineers can manage.',13000000,270000,7300,1,1,NULL,0,NULL,NULL,20070,20478),(33692,108,'Tayra Wiyrkomi Edition Blueprint','',0,0.01,0,1,NULL,7425000.0000,1,NULL,NULL,NULL,52),(33693,28,'Mammoth Nefantar Edition','The Mammoth is the largest industrial ship of the Minmatar Republic. It was designed with aid from the Gallente Federation, making the Mammoth both large and powerful yet also nimble and technologically advanced. A very good buy.',11500000,255000,5500,1,2,NULL,0,NULL,NULL,20078,20480),(33694,108,'Mammoth Nefantar Edition Blueprint','',0,0.01,0,1,NULL,9375000.0000,1,NULL,NULL,NULL,309),(33695,28,'Bestower Tash-Murkon Edition','The Bestower has for decades been used by the Empire as a slave transport, shipping human labor between cultivated planets in Imperial space. As a proof to how reliable this class has been through the years, the Emperor has used an upgraded version of this very same class as transports for the Imperial Treasury. The Bestower has very thick armor and large cargo space.\r\n',13500000,260000,4800,1,4,NULL,0,NULL,NULL,20063,20481),(33696,108,'Bestower Tash-Murkon Edition Blueprint','',0,0.01,0,1,NULL,4977500.0000,1,NULL,NULL,NULL,1064),(33697,1283,'Prospect','After the success of the Venture mining frigate, ORE spun their growing frontier exploration, exploitation and technology divisions into new subsidiaries. One of the first projects undertaken by the newly configured ORE conglomerate was the development of a new line of Expedition frigates, designed to meet the needs of the riskiest and most lucrative harvesting operations.\r\n\r\nThe Prospect combines improved asteroid mining systems with the Venture frame whose speed and agility made its predecessor famous. It is also the first ORE ship to take advantage of Covert Ops Cloaking Devices, allowing the Prospect to warp while cloaked for movement to and from asteroid fields in even the most hostile territories.',1400000,50000,150,1,128,NULL,1,1924,NULL,20066,20600),(33698,105,'Prospect Blueprint','',0,0.01,0,1,NULL,2825000.0000,1,NULL,NULL,NULL,20600),(33699,273,'Medium Drone Operation','Skill at controlling medium combat drones. 5% bonus to damage of medium drones per level.',0,0.01,0,1,NULL,100000.0000,1,366,33,NULL,0),(33700,1250,'\'Packrat\' Mobile Tractor Unit','The mobile tractoring unit takes some of the work out of looting the scorched ruins left by capsuleers, be it pulverized asteroids, wrecked ships, or obliterated inhabitation modules of various kinds. Once it has been deployed and completed its automatic activation process, it will lock on to any containers or wrecks within range, reel them in one by one, and empty their contents into its own cargo bay. All the capsuleer needs to do is keep up the pace of destruction.\n\n125km effective range.\n10 second activation time.\n\nMay not be deployed within 5km of another Mobile Tractor Unit, within 50km of Stargates, Stations or Upwell Structures, or within 40km of a Starbase.\nAutomatically decays if abandoned for two days.',10000,125,27000,1,NULL,NULL,1,1833,NULL,NULL,20387),(33701,1270,'\'Packrat\' Mobile Tractor Unit Blueprint','',0,0.01,0,1,NULL,30000000.0000,1,NULL,0,NULL,0),(33702,1250,'\'