t out in style.\r\n',0.5,0.1,0,1,NULL,NULL,1,1401,21156,NULL,0),(33786,1090,'Men\'s \'Rider\' Pants (white gold)','The overall design of these \'Rider\' pants - including the pleated fold at the front of the slim legs, the reflective edges that contrast precious gold with pure white, and the thin belt lacing at the top - clearly indicates that the wearer is of a high class indeed. \r\n\r\nAt the same time they are a perfect fit for a body that is never less than fresh out of the darkness of its pod, or the cleansing waters of its clone vats, and that is unhesitant to put its own life on the line whenever needed. Death, however often it visits, should not be any reason to allow oneself a slip in the high standards of style.\r\n',0.5,0.1,0,1,NULL,NULL,1,1401,21155,NULL,0),(33787,1090,'Men\'s \'Rider\' Pants (royal gold)','The overall design of these \'Rider\' pants - including the pleated fold at the front of the slim legs, the reflective edges that contrast classy gold with a practical dark beige, and the thin belt lacing at the top - clearly indicates that the wearer is of a high class indeed. \r\n\r\nAt the same time they are a perfect fit for a body that is never less than fresh out of the darkness of its pod, or the cleansing waters of its clone vats, and that is unhesitant to put its own life on the line whenever needed. Death, however often it visits, should not be any reason to allow oneself a slip in the high standards of style.\r\n',0.5,0.1,0,1,NULL,NULL,1,1401,21154,NULL,0),(33788,1090,'Men\'s \'Rider\' Pants (red gold)','The overall design of these \'Rider\' pants - including the pleated fold at the front of the slim legs, the reflective edges that contrast gold with a regal maroon, and the thin belt lacing at the top - clearly indicates that the wearer is of a high class indeed. \r\n\r\nAt the same time they are a perfect fit for a body that is never less than fresh out of the darkness of its pod, or the cleansing waters of its clone vats, and that is unh