laced harness locks in seamlessly on the front, while the starkly white sides are composed of thin but untearable material that\'s framed in pitch black and leads to pads covering major joints in the upper body. A capsuleer wearing this jacket is ready for a fight, both in and out of the pod.',0.5,0.1,0,1,NULL,NULL,1,1399,21180,NULL,0),(33792,1088,'Men\'s \'Impact\' Jacket (green camo)','Harkening back to the days where even the most experienced spacefarers needed protection from the bruising of the elements, this elegant, yet rough-and-tumble design shows that the wearer has seen their own share of action and is unquestionably ready for more.\r\n\r\nA pitch black nanofiber-laced harness locks in seamlessly on the front, while the sides are composed of thin but untearable material in the camouflage colors of ground warriors, leading all the way to pads that cover major joints in the upper body. A capsuleer wearing this jacket is ready for a fight, both in and out of the pod.\r\n',0.5,0.1,0,1,NULL,NULL,1,1399,21179,NULL,0),(33793,1088,'Men\'s \'Impact\' Jacket (graphite)','Harkening back to the days where even the most experienced spacefarers needed protection from the bruising of the elements, this elegant, yet rough-and-tumble design shows that the wearer has seen their own share of action and is unquestionably ready for more.\r\n\r\nClad in the utter darkness of deep and dangerous space, a nanofiber-laced harness locks in seamlessly on the front, while the sides are composed of thin but untearable material that leads to pads covering major joints in the upper body. A capsuleer wearing this jacket is ready for a fight, both in and out of the pod.',0.5,0.1,0,1,NULL,NULL,1,1399,21178,NULL,0),(33794,1088,'Men\'s \'Impact\' Jacket (dark red)','Harkening back to the days where even the most experienced spacefarers needed protection from the bruising of the elements, this elegant, yet rough-and-tumble design shows that the wearer has seen their own share of action and is