terwear signifies the wearer\'s regal nature and (some claim) near-divine immortality.\r\nWith a tattoo of golden decorations on a sandy beige background, as befits a person who is charged with the caretaking of innumerable souls, on their crew and elsewhere - along with, occasionally, ushering them to their maker - it is an undeniable statement of purpose in this dark and dangerous world. \r\n\r\nThe wearer, it says, is not afraid to attract the attention of others, be they admiring or antagonistic; for he follows a mandate greater than that of any mortal man, and he will not, ever, under any circumstances, be stopped.\r\n',0.5,0.1,0,1,NULL,NULL,1,1399,21174,NULL,0),(33798,1088,'Men\'s \'Curate\' Coat (red/gold)','This outerwear signifies the wearer\'s regal nature and (some claim) near-divine immortality.\r\nWith a tattoo of golden decorations on a blood red background, as befits a person who is charged with the caretaking of innumerable souls, on their crew and elsewhere - along with, occasionally, ushering them to their maker - it is an undeniable statement of purpose in this dark and dangerous world. \r\n\r\nThe wearer, it says, is not afraid to attract the attention of others, be they admiring or antagonistic; for he follows a mandate greater than that of any mortal man, and he will not, ever, under any circumstances, be stopped.\r\n',0.5,0.1,0,1,NULL,NULL,1,1399,21173,NULL,0),(33799,1088,'Men\'s \'Curate\' Coat (dark bronze)','This outerwear signifies the wearer\'s regal nature and (some claim) near-divine immortality.\r\nWith a tattoo of bronzed decorations, on a background that ranges from musky brown to the darkest black, it befits a person who is charged with the caretaking of innumerable souls, on their crew and elsewhere - along with, occasionally, ushering them to their maker - and is an undeniable statement of purpose in this dark and dangerous world. \r\n\r\nThe wearer, it says, is not afraid to attract the attention of others, be they admiring or antagonistic; for he follows a mandate greater than that of any mortal man, and he will not, ever, under any circumstances, be stopped.',0.5,0.1,0,1,NULL,NULL,1,1399,21172,NULL,0),(33800,1088,'Men\'s \'Curate\' Coat (black/silver)','This outerwear signifies the wearer\'s regal nature and (some claim) near-divine immortality.\r\nWith a tattoo of steely silver decorations on a pitch black background that brings to mind a starry sky, it befits a person who is charged with the caretaking of innumerable souls, on their crew and elsewhere - along with, occasionally, ushering them to their maker - and is an undeniable statement of purpose in this dark and dangerous world. \r\n\r\nThe wearer, it says, is not afraid to attract the attention of others, be they admiring or antagonistic; for he follows a mandate greater than that of any mortal man, and he will not, ever, under any circumstances, be stopped.\r\n',0.5,0.1,0,1,NULL,NULL,1,1399,21171,NULL,0),(33803,1088,'Men\'s \'Source\' Coat (black)','Hewing back to an established capsuleer tradition that power is best wielded in terrifyingly good style, this \"Source\" coat has a sleek, lithe look that befits the person who knows far more than they let on. It was released alongside an exclusive compendium that granted access to secret information on the world of New Eden - although it must be admitted that anyone confronted with a capsuleer, particularly one dressed in this fashion, won\'t find it too hard to be convinced that no information should be kept secret from these angry, immortal gods of the skies.',0.5,0.1,0,1,NULL,NULL,1,1662,21184,NULL,0),(33804,1088,'Women\'s \'Source\' Coat (silver)','Hewing back to an established capsuleer tradition that power is best wielded in terrifyingly good style, this \"Source\" coat has a sleek, lithe look that befits the person who knows far more than they let on. It was released alongside an exclusive compendium that granted access to secret information on the world of New Eden - although it must be admitted that anyone confronted with a capsuleer, particularly one dressed in this fashion, won\'t find it too hard to be convinced that no information should be kept secret from these angry, immortal gods of the skies.',0.5,0.1,0,1,NULL,NULL,1,1662,21183,NULL,0),(33805,695,'DED Officer 1st Class Vessel','This is a fighter-ship belonging to DED, a division in the CONCORD organization responsible for tracking down and eliminating criminals.  Consider it a threat to anyone that has commited a criminal offense within CONCORD patrolled space.',12155000,101000,900,1,NULL,NULL,0,NULL,NULL,NULL,1052),(33806,697,'CONCORD Starship Vessel','The CONCORD Starship is solely used for transporting or escorting people of extreme importance within CONCORD patrolled space.  It is built for defense with very light offensive capability.',20500000,1080000,665,1,NULL,NULL,0,NULL,NULL,NULL,1058),(33807,1730,'Cybernetic \'Source\' Subprocessor','This grafted subprocessor, based on technology similar to that which powers the New Eden Source compendium, is particularly good for understanding a great deal of information at once. It is implanted in the frontal lobe and grants a bonus to a character\'s Intelligence.\r\n\r\nEffect: +4 Bonus to Intelligence',0,1,0,1,NULL,400000.0000,1,621,2062,NULL,0),(33808,1730,'Neural \'Source\' Boost','This grafted subprocessor, based on technology similar to that which powers the New Eden Source compendium, is particularly good for amassing a great deal of information at once. It is implanted in the frontal lobe and grants a bonus to a character\'s Willpower.\r\n\r\nEffect: +4 Bonus to Willpower',0,1,0,1,NULL,400000.0000,1,620,2054,NULL,0),(33809,1194,'New Eden Source','This compendium of reports, data and historical documents - some of which are highly classified - details the landscape of New Eden and the lives of its various citizens. It is a blend of man-on-the-street tales, high-level political reportage, and behind-the-scenes information that casts a new light on the cluster.\r\n \r\nThe compendium itself is unique in its production: It serves as a repository of facts like any other book, digital or otherwise; but it has certain additional output functions that permit select readers to interface directly with its contents and grasp them at a level that is quite literally cerebral. This is a security measure more than anything, and an expensive one, but it means that parts of the book cannot even be read; instead, they must be imprinted directly on the brain\'s pathways. The only potential recipients of this kind of knowledge - at least, the only ones who can handle it without having their cranial nerves fried to a crisp - are capsuleers.\r\n \r\nThus, like the fabled Book of Emptiness in Amarr myth, this book is not only a book, but a vessel for a changed outlook on the world, and like that same mythological book, it has the ability to change those readers who are receptive to its dark wonders.',0,0.01,0,1,NULL,NULL,1,1661,21186,NULL,0),(33812,1089,'Men\'s \'Quafe\' T-shirt YC 116','Stalk the halls in your elegant new Quafe Commemorative Casual wear, designed exclusively for attendees of the YC 116 Inner Zone Shipping Conference.\r\n\r\nNote: While IZS is renowned for its safe shipping methods and extensive reach, the wearer of this shirt is unfortunately not entitled to free interstellar transport on an IZS flight for them and their accompanying family members or friends. They will, however, automatically and without question be seated as far from any Fedos in cargo as is humanly possible.',0.5,0.1,0,1,NULL,NULL,1,1662,21193,NULL,0),(33813,1089,'Women\'s \'Quafe\' T-shirt YC 116','Stalk the halls in your elegant new Quafe Commemorative Casual wear, designed exclusively for attendees of the YC 116 Inner Zone Shipping Conference.\r\n\r\nNote: While IZS is renowned for its safe shipping methods and extensive reach, the wearer of this shirt is unfortunately not entitled to free interstellar transport on 