 even the most vigorous physical activities with no ill effect.',0.1,0.1,0,1,NULL,NULL,1,1944,21271,NULL,0),(33990,1276,'Tournament Micro Jump Unit','',10000,1,27000,1,NULL,NULL,1,NULL,NULL,20151,20450),(33992,1083,'Accessories/Glasses/Monocle_01/Types/MonocleM01_RightBlack.type','Accessories/Glasses/Monocle_01/Types/MonocleM01_RightBlack.type',0.5,0.1,0,1,NULL,NULL,0,NULL,21269,NULL,0),(33993,1083,'Accessories/Glasses/Monocle_F_T02/Types/Monocle_F_T02_black_left.type','Accessories/Glasses/Monocle_F_T02/Types/Monocle_F_T02_black_left.type',0.5,0.1,0,1,NULL,NULL,0,NULL,21270,NULL,0),(33995,1084,'Tattoo/ArmLeft/Sleeve01/Types/Sleeve01_F_Left.type','Tattoo/ArmLeft/Sleeve01/Types/Sleeve01_F_Left.type',0.1,0.1,0,1,NULL,NULL,0,NULL,21230,NULL,0),(33996,1084,'Tattoo/ArmLeft/Sleeve02/Types/Sleeve02_F_Left.type','Tattoo/ArmLeft/Sleeve02/Types/Sleeve02_F_Left.type',0.1,0.1,0,1,NULL,NULL,0,NULL,21231,NULL,0),(33997,1084,'Tattoo/ArmLeft/Sleeve03/Types/Sleeve03_F_Left.type','Tattoo/ArmLeft/Sleeve03/Types/Sleeve03_F_Left.type',0.1,0.1,0,1,NULL,NULL,0,NULL,21232,NULL,0),(33998,1084,'Tattoo/ArmLeft/Sleeve06/Types/Sleeve06_F_Left.type','Tattoo/ArmLeft/Sleeve06/Types/Sleeve06_F_Left.type',0.1,0.1,0,1,NULL,NULL,0,NULL,21233,NULL,0),(33999,1084,'Tattoo/ArmLeft/Sleeve07/Types/Sleeve07_F_Left.type','Tattoo/ArmLeft/Sleeve07/Types/Sleeve07_F_Left.type',0.1,0.1,0,1,NULL,NULL,0,NULL,21234,NULL,0),(34000,1084,'Tattoo/ArmLeft/Sleeve09/Types/Sleeve09_F_Left.type','Tattoo/ArmLeft/Sleeve09/Types/Sleeve09_F_Left.type',0.1,0.1,0,1,NULL,NULL,0,NULL,21235,NULL,0),(34001,1084,'Tattoo/ArmLeft/Sleeve10/Types/Sleeve10_F_Left.type','Tattoo/ArmLeft/Sleeve10/Types/Sleeve10_F_Left.type',0.1,0.1,0,1,NULL,NULL,0,NULL,21236,NULL,0),(34002,1084,'Tattoo/ArmLeft/Sleeve11/Types/Sleeve11_F_Left.type','Tattoo/ArmLeft/Sleeve11/Types/Sleeve11_F_Left.type',0.1,0.1,0,1,NULL,NULL,0,NULL,21237,NULL,0),(34003,1084,'Tattoo/ArmLeft/Sleeve12/Types/Sleeve12_F_Left.type','Tattoo/ArmLeft/Sleeve12/Types/Sleeve12_F_Left.type',0.1,0