s that aim to enhance the human experience rather than cause - or worsen - a disconnect from reality. As such, its components have been carefully designed to ensure that they operate at a level of efficiency that is pleasing and empowering to the human mind, while not going too far beyond that level.\r\n\r\nFor instance, there are no unwieldy mechanical joints visible anywhere on the device. The shoulder is instead covered with a number of tiny clamps whose design conveys the sinuous curved lines of capsuleer beauty while simultaneously ensuring the shoulder has more than its full range of mobility. The elbow, likewise, appears more human than machine, thanks in good part to the superstrong stretchable material that covers it entirely in colors of unblemished white. Moreover, some of the traditionally larger muscles have replaced by socketed metal pumps that are nested inside one another in concentric fashion, giving a slim and tight, yet powerful impression.\r\n\r\nThe hand on the Arm resembles a glove, and its delineated fingers in practical gray are delicate enough to feel even the slightest change of pressure in the air. The hand\'s internal sensors render it so nimble that it can hold on to almost anything, even the slightest wisp of material, without leaving a mark; yet so strong that the only time its grip can be forced against the owner\'s will to open, the rest of its owner will long since have been separated from the Arm.',0.5,0.1,0,1,NULL,NULL,1,1836,21261,NULL,0),(34024,1271,'Men\'s \'Crusher\' Cybernetic Arm (black and orange left)','The F-916.083 model \'Crusher\' Cybernetic Arm, in night black and sunset orange, is the latest in naturalistic technologies that aim to enhance the human experience rather than cause - or worsen - a disconnect from reality. As such, its components have been carefully designed to ensure they operate at a level of efficiency that is pleasing and empowering to the human mind, while not going too far beyond that level.\r\n\r\nThe purpose of its shoulder pad, for instance, is not just to absorb any number of shocks that a capsuleer might suffer inside and out of the capsule, but also function as a clamp - because this model, quite honestly, is so strong that if its internal push/pull sensors were to malfunction and it were to grip something with the full extent of its capabilities, it might very well tear the wearer\'s entire shoulder out of its socket.\r\n\r\nLikewise, scanners in the fingers can detect details unavailable to normal humans - particulars in heat, texture and light reflection - but are set on a timer whereby they limit the details after a while, because even a capsuleer\'s mind, which can multitask at near-superhuman levels, is not set up to handle a constant influx of unnecessary data. \r\n\r\nFinally, the upper arms have exposed and slanted machinery that resembles the striations of raw muscle. It could of course have been covered over, but was kept open to indicate the unfettered strength of the capsuleer in all that he does.',0.1,0.5,0,1,NULL,NULL,1,1836,21262,NULL,0),(34025,1271,'Men\'s \'Crusher\' Cybernetic Arm (black and red left)','The F-916.083 model \'Crusher\' Cybernetic Arm, in night black and blood red, is the latest in naturalistic technologies that aim to enhance the human experience rather than cause - or worsen - a disconnect from reality. As such, its components have been carefully designed to ensure they operate at a level of efficiency that is pleasing and empowering to the human mind, while not going too far beyond that level.\r\n\r\nThe purpose of its shoulder pad, for instance, is not just to absorb any number of shocks that a capsuleer might suffer inside and out of the capsule, but also function as a clamp - because this model, quite honestly, is so strong that if its internal push/pull sensors were to malfunction and it were to grip something with the full extent of its capabilities, it might very well tear the wearer\'s entire shoulder out of it