orting structure in the area might collapse. In all their rescue operations, the rope itself has never broken.\r\n\r\nIn short, the material is light, porous, and damn near unbreakable, retaining its shape without strangling the legs or being overstretched after removal, and it may be used for even the most vigorous physical activities with no ill effect.',0.1,0.1,0,1,NULL,NULL,1,1944,21280,NULL,0),(34056,1092,'Men\'s \'Nova\' Headwear (black)','This regal and complex piece of headwear is, as the perspicuous viewer may have suspected, of Amarr origin. It derives in part from a type of cap that certain Amarr missionaries would routinely wear during excursions into unknown territories; part for protection against the elements, part to identify themselves with a type of clothing they felt certain would not be found in heathen places, and part, the myth goes, to help frighten the locals into submission.\r\n\r\nThe intricate and highly decorated headwear, black as the darkness that awaits all of us who fail to find the glory of God, is emblematic of the infinite machineries of our god and the vast expanses it represents. Moreover, it\'s complete with the powerful arms reaching from the origin of thought, consciousness and the waking world, spreading out to remind the wearer that the Lord\'s grasp on our world is absolute.',0.1,0.1,0,1,NULL,NULL,1,1943,21195,NULL,0),(34057,1092,'Men\'s \'Tectonic\' Headwear (matte black)','This imposing, interlocked piece of headwear comes from hardworking Caldari scientists, all of whom are of course fiercely loyal to the State\'s core cause of teamwork, cooperation and personal sacrifice for the greater good. \r\n\r\nIt is composed of sliding plates - matte black, so as to better fit in with the crowd - that adjust fully to the wearer\'s head. It is a complex assemblage of parts that shift in union, none of them out of place, and none of them failing to do its duty as supporter and protector of the whole.\r\n\r\nEach plate is, in and of itself, immensely resilient to all manner of wear and tear, but it\'s only when fitted into the complicated mesh that their resilience rises by an order of magnitude, each part linking to the next to form a layer of pure strength.',0.1,0.1,0,1,NULL,NULL,1,1943,21197,NULL,0),(34058,1092,'Men\'s \'Tectonic\' Headwear (white)','This imposing, interlocked piece of headwear comes from hardworking Caldari scientists, all of whom are of course fiercely loyal to the State\'s core cause of teamwork, cooperation and personal sacrifice for the greater good. \r\n\r\nIt is composed of sliding plates - white and unblemished, all the better to subtly indicate the purity of the Caldari working spirit - that adjust fully to the wearer\'s head. It is a complex assemblage of parts that shift in union, none of them out of place, and none of them failing to do its duty as supporter and protector of the whole.\r\n\r\nEach [white] plate is, in and of itself, immensely resilient to all manner of wear and tear, but it\'s only when fitted into the complicated mesh that their resilience rises by an order of magnitude, each part linking to the next to form a layer of pure strength.',0.1,0.1,0,1,NULL,NULL,1,1943,21198,NULL,0),(34059,1092,'Men\'s \'Nova\' Headwear (silver)','This regal and complex piece of headwear is, as the perspicuous viewer may have suspected, of Amarr origin. It derives in part from a type of cap that certain Amarr missionaries would routinely wear during excursions into unknown territories; part for protection against the elements, part to identify themselves with a type of clothing they felt certain would not be found in heathen places, and part, the myth goes, to help frighten the locals into submission.\r\n\r\nThe intricate and highly decorated headwear, silver as the twin moons over Athra, is emblematic of the infinite machineries of our god and the vast expanses it represents. Moreover, it\'s complete with the powerful arms reaching from the origin of thought, consciousness and the waking world, spreading out to remind the wearer that the Lord\'s grasp on our world is absolute.',0.1,0.1,0,1,NULL,NULL,1,1943,21199,NULL,0),(34060,1092,'Men\'s \'Nova\' Headwear (gold)','This regal and complex piece of headwear is, as the perspicuous viewer may have suspected, of Amarr origin. It derives in part from a type of cap that certain Amarr missionaries would routinely wear during excursions into unknown territories; part for protection against the elements, part to identify themselves with a type of clothing they felt certain would not be found in heathen places, and part, the myth goes, to help frighten the locals into submission.\r\n\r\nThe intricate and highly decorated headwear, golden as the sun rising on the magnificent Amarr empire, is emblematic of the infinite machineries of our god and the vast expanses it represents. Moreover, it\'s complete with the powerful arms reaching from the origin of thought, consciousness and the waking world, spreading out to remind the wearer that the Lord\'s grasp on our world is absolute.',0.1,0.1,0,1,NULL,NULL,1,1943,21200,NULL,0),(34061,1092,'Men\'s \'Nova\' Headwear (bronze)','This regal and complex piece of headwear is, as the perspicuous viewer may have suspected, of Amarr origin. It derives in part from a type of cap that certain Amarr missionaries would routinely wear during excursions into unknown territories; part for protection against the elements, part to identify themselves with a type of clothing they felt certain would not be found in heathen places, and part, the myth goes, to help frighten the locals into submission.\r\n\r\nThe intricate and highly decorated headwear, bronze as the blood that flows from heathens, is emblematic of the infinite machineries of our god and the vast expanses it represents. Moreover, it\'s complete with the powerful arms reaching from the origin of thought, consciousness and the waking world, spreading out to remind the wearer that the Lord\'s grasp on our world is absolute.\r\n',0.1,0.1,0,1,NULL,NULL,1,1943,21201,NULL,0),(34062,1092,'Men\'s \'Tectonic\' Headwear (metal)','This imposing, interlocked piece of headwear comes from hardworking Caldari scientists, all of whom are of course fiercely loyal to the State\'s core cause of teamwork, cooperation and personal sacrifice for the greater good. \r\n\r\nIt is composed of sliding plates - with a metal sheen, all the better to subtly indicate Caldari strength - that adjust fully to the wearer\'s head. It is a complex assemblage of parts that shift in union, none of them out of place, and none of them failing to do its duty as supporter and protector of the whole.\r\n\r\nEach plate is, in and of itself, immensely resilient to all manner of wear and tear, but it\'s only when fitted into the complicated mesh that their resilience rises by an order of magnitude, each part linking to the next to form a layer of pure strength.',0.1,0.1,0,1,NULL,NULL,1,1943,21202,NULL,0),(34063,1092,'Men\'s \'Tectonic\' Headwear (shiny black)','This imposing, interlocked piece of headwear comes from hardworking Caldari scientists, all of whom are of course fiercely loyal to the State\'s core cause of teamwork, cooperation and personal sacrifice for the greater good. \r\n\r\nIt is composed of sliding plates - with a shiny metal sheen, all the better to subtly indicate the limitless depths of Caldari strength and unity - that adjust fully to the wearer\'s head. It is a complex assemblage of parts that shift in union, none of them out of place, and none of them failing to do its duty as supporter and protector of the whole.\r\n\r\nEach plate is, in and of itself, immensely resilient to all manner of wear and tear, but it\'s only when fitted into the complicated mesh that their resilience rises by an order of magnitude, each part linking to the next to form a layer of pure strength.',0.1,0.1,0,1,NULL,NULL,1,1943,21203,NULL,0),(34064,1092,'Women\'s \'Aeriform\' Headwear (cyan)','This translucent cyan decoration was created for lightweight comfort. As part of its design it covers only part of the head, all the better to indicate a debonair look for the most fashionable (and, truth be told, richest and most powerful) individuals in the cluster. It is the kind of headgear that might be taken into sports, into high-speed traffic, or simply into a meeting of high-powered executives, where its casual style makes it very apparent who\'s boss.',0.1,0.1,0,1,NULL,NULL,1,1943,21204,NULL,0),(34065,1092,'Women\'s \'Blades\' Headwear (gunmetal)','This sharp-looking decoration in gunmetal hue draws its inspiration from ancient Amarr tradition, and has received greater attention in recent years due to the tendency of people of royal blood to wear it at official functions.\r\n\r\nIt is regal and imposing, with an otherworldly - and some say devilish - appearance, and in its clean design it is said to offer several different interpretations depending on whether the onlooker is standing at attention or supplicating on their knees. It  might be a halo around the wearer\'s head, gently implying her sanctified nature. it might be a set of wings that indicate the eventual heavenly flight of her soul. Or it might be the spikes on which those who displease her will be impaled.',0.1,0.1,0,1,NULL,NULL,1,1943,21205,NULL,0),(34066,1092,'Women\'s \'Aeriform\' Headwear (blue)','This translucent blue decoration was created for lightweight comfort. As part of its design it covers only part of the head, all the better to indicate a debonair look for the most fashionable (and, truth be told, richest and most powerful) individuals in the cluster. It is the kind of headgear that might be taken into sports, into high-speed traffic, or simply into a meeting of high-powered executives, where its casual style makes it very apparent who\'s boss.',0.1,0.1,0,1,NULL,NULL,1,1943,21206,NULL,0),(34067,1092,'Women\'s \'Blades\' Headwear (platinum)','This sharp-looking decoration in platinum hue draws its inspiration from ancient Amarr tradition, and has received greater attention in recent years due to the tendency of people of royal blood to wear it at official functions.\r\n\r\nIt is regal and imposing, with an otherworldly - and some say devilish - appearance, and in its clean design it is said to offer several different interpretations depending on whether the onlooker is standing at attention or supplicating on their knees. It  might be a halo around the wearer\'s head, gently implying her sanctified nature. it might be a set of wings that indicate the eventual heavenly flight of her soul. Or it might be the spikes on which those who displease her will be impaled.',0.1,0.1,0,1,NULL,NULL,1,1943,21207,NULL,0),(34068,1092,'Women\'s \'Spiderweb\' Headwear (black)','This elegant, intricately decorated black lacework is a perfect match for the pilot who wants her bodily decorations to have a nice undertone of her time in the capsule, while simultaneously reminding the lucky onlookers that she is, just like the decoration, elegant, cryptic, and not quite of this world.\r\n\r\nThe material is a delicate mesh of rare metals intermixed with sheets of superthin, stretchable atomic structures. It\'s strong enough to withstand any rigors and to help the head\'s skin breathe easy, while being supple enough to follow along with even the most minute shifts in expression; all the more for a lady of immense power, diplomacy, class and - for a select few - immeasurable deviousness, to slyly express her thoughts to the world.',0.1,0.1,0,1,NULL,NULL,1,1943,21208,NULL,0),(34069,1092,'Women\'s \'Blades\' Headwear (gold)','This sharp-looking decoration in golden hue draws its inspiration from ancient Amarr tradition, and has received greater attention in recent years due to the tendency of people of royal blood to wear it at official functions.\r\n\r\nIt is regal and imposing, with an otherworldly - and some say devilish - appearance, and in its clean design it is said to offer severa