r with the matching sleeve and collar suit top. \r\n',0.5,0.1,0,1,4,NULL,1,1403,21293,NULL,0),(34112,310,'Abandoned CRC Monitoring Station','This relay station was used by the Communications Relay Committee until July YC116, when it was abandoned after an assault by Dominations forces.\r\n\r\nContaining equipment used by the CRC to monitor and intercept radio, wireless and fluid router transmissions, the DED believe that the site was attacked after intercepting encrypted data broadcasted to Angel Cartel headquarters from a scouting party in Evati.\r\n\r\nThe CRC operator of this site, codenamed Eshtir, has vanished without trace and is now reportedly on the run from Dominations forces, whom have placed a sizeable bounty on his head. \r\n',1,1,0,1,NULL,NULL,0,NULL,NULL,NULL,1211),(34118,27,'Megathron Quafe Edition','The Megathron has established itself as one of the most feared and respected battleships around. Since its first appearance almost two decades ago it has seen considerable service in the troublesome regions on the outskirts of the Federation, helping to expand and defend Gallentean influence there.',98400000,486000,675,1,8,105000000.0000,0,NULL,NULL,20072,20928),(34119,107,'Megathron Quafe Edition Blueprint','',0,0.01,0,1,NULL,1250000000.0000,1,NULL,NULL,NULL,64),(34120,1297,'Mobile Competitive Vault','..',10000,300,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(34121,1268,'Mobile Competitive Vault Blueprint','',0,0.01,0,1,NULL,150000000.0000,1,NULL,0,NULL,0),(34122,1299,'Limited Jump Drive Economizer','This unit decreases the isotope fuel requirements of starship jump drives.\r\n\r\nCan only be fitted to Jump Freighters and Rorquals.\r\n\r\nPenalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',50,3500,0,1,NULL,NULL,1,1941,98,NULL,0),(34123,158,'Limited Jump Drive Economizer Blueprint','',0,0.01,0,1,NULL,249980.0000,1,NULL,98,NULL,0),(34124,1299,'Experimental Jump Drive Economizer','This uni