ense mechanisms still active in the area. Skillful hacking should do the trick. ',10000,27500,2700,1,4,NULL,0,NULL,NULL,20177,1680),(34306,1308,'Large Higgs Anchor I','This unique rig generates drag against the energy field of space itself, causing the fitted ship to increase in mass and agility while greatly reducing maximum velocity.\r\nThis effect also reduces a ship\'s maximum warp speed, although the impact on warp velocity can be mitigated through skilled use. As a side effect of the increased warp drag, interdiction nullified ships lose the benefits of their nullification while fitted with this rig, causing them to be affected by non-targeted warp disruption like normal vessels.\r\n\r\nThe drawbacks of fitting this rig may be reduced by training the <a href=showinfo:26254>Astronautics Rigging</a> skill.\r\nOnly one Higgs Anchor can be fitted at a time.\r\n\r\nPenalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',200,20,0,1,4,NULL,1,1212,3196,NULL,0),(34307,787,'Large Higgs Anchor I Blueprint','',0,0.01,0,1,4,1250000.0000,1,1242,76,NULL,0),(34308,1308,'Capital Higgs Anchor I','This unique rig generates drag against the energy field of space itself, causing the fitted ship to increase in mass and agility while greatly reducing maximum velocity.\r\nThis effect also reduces a ship\'s maximum warp speed, although the impact on warp velocity can be mitigated through skilled use. As a side effect of the increased warp drag, interdiction nullified ships lose the benefits of their nullification while fitted with this rig, causing them to be affected by non-targeted warp disruption like normal vessels.\r\n\r\nPenalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.\r\n\r\nThe drawbacks of fitting this rig may be reduced by training the <a href=showinfo:26254>Astronautics Rigging</a> skill.\r\n\r\nOnly one Higgs Anchor can be fitted at a time.\r\n\r\n',200,40,0,1,4,NULL,1,1740,3196,NULL,0),(34309,787,'Capital Higgs Anchor I Blueprint','',0,0.01,0,1,4,50000000.0000,1,1720,76,NULL,0),(34310,226,'Unidentified Structure','There\'s nothing in our databanks that matches this structure.',0,0,0,1,1,NULL,0,NULL,NULL,20185,20957),(34311,314,'Honorary Fabricator-General Baton','This baton of command is inscribed with the name of the capsuleer <url=showinfo:1377//1319007453>Ascentior</url> and signifies his honorary rank as a Fabricator-General of the Imperial Navy. This award was given in recognition of exemplary service as the top supplier of Sleeper components for the Imperial Navys research program in late YC 116.\r\n ',1,0.1,0,1,4,NULL,1,NULL,21380,NULL,0),(34312,314,'Honorary Brigadier of Engineers Insignia','This service insignia is inscribed on the reverse with the name of the capsuleer <url=showinfo:1377//332275222>TorDog</url> and indicates his honorary rank as a Caldari Brigadier of Engineers. This award was given in recognition of exemplary service as the top supplier of Sleeper components for the Caldari Navys research program in late YC 116.\r\n ',1,0.1,0,1,1,NULL,1,NULL,21381,NULL,0),(34313,314,'Honorary Federal Harbormaster Pennon','This naval pennon has the name of the capsuleer <url=showinfo:1377//101054534>Shipstorm</url> woven into its fabric and displays his honorary rank as a Federal Harbormaster. This award was given in recognition of exemplary service as the top supplier of Sleeper components for the Federation Navys research program in late YC 116.',1,0.1,0,1,8,NULL,1,NULL,21382,NULL,0),(34314,314,'Honorary Fleet Architect Badge','This military badge carries the name of the capsuleer <url=showinfo:1377//90771225>Lotrec Emetin</url> and is a mark of his honorary rank as a Republic Fleet Architect. This award was given in recognition of exemplary service as the top supplier of Sleeper components for the Republic Fleets research program in late YC 116.\r\n ',1,0.1,0,1,2,NULL,1,NULL,21383,NULL,0),(34315,306,'Hyperfluct Generator','This enigmatic unit hums with power, but to what purpose it is difficult to tell. It has a complex set of technical gadgets and perhaps delving into it with a Data Analyzer will reveal its true purpose. It seems though that it is well setup to protect its secrets, so caution is advised.',10000,27500,2700,1,4,NULL,0,NULL,NULL,20186,20969),(34316,226,'Damaged Spatial Concealment Chamber','The purpose of this large structure seems to have been to cloak a section of space - section big enough to conceal a sizable site. There are indications that this structure was damaged recently, to the point where it could no longer serve its purpose. Who damaged the structure or why is impossible to tell.',100000,100000000,10000,1,4,NULL,0,NULL,NULL,20185,20970),(34317,1305,'Confessor','Your first duty is to purge yourself in the flames of your confession before God. You must become ash in God\'s hands, for only then may you rise anew to strike the adversary down.\r\n\r\n-<i>Apostle-Martial Zhar Pashay\'s dawn address to the Paladins at the Battle of Rahdo, Amarr Prime AD 20538</i>',1800000,47000,400,1,4,NULL,1,1952,NULL,20063,20980),(34318,1309,'Confessor Blueprint','The Confessor-class Tactical Destroyer was developed for the glory of the Amarr Empire in YC116 with the invaluable aid of ninety-four loyal capsuleers. The most dedicated of these pilots were:\r\n<url=showinfo:1373//1319007453>Ascentior</url>\r\n<url=showinfo:1373//94237537>SALVATIONCOME4TRUBELIVER TYGODAMEN</url>\r\n<url=showinfo:1373//93337897>Blaze Tiberius</url>\r\n<url=showinfo:1373//422609556>Makoto Priano</url>\r\n<url=showinfo:1373//92813750>Ibrahim Tash-Murkon</url>\r\n<url=showinfo:1373//92355763>Lunarisse Aspenstar</url>\r\n<url=showinfo:1373//166109376>Methos Horseman</url>\r\n<url=showinfo:1373//150389477>Chiralos</url>\r\n<url=showinfo:1373//93396569>Soren Tyrhanos</url>\r\n<url=showinfo:1373//90500669>Dreadnaught X</url>',0,0.01,0,1,4,40000000.0000,1,NULL,NULL,NULL,1748),(34319,1306,'Confessor Defense Mode','33.3% bonus to all armor resistances\r\n33.3% reduction in ship signature radius',100,5,0,1,4,NULL,0,NULL,1042,NULL,0),(34321,1306,'Confessor Sharpshooter Mode','66.6% bonus to Small Energy Turret optimal range\r\n33% bonus to Small Energy Turret damage\r\n100% bonus to sensor strength and targeting range\r\n66% bonus to Sensor Dampener and Weapon Disruptor resistances',100,5,0,1,4,NULL,0,NULL,1042,NULL,0),(34323,1306,'Confessor Propulsion Mode','66.6% bonus to AB and MWD speed boost\r\n33.3% bonus to ship inertia modifier',100,5,0,1,4,NULL,0,NULL,1042,NULL,0),(34325,15,'Sisters of EVE Logistics Station','',0,1,0,1,8,600000.0000,0,NULL,NULL,20183,20967),(34326,15,'Sisters of EVE Industrial Station','',0,1,0,1,8,600000.0000,0,NULL,NULL,20183,20968),(34327,257,'ORE Freighter','Skill at operating ORE freighters.',0,0.01,0,1,128,35000000.0000,1,377,33,NULL,0),(34328,513,'Bowhead','As part of its ongoing program of developing new products for the capsuleer market, ORE has created the Bowhead freighter as a specialized ship transporter. Experience with the ship-handling technology used in the Orca and Rorqual vessels enabled the Outer Ring Development division to build a ship dedicated to moving multiple assembled hulls at once.\r\n\r\nOuter Ring Excavations are aggressively marketing the Bowhead as a flexible transport platform for organizing fleet logistics across New Eden, available from authorized ORE outlets.',400000000,17550000,4000,1,128,769286366.0000,1,1950,NULL,20073,20977),(34329,525,'Bowhead Blueprint','',0,0.01,0,1,128,1550000000.0000,1,1949,NULL,NULL,0),(34330,306,'Resource Container','The bolted container drifts silently amongst the stars, giving no hint to what treasures it may hide.',10000,2750,2700,1,4,NULL,1,NULL,NULL,NULL,1176),(34331,6,'Sun A0IV (Turbulent Blue Subgiant)','A bright blue stellar body emitting unusually high neutrino levels, this star experiences frequent coronal mass ejections at unpredictable intervals.\r\n\r\nThe turbulent subgiants of this type found in New Eden are prone to violent instability that scientists now believe is linked to unstable wormhole activity and the \"Caroline\'s Star\" stellar anomaly.',1e18,1,0,1,4,NULL,0,NULL,NULL,20096,21456),(34332,226,'Expedition Command Outpost Wreck','Scarred and scorched by devastating forces, this wrecked station apparently served as the command post for the Sanctuary expedition to Thera. Wreathed in clouds of plasma, gas and dust, the station\'s destruction, while not absolute, is profound and the interior has been gutted by fire and explosions.',0,0,0,1,8,NULL,0,NULL,NULL,NULL,3786),(34333,227,'Cloud Rings','',0,0,0,1,4,NULL,0,NULL,NULL,NULL,20964),(34334,226,'Planetary Colonization Office Wreck','Perhaps the saddest testament to the shattered dreams of the expedition to Thera, this wrecked station seems to have been established as a coordinating center for the colonization of the planet it orbits. As Thera VIII is shattered and wracked by titanic quakes, such an effort would seem improbable unless the shattering happened relatively recently.  \r\n\r\nWhile the damage to this station is extensive and very little survives, there are large storage areas containing bins of rock samples that apparently originated from a geologically stable barren or temperate planet.\r\n',0,0,0,1,8,NULL,0,NULL,NULL,NULL,3786),(34335,226,'Testing Facilities Wreck','Apparently set up to study nearby Talocan technology, this station has been buckled and broken by numerous impacts, possibly from material thrown up from the devastated planet below. The array of Talocan static gates nearby is eerily intact and seems to be functional to some degree.',0,0,0,1,8,NULL,0,NULL,NULL,NULL,3787),(34336,226,'Exotic Specimen Warehouse Wreck','Wrecked and battered, though largely intact, this station and its neighbor must originally have been sheltered in the lee of the planet to some extent. Disruption of orbital mechanics in this system make it difficult to be sure but the proximity of Thera III to the central star and the survival of recognizable station ruins requires an explanation of this kind. Some have suggested wilder theories concerning the nearby Talocan technology.\r\n\r\nThe station itself seems to have functioned as a vast storehouse of materials and specimens gathered from the core of the system. Not much remains and large quantities of radioactive fullerene gas seem to have bled from the ruptured storage vessels.\r\n',0,0,0,1,8,NULL,0,NULL,NULL,NULL,3788),(34337,1307,'Autothysian Lancer','The Autothysian Lancer is a Drifter-allied drone with a similar base design to the Circadian Seekers but is much more dangerous, sporting an upgraded array of defenses and weapons. Though highly militarized in response to capsuleer resistance, the drone still explores New Eden with the mechanical indifference seen in previous, weaker variants.',2000000,0,0,1,64,NULL,0,NULL,NULL,12,20978),(34338,988,'Wormhole T458','An unstable wormhole, deep in space. Wormholes of this kind usually collapse after a few days, and can lead to anywhere.',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,3715),(34339,485,'Moros Interbus Edition','Of all the dreadnoughts currently in existence, the imposing Moros possesses a tremendous capacity to fend off garguantuan hostiles while still posing a valid threat to any and all larger-scale threats on the battlefield. By virtue of its protean array of point defense capabilities, and its terrifying ability to unleash rapid and thoroughly devastating amounts of destruction on the battlefield, the Moros is single-handedly capable of turning the tide in a fleet battle.',1292500000,17550000,2550,1,8,1549802570.0000,0,NULL,NULL,NULL,20974),(34340,537,'Moros Interbus Edition Blueprint','',0,0.01,0,1,4,1900000000.0000,1,NULL,NULL,NULL,296),(34341,485,'Naglfar Justice Edition','The Naglfar is based on a Matari design believed to date back to the earliest annals of antiquity.  While the exact evolution of memes informing its figure is unclear, the same distinctive vertical monolith form has shown up time and time again in the wind-scattered remnants of Matari legend.\r\n\r\nBoasting an impressive versatility in firepower options, the Naglfar is capable of holding its own against opponents of all sizes and shapes.  While its defenses don\'t go to extremes as herculean as those of its counterparts, the uniformity of resilience - coupled with the sheer amount of devastation it can dish out - make this beast an invaluable addition to any fleet.\r\n\r\n',1127500000,15500000,2900,1,2,1523044240.0000,0,NULL,NULL,NULL,20972),(34342,537,'Naglfar Justice Edition Blueprint','',0,0.01,0,1,4,1850000000.0000,1,NULL,NULL,NULL,296),(34343,485,'Phoenix Wiyrkomi Edition','In terms of Caldari design philosophy, the Phoenix is a chip off the old block.  With a heavily tweaked missile interface, targeting arrays of surpassing quality and the most advanced shield systems to be found anywhere, it is considered the strongest long-range installation attacker out there.\r\n\r\nWhile its shield boosting actuators allow the Phoenix, when properly equipped, to withstand tremendous punishment over a short duration, its defenses are not likely to hold up against sustained attack over longer periods.  With a strong supplementary force, however, few things in existence rival this vessel\'s pure annihilative force.',1320000000,16250000,2750,1,1,1541551100.0000,0,NULL,NULL,NULL,20973),(34344,537,'Phoenix Wiyrkomi Edition Blueprint','',0,0.01,0,1,4,1950000000.0000,1,NULL,NULL,NULL,296),(34345,485,'Revelation Sarum Edition','The Revelation represents the pinnacle of Amarrian military technology.  Maintaining their proud tradition of producing the strongest armor plating to be found anywhere, the Empire\'s engineers outdid themselves in creating what is arguably the most resilient dreadnought in existence.\r\n\r\nAdded to that, the Revelation\'s ability to fire capital beams makes its position on the battlefield a unique one.  When extended sieges are the order of the day, this is the ship you call in.',1237500000,18500000,2175,1,4,1539006890.0000,0,NULL,NULL,NULL,20971),(34346,537,'Revelation Sarum Edition Blueprint','',0,0.01,0,1,4,2000000000.0000,1,NULL,NULL,NULL,296),(34347,1088,'Men\'s \'Outlaw\' Jacket (Blood Raiders)','Designer: Unknown\r\n\r\nStraight from the discreet consignments of Intaki Commerce, this jacket indicates that the wearer is a true supporter of the Blood Raiders. Each jacket is crafted from the finest leather, dyed carbon black, and accented with studded crimson passants and crimson trim. Finally, the jacket is emblazoned with the Blood Raiders logo, located directly over the heart of the wearer. \r\n',0.5,0.1,0,1,4,NULL,1,1399,21384,NULL,0),(34348,1088,'Men\'s \'Outlaw\' Jacket (Sansha\'s Nation)','Designer: Unknown\r\n\r\nStraight from the discreet consignments of Intaki Commerce, this jacket indicates that the wearer is a true supporter of the Sansha cause. Each jacket is crafted from the finest leather, dyed a dark green, and accented with spiked white passants and olive trim. Finally, the jacket is emblazoned with the Sansha\'s Nation logo, located directly over the heart of the wearer.',0.5,0.1,0,1,4,NULL,1,1399,21385,NULL,0),(34349,1088,'Men\'s \'Outlaw\' Jacket (Guristas)','Designer: Unknown\r\n\r\nStraight from the discreet consignments of Intaki Commerce, this jacket indicates that the wearer is a true supporter of the Guristas. Each jacket is crafted from the finest leather, dyed charcoal gray, and accented with studded white passants and umber trim. Finally, the jacket is emblazoned with the Guristas logo, located directly over the heart of the wearer\r\n',0.5,0.1,0,1,4,NULL,1,1399,21386,NULL,0),(34350,1088,'Women\'s \'Outlaw\' Coat (Sansha\'s Nation)','Designer: Unknown\r\n\r\nStraight from the discreet consignments of Intaki Commerce, this jacket indicates that the wearer is a true supporter of the Sa