ake it functional.\r\n\r\nAll three coordinate plots need to be placed into either the low power or the high power Remote Calibration Device.\r\n',1,0.1,0,1,4,NULL,1,NULL,1192,NULL,0),(34382,314,'Y-Axis Calibration Coordinate','This is one of three coordinate plots required to correctly align the nearby rift to make it functional.\r\n\r\nAll three coordinate plots need to be placed into either the low power or the high power Remote Calibration Device.',1,0.1,0,1,4,NULL,1,NULL,1192,NULL,0),(34383,314,'Z-Axis Calibration Coordinate','This is one of three coordinate plots required to correctly align the nearby rift to make it functional.\r\n\r\nAll three coordinate plots need to be placed into either the low power or the high power Remote Calibration Device.',1,0.1,0,1,4,NULL,1,NULL,1192,NULL,0),(34384,226,'Immobile Tractor Beam','Heavy duty, fast working tractor beam. It can be aligned to pull storage depots surrounding the distant Sleeper enclave close to itself, if you manage to activate it.',10000,27500,2700,1,4,NULL,0,NULL,NULL,NULL,2412),(34385,306,'Pristine Storage Depot','This storage depot seems to be in pristine condition. Whatever is stored inside should be completely unscathed and is only a relic analyzing away from being available.',10000,27500,2700,1,4,NULL,0,NULL,NULL,NULL,2301),(34386,226,'Impenetrable Storage Depot','This storage depot has thick walls, making it hard to gauge its contents from afar. You need to get close to get a read on what is hidden inside.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,2301),(34387,226,'Spatial Rift','Superficially similar to natural phenomena observed throughout space, this spatial rift appears to be artificially generated by a Talocan static gate array. Observations have shown that large quantities of dangerous gamma radiation and x-rays are pouring out of the rift. If this tear in space-time leads anywhere it is likely to be very inhospitable.',1,0,0,1,4,NULL,0,NULL,NULL,20211,2907),(34388,226,'Communication Relay','Apparently a hastily converted radiation monitoring satellite, this device seems to have briefly functioned as an emergency communications relay. It shows relatively few signs of damage but seems to have been knocked out of commission by several precise energy weapon strikes to its processing cores.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,2412),(34389,226,'Matyrhan Lakat-Hro','Surviving markings on the wreck of this Hel-class supercarrier identify it as the Matyrhan Lakat-Hro. In many places symbols of the Thukker Tribe are present along with numerous caravan markings that appear to confirm a link to the lost Lakat-Hro Great Caravan. \r\n\r\nThe presence of such a vessel in the Thera system has drawn attention to the Thukker contingent working with the Sanctuary here but no comment on the matter has been forthcoming from either party. Early delvers into the wreck\'s scorched interior soon discovered that all data storage devices had been carefully purged and destructively irradiated.\r\n',0,0,0,1,4,NULL,0,NULL,NULL,NULL,3110),(34390,257,'Amarr Tactical Destroyer','Skill at operating Amarr Tactical Destroyers.',0,0.01,0,1,4,1000000.0000,1,377,33,NULL,0),(34391,952,'Solray Gamma Alignment Unit','This unit catches gamma rays from the sun, amplifies them and redirects elsewhere based on how the unit is aligned. It may require a Gamma Ray Modulate Disc to align correctly.',10000,27500,2700,1,4,NULL,0,NULL,NULL,NULL,1725),(34392,226,'Bioinformatics Processing Cells','Such scans as can penetrate this structure suggest it is primarily made up of a series of interconnected cells, run through with monitoring systems and data processing networks. There is significant damage to the shielding of this facility and some conduits are sufficiently exposed to reveal that complex processing routines are still operating on vast quantities of bioinformatic data.',100000,100000000,10000,1,4,NULL,0,NULL,NULL,NULL,3567),(34393,1088,'Men\'s \'Outlaw\' Jacket (Burnt Orange)','Designer: Unknown\r\n\r\nStraight from the discreet consignments of Intaki Commerce, this jacket was given as a gift to signify the coming of the New Year. Each jacket is crafted from the finest leather, dyed charcoal gray, and accented with studded white passants and burnt orange trim. \r\n',0.5,0.1,0,1,4,NULL,1,1399,21387,NULL,0),(34394,1088,'Women\'s \'Outlaw\' Coat (Burnt Orange)','Designer: Unknown\r\n\r\nStraight from the discreet consignments of Intaki Commerce, this jacket was given as a gift to signify the coming of the New Year. Each jacket is crafted from the finest leather, dyed charcoal gray, and accented with studded white passants and burnt orange trim. \r\n',0.5,0.1,0,1,4,NULL,1,1405,21390,NULL,0),(34395,186,'Amarr Advanced Destroyer Wreck','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it. ',10000,27500,27500,1,4,NULL,0,NULL,NULL,NULL,3116),(34396,964,'Self-Assembling Nanolattice','Self-Assembling Nanolattices are the result of a breakthrough in applied fullerene technology achieved by a joint Carthum-Viziam research team formed at the request of the Imperial Navy in late YC116. The development of this technology was made possible by the contributions of numerous capsuleers, most notably members of the venerable loyalist alliance <url=showinfo:16159//1186465684>Praetoria Imperialis Excubitoris</url>.\r\n\r\nAlthough these carbon-based structures are exceptional in their high strength and low mass, it is their ability to reconfigure rapidly when exposed to electromagnetic fields that makes Self-Assembling Nanolattices one of the most significant advancements in starship engineering in decades.',1,5,0,1,4,400000.0000,1,1147,3718,NULL,0),(34397,965,'Self-Assembling Nanolattice Blueprint','',0,0.01,0,1,4,10000000.0000,1,1191,96,NULL,0),(34398,952,'Solray Infrared Alignment Unit','This unit catches infrared rays from the sun, amplifies them and redirects elsewhere based on how the unit is aligned. It may require an Infrared Ray Modulate Disc to align correctly.',10000,27500,2700,1,4,NULL,0,NULL,NULL,NULL,1725),(34399,952,'Solray Radio Alignment Unit','This unit catches radio rays from the sun, amplifies them and redirects elsewhere based on how the unit is aligned. It may require a Radio Ray Modulate Disc to align correctly.',10000,27500,2700,1,4,NULL,0,NULL,NULL,NULL,1725),(34400,314,'Gamma Ray Modulate Disc','This disc of crystals is specially constructed to modulate gamma rays in a Solray Gamma Alignment Unit.',1,0.1,0,1,4,2000000.0000,1,NULL,2038,NULL,0),(34401,314,'Infrared Ray Modulate Disc','This disc of crystals is specially constructed to modulate infrared rays in a Solray Infrared Alignment Unit.',1,0.1,0,1,4,2000000.0000,1,NULL,2038,NULL,0),(34402,314,'Radio Ray Modulate Disc','This disc of crystals is specially constructed to modulate radio rays in a Solray Radio Alignment Unit.',1,0.1,0,1,4,2000000.0000,1,NULL,2038,NULL,0),(34403,306,'Solray Observational Unit','The Solray Observational Unit monitors the nearby Solray structure. Hacking into its mainframe gives the data needed to correct the alignment error of the Solray alignment units, in the form of a crystal discs.',10000,27500,2700,1,4,NULL,0,NULL,NULL,NULL,3518),(34404,226,'Solray Unaligned Power Terminal','The Solray Power Terminal is intended to use solar power to generate energy, by gathering solar power from nearby Solray Alignment Units. However, it seems the alignment units are not working properly, causing the Solray Power Terminal to flare its energy erratically into space around it. This makes it extremely hazardous to move close to.',0,0,0,1,4,NULL,0,NULL,NULL,20,2069),(34405,226,'Solray Aligned Power Terminal','The Solray Power Terminal now seems to be in working order. The erratic outlet of energy seems to be lessening. You should be able to move close to this structure now, but use extreme care.',0,0,0,1,4,NULL,0,NULL,NULL,20,2069),(34406,306,'Remote Reroute Unit','This unit can be used to change settings of nearby structures, such as changing destination beacon for a spatial rift. Skillful use of hacking is required, but note that it might not be possible to adjust the settings a second time.',10000,27500,2700,1,4,NULL,0,NULL,NULL,20177,1680),(34412,997,'Small Intact Hull Section','Found drifting amongst the ruins of a Sleeper compound, these small sections of a Sleeper vessel represent a significant archaeological discovery. Not only is the hull itself an incredibly rare find, but the excellent condition it is in makes this a particularly useful case study for the Sleeper\'s ship construction methods.\r\n\r\nPristine, working examples of Sleeper technology such as this are extremely rare and even more valuable. With the right skills and equipment, they can offer great insights into the scientific pursuits of the ancient race that designed them. ',0,30,0,1,4,NULL,1,1909,3766,NULL,0),(34414,997,'Small Malfunctioning Hull Section','Found drifting amongst the ruins of a Sleeper compound, these small sections of a Sleeper vessel represent a significant archaeological discovery. The hull itself is an incredibly rare find, tainted only by the condition it is in. Although it was clearly built to survive the stress of space, the countless years of environmental exposure have still taken a heavy toll, stripping from it a great deal of the original functionality. \r\n\r\nEven despite the damage, it would still make a respectable case study for the Sleeper\'s vessel construction methods. A skilled scientist could still possibly extract enough information to try and reverse engineer it. ',0,30,0,1,4,NULL,1,1909,3766,NULL,0),(34416,997,'Small Wrecked Hull Section','Mistakenly identified by the analyzers as a derelict structure, these ancient Sleeper hull fragments are almost entirely destroyed. Whether slow erosion or some more rapid and violent event devastated the technology remains unclear. It is simply too badly damaged to make an educated guess. \r\n\r\nThere isn\'t much of a chance that anything useful could be reverse engineered from such badly ruined fragments, but there is little doubt that those few lucky researchers who successfully managed it would uncover the secrets to Sleeper hull designs. For many, that opportunity alone would be worth the gamble. ',0,30,0,1,4,NULL,1,1909,3766,NULL,0),(34417,1194,'Manufacturing Unions Placard','A solid morphite placard produced in celebration of the Secure Commerce Commissions official recognition of the Manufacturing Workers Union on July 22nd, YC115.',10,3,0,1,4,NULL,1,1661,2103,NULL,0),(34418,1194,'The Galactic Party Planning Guide','A compilation of guidelines for hosting your own capsuleer focused social gatherings, with chapters written by <url=showinfo:1384//647201759>Zapawork</url>, <url=showinfo:1377//101032679>nGR RDNx</url>, <url=showinfo:1375//806529354>Demetri Slavic</url>, <url=showinfo:1383//109000795>Dierdra Vaal</url> and <url=showinfo:1376//1239463613>Bam Stroker</url>.\r\n\r\nNote: Due to a formatting error, chapters by <url=showinfo:1377//101032679>nGR RDNx</url> and <url=showinfo:1376//1239463613>Bam Stroker</url> may be displayed upside down.\r\n',10,3,0,1,4,NULL,1,1661,10159,NULL,0),(34419,1194,'Jump Fatigue Recovery Agent','Poteque Pharmaceuticals were unable to trace the origins of this strange white powder, and were similarly baffled when trying to explain its miraculous ability to cure jump fatigue and allow the user to speak at a rate of roughly 300 words per minute.',10,3,0,1,4,NULL,1,1661,1194,NULL,0),(34420,1194,'Cooking With Veldspar','A family friendly holoreel compilation filled with the finest culinary tips New Eden has to offer.',10,3,0,1,4,NULL,1,1661,1177,NULL,0),(34421,1194,'Chribbas Modified Strip Miner','Jury rigged with duct tape and a laser pointer, even Outer Ring Excavations are bewildered by this modules ability to chew through so much ore per hour.',10,3,0,1,4,NULL,1,1661,2887,NULL,0),(34422,1194,'Rooks & Kings  The Clarion Call Compilation','Presented in all its glory on high resolution holoreel, you can now enjoy the glorious smooth tones of <url=showinfo:1373//822363613>Lord Maldorors</url> narration in the comfort of your own captains quarters.\r\n\r\n',10,3,0,1,4,NULL,1,1661,1177,NULL,0),(34423,1194,'Pre-Completed CSM 10 Ballot Paper','It would appear that a certain alliance has already decided whom its pilots will be voting for!',10,3,0,1,4,NULL,1,1661,1192,NULL,0),(34424,1194,'Titanium Plated Cranial Shielding','Those amidst the capsuleer \"information elite\" often utilize this homemade armor-piece to protect them from the dangers inherent in meta-space communication and theory-crafting.',10,3,0,1,4,NULL,1,1661,3182,NULL,0),(34425,1194,'SCC Guidelines  Lotteries For Dummies','The Secure Commerce Commission presents this comprehensive guide on how to host your gambling establishment within the law, in order to prevent seizure of assets by CONCORD.',10,3,0,1,4,NULL,1,1661,10159,NULL,0),(34426,1194,'Sort Dragons Guide To Diplomacy','Famed for his leadership of Here Be Dragons, <url=showinfo:1384//1272172192>Sort Dragon</url> shares his top ten tips for Coalition self-destruction.',10,3,0,1,4,NULL,1,1661,10159,NULL,0),(34427,1194,'Polaris Eviction Notice','Oops.',10,3,0,1,4,NULL,1,1661,21060,NULL,0),(34428,1194,'Jump Portal Generation Instruction Holoreel','The finer points of bridging your fleet, rather than jumping. Narrated by <url=showinfo:1383//942377007>Oleena Natiras</url>, veteran of the Battle of Asakai.',10,3,0,1,4,NULL,1,1661,1177,NULL,0),(34429,1194,'Vincent Pryces Warp Disruption Field Generator','A scale replica of the actual Warp Disruption Field Generator that caused the Battle of Asakai, one of the most expensive engagements in the history of Capsuleer warfare.',10,3,0,1,4,NULL,1,1661,111,NULL,0),(34430,1194,'My God, Its Full Of Holes!','The Capsuleers guide to all things wormhole. Navigation, mass calculation and lifestyle tips for wormhole dwellers included!',10,3,0,1,4,NULL,1,1661,10159,NULL,0),(34431,1194,'Guillome Renards Sleeper Loot Stash','Crate after crate, packed with Neural Network Analyzers and Sleeper Data Libraries which were collected by <url=showinfo:1378//1643090141>Guillome Renard</url> during the research race of YC116.',10,3,0,1,4,NULL,1,1661,3755,NULL,0),(34432,1194,'Sisters Of EVE Charity Statue','A commemorative golden statue from a Sisters Of EVE Fundraiser which raised 7,634,000,000,000 Kredits in YC115.',10,3,0,1,4,NULL,1,1661,1656,NULL,0),(34433,1194,'The Damsels Drunk Bodyguard','This guy really should probably be working',10,3,0,1,4,NULL,1,1661,2544,NULL,0),(34434,1194,'Alice Sakis Good Posting Guide','Straight from the woman with the most positive Intergalactic Summit profile in the cluster, 101 tips for public relations superiority.',10,3,0,1,4,NULL,1,1661,10159,NULL,0),(34435,1194,'Soxfours Spaceboots','Found in the airlock of a Leisure Group pleasure node on board the station orbiting Arifsdald III - Moon 14, these boots contain a note that reads as follows Dear Nullarbor. Stop stealing my shoes. Its not funny anymore.  FF',10,3,0,1,4,NULL,1,1661,21170,NULL,0),(34436,1194,'The Friend Ship','The best ship in New Eden.',10,3,0,1,4,NULL,1,1661,2106,NULL,0),(34437,383,'Rewired Sentry Gun','A sentry gun of Sleeper design. Has been rewired to view hostile targets as friendly and vice versa.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,3533),(34438,306,'Sentry Repair Station','This is a maintenance facility for the Sleeper sentry guns in the vicinity. It can be hacked to change what sentry guns it is repairing.',10000,27500,2700,1,4,NULL,0,NULL,NULL,NULL,3518),(34439,988,'Wormhole A009','An unstable wormhole, deep in space. Wormholes of this kind usually collapse after a few days, and can lead to anywhere.',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,3715),(34440,186,'Sleeper Medium Wreck ','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it. ',10000,27500,27500,1,NULL,NULL,0,NULL,NULL,NULL,3116),(34441,27,'Dominix Quafe Edition','The Dominix is one of the old warhorses dating back to the Gallente-Caldari War. While no longer regarded as the king of the hill, it is by no means obsolete. Its formidable hulk and powerful drone arsenal means that anyone not in the largest and latest battleships will regret ever locking horns with it.',100250000,454500,600,1,8,62500000.0000,0,NULL,NULL,NULL,20982),(34442,107,'Dominix Quafe Edition Blueprint','',0,0.01,0,1,NULL,1660000000.0000,1,NULL,NULL,NULL,318),(34443,25,'Tristan Quafe Edition','Often nicknamed The Fat Man this nimble little frigate is mainly used by the Federation in escort duties or on short-range patrols. The Tristan has been very popular throughout Gallente space for years because of its versatility. It is rather expensive, but buyers will definitely get their money\'s worth, as the Tristan is one of the more powerful frigates available on the market.',956000,26500,140,1,8,NULL,0,NULL,NULL,NULL,1796),(34444,105,'Tristan Quafe Edition Blueprint','',0,0.01,0,1,NULL,2825000.0000,1,NULL,NULL,NULL,60),(34445,26,'Vexor Quafe Edition','The Vexor is a strong combat ship that is also geared to operate in a variety of other roles. The Vexor is especially useful for surveying in potentially hostile sectors as it can stay on duty for a very long time before having to return to base. Furthermore, it is well capable of defending itself against even concentrated attacks.',11100000,115000,480,1,8,NULL,0,NULL,NULL,NULL,20981),(34446,106,'Vexor Quafe Edition Blueprint','',0,0.01,0,1,NULL,83250000.0000,1,NULL,NULL,NULL,62),(34447,306,'Cerebrum Maintenance Chamber','This large structure contains various materials used to maintain and repair the important Central Archive Cerebrum structure. Note that it is possible this structure is linked into the archive defense system, so hack with caution. ',10000,27500,2700,1,4,NULL,0,NULL,NULL,NULL,2007),(34448,226,'Smoldering Archive Ruins','These are the remains o