e while moving. The standard weapon systems of this ship appear to be semi-autonomous and effective against a range of targets.\r\nDED contact briefings suggest the free floating turrets are a secondary weapon, with an extremely dangerous primary weapon held in reserve against those this ship\'s commander considers a significant threat.\r\nThreat level: Critical',10900000,109000,120,1,64,NULL,0,NULL,NULL,20207,21049),(34562,1305,'Svipul','Released in YC 117 as the result of the first Republic Fleet joint research project to include engineers from all seven Minmatar tribes, the Svipul is a powerful symbol of inter-tribal unity for many Republic citizens.\r\n\r\nAlthough the contributions of engineers from the Nefantar and Starkmanir tribes were fairly minor, a large delegation from the Vo-Lakat Thukker caravan and donations from Republic loyalist capsuleers across the cluster were invaluable to the development of this incredibly adaptable warship.',1400000,47000,430,1,2,NULL,1,1953,NULL,20074,21052),(34563,1309,'Svipul Blueprint','The Svipul-class Tactical Destroyer was developed on behalf of the Minmatar people in YC117 with the invaluable aid of eighty-seven dedicated capsuleers. Of these pilots, the greatest contributors were:\r\n<url=showinfo:1373//90771225>Lotrec Emetin</url>\r\n<url=showinfo:1373//334330150>Robert Warner</url>\r\n<url=showinfo:1373//230923199>Dr Scott</url>\r\n<url=showinfo:1373//1097436858>Esrevid Nekkeg</url>\r\n<url=showinfo:1373//257707569>SambaSol</url>\r\n<url=showinfo:1373//90792984>Nrone3 Agalder</url>\r\n<url=showinfo:1373//1540818861>Myronik</url>\r\n<url=showinfo:1373//644454761>Lynnu</url>\r\n<url=showinfo:1373//986524995>Maataak</url>\r\n<url=showinfo:1373//577820985>Shalmon Aliatus</url>',0,0.01,0,1,2,40000000.0000,1,NULL,NULL,NULL,1748),(34564,1306,'Svipul Defense Mode','33.3% bonus to all shield and armor resistances\r\n66.6% reduction in MicroWarpdrive signature radius penalty',100,5,0,1,2,NULL,0,NULL,1042,NULL,0),(34566,1306,'Svipul Propulsion Mode','66.6% bonus to AB and MWD speed boost\r\n33.3% bonus to ship inertia modifier',100,5,0,1,2,NULL,0,NULL,1042,NULL,0),(34570,1306,'Svipul Sharpshooter Mode','33.3% bonus to Small Projectile Turret tracking speed\r\n33.3% bonus to Small Projectile Turret damage\r\n100% bonus to sensor strength and targeting range\r\n66.6% bonus to Sensor Dampener and Weapon Disruptor resistances',100,5,0,1,2,NULL,0,NULL,1042,NULL,0),(34572,1207,'Sleeper Databank','This hull plate still has an unobstructed access point for the databank it holds. You may be able to extract something with your Data Analyzer.',10000,27500,2700,1,64,NULL,0,NULL,NULL,NULL,3704),(34573,226,'Unidentified Structure','There\'s nothing in our databanks that matches this structure.',0,0,0,1,1,NULL,0,NULL,NULL,20209,21056),(34574,1,'CharacterDrifter','',0,0,0,1,16,NULL,1,NULL,NULL,NULL,0),(34575,1314,'Antikythera Element','Limited information is available on this object.\n\nA direct analysis reveals some vague and distorted results. Slight external damage signals that it was detached from something else, but despite its removal, the core structure continues to thrum with a deep, surging power.\n\nEven without proof or solid knowledge of the function of this component, it is quite clear that it forms a vital part of something much larger.\n',1,0.1,0,1,64,5000000.0000,1,2013,21408,NULL,0),(34579,286,'Clonejacker Punk','This young pirate is looking to make a name as a clonejacker, raiding illegal clone labs for biomass to be sold on the black market. Such an inexperienced criminal is unlikely to pick a fight with a capsuleer unless provoked.',1970000,19700,125,1,1,NULL,0,NULL,NULL,NULL,1830),(34580,53,'Lux Kontos','This strange weapon system appears to be semi-autonomous, floating freely from the vessel deploying it. Analysis of the weapon\'s firing signature indicates a broad spectrum of disruptive energies are used against its targets.\r\n',0,0,0,1,16,NULL,1,NULL,21409,NULL,21058),(34584,186,'Minmatar Advanced Destroyer Wreck','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it. ',10000,27500,27500,1,2,NULL,0,NULL,NULL,NULL,3116),(34588,286,'Belter Hoodlum','This low level criminal is likely a former asteroid miner turned to preying on his former colleagues. Many crime gangs recruit from the lowest paid among those who work in space as a means of gaining new pilots. Such an inexperienced criminal is unlikely to pick a fight with a capsuleer unless provoked.',1970000,19700,125,1,1,NULL,0,NULL,NULL,NULL,1830),(34589,286,'Narco Pusher','This criminal is a low level pusher for narcotics gangs operating in the area. These drug pushers sell their illegal wares to miners and others working in dangerous space industries. These criminals avoid trouble unless provoked.',1970000,19700,125,1,1,NULL,0,NULL,NULL,NULL,1830),(34590,26,'Victorieux Luxury Yacht','Developed for use by station governors and other well-connected members of the Intaki Syndicate, Victorieux-class Luxury Yachts combine opulent accommodations with state of the art cloaking and propulsion systems. The Victorieux enables comfortable and discreet travel for business or pleasure, from Poitot to Intaki and beyond.\r\n\r\nThe Syndicate has steadfastly refused to answer inquiries on how they obtained the technology necessary to enable simultaneous cloak and warp drive activation on this yacht.\r\n\r\nIn early YC117, Silphy en Diabel announced that the Syndicate would be sponsoring an invitational tournament and making limited run blueprints for the Victorieux available to all capsuleer supporters of the winning team.',10000000,115000,30,1,8,NULL,1,1699,NULL,20074,21076),(34591,106,'Victorieux Luxury Yacht Blueprint','',0,0.01,0,1,8,NULL,1,NULL,NULL,NULL,49),(34592,817,'Serpentis Burner Cruiser','With the advent of clone soldiers, a new breed of pirate has arisen to take advantage of their existence. CONCORD, which had been content to leave the pirates be so long as they remained within their own territories, sees the presence of pirate-affiliated clone soldiers as a major threat to the safety of the cluster, and will go to extraordinary means to disrupt their operations.\r\n\r\nThis Serpentis pirate is a negotiator, a fixer who establishes contracts between pirate-trained clone soldiers and those who, like the Serpentis, are playing the long game of strategy and counter-strategy, and whose tactical needs are served best by shadowy associations with a small but unstoppable force of death.',11200000,112000,480,1,8,NULL,0,NULL,NULL,31,0),(34593,1313,'Entosis Link I','This mysterious device is the result of reverse-engineering salvaged Drifter technology. It appears to use ancient Jovian techniques and materials to allow more efficient mind-machine links than were thought possible in the past. The practical applications of this technology are still unclear.\r\n\r\nThis module cannot be fitted to Interceptors.\r\nThis module requires a full warm-up cycle before beginning to influence targeted structures.\r\nShips fitted with an Entosis Link are unable to accelerate beyond 4000m/s using their normal sub-warp engines.\r\nOnce activated, this module cannot be deactivated until it completes its current cycle.\r\nWhile an Entosis Link is active, the fitted ship cannot cloak, warp, jump, dock or receive any form of remote assistance.\r\n\r\nDisclaimer: The Carthum Conglomerate, as well as its registered subsidiaries and partners, accepts absolutely no legal or ethical liability for any unforeseen consequences of connecting untested Drifter-derived technology directly to the user\'s mind.',0,20,0,1,16,NULL,1,2018,21421,NULL,21099),(34594,1318,'Entosis Link I Blueprint','The Entosis Link was developed by Carthum Conglomerate from recovered Drifter technology. It appears to use ancient Jovian techniques and materials to allow more efficient mind-machine links than were thought possible in the past. This technology has proven to be the most efficient method of interfacing with Capsuleer sovereignty infrastructure.\r\n\r\nMany capsuleers played key parts in the development and ongoing refinement of Entosis Link technology. The greatest contributors have been the innovative thinkers in Pandemic Legion\'s legendary SPHERE Labs.\r\nThe greatest capsuleer contributors to early testing of Entosis technology were members of the following organizations:\r\n<url=showinfo:16159//386292982>Pandemic Legion</url>\r\nSpectre Fleet\r\nNo Not Believing (Especially <url=showinfo:2//1239884823>Noir. Corporation</url>)\r\n<url=showinfo:16159//99004211>Affirmative</url>\r\n<url=showinfo:16159//1006830534>Fidelas Constans</url>\r\n<url=showinfo:16159//99003214>Brave Collective</url>\r\n<url=showinfo:16159//99002938>DARKNESS.</url>\r\n<url=showinfo:16159//99002172>I Whip My Slaves Back and Forth</url>\r\n<url=showinfo:16159//431502563>Ministry of Inappropriate Footwork</url>\r\n<url=showinfo:16159//99003322>Nemesis Enterprises.</url>\r\n<url=showinfo:16159//99003035>Praetorian Directorate</url>\r\n<url=showinfo:16159//99003033>Q Alliance</url>\r\n<url=showinfo:16159//99005286>Stella Nova</url>\r\n<url=showinfo:16159//99001697>Suddenly Spaceships.</url>',0,0.01,0,1,16,200000000.0000,1,2020,107,NULL,0),(34595,1313,'Entosis Link II','This mysterious device is the result of reverse-engineering salvaged Drifter technology. It appears to use ancient Jovian techniques and materials to allow more efficient mind-machine links than were thought possible in the past. The practical applications of this technology are still unclear.\r\n\r\nThis module cannot be fitted to Interceptors.\r\nThis module requires a full warm-up cycle before beginning to influence targeted structures.\r\nShips fitted with an Entosis Link are unable to accelerate beyond 4000m/s using their normal sub-warp engines.\r\nOnce activated, this module cannot be deactivated until it completes its current cycle.\r\nWhile an Entosis Link is act