he ship\'s EM footprint.\r\n\r\nPenalty: Max capacitor reduced.\r\n\r\nNote: Usually fit on Frigates and Destroyers.',0,10,0,1,8,37748.0000,1,131,10149,NULL,0),(35659,46,'50MN Y-T8 Compact Microwarpdrive','Massive boost to speed for a very short time. The thrust that boosts the ship, and the corresponding maximum velocity bonus, are limited by the mass of the ship that uses this module. The sheer amount of energy needed to power this system means that it must permanently reserve a fraction of the capacitor output just to maintain the integrity of its warp containment field, and when activated it substantially increases the ship\'s EM footprint.\r\n\r\nPenalty: Max capacitor reduced.\r\n\r\nNote: Usually fit on Cruisers and Battlecruisers.',0,10,0,1,1,37748.0000,1,131,10149,NULL,0),(35660,46,'50MN Quad LiF Restrained Microwarpdrive','Massive boost to speed for a very short time. The thrust that boosts the ship, and the corresponding maximum velocity bonus, are limited by the mass of the ship that uses this module. The sheer amount of energy needed to power this system means that it must permanently reserve a fraction of the capacitor output just to maintain the integrity of its warp containment field, and when activated it substantially increases the ship\'s EM footprint.\r\n\r\nPenalty: Max capacitor reduced.\r\n\r\nNote: Usually fit on Cruisers and Battlecruisers.',0,10,0,1,1,37748.0000,1,131,10149,NULL,0),(35661,46,'500MN Y-T8 Compact Microwarpdrive','Massive boost to speed for a very short time. The thrust that boosts the ship, and the corresponding maximum velocity bonus, are limited by the mass of the ship that uses this module. The sheer amount of energy needed to power this system means that it must permanently reserve a fraction of the capacitor output just to maintain the integrity of its warp containment field, and when activated it substantially increases the ship\'s EM footprint.\r\n\r\nPenalty: Max capacitor reduced.\r\n\r\nNote: Battleship class module.',0,10,0,1,2,790940.0000,1,131,10149,NULL,0),(35662,46,'500MN Quad LiF Restrained Microwarpdrive','Massive boost to speed for a very short time. The thrust that boosts the ship, and the corresponding maximum velocity bonus, are limited by the mass of the ship that uses this module. The sheer amount of energy needed to power this system means that it must permanently reserve a fraction of the capacitor output just to maintain the integrity of its warp containment field, and when activated it substantially increases the ship\'s EM footprint.\r\n\r\nPenalty: Max capacitor reduced.\r\n\r\nNote: Battleship class module.',0,10,0,1,2,790940.0000,1,131,10149,NULL,0),(35663,383,'Inert Proximity-activated Autoturret','Proximity based sentry gun.\r\n\r\nEntering within 10km of this turret will cause it to engage with your ship.',1000,1000,1000,1,4,NULL,0,NULL,NULL,NULL,2421),(35676,1306,'Jackdaw Defense Mode','33.3% bonus to all shield resistances\r\n33.3% reduction in ship signature radius',100,5,0,1,4,NULL,0,NULL,1042,NULL,0),(35677,1306,'Jackdaw Propulsion Mode','33.3% bonus to maximum velocity\r\n66.6% bonus to ship inertia modifier',100,5,0,1,4,NULL,0,NULL,1042,NULL,0),(35678,1306,'Jackdaw Sharpshooter Mode','66.6% bonus to Rocket and Light Missile velocity\r\n33.3% bonus to Rocket and Light Missile damage\r\n100% bonus to sensor strength and targeting range\r\n66.6% bonus to Sensor Dampener and Weapon Disruptor resistances',100,5,0,1,4,NULL,0,NULL,1042,NULL,0),(35679,554,'Burner Clone Soldier Transport','With the advent of clone soldiers, a new breed of pirate has arisen to take advantage of their existence. CONCORD, which had been content to leave the pirates be so long as they remained within their own territories, sees the presence of pirate-affiliated clone soldiers as a major threat to the safety of the cluster, and will go to extraordinary means to disrupt their operations. This former member of the Angel Cartel is a transporter, responsible for the swift conveyance of clone soldiers to their intended destination.\r\n\r\nIntelligence experts have been unable to determine why this splinter group of former Angel Cartel pirates is recruiting clone soldiers in such large numbers.',89000000,890000,2000,1,2,NULL,0,NULL,NULL,NULL,2714),(35680,257,'Caldari Tactical Destroyer','Skill at operating Caldari Tactical Destroyers.',0,0.01,0,1,1,1000000.0000,1,377,33,NULL,0),(35681,1089,'Men\'s \'Humanitarian\' T-shirt YC 117','This highly prestigious item of clothing was created in YC 117 and presented to New Eden\'s charitable societies. The shirt stands as undeniable proof that its purchaser is on the side of good in a world that all too often can be cruel and merciless. Wear it with pride, and know that you have made a difference in the lives of strangers.',0,0.1,0,1,4,NULL,1,1398,21424,NULL,0),(35682,1089,'Women\'s \'Humanitarian\' T-shirt YC 117','This highly prestigious item of clothing was created in YC 117 and presented to New Eden\'s charitable societies. The shirt stands as undeniable proof that its purchaser is on the side of good in a world that all too often can be cruel and merciless. Wear it with pride, and know that you have made a difference in the lives of strangers.',0,0.1,0,1,4,NULL,1,1406,21425,NULL,0),(35683,1305,'Hecate','The first Hecate-class destroyers have entered official service in the Federation Navy on July 7th, YC117 after successful completion of an accelerated proving period. The new ship design has received near-unanimous praise from military experts but a troubled development period has stirred controversy among opposition senators.\r\n\r\nPresident Roden\'s office has issued a press statement extolling the capabilities of this new vessel:\r\n<i>\"In these tumultuous times we rely on the brave men and women of the Navy to stand firm against the enemies of our Federation. This administration stands with our armed forces and remains committed to providing these heroes with the best equipment available anywhere in the cluster. The Hecate makes use of the most advanced technology to provide unrivaled flexibility and firepower. Those who would threaten our liberty will learn to fear the strength and resolve of the Federation.\"</i>\r\n\r\nThe press release does not address the recent demands from a group of prominent doves in the Senate that the Navy procurement process be subjected to a public inquiry. The administration has previously defended the choice to pour unprecedented amounts of Federal funds into the development of the Hecate through a sole source contract with Roden Shipyards as the only way to retain technological parity with the other empires after the Federation received relatively light support from Capsuleers in their recent research efforts.\r\n-<i>Scope News special report, YC117</i>',1050000,47000,450,1,8,30000000.0000,1,2034,NULL,20074,21150),(35684,1309,'Hecate Blueprint','The Hecate-class Tactical Destroyer was developed for the defense of the Gallente Federation in YC117 with the invaluable aid of one hundred and thirty-nine valorous capsuleers. The most significant contributors among these pilots were:\r\n<url=showinfo:1373//101054534>Shipstorm</url>\r\n<url=showinfo:1373//91372910>Silverdaddy</url>\r\n<url=showinfo:1373//1613567968>Riyusone Haro</url>\r\n<url=showinfo:1373//91670949>Kiera Minaris</url>\r\n<url=showinfo:1373//1322769581>Lauralyn Zendatori</url>\r\n<url=showinfo:1373//1047741762>Oreamnos Amric</url>\r\n<url=showinfo:1373//228226565>snowdor</url>\r\n<url=showinfo:1373//93498126>Dominique Saint-Clair</url>\r\n<url=showinfo:1373//331279979>Fred Strangelove</url>\r\n<url=showinfo:1373//1157105405>Donaldo Duck</url>',0,0.01,0,1,8,40000000.0000,1,NULL,NULL,NULL,1748),(35685,257,'Gallente Tactical Destroyer','Skill at operating Gallente Tactical Destroyers.',0,0.01,0,1,8,1000000.0000,1,377,33,NULL,0),(35686,1306,'Hecate Defense Mode','33.3% bonus to all armor and hull resistances\r\n33.3% reduction to armor repairer duration',100,5,0,1,