ed',20,5,0,1,NULL,NULL,1,2033,21439,NULL,0),(35776,366,'Large Acceleration Gate','Acceleration gate technology reaches far back to the expansion era of the empires that survived the great EVE gate collapse. While their individual setup might differ in terms of ship size they can transport and whether they require a certain passkey or code to be used, all share the same fundamental function of hurling space vessels to a destination beacon within solar system boundaries.',100000,0,0,1,4,NULL,0,NULL,NULL,20171,3468),(35777,226,'Sail Charger','This construction uses electromagnetic conductors to harvest solar power from the system\'s sun.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,21153),(35779,831,'Imp','The Imp is an advanced Sansha\'s Nation Interceptor intended for use by forward parties of True Power\'s feared harvester squadrons. Able to penetrate even the most intense blockades, hunt down stragglers or simply hold ships while waiting for the main harvester force to arrive, the Imp is yet another case of Sansha\'s Nation technology improving on existing advanced hardware. Like most Sansha\'s Nation equipment, the few captured examples of the Imp have proven to be readily adaptable for capsuleer use.',900000,28600,150,1,4,NULL,1,1932,NULL,20118,21156),(35780,105,'Imp Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,300),(35781,894,'Fiend','The Fiend was originally designed by Sansha\'s Nation as a Heavy Interdiction Cruiser for use by elite harvester squadrons as a means to capture and board ships typically requiring large crew complements. The advanced interdiction technology the vessel is equipped with allows it to generate warp disruption fields without impairing its flight characteristics. This allows these formidable ships to easily chase down and hold even the fastest vessels in the larger size brackets. As with other Sansha\'s Nation equipment, the handful of captured Fiends in commercial hands have proven to be adaptable for capsuleer use.',9000000,101000,450,1,4,