nus at the expense of its range bonus.',1,1,0,1,NULL,4000.0000,1,1094,21442,NULL,0),(35796,912,'Missile Range Script Blueprint','',0,0.01,0,1,NULL,1500000.0000,1,1105,1131,NULL,1131),(35797,912,'Missile Precision Script Blueprint','',0,0.01,0,1,NULL,1500000.0000,1,1105,1131,NULL,1131),(35799,920,'Drifter Incursion 3 to 4 Victory','',1,20,0,250,4,NULL,1,NULL,NULL,NULL,1217),(35800,920,'Drifter Incursion 5 to 7 Victory','',1,20,0,250,4,NULL,1,NULL,NULL,NULL,1217),(35801,920,'Drifter Incursion 8+ Victory','',1,20,0,250,4,NULL,1,NULL,NULL,NULL,1217),(35802,920,'Drifter Incursion 3 to 4 Defeat','',1,20,0,250,4,NULL,1,NULL,NULL,NULL,1217),(35803,920,'Drifter Incursion 5 to 7 Defeat','',1,20,0,250,4,NULL,1,NULL,NULL,NULL,1217),(35804,920,'Drifter Incursion 8+ Defeat','',1,20,0,250,4,NULL,1,NULL,NULL,NULL,1217),(35812,1402,'Amarr Navy Apocalypse','',97100000,495000,0,1,4,NULL,0,NULL,NULL,NULL,2239),(35813,1413,'Amarr Navy Guardian','',10900000,0,0,1,4,NULL,0,NULL,NULL,NULL,21157),(35814,1411,'Amarr Navy Omen','',10850000,0,0,1,4,NULL,0,NULL,NULL,NULL,1731),(35815,1411,'Amarr Navy Augoror','',10650000,0,0,1,4,NULL,0,NULL,NULL,NULL,1730),(35816,1402,'Amarr Navy Armageddon','',20500000,1100000,0,1,4,NULL,0,NULL,NULL,NULL,3814),(35819,1412,'Amarr Navy Archon','',1012500000,0,0,1,4,NULL,0,NULL,NULL,NULL,21163),(35820,1414,'Amarr Navy Crucifier','',1064000,0,0,1,4,NULL,0,NULL,NULL,NULL,1733),(35825,1404,'Raitaru','Named after Tyma Raitaru, who pioneered the development of modern day missile technology, the Raitaru Engineering Complex is a medium-sized structure from the Upwell Consortium and is specialized in manufacturing and research operations.\r\n\r\nThe Raitaru is the entry-level Engineering Complex in the Upwell Consortiums new line of structures, and is able to use Upwell\'s Standup Service modules, allowing flexibility and customization of its functions. This dedicated industrial structure also provides access to Upwells M-Set line of rigs designed to improve productivity and optimization of various aspects of manufacturing and research.\r\n\r\nThe Raitaru provides tethering technology and has docking capabilities for subcapital ships and freighters.\r\n\r\n1% reduction in manufacturing job required materials\r\n15% reduction in manufacturing and science job required time\r\n3% reduction in manufacturing and science job required ISK cost\r\n25% reduction in Engineering Service Module fuel consumption',3000000000,8000,0,1,2,NULL,1,2324,NULL,20242,21344),(35826,1404,'Azbel','Named after Li Azbel, a Gallente scientist who pioneered the first breakthroughs in faster than light communications, the Azbel Engineering Complex is a large-sized structure from the Upwell Consortium and is specialized in manufacturing and research operations. \r\n\r\nThe Azbel Engineering Complex fits into the industrial major-player spot in the Upwell Consortiums new line of structures, and is able to use Upwell\'s Standup Service modules, allowing flexibility and customization of its functions. This dedicated industrial structure also provides access to Upwells L-Set line of rigs designed to improve productivity and optimization of various aspects of manufacturing and research.\r\n\r\nDue to its large size this engineering complex can accommodate construction of capital ships using the Standup Capital Shipyard I Service Module.\r\n\r\nThe Azbel provides tethering technology and has docking capabilities for subcapital ships and freighters.\r\n\r\n1% reduction in manufacturing job required materials\r\n20% reduction in manufacturing and science job required time\r\n4% reduction in manufacturing and science job required ISK cost\r\n25% reduction in Engineering Service Module fuel consumption',10000000000,80000,0,1,1,NULL,1,2324,NULL,20243,21405),(35827,1404,'Sotiyo','Named after one of the co-creators of the first Caldari warp drive, the Sotiyo-Urbaata Drive, the Sotiyo serves as a mega-scale manufacturing and assembly site for everything from subcapital ships and modules, up to supercapital class hulls. \r\n\r\nThe Sotiyo is the Engineering Complex fit for megacorporations in the Upwell Consortiums new line of structures, and is able to use Upwell\'s Standup Service modules, allowing flexibility and customization of its functions. This dedicated industrial structure also provides access to Upwells XL-Set line of rigs designed to improve productivity and optimization of various aspects of manufacturing and research.\r\n\r\nDue to its extra-large size this engineering complex can accommodate construction of supercapital ships using the Standup Supercapital Shipyard I Service Module.\r\n\r\nThe Sotiyo provides tethering technology and has docking capabilities for capital-size ships and below.\r\n\r\n1% reduction in manufacturing job required materials\r\n30% reduction in manufacturing and science job required time\r\n5% reduction in manufacturing and science job required ISK cost\r\n25% reduction in Engineering Service Module fuel consumption',50000000000,800000,0,1,4,NULL,1,2324,NULL,20244,21406),(35828,1405,'Medium Laboratory','New medium laboratory structure.',500,4000,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(35829,1405,'Large Laboratory','New large laboratory structure.',500,4000,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(35830,1405,'X-Large Laboratory','New X-large laboratory structure.',500,4000,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(35832,1657,'Astrahus','As the entry-level product in the Upwell Consortium\'s Citadel range of space stations, the Astrahus has been designed as an economical option for medium-scale operations in space, such as serving as a base of operations for a small- to medium-sized corporation, or as an outpost for larger corporations or even small alliances.\r\n\r\nThe Astrahus has been built with new spaceship tethering technology as standard, and will happily accommodate ships under capital size, and even freighter-class hulls, in its internal docking bays. The Astrahus can be configured using Upwell\'s Standup brand service and structure modules so as to serve the specific needs of the structure operator. Further adjustment of the hardware of the Astrahus can be achieved by installed Standup M-Set rigs to optimize the specific role of the citadel.\r\n\r\n25% bonus to all structure combat rig effects\r\n25% reduction in citadel service module fuel consumption',3000000000,8000,0,1,2,NULL,1,2201,NULL,20231,21137),(35833,1657,'Fortizar','Conceived as a good balance of capability and investment in the Upwell Consortium\'s Citadel range of space stations, the Fortizar has been designed for large-scale operations in space, such as providing a well-equipped home for large corporations and small alliances, or as a border or trade post for larger alliances.\r\n\r\nThe Fortizar has been built with new spaceship tethering technology as standard, and will readily accommodate most ships, including freighters and even capital ships, in its internal docking bays. While the docks are unable to service \'supercapital\' level vessels, the defensive capabilities of the Fortizar are considerably enhanced in lower security star systems with the ability to mount area effect weapons. The Fortizar can be configured using Upwell\'s Standup brand service and structure modules so as to serve the specific needs of the structure operator. Further adjustment of the hardware of the Fortizar can be achieved by installed Standup L-Set rigs to optimize the specific role of the citadel.\r\n\r\n25% bonus to all structure combat rig effects\r\n25% reduction in citadel service module fuel consumption',10000000000,80000,0,1,1,NULL,1,2201,NULL,20232,21138),(35834,1657,'Keepstar','Envisaged as the flagship product in the Upwell Consortium\'s Citadel range of space stations, the Keepstar has been designed for the most important and largest-scale of operations in space, such as providing a fully-featured home for large alliances, and even coalitions, or as a key element in the fortification of large territorial empires.\r\n\r\nThe Keepstar has been built with new spaceship tethering technology as standard, and it will accommodate all size classes of ship, including \'supercapital\' vessels, in its internal docking bays. The defensive capabilities of the Keepstar are formidable and are highly enhanced in lower security star systems with the ability to mount area effect and \'doomsday\' weapons. The Keepstar can be configured using Upwell\'s Standup brand service and structure modules so as to serve the specific needs of the structure operator. Further adjustment of the hardware of the Keepstar can be achieved by installed Standup XL-Set rigs to optimize the specific role of the citadel.\r\n\r\n25% bonus to all structure combat rig effects\r\n25% reduction in citadel service module fuel consumption',50000000000,800000,0,1,4,NULL,1,2201,NULL,20233,21139),(35835,1406,'Athanor','New medium refinery structure.',3000000000,8000,0,1,NULL,NULL,0,NULL,NULL,20744,21445),(35836,1406,'Tatara','New large refinery structure.',10000000000,80000,0,1,NULL,NULL,0,NULL,NULL,20745,21451),(35837,1408,'Custom gate 1','Saminer T-NNJZ prototype',500,4000,0,1,NULL,NULL,0,NULL,NULL,NULL,3465),(35838,1407,'Medium Observatory Array','New medium observatory array structures.',500,4000,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(35839,1407,'Large Observatory Array','New large observatory array structure.',500,4000,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(35840,1408,'Medium Stargate','New medium stargate structure.',500,4000,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(35841,1408,'X-Large Stargate','New X-Large stargate structure.',500,4000,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(35842,1409,'Medium Administration Hub','New medium administration hub structure.',500,4000,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(35843,1409,'Large Administration Hub','New large administration hub',500,4000,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(35844,1409,'X-Large Administration Hub','New x-large administration hub',500,4000,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(35845,1410,'X-Large Advertisement Center','New x-large advertisement center.',500,4000,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(35877,1415,'Standup Supercapital Shipyard I','The Standup Supercapital Shipyard I is a service module that allows the manufacturing of Supercapital Ships when installed into an Upwell technology structure.\r\n\r\nStandup is a proprietary system that uses a Structure Autonomous Nanoassembly Device (Upwell) containing integrated template software, a nanoassembler array and sufficient nanomass to enable the construction of a variety of service modules, structure modules and structure rigs when inserted into the appropriate slots on a structure built with Upwell technology.\r\n\r\nNote: The installation of this Service Module is restricted to the <a href=showinfo:35827>Sotiyo</a> Engineering Complex',4000,64000,0,1,NULL,NULL,1,2332,3007,NULL,0),(35878,1415,'Standup Manufacturing Plant I','The Standup Manufacturing Plant I is a service module that allows manufacturing of any product (except Capital and Super Capital ships) when installed into an Upwell technology structure.\r\n\r\nStandup is a proprietary system that uses a Structure Autonomous Nanoassembly Device (Upwell) containing integrated template software, a nanoassembler array and sufficient nanomass to enable the construction of a variety of service modules, structure modules and structure rigs when inserted into the appropriate slots on a structure built with Upwell technology.',500,4000,0,1,NULL,NULL,1,2332,3007,NULL,0),(35880,1717,'Standup Drug Lab I','',500,4000,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(35881,1415,'Standup Capital Shipyard I','The Standup Capital Shipyard I is a service module that allows the manufacturing of Capital Ships when installed into an Upwell technology structure.\r\n\r\nStandup is a proprietary system that uses a Structure Autonomous Nanoassembly Device (Upwell) containing integrated template software, a nanoassembler array and sufficient nanomass to enable the construction of