0000000.0000,0,NULL,NULL,NULL,0),(37450,54,'Ice Mining Laser I','A unit used to extract valuable materials from ice asteroids. Used on Expedition Frigates. ',0,5,0,1,NULL,NULL,1,2151,1061,NULL,21211),(37451,54,'Ice Mining Laser II','A unit used to extract valuable materials from ice asteroids. Used on Expedition Frigates. ',0,5,0,1,NULL,NULL,1,2151,1061,NULL,21212),(37452,54,'ORE Ice Mining Laser','A unit used to extract valuable materials from ice asteroids. Used on Expedition Frigates. ',0,5,0,1,NULL,NULL,1,2151,1061,NULL,21213),(37453,25,'Crucifier Navy Issue','As YC117 came to a close, the Imperial Navy found itself facing the most significant series of crises in over seven years. The loss of Empress Jamyl Sarum to the hostile and enigmatic Drifter fleet followed by further Drifter incursions into the Empire left the Navy stretched thin and barely able to keep up with the demands of defending the throne worlds. In response to these challenges, the Empire has turned to their Capsuleer allies for support in their time of need.\r\n\r\nThe Crucifier Navy Issue is the first Navy vessel to be designed for Capsuleer use first and traditional navy use second. It combines powerful laser systems with overwhelming weapon disruption at close ranges, designed to meet the realities of capsuleer combat in the contested low security regions where the Empire\'s borders are in most need of bolstering.',1064000,28100,165,1,4,200000.0000,1,1366,NULL,20063,1733),(37454,25,'Vigil Fleet Issue','The Vigil Fleet Issue is the latest development from the Republic Fleet\'s innovative R&D labs. Designed with the demands of Capsuleer loyalist corporations in mind, this aggressive ship is intended to support new offensive operations into the Empire\'s vulnerable constellations in The Bleak Lands and Devoid regions. Long range stasis webifiers and high speed allow the Vigil Fleet Issue to chase down and catch the most evasive prey and pull them into range of its deadly rocket launchers.',1080000,17400,250,1,2,200000.0000,1,1366,NULL,20078,1976),(37455,25,'Griffin Navy Issue','The Griffin Navy Issue represents a new experiment in close-range tactics from the Caldari Navy. Combining deadly hybrid weapon systems with electronic countermeasure systems optimized for short range combat has allowed the Griffin Navy Issue to surprise hostile forces with uncharacteristically aggressive tactics.',1056000,19400,260,1,1,200000.0000,1,1366,NULL,20070,1789),(37456,25,'Maulus Navy Issue','The Maulus Navy Issue is the result of the Federation Navy\'s decision to pivot towards increased support for their Capsuleer allies in the contested low-security constellations across Black Rise and Placid. Borrowing innovative concepts from local pirate bands, Gallente engineers developed a ship capable of extremely powerful warp scrambling alongside respectable combat abilities.',1063000,23000,275,1,8,200000.0000,1,1366,NULL,20074,1811),(37457,1527,'Deacon','The Deacon is the latest success from the engineers at Carthum Conglomerate, designed as a remote repairing ship that can keep up with fast moving fleets including those containing the extremely popular Confessor-class Tactical Destroyer. Managing to miniaturize the powerful remote armor repairing systems from their best-selling Guardian Logistics Cruiser onto a frigate-sized hull was no simple task, but Carthum was able to release the Deacon in nearly record time and under-budget thanks in part to extensive cooperation with researchers from the Lai Dai megacorp.\r\n\r\nDeveloper: Carthum Conglomerate\r\n\r\nCarthum ships are the very embodiment of the Amarrian warfare philosophy. Possessing sturdy armor and advanced weapons systems, they provide a nice mix of offense and defense. On the other hand, their electronics and shield systems tend to be rather limited.',1630000,28700,250,1,4,2000000.0000,1,2147,NULL,20063,21220),(37458,1527,'Kirin','The Kirin-class Logistics Frigate represents the latest development from Lai Dai\'s venerable research division. Making use of their deep experience in remote shield booster technology obtained from the larger Basilisk cruiser, Lai Dai managed to create an extremely powerful shield boosting platform on a small and mobile Bantam hull. The Kirin development has also benefited from an extensive knowledge sharing agreement with the Carthum Conglomerate.\r\n\r\nDeveloper: Lai Dai\r\n\r\nLai Dai have always favored a balanced approach to their mix of on-board systems, leading to a line-up of versatile ships but providing very little in terms of tactical specialization. With the Kirin, their aim was to continue pushing forward the development of cutting-edge defense optimization systems while providing powerful and mobile support capability.',1480000,20000,270,1,1,2000000.0000,1,2148,NULL,20070,21218),(37459,1527,'Thalia','The Thalia-class Logistics Frigate was developed by Roden Shipyards as a more mobile counterpart to their wildly successful Oneiros Logistics Cruiser. Able to keep pace with frigate and destroyer wings, the Thalia boasts excellent armor support capabilities in a compact and reasonably-priced form factor. In late YC117, news that the Federation Navy had placed a massive order for Thalia-class frigates brought Roden Shipyards stock to a seven year high.\r\n\r\nDeveloper: Roden Shipyards \r\n\r\nRoden Shipyards is the fastest growing ship manufacturer in the Federation, thanks to an extremely aggressive R&D division and extensive connections in government and military procurement communities. Roden ships are distinguished by strong armor defenses and excellent electronic capabilities. They also tend towards gunboats with exceptional range and tracking systems, and less reliance on drones than the average Federation warship.',1450000,10000,280,1,8,2000000.0000,1,2149,NULL,20074,21217),(37460,1527,'Scalpel','Thukker Tribe caravans have made use of jury-rigged repair frigates for years, mastering the art of optimizing remote shield booster systems for a fast and light frame. With the Scalpel Logistics Frigate, Thukker Mix has built upon the foundation of this experience to release an incredibly fast repair platform that can keep up with all kinds of mobile frigate and destroyer fleets. Upgrading the common Burst hull with increased shield resistances, more powerful remote shield boosters and improved agility, the engineers at Thukker Mix have developed a ship that is sure to become a common sight in New Eden\'s conflict zones.\r\n\r\nDeveloper: Thukker Mix\r\n\r\nThukkers spend their entire lives forever wandering the infinite in their vast caravans. As such their technology is based as much upon necessity as their ingenious ability to tinker. Their ship designs therefore tend to based upon the standard empire templates but extensively modified for the Thukkers unique needs.',1420000,17100,260,1,2,2000000.0000,1,2150,NULL,20078,21219),(37461,1681,'Angel Dreadnought','This is a fighter for the Arch Angels. It is protecting the assets of Arch Angels and may attack anyone it perceives as a threat or easy pickings. \r\n\r\nAngel Cartel dreadnoughts are rarely seen outside of core Archangel facilities. However in recent months the Angel Cartel capital fleets seem to have become more bold, striking out at capsuleers who interfere with smaller-scale Angel operations.\r\n\r\nThreat level: Deadly',1127500000,15500000,0,1,NULL,NULL,0,NULL,NULL,31,21275),(37462,1682,'Domination Titan','Scuttling from Heaven the Domination Commanders pursue a secret agenda as dark and sinister as their reputation. \r\n\r\nRSS intelligence indicate that the Salvation Angel engineers have been benefiting greatly from their partnership with the Serpentis Corporation. Combining technology reverse engineered from the titanic FNS Molyneux with more readily available Promethean titan blueprints has allowed the Angel Cartel to develop their own deadly variation of the Ragnarok.\r\n\r\nThreat level: \"We\'re going to need a bigger ship\"',2075625000,100000000,0,1,NULL,NULL,0,NULL,NULL,31,21276),(37463,1683,'Blood Dreadnought','This is a fighter for the Blood Raiders. It is protecting the assets of Blood Raiders and may attack anyone it perceives as a threat or easy pickings. \r\n\r\nThis modified Revelation-class Dreadnought is one of the largest and deadliest ships within the Blood Raider arsenal. Nobody outside the Covenant seems to know for sure what the massive hull patterns are made from, and at this point everyone is afraid to ask.\r\n\r\nThreat level: Deadly',1237500000,18500000,0,1,NULL,NULL,0,NULL,NULL,31,21277),(37464,1684,'Dark Blood Titan','Blood Raider Commanders have mastered the Rites of Blood, giving them unnatural affinity with all things living. \r\n\r\nThis massive Titan inspires terror in even the bravest navy captain. Disturbing rumors suggest that its many halls are filled with numerous captives and unnatural rituals.\r\n\r\nThreat level: \"We\'re going to need a bigger ship\"',2278125000,155000000,0,1,NULL,NULL,0,NULL,NULL,31,21278),(37465,1685,'Guristas Dreadnought','This is a fighter for the Guristas. It is protecting the assets of Guristas and may attack anyone it perceives as a threat or easy pickings. \r\n\r\nThis heavily modified Phoenix-class Dreadnought is a potent tool for intimidation and defense of Guristas assets.\r\n\r\nThreat level: Deadly',1320000000,16250000,0,1,NULL,NULL,0,NULL,NULL,31,21279),(37466,1686,'Dread Guristas Titan','Guristas Commanders are master tacticians, frequently veterans of empire navies before swerving off the straight path to become outlaws. \r\n\r\nThis heavily modified Leviathan-class Titan represents a new level of threat from the Guristas Pirates. Rumors suggest that the Guristas gained access to Titan technology by salvaging the wreckage of capsuleer capital shipyards destroyed in one of their numerous wars within the Guristas-occupied nullsec regions.\r\n\r\nThreat level: \"We\'re going to need a bigger ship\"',2430000000,132500000,0,1,NULL,NULL,0,NULL,NULL,31,21280),(37467,1687,'Sansha\'s Dreadnought','This is a fighter for Sansha\'s Nation. It is protecting the assets of Sansha\'s Nation and may attack anyone it perceives as a threat or easy pickings.\r\n\r\nSansha\'s Nation are no strangers to the use of capital ships in their operations. However it is only recently that these Dreadnought-class vessels have been seen augmenting Nation battlefleets.\r\n\r\nThreat level: Deadly',1237500000,18500000,0,1,NULL,NULL,0,NULL,NULL,31,21281),(37468,1689,'Serpentis Dreadnought','The Angel Cartel profits enough from its protection deal with the Serpentis Corporation for it to send its best and brightest pilots on guarding duty.\r\n\r\nThe use of Guardian Angel capital ships to defend static Serpentis Corporation installations has been common for years, although only recently have these huge ships been seen on the offense.\r\n\r\nThreat level: Deadly',1292500000,17550000,0,1,NULL,NULL,0,NULL,NULL,31,21282),(37470,1691,'Infested Carrier','Rogue drones are hi-tech drones that have the ability to manufacture themselves. Rogue drone hives can be found throughout the universe of EVE and are a constant menace to space travelers. \r\n\r\nThis Thanatos-class carrier has been infested with Rogue Drones and heavily modified to meet their needs. It is unclear whether this ship was captured and infested in the depths of the Drone Regions or if the drones built it themselves as a mimicry of human technology.\r\n\r\nThreat level: Deadly',1163250000,13095000,0,1,NULL,NULL,0,NULL,NULL,31,21284),(37471,1692,'Sentient Infested Supercarrier','Rogue drones are hi-tech drones that have the ability to manufacture themselves. Rogue drone hives can be found throughout the universe of EVE and are a constant menace to space travelers. \r\n\r\nThis Nyx-class Supercarrier has been infested with Rogue Drones and heavily modified to meet their needs. It is unclear whether this ship was captured and infested in the depths of the Drone Regions or if the drones built it themselves as a mimicry of human technology.\r\n\r\nThreat level: \"We\'re going to need a bigger ship\"',1615625000,58200000,0,1,NULL,NULL,0,NULL,NULL,31,21285),(37472,1529,'Upgraded Avenger','The hull structure of this Sleeper drone resembles that of known \"sleepless\" units, but focused scans clearly indicate that this drone has received significant retooling recently. Energy concentrations at the weapons appears to have increased significantly, and additional banks of energy neutralizers are visible.\r\nUnlike its older kin, this drone appears focused on a single overriding purpose and will ignore any lesser threats until it has destroyed or driven away away its primary targets.',19000000,19000000,120,1,64,NULL,0,NULL,NULL,12,3516),(37473,1530,'Drifter Response Battleship','CONCORD\'s analysis of this battleship has been hampered by its advanced hull and shielding. The propulsion system is unfamiliar but tentative theories have suggested that the vessel somehow directly interacts with the fabric of space-time while moving. The standard weapon systems of this ship appear to be semi-autonomous and effective against a range of targets.\r\nDED contact briefings suggest the free floating turrets are a secondary weapon, with an extremely dangerous primary weapon held in reserve against those this ship\'s commander considers a significant threat.\r\nThreat level: Critical',10900000,109000,120,1,64,NULL,0,NULL,NULL,20207,21049),(37474,588,'Catmageddon','',100,10,0,1,NULL,240727880.0000,0,NULL,2934,NULL,0),(37475,1600,' Medium Tech I Large Ship Research II','',200,10,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(37479,1533,'Micro Jump Field Generator','This module spools up and then teleports the ship and any ships nearby 100km in the direction the ship is facing. All ships teleported will retain their movement direction and velocity in the new location.\r\n\r\nNote: The micro jump field only affects capsuleer-piloted ships and will not move certain ship types, including: Capital Ships, Freighters and the Orca.',0,10,0,1,NULL,340852.0000,1,2135,20971,NULL,0),(37480,1534,'Bifrost','Command Destroyers represent a versatile addition to fleets of all sizes. Being the smallest and most agile platforms for Command Burst technology positions them as the premier support option for fast-moving wolf packs. Unique access to Micro Jump Field Generators also allows them to perform maneuvers that rapidly reposition other ships, be they friend or foe.',1235000,43000,400,1,2,NULL,1,2133,NULL,20077,21224),(37481,1534,'Pontifex','Command Destroyers represent a versatile addition to fleets of all sizes. Being the smallest and most agile platforms for Command Burst technology positions them as the premier support option for fast-moving wolf packs. Unique access to Micro Jump Field Generators also allows them to perform maneuvers that rapidly reposition other ships, be they friend or foe.',1250000,47000,380,1,4,NULL,1,2126,NULL,20061,21222),(37482,1534,'Stork','Command Destroyers represent a versatile addition to fleets of all sizes. Being the smallest and most agile platforms for Command Burst technology positions them as the premier support option for fast-moving wolf packs. Unique access to Micro Jump Field Generators also allows them to perform maneuvers that rapidly reposition other ships, be they friend or foe.',1300000,52000,450,1,1,NULL,1,2131,NULL,20068,21221),(37483,1534,'Magus','Command Destroyers represent a versatile addition to fleets of all sizes. Being the smallest and most agile platforms for Command Burst technology positions them as the premier support option for fast-moving wolf packs. Unique access to Micro Jump Field Generators also allows them to perform maneuvers that rapidly reposition other ships, be they friend or foe.',1150000,55000,400,1,8,NULL,1,2132,NULL,20072,21223),(37484,1311,'Crucifier Raata Sunset SKIN (Permanent)','',0,0.01,0,1,4,NULL,1,2002,NULL,NULL,0),(37485,1311,'Executioner Raata Sunset SKI