311,'Occator Valimor Legacy SKIN (Permanent)','',0,0.01,0,1,8,NULL,1,2090,NULL,NULL,0),(37594,1311,'Obelisk Valimor Legacy SKIN (Permanent)','',0,0.01,0,1,8,NULL,1,1986,NULL,NULL,0),(37595,1311,'Anshar Valimor Legacy SKIN (Permanent)','',0,0.01,0,1,8,NULL,1,2097,NULL,NULL,0),(37596,186,'Sleeper Upgraded Avenger Wreck','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it.',10000,27500,27500,1,NULL,NULL,0,NULL,NULL,NULL,3115),(37599,1537,'Cenobite I','<b>Type:</b> Support Fighter\r\n<b>Role:</b> Energy Neutralizing\r\n<b>Description:</b> The Cenobite brings energy neutralizing support to the battlefield.\r\n\r\n<b>Energy Neutralizer</b>: Neutralizes a portion of the energy of the target\'s capacitor.\r\n<b>Microwarpdrive</b>: Gives a significant speed boost at the cost of higher signature radius. The Microwarpdrive has a long cool-down cycle between uses.',1500,3000,0,1,4,NULL,1,2239,NULL,NULL,2899),(37600,1088,'Women\'s Genolution Combat Suit','Genolutions expertise in cloning technology led it to develop a small range of items adapted for the special needs of clone users operating in a range of environments. The Genolution Combat Suit is designed to integrate comfortably and seamlessly with clones adapted for neural interface linking with a range of systems, including capsule neural interfaces.',0.5,0.1,0,1,NULL,NULL,1,1405,21493,NULL,0),(37601,1088,'Women\'s CONCORD \'Solitaire\' Survival Suit','CONCORD\'s elite test pilots are expected to qualify for solo flight on every known frigate design and their variants. The \'Solitaire\' survival suit is designed to maximize the survival chances of pilots testing new frigate configurations in the exacting and perilous proving scenarios established by CONCORD\'s aerospace research division.',0.5,0.1,0,1,NULL,NULL,1,1405,21494,NULL,0),(37602,1088,'ArmorSuitCF01_Copper.type','',0.5,0.1,0,1,NULL,NULL,0,NULL,21495,NULL,0),(37603,1088,'Women\'s Sisters of EVE Advanced Combat Suit','A combat suit worn by Sisters of EVE military personnel.',0.5,0.1,0,1,NULL,NULL,0,NULL,21496,NULL,0),(37604,1538,'Apostle','<i>\"Her Imperial Majesty\'s life will stand eternal as an example for all who live truly and rightly within the embrace of Holy Amarr. The martyrdom of Empress Jamyl I was inflicted with base treachery but its lasting effect will be the inspiration of a thousand generations down the ages.\"</i> - excerpt from the Funeral Oration on the Passing of Empress Jamyl I by High Chaplain Kalefa Sufrin an-Kador, YC117.09.20\r\n\r\nFollowing the assassination by a Drifter strikeforce of Empress Jamyl I while she was aboard an Avatar-class Titan in late August YC117, there was a period of soul-searching and close scrutiny of capital ship doctrines by the Imperial Navy\'s staff officers. It was soon realized that lack of experience in capital ship warfare had left fleet doctrines lagging behind the tactics of capsuleers fighting in the Outer Regions.\r\n\r\nFrom this realization was born the concept of the Force Auxiliary capital ship, a vessel dedicated to ensuring the survival of more combat- and command-oriented capital ships such as Carriers and Titans. The Apostle-class Force Auxiliary was commissioned in memory of Empress Jamyl I and is richly decorated in token of this dedication.\r\n',1310000000,18135000,2175,1,4,1700000000.0000,1,2272,NULL,20062,21252),(37605,1538,'Minokawa','<i>\"The Amarr have decided that there\'s something to learn from the capsuleers when it comes to capital ships. I can\'t say as I disagree. I\'ve been trying to tell the Navy this for years.\"</i> - remarks by Ishukone CEO Mens Reppola on the occasion of the Amarr-Caldari Capital Warfare Summit, YC118.01.15\r\n\r\nA well established and close co-operation between Amarr and Caldari capital warfare tacticians and naval architects all but guaranteed that the Amarr would share their conclusions on the need to alter capital warfare doctrines and accommodate such changes with updated designs and new ship concepts.\r\n\r\nThe infusion of Amarr thinking on the subject of capital ship warfare served to break a long-standing impasse between doctrinal factions in the Caldari Navy\'s strategic command. The wisdom of learning from the example of the most experienced capital warfare pilots in New Eden was accepted and the Minokawa-class Force Auxiliary was the eventual result.\r\n',1300000000,15500000,2600,1,1,1700000000.0000,1,2273,NULL,20069,21254),(37606,1538,'Lif','<i>\"I sometimes think it would have been a good thing if all the Brutor on the General Staff had been at Colelie back in \'15. That might have made up for the whole farce.\"</i> - remarks attributed to a Sebiestor naval architect on the occasion of Valklear General Khassan Triat\'s call for new siege capitals to be developed in testimony before the Tribal Council\'s Inquiry into Capital Ship Doctrines, YC118.02.07\r\n\r\nThe Republic Fleet were slow to follow the other naval powers along the new path of capital warfare inspired by capsuleer combat experience in the many wars of the Outer Regions of New Eden. In large part this was due to a flaring up of the old debate between the firepower- and maneuver-oriented generals of the Brutor dominated military circles and the logistics- and fighter-oriented Sebiestor fleet tactician and technologist circles.\r\n\r\nAfter much chest-beating, and due in no small part to the intervention of Sanmatar Maleatu Shakor, the arguments of the Sebiestor won out and the Lif-class Force Auxiliary was commissioned over the objections of the Brutor military elite.\r\n',1260000000,14625000,3000,1,2,1700000000.0000,1,2275,NULL,20077,21256),(37607,1538,'Ninazu','<i>\"It is imperative that our Federation Navy capital ship fleets remain a match for any threat that may be posed by hostile entities or aggressive powers. To that end, let me assure the peoples of the Gallente Federation that I have issued the appropriate executive directives to our military and intelligence apparatus. Naturally these directives will be subject to democratic oversight in the best traditions of our Federation.\"</i> - Gallente President Jacus Roden, Address to the Peoples of the Federation, YC118.01.21\r\n\r\nMilitary experts within the Gallente Federation were not slow in recognizing the significance of the agreements made between the Empire and State at the Amarr-Caldari Capital Warfare Summit of January YC118. The military-industrial complex of the Federation was more than equal to the task of implementing the necessary changes to existing designs in line with the concepts inspired by capsuleer capital warfare practice.\r\n\r\nThe Federal Intelligence Office additionally recommended that the Gallente build a Force Auxiliary capital of their own to maintain parity with the Amarr-Caldari alliance. The resulting crash development program created the Ninazu-class Force Auxiliary.\r\n',1250000000,17020000,2800,1,8,1700000000.0000,1,2274,NULL,20073,21255),(37608,899,'Pitfall Compact Warp Disruption Field Generator','The field generator projects a warp disruption sphere centered upon the ship for its entire duration. The field prevents any warping or jump drive activation within its area of effect.\r\n\r\nThe generator has several effects upon the parent ship whilst active. It increases its signature radius and agility whilst penalizing the velocity bonus of any afterburner or microwarpdrive modules. It also prevents any friendly remote effects from being rendered to the parent ship.\r\n\r\nThis module\'s effect can be modified with scripts. When scripted it prevents capital class ships from using stargates (excluding Jump Freighters, Freighters and the Orca). \r\n\r\nNote: Can only be fitted on the Heavy Interdiction Cruisers.',0,50,1,1,NULL,3964874.0000,1,1085,21489,NULL,20396),(37610,899,'Clutch Restrained Warp Disruption Field Generator','The field generator projects a warp disruption sphere centered upon the ship for its entire duration. The field prevents any warping or jump drive activation within its area of effect.\r\n\r\nThe generator has several effects upon the parent ship whilst active. It increases its signature radius and agility whilst penalizing the velocity bonus of any afterburner or microwarpdrive modules. It also prevents any friendly remote effects from being rendered to the parent ship.\r\n\r\nThis module\'s effect can be modified with scripts. When scripted it prevents capital class ships from using stargates (excluding Jump Freighters, Freighters and the Orca). \r\n\r\nNote: Can only be fitted on the Heavy Interdiction Cruisers.',0,50,1,1,NULL,3964874.0000,1,1085,21489,NULL,20396),(37611,899,'M-36 Enduring Warp Disruption Field Generator','The field generator projects a warp disruption sphere centered upon the ship for its entire duration. The field prevents any warping or jump drive activation within its area of effect.\r\n\r\nThe generator has several effects upon the parent ship whilst active. It increases its signature radius and agility whilst penalizing the velocity bonus of any afterburner or microwarpdrive modules. It also prevents any friendly remote effects from being rendered to the parent ship.\r\n\r\nThis module\'s effect can be modified with scripts. When scripted it prevents capital class ships from using stargates (excluding Jump Freighters, Freighters and the Orca). \r\n\r\nNote: Can only be fitted on the Heavy Interdiction Cruisers.',0,50,1,1,NULL,3964874.0000,1,1085,21489,NULL,20396),(37612,899,'True Sansha Warp Disruption Field Generator','The field generator projects a warp disruption sphere centered upon the ship for its entire duration. The field prevents any warping or jump drive activation within its area of effect.\r\n\r\nThe generator has several effects upon the parent ship whilst active. It increases its signature radius and agility whilst penalizing the velocity bonus of any afterburner or microwarpdrive modules. It also prevents any friendl