and enforcement personnel to be worn beneath their ballistic armor and flak protection.  ',0.5,0.1,0,1,NULL,NULL,1,1398,21510,NULL,0),(37867,1311,'Garmur Waschi Uprising \'Combat\' SKIN (Permanent)','',0,0.01,0,1,1,NULL,1,2031,NULL,NULL,0),(37868,1311,'Orthrus Waschi Uprising \'Combat\' SKIN (Permanent)','',0,0.01,0,1,1,NULL,1,2030,NULL,NULL,0),(37869,1311,'Barghest Waschi Uprising \'Combat\' SKIN (Permanent)','',0,0.01,0,1,1,NULL,1,1963,NULL,NULL,0),(37870,319,'Serpentis Secure Hold','',0,0,0,1,32,NULL,0,NULL,NULL,15,21237),(37874,1194,'Project Compass Star Charts','Totaling over seven and a half thousand entries annotated with all manner of mathematical calculation, this datapad is packed with the results of capsuleer Mark726s efforts to accurately depict the stellar positioning of every unidentified system in New Eden.\r\n\r\nWhile impressive in its scope and scale, the accuracy of this collection of stellar cartography has never been verified by the CONCORD Assembly.',0,0.01,0,1,NULL,NULL,1,1661,2853,NULL,0),(37875,1194,'Contraband Amarrian Walnuts','Confiscated by Imperial Customs, this crate of Amarrian Walnuts is stamped with a logo and tracking number from Prompt Delivery.\r\n\r\nWhile appearing innocent from the outside, one does not have to be a connoisseur in the field of botany to ascertain that the natural core of a walnut does not contain fine white powder.\r\n\r\nSomething is certainly amiss with this shipment.',0,0.01,0,1,NULL,NULL,1,1661,30,NULL,0),(37877,1194,'Cerebrum In A Container','Surprisingly not of Sanshas Nation origin, this is quite literally a brain detached from its host body.\r\n\r\nIn a box.',0,0.01,0,1,NULL,NULL,1,1661,1209,NULL,0),(37878,1194,'Sansha Claws Fairytale Book','A compendium of the darkest and most chilling tales from the depths of stain. \r\n\r\nWhat better way to scare the children to bed than with a frightening festive tale of gruesome bloodshed and carnage?',0,0.01,0,1,NULL,NULL,1,1661,10159,NULL,0),(37879,1194,'Festive Firecrackers','Used in celebrations around the cluster, these small cosmetic explosives produce a loud rapid series of reports that is often mistaken for automatic gunfire. \r\n\r\nThankfully, the noise is also mated with multiple colors and effects, which helps avoid friendly fire, or draw more attention to the source of the gunfire, depending on how smart your friends happen to be.',0,0.01,0,1,NULL,NULL,1,1661,3444,NULL,0),(37880,1194,'Max Amarria','While not regarded illegal by the Imperial authorities, this alternative compilation of scriptures, teachings and sermons compiled by well-known capsuleer Max Singularity is regarded as improper and sacrilegious by most conservative Amarr organizations.',0,0.01,0,1,NULL,NULL,1,1661,33,NULL,0),(37881,1194,'Grand Teigjon Casino Chip','This one billion ISK value casino chip will be familiar to any high limit table player at the Grand Teigjon Resort & Casino in Vellaine. Holographically dated to be valid only for the 95th Interstellar Mindclash Championship in October YC117, it is now invalid and worth only its weight in the crystallized Isogen that it happens to be laser cut from.',0,0.01,0,1,NULL,NULL,1,1661,3000,NULL,0),(37882,1194,'YC117 Symposium On Emergent Threats Access Pass','This access pass granted the user full VIP clearance to all sessions of the YC117 Symposium On Emergent Threats, hosted by the CONCORD Assembly aboard Yulai X  DED Assembly Plant on March 19-21st YC117.\n\nNow useless after the conclusion of the symposium, it may be of value to some collectors.',0,0.01,0,1,NULL,NULL,1,1661,21061,NULL,0),(37883,1194,'95th Interstellar Mindclash Championship Tickets','VIP tickets detailed with gold leaf and blue tigers, along with the embossed portrait of defending Interstellar Mindclash Champion Joelyn Donalokos. These tickets are now used, but once granted access to the 95th Interstellar Mindclash Championships, which was hosted at the Grand Teigjon Resort & Casino in October YC117.',0,0.01,0,1,NULL,NULL,1,1661,21064,NULL,0),(37884,1194,'Feawen\'s Approval Documentation','Capsuleers are known to use Galnet discussion boards and forums just as much as anyone else. In response to what appeared to be a leak of intelligence from a rival capsuleer alliance, an Amarr capsuleer known as Feawen responded with the simple, but now famous, \"Feawen likes this.\"\n\nIt was deemed sufficiently funny by her peers that it became a commonplace remark to leave in response to nearly any discussion, and it was a particular mark of honor to have Feawen herself respond to a discussion thread with her trademark quip.\n\nThis massive tome contains a full list of everything that Feawen has been stated to like since the beginning of this odd (but typical to capsuleers) linguistic phenomenon. Literary critics around New Eden have noted with some humor, however, that it might have been easier and more cost-effective to simply list the things that Feawen does not like.',0,0.01,0,1,NULL,NULL,1,1661,10159,NULL,0),(37885,1194,'Meat Popsicle','Scooped from the cold void of space in the wake of the battle of B-R5RB, this unfortunate crew member was one of more than ten million casualties of the largest recorded fleet battle in the history of New Eden.\r\nRemarkably well preserved after being exposed to vacuum, this individual stands as a reminder to the fragility of life, and the destructive nature of the capsuleer psyche.',0,0.01,0,1,NULL,NULL,1,1661,2855,NULL,0),(37886,1194,'Capital Parking Ticket','Issued by the Directive Enforcement Department, this penalty ticket was delivered to an unidentified capsuleer pilot who left his Erebus class titan adrift outside the DED Assembly Plant in Nalnifan. An unusual event, the ticket was issued when officers came to the realization that the vessel was too large to tow.\n\nRumor has it that the pilot in question was sighted on board the stations medical deck the morning after a drunken late night visit to the stations pleasure hub, wondering how it was humanly possible to have misplaced 2.4 million tons of starship.',0,0.01,0,1,NULL,NULL,1,1661,21060,NULL,0),(37887,1194,'Counterfeit Dominix Model','Available for a limited time on holonet exclusively in the Federation, this model of the widely loved Gallente battleship was advertised by a Caldari model maker, boasting unrivaled levels of detail and realism with some assembly required.\n\nWhen the model was eventually delivered across the border, most buyers were confused at having to dig into a box of synthetic soil, only to find that their model actually required more growth than assembly after coming to the realization that what they had actually paid for was quite literally, a potato.',0,0.01,0,1,NULL,NULL,1,1661,1181,NULL,0),(37888,1194,'Starsi','Conceived by the Apex Conglomerate as a rival to Quafe, Starsi has enjoyed a cult following within the Caldari State for the last decade or so. After the purchase of rights to the soft drink by Nugoeihuvi in December YC117, the brand has taken on a new lease of life, and is now stocked in stores across the Caldari State and Amarr Empire.',0,0.01,0,1,NULL,NULL,1,1661,27,NULL,0),(37889,1194,'YC118 Succession Trial Champions Decree  House Tash-Murkon','Issued by Lady Catiz Tash Murkon, this decree was broadcast across the empire, and bears the seal of the Tash-Murkon family. The text reads:\n\nBy ancient trial of fire and blood in the YC118 Amarr Championships I, Lady Catiz Tash Murkon, Heir of House Tash-Murkon, do affirm the selection of capsuleer pilot call signed Kelon Darklight as my champion and representative during the YC118 Imperial Succession Trials.\n\nThis decree grants my champion Lordship within the Tash-Murkon Family, along with title and estate as Holder on Tash-Murkon Prime III, in the Imperial system of Tash-Murkon Prime.',0,0.01,0,1,NULL,NULL,1,1661,2908,NULL,0),(37892,1194,'YC118 Succession Trial Champions Decree  House Ardishapur','Issued by Lord Yonis Ardishapur, this decree was broadcast across the empire, and bears the seal of the Ardishapur family. The text reads:\r\n\r\nBy ancient trial of fire and blood in the YC118 Amarr Championships I, Lord Yonis Ardishapur, Heir of House Ardishapur, do affirm the selection of capsuleer pilot call signed SoulLess Zealot as my champion and representative during the YC118 Imperial Succession Trials.\r\n\r\nThis decree grants my champion Lordship within the Ardishapur Family, along with title and estate as Holder on Radonis, in the Imperial system of Ardishapur Prime.\"',0,0.01,0,1,NULL,NULL,1,1661,2908,NULL,0),(37893,1194,'YC118 Succession Trial Champions Decree  House Kador','Issued by Lord Uriam Kador, this decree was broadcast across the empire, and bears the seal of the Kador family. The text reads:\n\nBy ancient trial of fire and blood in the YC118 Amarr Championships I, Lord Uriam Kador, Heir of House Kador, do affirm the selection of capsuleer pilot call signed Ithica Hawk as my champion and representative during the YC118 Imperial Succession Trials.\n\nThis decree grants my champion Lordship within the Kador Family, along with title and estate as Holder on Kador Prime III, in the Imperial system of Kador Prime.',0,0.01,0,1,NULL,NULL,1,1661,2908,NULL,0),(37894,1194,'YC118 Succession Trial Champions Decree  House Khanid','Issued by King Khanid II, this decree was broadcast across the Amarr Empire and the Khanid Kingdom, and bears the seal and Royal crest of the Khanid Kingdom. The text reads:\n\nBy ancient trial of fire and blood in the YC118 Amarr Championships I, His Majesty, Garkeh Khanid, Royal Heir to the Imperial Throne of Amarr, Khanid II of the Kingdom of Khanid, Lord of the Marches, Imperator of the Royal Khanid Navy, do affirm the selection of capsuleer pilot call signed Damassys Kadesh as my champion and representative during the YC118 Imperial Succession Trials.\n\nThis decree shall grant my champion Ladyship within my realms, along with title and estate as Holder on Kihtaled IV, and title styled Knight of the Marches.',0,0.01,0,1,NULL,NULL,1,1661,2908,NULL,0),(37895,1194,'YC118 Succession Trial Champions Decree  House Kor-Azor','Issued by Lord Aritcio Kor-Azor, this decree was broadcast across the empire, and bears the seal of the Kor-Azor family. The text reads:\r\n\r\nBy ancient trial of fire and blood in the YC118 Amarr Championships I, Lord Aritcio Kor-Azor, Heir of House Kor-Azor, do affirm the selection of capsuleer pilot call signed Lysus as my champion and representative during the YC118 Imperial Succession Trials.\r\n\r\nThis decree grants my champion Lordship within the Kor-Azor Family, along with title and estate as Holder on Eclipticum, in the Imperial system of Kor-Azor Prime.',0,0.01,0,1,NULL,NULL,1,1661,2908,NULL,0),(37896,1194,'YC118 Succession Trial Champions Decree  House Sarum','Issued by Lord Merimeth Sarum, this decree was broadcast across the empire, and bears the seal of the Sarum family. The text reads:\n\nBy ancient trial of fire and blood in the YC118 Amarr Championships I, Lord Merimeth Sarum, Heir of House Sarum, do affirm the selection of capsuleer pilot call signed Mitara Newelle as my champion and representative during the YC118 Imperial Succession Trials.\n\nThis decree grants my champion Ladyship within the Sarum Family, along with title and estate as Holder on Sarum Prime III, in the Imperial system of Sarum Prime.',0,0.01,0,1,NULL,NULL,1,1661,2908,NULL,0),(37897,1311,'Apocalypse Ardishapur Serenity Only SKIN (Permanent)','',0,0.01,0,1,4,NULL,1,NULL,NULL,NULL,0),(37898,1311,'Providence Ardishapur Serenity Only SKIN (Permanent)','',0,0.01,0,1,4,NULL,1,NULL,NULL,NULL,0),(37899,1311,'Arbitrator Ardishapur Serenity Only SKIN (Permanent)','',0,0.01,0,1,4,NULL,1,NULL,NULL,NULL,0),(37900,1311,'Augoror Ardishapur Serenity Only SKIN (Permanent)','',0,0.01,0,1,4,NULL,1,NULL,NULL,NULL,0),(37901,1311,'Coercer Ardishapur Serenity Only SKIN (Permanent)','',0,0.01,0,1,4,NULL,1,NULL,NULL,NULL,0),(37902,1311,'Executioner Ardishapur Serenity Only SKIN (P